VALUES
	(1,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах, курсы егэ по математике, курсы егэ по физике, курсы огэ, курсы огэ в Москве','Курсы подготовки к ЕГЭ и ОГЭ (ГИА), Школа мышления - Upbrain','lp_ege',NULL,NULL,NULL,NULL,0,'Курсы подготовки в Москве к ЕГЭ','Обогнать школьный курс на 33% за один месяц без стресса и истерики',NULL,NULL,NULL,'',NULL,NULL,NULL,'2017-10-23 09:49:08','2018-03-01 10:38:42'),
	(2,NULL,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах, курсы егэ по математике, курсы егэ по физике, курсы огэ, курсы огэ в Москве','Курсы подготовки к ЕГЭ и ОГЭ (ГИА), Школа мышления - Upbrain','lp_oge',NULL,NULL,NULL,NULL,1,'Курсы подготовки в Москве к ОГЭ','Сделать обучение легче на 90% через один месяц без стресса и истерики',NULL,NULL,NULL,'',NULL,NULL,NULL,'2017-10-23 17:11:44','2018-01-03 17:26:59'),
	(3,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по математике, курсы егэ на Краснопресненской по математике, курсы егэ по математике, курсы егэ в Москве по математике','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по математике, Школа мышления - Upbrain','course_ege_math',NULL,NULL,NULL,NULL,2,'Курсы ЕГЭ по математике на Чистых прудах','Твой средний балл по математике поднимется до 70 уже через месяц',NULL,NULL,NULL,'<div class=\"font-light mb-3\">\n<h1>Подготовка ЕГЭ по математике Upbrain</h1>\n<p>Математика является одним из самых важных и сложных экзаменов для поступления в ВУЗ. Конечно мы говорим о профильном ЕГЭ. Наши курсы по подготовке к ЕГЭ в Москве помогут вам справится с этим предметом. В первую очередь, мы помогаем справиться с пробелами в знаниях. Наши преимущества в том, что материал будет изложен в игровой форме, с использованием комиксов, картинок, презентаций и позитивного настроя. Преподаватели по математике курсов UPBRAIN любят свой предмет, любят детей и поэтому пришли к нам, чтобы донести свои знания и помочь детям. </p>\n<p>В нашем центре они проходят обучение по нашей авторской методике, помимо уже полученных знаний, что помогает им сформулировать сложные вещи доступным для ученика языком. В наших группах уютная атмосфера и каждый ученик может спросить о любом непонятном ему задании или ответе. Также важную роль сыграют тренировочные написания экзамена. Почувствуйте себя в экзаменационной обстановке. Это поможет вам преодолеть страх, волнение и покажет ваш результат. Также преподаватель по математике поддерживает связь с учениками вплоть до экзамена, что максимально эффективно поможет подготовиться к ЕГЭ и ОГЭ по математике.</p>\n\n<h2>Чем мы вас удивим на своих занятиях?</h2>\n<ul>\n<li>Нескучный разбор заданий ЕГЭ по математике. Преподаватель по математике поможет разобраться в сложных аспектах каждой задачи. Покажет необычные методы решения и запоминания!</li>\n<li>Мини-группы до 8 человек. Каждому будет внимание: педагог удостовериться в усвоении материала урока, даст индивидуальное задание на дом или при необходимости на уроке, ответит на все вопросы учеников!</li>\n<li>Удобное расположение курсов UPBRAIN. Мы подберем самый близкий к вам центр, где будут проходить занятия по математике. </li>\n<li>Продуманные часы. Занятия по подготовке к ЕГЭ по математике будут проходить 2 раза в неделю по 2 часа. Это самое эффективное расписание, так как усвоение информации идёт максимум 2 часа, а такая частота занятий позволит максимально овладеть материалом. </li>\n<li>Бесплатное занятие, для того, чтобы прочувствовать на себе атмосферу на курсах UPBRAIN по математике!</li>\n<li>Симуляция экзамена. Наши курсы UPBRAIN дают вам возможность пройти 2 пробных ЕГЭ по математике, чтобы чувствовать себя спокойно и уверенно на настоящем экзамене. </li>\n<li>Квалифицированные преподаватели, которые любят математику и пришли на наши курсы, чтобы помочь учащимся полюбить Ее тоже! </li>\n<li>Доступная цена. Никаких доплат за популярность! Возможность оплаты по частям, наши менеджеры подберут удобный порядок оплат.</li>\n<li>Средние результаты больше 80 баллов. Наши выпускники уже учатся в престижных ВУЗах и их отзову вы можете увидеть на нашем сайте.</li>\n</ul>\n<p>Также для понимания, зачем сдавать профильную математику, рассмотрите список профессий, для которых нужно сдавать этот предмет: </p>\n<p>\n  <a class=\"btn btn-primary\" data-toggle=\"collapse\" href=\"#prof\" aria-expanded=\"false\" aria-controls=\"prof\">\n    Показать профессии\n  </a>\n</p>\n<div class=\"collapse\" id=\"prof\">\n  <div class=\"card card-block\">\n            <ul>\n                <li>Авиадиспетчеры</li>\n                <li>Агроинженеры</li>\n                <li>Архитекторы</li>\n                <li>Аудиторы</li>\n                <li>Банкиры</li>\n                <li>Бизнес-информатики</li>\n                <li>Управленцы персоналом (гостиничным делом и тд)</li>\n                <li>Биоинженеры, биоинформатики</li>\n                <li>Биологи</li>\n                <li>Маркетологи</li>\n                <li>Метеорологи</li>\n                <li>Геологи</li>\n                <li>Инженеры</li>\n                <li>Педагоги </li>\n                <li>Социологи</li>\n                <li>Лингвисты</li>\n                <li>Экономисты</li>\n                <li>Логисты</li>\n                <li>Налоговые инспектора</li>\n                <li>Нанотехнологи</li>\n                <li>Пилоты (штурманы, судоводители)</li>\n                <li>Программисты </li>\n                <li>Психологи</li>\n                <li>Риелторы</li>\n                <li>Товароведы</li>\n                <li>Аналитики</li>\n                <li>Флористы</li>\n                <li>Ювелиры</li>\n                <li>И многие другие.</li>\n            </ul>\n  </div>\n</div>\n</div>','Подготовка к ЕГЭ по математике','images/bg/subjects/dragon_math.png','Наше обучение по математике снимает психологическую нагрузку, убирает стресс и поднимает настроение. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. <br><b class=\"font-regular\">Готовьтесь к математике с драконом.</b> <a href=\"#\" class=\"font-lite\">Пройти онлайн тест.</a>','2017-12-12 11:51:58','2018-03-01 10:38:08'),
	(4,0,NULL,NULL,NULL,'курсы огэ, курсы огэ на Чистых прудах по математике, курсы огэ на Краснопресненской по математике, курсы огэ по математике, курсы огэ в Москве по математике','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по математике, Школа мышления - Upbrain','course_oge_math',NULL,NULL,NULL,NULL,3,'Курсы ОГЭ/ГИА по математике на Чистых прудах','С нами ты поднимешь свой уровень по математике на все 100%',NULL,NULL,NULL,'','Подготовка к ОГЭ по математике','images/bg/subjects/dragon_math.png','Наше обучение по математике снимает психологическую нагрузку, убирает стресс и поднимает настроение. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. <br><b class=\"font-regular\">Готовьтесь к математике ОГЭ/ГИА с драконом.</b> <a href=\"#\" class=\"font-lite\">Пройти онлайн тест.</a>','2017-12-12 11:57:22','2018-01-18 10:36:01'),
	(5,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по физике, курсы егэ на Краснопресненской по физике, курсы егэ по физике, курсы егэ в Москве по физике','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по физике, Школа мышления - Upbrain','course_ege_physics',NULL,NULL,NULL,NULL,4,'Курсы ЕГЭ по физике на Чистых прудах','Мы научим понимать и решать задачи второй части ЕГЭ',NULL,NULL,NULL,'','Подготовка к ЕГЭ по физике','images/bg/subjects/dragon_physics.png','Наше обучение по физике включает курс подготовки к олимпиадам 8-11 класс и к ДВИ МГУ. Разбираем интересные опыты, уроки проходят в интересной \r\nи завораживающей обстановке. Также вам расскажут, каким будет физика в ближайшем будущем и как она срастается информатикой. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. <br><b class=\"font-regular\">Готовьтесь к физике с драконом.</b> <a href=\"#\" class=\"font-lite\">Пройти онлайн тест.</a>','2017-12-12 14:11:30','2018-03-01 10:38:28'),
	(6,0,NULL,NULL,NULL,'курсы огэ, курсы огэ на Чистых прудах по физике, курсы огэ на Краснопресненской по физике, курсы огэ по физике, курсы огэ в Москве по физике','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по физике, Школа мышления - Upbrain','course_ege_physics',NULL,NULL,NULL,NULL,5,'Курсы ОГЭ/ГИА по физике на Чистых прудах','С нами ты поднимешь свой уровень по физике на все 100%',NULL,NULL,NULL,'','Подготовка к ОГЭ по физике','images/bg/subjects/dragon_physics.png','Наше обучение по физике снимает психологическую нагрузку, убирает стресс и поднимает настроение. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. <br><b class=\"font-regular\">Готовьтесь к физике ОГЭ/ГИА с драконом.</b> <a href=\"#\" class=\"font-lite\">Пройти онлайн тест.</a>','2017-12-12 14:41:21','2018-01-18 10:36:33'),
	(7,1,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по математике, курсы егэ на Краснопресненской по математике, курсы егэ по математике, курсы егэ в Москве по математике','Лучшая образовательная система основанная на человеческих отношениях. У нас есть всё для того чтобы родители и дети были счастливы. Подготовка к ЕГЭ и ОГЭ, к олимпиадам и ДВИ.','compare',NULL,NULL,NULL,NULL,11,'Почему мы?','Что самое ценное могут сделать родители для своего ребёнка?',NULL,NULL,NULL,'<table class=\"table table-bordered compare\">\n    <thead>\n        <tr>\n            <th>Основы</th>\n            <th>Upbrain.ru</th>\n            <th>Другие</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>Мотивация</td>\n            <td>\n                 <img src=\"images/bg/icon_compare/motivation.png\" alt=\"Мотивация\" class=\"float-left\">\n                <p>Мы раскрываем и мотивируем раскрыть талант самим, положительно это оцениваем. Некоторые задания имеют творческий мульти ответ. Это позволяет получать знания в несколько раз глубже, на экспертном уровне.</p>\n            </td>\n            <td>\n                 <img src=\"images/bg/icon_compare/motivation_not.png\" alt=\"Мотивация\" class=\"float-left\">\n                <p>Требуют мыслить исключительно в заданных рамках: правильно-неправильно. Выход из рамок нежелателен и даже наказывается. Полное непонимание последствий этой системы.</p>\n            </td>\n        </tr>\n\n        <tr>\n            <td>Преподаватель + команда</td>\n            <td>\n                         <img src=\"images/bg/icon_compare/friendly.png\" alt=\"Преподаватель + команда\" class=\"float-left\">\n               <p>Добрая дружеская атмосфера в группе. \n                Преподаватель – это друг и соратник, который всегда поможет. Каждый чувствует себя членом команды и искренне учится.\n                Как мы этого достигли, читайте в наших <a href=\"/blog\">информационных выпусках</a>.<br>\n                                Ученики без страха и опасения общаются с преподавателями и друг с другом. У всех  друг к другу взаимное уважение.</p>\n            </td>\n            <td>\n                         <img src=\"images/bg/icon_compare/friendly_not.png\" alt=\"Преподаватель + команда\" class=\"float-left\">\n                <p>Классический формат, преподаватель - главный, ученики должны слушать только его. \n                Как результат отсутствие инициативности, а в будущем, подавленные предприимчивость, творчество и командная работа.<br>\n                                Урок сопровождается страхом быть униженным и наказанным,  если преподавателю не понравится ответ. Неуважение к друг другу – норма.</p>\n            </td>\n        </tr>\n        <tr>\n            <td>Успех</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/success.png\" alt=\"Успех\" class=\"float-left\">\n                        <p>Здоровая психика, учёба в радость, гордость родителей за своих детей, высокие результаты на экзаменах, олимпиадах, других конкурсах. Результат в целом зависит от самого человека.</p>\n                                                 <p>Проявление эмоций - это естественный процесс, и Мы создаём мероприятия, где их можно проявлять, что очень важно для психики и целостного развития ребёнка. Умение радоваться и быть открытым, правильно реагировать на свои ошибки. Великолепные коммуникативные навыки, умение вызывать симпатию других людей. Прекрасное здоровье.</p>\n            </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/success_not.png\" alt=\"Успех\" class=\"float-left\">\n                <p>Детские душевные травмы не редкость. Это приводит к серьёзным последствиям в будущем. Результаты даются огромным трудом.</p>\n                                 <p>Проявление энергичности и эмоций считается за недопустимое и безобразное поведение, что и калечит детскую психику. Возникают психологические травмы, а это приводит к замкнутости. Часто чувствуют себя несчастными. Обычно плохое здоровье.</p> \n            </td>\n        </tr>\n        <tr>\n            <td>Процесс обучения</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/relation.png\" alt=\"Процесс обучения\" class=\"float-left\">\n                <p>Наши уроки основаны на естественном процессе познания. Процесс обучения состоит из ошибок, поиска их, исправления, закрепление материала. Умение самостоятельно найти ошибку и исправить её - это показатель глубоких знаний и осознанности. </p>\n                                <p>Мы никогда не наказываем за ошибку, а предлагаем самостоятельно разобраться, почему не сходится ответ.  Более того, есть задания: одни прячут ошибку, другие находят её. Любой процесс в жизни – это обучение на ошибках, исправлении их, формировании правильных выводов. Кроме того, ошибки делают сильнее, умнее, мудрее и мы называем это опытом.</p>\n            </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/relation_not.png\" alt=\"Процесс обучения\" class=\"float-left\">\n                <p>Учёба противоречит естественному процессу обучения. За ошибки наказывают, заставляют их немедленно исправлять.  \n                Возникает психологическая травма и страх сделать первый шаг.</p>\n                                <p>Почему когда учитель вызывает к доске, очень страшно? Расстрел у доски за неправильный ответ. Так за чем же его писать, лучше ничего не делать.  \n                Как это отразится во взрослой жизни? –  Синдром нерешительности.</p>\n            </td>\n        </tr>\n        <tr>\n            <td>Навыки</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/skills.png\" alt=\"Навыки\" class=\"float-left\">\n                <p>Наши ученики уже на наших уроках получают практические навыки для реальной жизни. Такой подход позволяет развивать предприимчивость, творчество, умение проявлять свои сильные качества, достигать амбициозные цели и в целом быть успешным.</p>\n            </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/skills_not.png\" alt=\"Навыки\" class=\"float-left\">\n                <p>Ученики становятся неуверенными в себе, боятся предпринимать и становятся обычными исполнителями, как правило с незавидной судьбой.</p>\n            </td>\n        </tr>\n        <tr>\n            <td>Кого мы формируем?</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/build.png\" alt=\"Кого мы формируем?\" class=\"float-left\">\n                <p>Становятся лучшими в своём деле, мастерами, профессионалами. Это предприниматели, творческие личности, учёные, тренеры, и другие великие личности.<br>\n                                Высокое благосостояние. Чёткое понимание своих целей, умение строит планы и достигать свои цели. Высокая самооценка, уверенность в себе.</p>\n            </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/build_not.png\" alt=\"Кого мы формируем?\" class=\"float-left\">\n                <p>Хороший робот пока, есть здоровье. Здоровье быстро портиться из-за слишком больших напрягов. Такая учёба формирует исполнителей.<br>\n                                                Низкая самооценка, неуверенность в себе или завышенная самооценка, которую легко уронить до низкой. Благосостояние зависит от места работы, должности, экономики и количестве рабочих часов.</p>\n            </td>\n        </tr>\n        <tr>\n            <td>Жизненная позиция + взгляд на жизненные задачи</td>\n            <td>\n                    <img src=\"images/bg/icon_compare/master.png\" alt=\"Жизненная позиция + взгляд на жизненные задачи\" class=\"float-left\">\n                        <p>Хозяева, творцы собственной жизни. <br>Задачу можно решить разными способами, всегда есть несколько выходов из любой ситуации. И её всегда можно найти.</p>\n                        </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/master_not.png\" alt=\"Жизненная позиция + взгляд на жизненные задачи\" class=\"float-left\">\n                        <p>Качество жизни зависит от многих внешних факторов. <br> Задача имеет два ответа: правильный и неправильный. Жизнь по правилам. Ожидание наказания и поощрения. Нервные срывы.</p>\n                        </td>\n        </tr>\n        <tr>\n            <td>Кем ты станешь в будущем?</td>\n            <td>\n               <img src=\"images/bg/icon_compare/in_future.png\" alt=\"Кем ты станешь в будущем?\" class=\"float-left\">\n               <p>Из-за своих способностей занимают высокие должности или сами являются организаторами проектов, предприятий, владельцами бизнеса, всё что связано с управлением</p>\n            </td>\n            <td>\n                         <img src=\"images/bg/icon_compare/in_future_not.png\" alt=\"Кем ты станешь в будущем?\" class=\"float-left\">\n                        <p>Обычные должности, иногда при очень усердной    работе возможны повышения.</p>\n            </td>\n        </tr>\n        <tr>\n            <td>Семья</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/family.png\" alt=\"Семья\" class=\"float-left\">\n                            <p>Счастливая семья.</p>\n                        </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/family_not.png\" alt=\"Семья\" class=\"float-left\">\n                            <p>Проблемы в семейной жизни.</p>\n                        </td>\n        </tr>\n        <tr>\n            <td>Цели</td>\n            <td>\n                        <img src=\"images/bg/icon_compare/purpose.png\" alt=\"Цели\" class=\"float-left\">\n                            <p>Цели от желаний.</p>\n                        </td>\n            <td>\n                        <img src=\"images/bg/icon_compare/purpose_not.png\" alt=\"Цели\" class=\"float-left\">\n                            <p>Цели от обязательств.</p>\n                        </td>\n        </tr>\n    </tbody>    \n</table>',NULL,NULL,NULL,'2017-12-22 12:02:23','2018-01-11 13:04:20'),
	(8,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по обществознанию, курсы егэ на Краснопресненской по обществознанию, курсы егэ по обществознанию, курсы егэ в Москве по обществознанию','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по обществознанию, Школа мышления - Upbrain','course_ege_social_sciences',NULL,NULL,NULL,NULL,6,'Курсы ЕГЭ по обществознанию на Краснопресненской','Твой средний балл по обществознанию поднимется до 70 уже через месяц',NULL,NULL,NULL,'<div class=\"font-light mb-3\">\n<h1>Подготовка ЕГЭ по обществознанию Upbrain</h1>\n<p>Наши курсы по подготовке к ЕГЭ по обществознанию в Москве поможет вам разобраться в праве, разобрать все нюансы разделения властей, справиться с экономикой и многое другое. Наши преподаватели по обществознанию смогут донести материал и при большом количестве информации не запутаться. Преподаватели по обществознанию курсов UPBRAIN обладают терпением, которое очень важно при работе с детьми. А обучение по нашей авторской методике даёт ему возможность организовать учебный план таким образом, чтобы ученик не взвыл от длительного разбора сложных задач, а постепенно готовился к ним.</p>\n<p>Педагог поможет осознать и достичь выбранную цель. Также мы сможем помочь справиться со стрессом и тревогой перед экзаменами посредством симуляции настоящего экзамена. Когда вы придёте на свой, вы будете чувствовать себя комфортно! Приходите на наши курсы по подготовке к ЕГЭ по Обществознанию UPBRAIN для 10-11 классов и почувствуйте, что сделали правильный выбор!!</p>\n\n<p>Для сдачи ЕГЭ по обществознанию надо обладать знаниями из разделов: право, экономика, политика, человек и общество и социальные отношения. Это кажется простым на первый взгляд, но каждый блок включает в себя множество тем с большим количеством мелких деталей. Чтобы все запомнилось и не было путаницы приходите на наши курсы, а также у нас вы:</p>\n<ul>\n<li>Сможете написать 2 пробных экзамена, чтобы быть готовым к настоящему. Узнайте все правила проведения экзамена. Задайте все волнующими вас вопросы! Мы вам все разъясним!</li>\n<li>Научитесь писать эссе с учётом всех критериев. Мы ответим на все вопросы и дадим клише для его написания.</li>\n<li>Сможете в любой момент обратиться к преподавателю по обществознанию с вопросом по теме или домашнему заданию. А также к куратору по всем организационным вопросам.</li>\n<li>Найдёте новых друзей и соратников. На наших курсах только те, кто хочет учиться и развиваться!</li>\n</ul>\n\n<h2>Чем ещё привлекают наши курсы?</h2>\n<ul>\n<li>Наши менеджеры подберут самый удобный по расположению к вам центр для занятий!</li> \n<li>Выгодная цена. Мы не берём деньги за бренд или популярность, нам важно донести знания до каждого ученика.</li>\n<li>Только квалифицированные преподаватели с высшим образованием, которые прошли курсы нашей авторской методики. Мы тщательно провели отбор и подбираем самых лучших кандидатов.</li>\n<li>Нескучные занятия. Никаких зубрёжек, обычного чтение и решения задач. Попробуй полюбить учебу с помощью игр, картинок и просто уютной атмосфере!</li>\n<li>Мини-группы до 8 человек. Каждому будет внимание: педагог удостовериться в усвоении материала урока, даст индивидуальное задание на дом или при необходимости на уроке, ответит на все вопросы учеников!</li>\n<li>Продуманные часы. Занятия по подготовке к ЕГЭ по математике будут проходить 2 раза в неделю по 2 часа. Это самое эффективное расписание, так как усвоение информации идёт максимум 2 часа, а такая частота занятий позволит максимально овладеть материалом.</li>\n</ul>\n\n<p>Профессии, для которых нужно сдать ЕГЭ по обществознанию:</p>\n<p>\n  <a class=\"btn btn-primary\" data-toggle=\"collapse\" href=\"#prof\" aria-expanded=\"false\" aria-controls=\"prof\">\n    Показать профессии\n  </a>\n</p>\n    <div class=\"collapse\" id=\"prof\">\n            <div class=\"card card-block\">\n                        <ul>\n                            <li>Менеджеры (бренды, управление персоналом, праздничных мероприятий)</li>\n                