	(10,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по истории, курсы егэ на Краснопресненской по истории, курсы егэ по истории, курсы егэ в Москве по истории','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по истории, Школа мышления - Upbrain','course_ege_history',NULL,NULL,NULL,NULL,8,'Курсы ЕГЭ по истории на Краснопресненской','Твой средний балл по истории поднимется до 70 уже через месяц',NULL,NULL,NULL,'<div class=\"font-light mb-3\">\n<h1>Подготовка ЕГЭ по история Upbrain</h1>\n<p>История является одним из сложнейших экзаменов из-за множества дат, имён и событий. Наши курсы предлагают вам заучить важные детали так, чтобы вы были уверены в своих знаниях во время экзамена. Одна из самых важных задач-не перепутать из-за большого количества информации. Преподаватели по истории, после обучения нашей авторской методикой, способны передать знания так, чтобы каждая дата, событие и имя было связано воедино. Педагоги доводят каждого до поставленной цели! Занятия проводятся в уютной мини-группе, где у каждого ученика будет возможность задать свой вопрос и ответить на вопрос педагога. Также мы проведём 2 симуляции экзамена, которые в полной мере передадут атмосферу и задание, что поможет преодолеть страх и увидеть видимый результат курсов. Ждём вас на курсах подготовки к ЕГЭ по истории UPBRAIN для 10-11 классов!</p>\n\n<h2>Почему с нами вы поступите в ВУЗ 100%?</h2>\n<p>История является одним из самых трудных экзаменов из-за большого количества материала, который важно запомнить. Есть множество причин, по которым наши курсы могут обеспечить успешную сдачу этого ЕГЭ:</p>\n<ul>\n<li>Вы сможете преодолеть страх, волнение, беспокойство и неуверенность путём сдачи 2 пробных экзамена. История является самым длительным по времени ЕГЭ и одним из самых требовательных по знанию материала.</li>\n<li>Наши квалифицированные педагоги, которые помимо полученных знаний в ВУЗе, прошли наши авторские курсы донесут до каждого учащегося знания и помогут разложить знания по блоком, чтобы не запутаться.</li>\n<li>Занятия в мини-группах до 8 человек позволят уделить время каждому ученику и ответить на все вопросы. Также преподаватель по истории поможет понять сложные темы и будет давать индивидуальные задания.</li>\n<li>Тут вы сможете найти друзей или просто учиться в уютной атмосфере, где отовсюду будет поддержала и вера в каждого. Возможность в любой момент написать преподавателю и куратору.</li>\n<li>Мы подберем самый ближайший центр для занятий к вам. Меньше времени в пути-больше времени на подготовку и отдых. Также наши курсы проходят 2 раза в неделю по 2 часа, что позволяет продуктивно воспринимать информацию и успешно подготовиться к сдаче ЕГЭ по истории.</li>\n</ul>\n\n<p>Приводим для вас список профессий, которые требуют сдачи ЕГЭ по истории:</p>\n<p>\n  <a class=\"btn btn-primary\" data-toggle=\"collapse\" href=\"#prof\" aria-expanded=\"false\" aria-controls=\"prof\">\n    Показать профессии\n  </a>\n</p>\n    <div class=\"collapse\" id=\"prof\">\n        <div class=\"card card-block\">\n                <ul>\n                    <li>Менеджеры (развлекательная индустрия, реклама, туризм и гостиничное дело)</li>\n                    <li>Адвокаты</li>\n                    <li>Архитекторы</li>\n                    <li>Дизайнеры</li>\n                    <li>Экскурсоводы</li>\n                    <li>Дипломаты</li>\n                    <li>Историки (страноведы, искусствоведы, культуроведы)</li>\n                    <li>Политологи</li>\n                    <li>Нотариус</li>\n                    <li>Философы</li>\n                    <li>Редакторы</li>\n                    <li>Юристы</li>\n                    <li>Следователи</li> \n                    <li>Парикмахеры</li>\n                </ul>\n        </div>\n    </div>\n</div>','Подготовка к ЕГЭ по истории','images/bg/subjects/dragon_history.png','Подготовка по истории проходит в классе на основе авторских методичек. Вы всю теорию изучаете дома, а трудные задания, тонкие моменты и секретные приёмы с преподавателем в классе. Наша система снимает психологическую нагрузку, убирает стресс и поднимает настроение. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. Готовьтесь к истории с драконом. <a href=\"#\">Пройти онлайн тест</a>','2018-01-03 17:30:21','2018-01-03 17:49:16'),
