	(12,0,NULL,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах по русскому языку, курсы егэ на Краснопресненской по русскому языку, курсы егэ по русскому языку, курсы егэ в Москве по русскому языку','Курсы подготовки к ЕГЭ и ОГЭ (ГИА) по русскому языку, Школа мышления - Upbrain','course_ege_russian',NULL,NULL,NULL,NULL,10,'Курсы ЕГЭ по русскому языку на Краснопресненской','Твой средний балл по русскому языку поднимется до 70 уже через месяц',NULL,NULL,NULL,'<div class=\"font-light mb-3\">\n<h1>Подготовка ЕГЭ по русскому языку Upbrain</h1>\n\n<p>Русский язык по сути один из самых простых  экзаменов, но иногда не хватает нескольких заветных баллов. На наших курсах по подготовке к ЕГЭ по русскому языку мы поможем вам разобрать самые распространенные ошибки и ловушки. Занятия будут проводиться в игровой форме, в такой атмосфере легче задавать вопросы. Преподаватель по русскому курсов UPBRAIN ответит на все вопросы и разберет не получившиеся задачи из домашнего задания. Также они проходят обучение по нашей авторской методике, помимо уже полученных знаний, что позволяет им заполучить внимание ученика и вызвать в нем интерес.</p>\n<p>Преподаватель с душой относится к каждому ученику, что даёт ребёнку почувствовать себя уверенно и заниматься с удовольствием. И, что не мало важно, педагог поможет осознать и достичь цель в обучении. Наши курсы по русскому языку помогут вам освоить даже самые сложные правила, запомнить исключения и научиться писать сочинение с 0. Мы проведем репетицию настоящего экзамена, чтобы вам было спокойно во время настоящего. Приходите заниматься на курсы по русскому UPBRAIN для 10-11 классов и мы покажем как получать удовольствие от обучения!!</p>\n\n<h2>Почему русский язык это легко?</h2>\n<p>ЕГЭ по русскому языку сдать легко, так как это наш родной язык. Многие задания мы можем решить путём собственной «чуйки», но также в нашем языке есть исключения и правила, которые нам на первый взгляд кажутся ошибочными. Также знание правил не поможет вам написать сочинение. Поэтому, когда вы приедете на наши курсы по подготовке к ЕГЭ по русскому языку, вы: </p>\n<ul>\n<li>Научитесь формулировать и грамотно писать сочинение. Как итоговое, так и ЕГЭшное! Сделаем все возможное для вашей сдачи на все критерии!</li>\n<li>Выучите все правила, которые понадобятся на экзамене. А также мы поможем вам запомнить материал без зубрежки. Ведь главное-понимание.</li> \n<li>Сможете задать все волнующие вас вопросы на занятии. Также ваш преподаватель поможет вам понять те темы, которые для вас окажутся самыми сложными, путём индивидуальных заданий.</li>\n<li>Попробуете написать 2 пробных экзамена, чтобы почувствовать атмосферу и преодолеть волнение, страх и другие ненужные ощущения. На экзамене вы почувствуете себя как дома!</li>\n<li>Найдёте друзей и почувствуете, что такое комфортная атмосфера!</li>\n</ul>\n\n<h2>Что ещё привлекательного у нас на курсах?</h2> \n<ul>\n<li>Наши менеджеры подберут самый удобный по расположению к вам центр для занятий! \n<li>Выгодная цена. Мы не берём деньги за бренд или популярность, нам важно донести знания до каждого ученика.\n<li>Только квалифицированные преподаватели с высшим образованием, которые прошли курсы нашей авторской методики. Мы тщательно провели отбор и подбираем самых лучших кандидатов.\n<li>Нескучные занятия. Никаких зубрёжек, обычного чтение и решения задач. Попробуй полюбить учебу с помощью игр, картинок и просто уютной атмосфере!\n<li>Мини-группы до 8 человек. Каждому будет внимание: педагог удостовериться в усвоении материала урока, даст индивидуальное задание на дом или при необходимости на уроке, ответит на все вопросы учеников!\n<li>Продуманные часы. Занятия по подготовке к ЕГЭ по математике будут проходить 2 раза в неделю по 2 часа. Это самое эффективное расписание, так как усвоение информации идёт максимум 2 часа, а такая частота занятий позволит максимально овладеть материалом. \n</ul>\n\n<p>Профессии, для которых требуется сдача ЕГЭ по русскому языку:</p>\n<p>\n  <a class=\"btn btn-primary\" data-toggle=\"collapse\" href=\"#prof\" aria-expanded=\"false\" aria-controls=\"prof\">\n    Показать профессии\n  </a>\n</p>\n    <div class=\"collapse\" id=\"prof\">\n        <div class=\"card card-block\">\n<ul>\n<li>Менеджеры</li>\n<li>Авиадиспетчеры</li> \n<li>Агроинженеры</li>\n<li>Адвокаты</li>\n<li>Архитекторы</li>\n<li>Аудиторы</li>\n<li>Банкиры</li>\n<li>Информатики</li>\n<li>Биоинформатики</li>\n<li>Биоинженеры</li>\n<li>Биологи</li>\n<li>Биохимики</li>\n<li>Дизайнеры</li>\n<li>Врачи (ветеринары, терапевты, хирурги, педиатры)</li>\n<li>Экскурсоводы</li>\n<li>Геологи</li>\n<li>Декораторы</li>\n<li>Дипломаты</li>\n<li>Журналисты</li>\n<li>Лингвисты</li>\n<li>Экономисты</li>\n<li>Маркетологи</li>\n<li>Информатики</li>\n<li>Историки</li>\n<li>Косметологи</li>\n<li>Архитекторы</li> \n<li>Логисты</li>\n<li>Педагоги</li>\n<li>Налоговые инспектора</li>\n<li>Юристы</li>\n<li>Нанотехнологи</li>\n<li>Нотариусы</li>\n<li>Пилоты (штурманы, судоводители)</li>\n<li>Философы</li>\n<li>Политологи</li>\n<li>Программисты</li>\n<li>Психологи</li>\n<li>Историки</li>\n<li>Географы</li>\n<li>Редакторы</li>\n<li>Риелторы</li>\n<li>Пиарщики</li>\n<li>Следователи</li>\n<li>Дезайнеры (парикмахеры, визажисты)</li>\n<li>Таможенники</li>\n<li>Товароведы</li>\n<li>Фармацевты-провизоры</li>\n<li>Физики</li>\n<li>Аналитики</li>\n<li>Флористы</li>\n<li>Ювелиры</li>\n</ul>\n        </div>\n    </div>\n</div>','Подготовка к ЕГЭ по русскому языку','images/bg/subjects/dragon_russian.png','Подготовка по русскому языку проходит в классе на основе авторских методичек. Вы всю теорию изучаете дома, а трудные задания, тонкие моменты и секретные приёмы с преподавателем в классе. Наша система снимает психологическую нагрузку, убирает стресс и поднимает настроение. Преподаватель всегда рядом, понятно объяснит и выстроит эффективный настрой в течение 2-3 недель. Готовьтесь к русскому языку с драконом. <a href=\"#\">Пройти онлайн тест</a>','2018-01-03 18:03:51','2018-01-03 18:14:19'),
