	(14,1,1,NULL,NULL,'курсы егэ, курсы егэ на Чистых прудах, курсы егэ по математике, курсы егэ по физике, курсы огэ, курсы огэ в Москве','Интенсив подготовки к ЕГЭ и ОГЭ (ГИА) по математике, пробный экзамен, приближённый к реальному ЕГЭ - Upbrain','intensive_exam',NULL,NULL,NULL,NULL,0,'Суперкурс \"Прокачай мозги\" или как посупить в ТОП 10 ВУЗов','Почему вы решили что не завалите экзамены в этом году?',NULL,NULL,NULL,'<div class=\"up-text\">\n<p>Наступает весенняя пора, назревает состояние беспокойства и переживания перед экзаменами.\nВ твоей голове рождается мысль о том, как ты будешь сдавать экзамены. Каждый день сталкиваясь в школе с напоминанием о предстоящих летних испытаниях, возникают тревозные образы: \"А если я плохо напишу?\" или \"Что будет если я завалю экзамен?\", \"Так мало времени\", \"Я ничего не успеваю\", \"Почему я так долго соображаю?\", \"Надо срочно, что-то делать\", \"Как будто я всё забыл, то что до этого учил\", \"Я как в тумане\". Начинает появляться страх и состояние беспомощности, которое усиливается обстановкой в классе создаваемое учителем и безразличием одноклассников к твоим внутренним преживаниям. Возникает ощущение отречённости, никого не интересует твоё внутреннее состоние, поэтому ты боишься поделиться или рассказать о своих чувствах, раскрыть душу чтобы объединиться и преодолеть совместную неприязнь и отвращение к предмету, необходимый для поступления в свой ВУЗ мечты.</p>\n\n<div class=\"container container-wrap-process-1 m-b-lg\">\n    <div class=\"m-b-0 text-center\">\n        <span class=\"common-title\" id=\"subjects\">Суперкурс по ЕГЭ математике и физике</span>\n    </div>\n    <div class=\"font-lite px-5\">\n        <div class=\"row row-centered\">\n            <div class=\"col-sm-3\">\n                <img class=\"img-fluid\" src=\"http://upbrain.ru/images/bg/subjects/hand_course_2.jpg\" width=\"300px\" alt=\"Курсы ЕГЭ по математике\">\n            </div>\n            <div class=\"col-sm-9 col-sm-offset-1\">\n                Вы заполните все свои пробелы по математике и физике, получите сильную практику в написании экзамена. \nМы разберём все хитрые места второй части: как не потерять баллы и приобрести дополнительные \"лёгкие\" баллы. \nКак мыслят эксперты и за что они снимают баллы? Всё это узнаете на интенсиве \"Суперкурс ЕГЭ\"\n            </div>\n        </div>\n    </div>\n</div>\n\n<p>Ищешь выход из ситуации прокручиваешь в голове возможные решения и понимаешь, что ни родители, ни школа не в состоянии понять тебя и выработать лекарство от этой боли, пронизывающая тебя до каждой клеточки твоего тела при напоминании о предстоящих испытаниях ОГЭ или ЕГЭ. Да именно Вы находитесь в поединке один на один. На уровне вашего тела это может проявляться в виде головных болей, внезапное повышение температуры, простуды, оживление старых болячек, ослабление иммунитета. Такое психологическое давление, что трудно удержать состояние осознанности и лёгкости в голове. Непривычное состояние правда?</p>\n\n<h3>Что же делать? Как убрать эту боль? Эту неуверенность в завтрашнем дне?</h3>\n\n<p>Чтобы ответить на эти вопросы, нам самим пришлось проходить через все эти испытания и прочувствать на своей шкуре боль, страх, много раз ошибиться, разочароваться и в итого побе. Поэтому мы систематизировали и выстрадали наш подход к подготовке к стрессовым и критическим ситуациям.</p>\n\n<p>Первое что нужно сделать это убедить себя, что вы можете пройти все эти испытания, преодолев надуманный и преувеличенный страх - быть плохо подготовленныем к экзаменам ОГЭ или ЕГЭ.</p>\n\n<p>Для этого нужна среда и атмосфера <span class=\"font-bold\">сильного преподавателя</span>, в поле которого вы почувствуете поддержку и волю человека готовым искренне помочь Вам.</p>\n<p>Преподаватель <span class=\"font-bold\">сильный психолог</span>, с ним вы раскроетесь от внутренних зажимов и страхов, которые тревожат вас и мешают спокойно готовиться, занижают ваши умственные способности и самооценку.</p>\n\n<p>Чёткая структура вашей подготовки распределённая по времени. Это и есть индивидуальная программа разработанная по вашим способностям и навыкам, а также каждонедельная работа с обратной связью. Туда входит:</p>\n<ul>\n    <li>Тестирование навыков и определение ваших сильных и слабых мест по предмету</li>\n    <li>Онлайн общение с преподвателем в соц. сети, вы можете в любой момент задать вопрос</li>\n    <li>Интенсив по теории с применением практики для успешной задачи первой части с кратким ответом</li>\n    <li>Интенсив по теории с применением практики для успешной задачи второй части с развёрнутым ответом</li>\n    <li>Закрепляющий вебинар на основании общих выводов вышей подготовки за две недели, в котором будут разбираться ваши пробелы</li>\n</ul>\n\n<h3>Запишитесь на интенсив \"Суперкурс ЕГЭ\" до 6 апреля:</h3>\n<p>Интенсив проходит каждый месяц:</p>\n<ul>\n    <li>3 часа задачи первой части с кратким ответом</li>\n    <li>3 часа задачи второй части с развёрнутым ответом</li>\n</ul>\n<p>Стоимость одного интенсива: <span class=\"font-bold\">5000р</span></p>\n\n<h3>Пробный экзамен приближённый к реальному ОГЭ и ЕГЭ</h3>\n<p>Проведение пробного экзамена максимально приближённые к реальному ОГЭ и ЕГЭ.\nНа экзамене будет предоставлен вариант сформированный на основании глубокого анализа, содержащий задачи которые могут попасть на экзамене. Как будет проходить:</p>\n<ul>\n    <li>Экзамен пишется по всем правилам ОГЭ/ЕГЭ с заполнением бланков</li>\n    <li>Время проведения экзамена 3ч 55мин</li>\n    <li>Первую часть варианта с кратким ответом проверяет ЭВМ по распознаванию символов</li>\n    <li>Вторую часть варианта с развёрнутым ответом проверяют преподаватели-эксперты ОГЭ/ЕГЭ, с комментариями и выставленим оценок</li>\n</ul>\n<p>Стоимость пробного экзамена: <span class=\"font-bold\">1500р</span></p>\n</div>','Суперкурс по ЕГЭ математике и физике','images/bg/subjects/hand_course_2.jpg','Вы заполните все свои пробелы по математике и физике, получите сильную практику в написании экзамена. \r\nМы разберём все хитрые места второй части: как не потерять баллы и приобрести дополнительные \"лёгкие\" баллы. \r\nКак мыслят эксперты и за что они снимают баллы? Всё это узнаете на интенсиве \"Суперкурс ЕГЭ\"','2018-03-01 08:58:00','2018-04-07 20:00:31'),
	(15,1,0,NULL,'container-webinar','бесплатный вебинар, вебинар по егэ, вебинар по физике, вебинар по математике, вебинар егэ по математике, вебинар егэ по физике, курсы егэ, курсы егэ на Чистых прудах, курсы егэ по математике, курсы егэ по физике','Как за два месяца подготовиться к ЕГЭ на 80+? Вы узнаете на вебинаре.','meet',NULL,NULL,NULL,NULL,0,'За 1,5 месяца к ЕГЭ на 80+','Бесплатный вебинар',NULL,NULL,NULL,'<div class=\"row row-backbordered m-b-lg\">\n<div class=\"mx-auto col-sm-8\">\n<h2 class=\"m-t-lg\">На онлайн - встрече вы получите:</h2>\n<div class=\"row\">\n<i class=\"fas fa-rocket fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Чёткий план действий и работающие рекомендации к эффективной подготовке.</p>\n<p>До экзамена остались считанные дни. Это время нужно максимально рационально использовать. Опытным путём мы выяснили, как готовится в экстремально короткие сроки.</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-user-secret fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Секреты ЕГЭ. Как набрать высокие баллы?</p>\n<p>Покажем на каких заданиях по незнанию теряют баллы, а на каких легче всего их набрать. Эту стратегию знают единицы репетиторов.</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-clock fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p  class=\"font-bold\">Психологическую и тактическую подготовку</p>\n<p>Расскажем: \nКак лучше распределить время, чтобы всё успеть. \nКак не отвлекаться на страх, а сконцентрироваться на решении. </p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-globe fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Как построена учёба на Физическом факультете МГУ? </p>\n<p>Не секрет, выпускники Физфака ценятся не только в России во всех отраслях экономики, но и во всём Мире. Особенно в научной сфере.\nРасскажем откуда такой успех.</p>\n</div>\n</div>\n</div></div>\n<div class=\"row row-backbordered m-b-lg\">\n<div class=\"col-sm-8 mx-auto\">\n<h2>Ведущие вебинара</h2>\n<div class=\"row\">\n<div class=\"mx-auto col-sm-6 text-center\">\n<img src=\"images/teachers/AV.png\" alt=\"Перлов Артём Валерьевич\n- Эксперт ЕГЭ по математике и физике\">\n<p>Артём Валерьевич. <br>Эксперт ЕГЭ. <br>Основатель Upbrain. <br>Физический факультет МГУ. <br>ИОФ РАН Прохорова. <br>Составитель задач по математике и физике</p>\n</div>\n<div class=\"mx-auto col-sm-6 text-center\">\n<img src=\"images/teachers/EV.png\" alt=\"Перлов Егор Валерьевич\n- Эксперт ЕГЭ по математике и физике\">\n<p>Егор Валерьевич. <br>Эксперт ЕГЭ. <br>Основатель Upbrain. \n<br>Физический факультет МГУ. \n<br>ФИАН им. Лебедева. \n<br>Составитель задач по математике и физике</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"row row-backbordered m-b-lg\">\n<div id=\"uv-div\" class=\"mx-auto col-sm-8\">\n<script src=\"js/lp/d3.v3.min.js\"></script>\n<script src=\"js/lp/uvcharts.min.js\"></script>\n<script>\nvar width = parseInt(getComputedStyle(document.getElementById(\'uv-div\')).width)-200;\nif(width < 159)\n      width = 159;\nconsole.log(width);\nvar  olympics_data = {\n    categories : [\'Средний начальный балл учеников\',\'Классическая дополнительная подготовка учеников\',\'После работы со стрессом\'],\n    dataset : {\n        \'Средний начальный балл учеников\' : [\n            {name: \'средние\', value: 42 },\n            {name: \'без подготовки\', value: 7 },\n            {name: \'подготовленные\', value: 64 },\n        ],\n\n        \'Классическая дополнительная подготовка учеников\' : [\n            {name: \'средние\', value: 68 },\n            {name: \'без подготовки\', value: 44 },\n            {name: \'подготовленные\', value: 84 },\n        ],\n\n        \'После работы со стрессом\' : [\n            {name: \'средние\', value: 86 },\n            {name: \'без подготовки\', value: 68 },\n            {name: \'подготовленные\', value: 96 },\n        ]\n    }\n };\nvar config = {\n\n        graph : {\n            bgcolor: \'none\',\n            custompalette : [\'#1a99aa\',\'#aaa\',\'#ff5c00\'],\n             //orientation: \'Vertical\'\n        },\n\n        dimension : {\n            width : width,\n        },\n\n        margin : {\n            top : 60,\n            bottom : 150,\n            left : 100,\n            right : 40\n        },\n\n        axis : {\n            showsubticks : false,\n            fontfamily : \'PT Sans\'\n        },\n\n        meta : {\n            caption : \'Баллы ЕГЭ\',\n            hlabel : \'Абсолютный рост\',\n                        //vlabel: \'Баллы\'\n        },\n\n        frame : {\n            bgcolor: \'none\'     \n        },\n\n        legend : {\n            fontfamily: \'PT Sans\',\n                                position: \'bottom\',\n            legendstart: 0\n            },\n        effects : {\n            textcolor: \'#000\'\n        },\n\n        caption : {\n            fontfamily: \'PT Sans\'\n        },\n\n        subCaption : {\n            fontfamily : \'PT Sans\'\n        }\n};\nvar chart = uv.chart(\'Bar\', olympics_data, config);\n</script>\n</div></div>\n<div class=\"row row-backbordered m-b-lg\">\n<div id=\"uv-div\" class=\"mx-auto col-sm-8\">\n<h2 class=\"m-t-lg\">Также узнаете</h2>\n<div class=\"row\">\n<i class=\"fas fa-couch fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Как убрать лень, апатию и прокрастинацию.</p>\n<p>Миллионы школьников с этим сталкиваются, но никто не знает что делать.  А мы знаем.</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-heartbeat fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Как побороть страх и начать действовать.</p>\n<p>Секретные техники разработанные для  космонавтов и секретных служб.</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-utensils fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Какой рацион питания для лучшей работы мозга.</p>\n<p>Мозг расходует энергии больше, чем любой другой орган.</p>\n</div></div>\n</div></div>',NULL,NULL,NULL,'2018-03-27 17:47:01','2018-04-07 22:04:44'),
	(16,1,0,'ЕГЭ','container-webinar','пробный экзамен егэ, пробный экзамен егэ 2018, пробный экзамен математика егэ, результаты пробных экзаменов егэ 2018, пробные экзамены огэ, пробные экзамены 2018 огэ, робный экзамен 9 класс огэ, робный экзамен по математике огэ, пробный экзамен огэ по алг','Проводим пробный приближённый к реальному экзамену ЕГЭ и ОГЭ для 9 -11 классов по математике, физике, русскому языку','trial_exam',NULL,NULL,NULL,NULL,0,'Полное тестирование ЕГЭ по математике','Будь умнее, подготовленным и не дай себе завалить судьбоносный экзамен','margin-top:0','font-size:35px','font-size:30px','<div class=\"row row-backbordered m-b-lg\">\n<div class=\"mx-auto col-sm-8\">\n<h2 class=\"m-t-lg\">Что Вы получите:</h2>\n<div class=\"row\">\n<i class=\"fas fa-pen-square fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Полноценный вариант приближённый к экзамену математике 2018</p>\n<p>Полное погружение в атмосферу экзамена. Будут представлены задачи похожие на экзаменационные в этом году, которые дадут вам представление о вашей подготовке.</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-puzzle-piece fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Разбор вашего варианта с экспертом ЕГЭ</p>\n<p>Укажут на ваши ошибки. Покажут тонкости второй части. Как нужно оформлять задачи и где можно получить баллы? Где вы можете потерять баллы?</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-clock fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p  class=\"font-bold\">Психологическую и тактическую подготовку</p>\n<p>Расскажем: \nКак лучше распределить время, чтобы всё успеть. \nКак не отвлекаться на страх, а сконцентрироваться на решении. </p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-address-card fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p  class=\"font-bold\">Вы получите онлайн результаты и рекомендации от  эксперта ЕГЭ</p>\n<a href=\"images/bg/exams/result_exam_1.png\" data-toggle=\"lightbox\">\n            <img src=\"images/bg/exams/result_exam_thumb_1.png\" alt=\"Анализ пробного экзамена по ЕГЭ\" class=\"img-fluid col-sm-5\">\n            </a>\n<a href=\"images/bg/exams/result_exam_2.png\" data-toggle=\"lightbox\"><img src=\"images/bg/exams/result_exam_thumb_2.png\" alt=\"Анализ пробного экзамена по ЕГЭ\"  class=\"img-fluid col-sm-5\"></a>\n</div></div>\n</div></div>\n<div class=\"row row-backbordered m-b-lg\">\n<div class=\"col-sm-8 mx-auto\">\n<h2>Преподаватели</h2>\n<div class=\"row\">\n<div class=\"mx-auto col-sm-6 text-center\">\n<img src=\"images/teachers/AV.png\" alt=\"Перлов Артём Валерьевич\n- Эксперт ЕГЭ по математике и физике\">\n<p>Артём Валерьевич. <br>Эксперт ЕГЭ. <br>Основатель Upbrain. <br>Физический факультет МГУ. <br>ИОФ РАН Прохорова. <br>Составитель задач по математике и физике</p>\n</div>\n<div class=\"mx-auto col-sm-6 text-center\">\n<img src=\"images/teachers/EV.png\" alt=\"Перлов Егор Валерьевич\n- Эксперт ЕГЭ по математике и физике\">\n<p>Егор Валерьевич. <br>Эксперт ЕГЭ. <br>Основатель Upbrain. \n<br>Физический факультет МГУ. \n<br>ФИАН им. Лебедева. \n<br>Составитель задач по математике и физике</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"row row-backbordered m-b-lg\">\n<div id=\"uv-div\" class=\"mx-auto col-sm-8\">\n<script src=\"js/lp/d3.v3.min.js\"></script>\n<script src=\"js/lp/uvcharts.min.js\"></script>\n<script>\nvar width = parseInt(getComputedStyle(document.getElementById(\'uv-div\')).width)-200;\nif(width < 159)\n      width = 159;\nconsole.log(width);\nvar  olympics_data = {\n    categories : [\'Баллы до разбора\',\'Баллы после нашего разбора\'],\n    dataset : {\n        \'Баллы до разбора\' : [\n                    {name: \'минимальные\', value: 7 },\n            {name: \'средние\', value: 48 },\n                        {name: \'максимальные\', value: 90 },\n        ],\n\n        \'Баллы после нашего разбора\' : [\n            {name: \'минимальные\', va