</p>\n</div></div>\n<div class=\"row\">\n<i class=\"fas fa-utensils fa-3x col-sm-2 text-center\"></i>\n<div class=\"col-sm-10\">\n<p class=\"font-bold\">Какой рацион питания для лучшей работы мозга.</p>\n<p>Мозг расходует энергии больше, чем любой другой орган.</p>\n</div></div>\n</div></div>',NULL,NULL,NULL,'2018-04-20 16:33:24','2018-04-27 11:07:48');
