	(2,'Проблемные дети навсегда? Откуда растут ноги или как решить нерешаемый вопрос?','<h2>Почему даже хороший ребёнок может стать проблемным. Как этого избежать?</h2>\n<p>Проблемность детей начинается с их поведения. Делают не так, делают не то что нужно, делают то что нельзя. При этом даже решительные меры его не останавливают.   Откуда же такая сила и мотивация делать себе плохо?</p>\n<p>В Мире ни один здоровый организм не будет делать себе плохо, если это не сделает ему жизнь ещё лучше. Даже бактерии, а про высших животных и говорить нечего. Человек это самый разумнейший из животных. Да, всё же люди – это очень умные животные, оторвавшиеся от природного Мира. Я не опускаю человека, а наоборот предлагаю взглянуть шире, выйти из стереотипов мышления.</p> \n<p>И так, если ребёнок не психически больной, то просто так себе проблемы создавать он себе не будет. И забегая вперед, «проблемные дети» - не значит, что они психи. \nТогда зачем же он себе такие страдания причиняет?\nДля него эти страдания намного меньше чем, его душевные. Да, у него в душе боль. \nФизическую боль можно перетерпеть, обезболить, а душевную только залечить.</p>\n<h3>Откуда же она?</h3> \n<p>Если ребёнка часто ругать, упрекать, и очень редко хвалить, то у него возникают травмирующие последствия. А если не давать ему свободу или ещё хуже не любить, то проблемы пожинать начнёте еще в раннем возрасте.\nЗаниженная самооценка, неверие себе и окружающим, злость и обида на всех – это ещё только цветочки.  Дело в том, базовое формирование личности происходит в первые 7-10 лет. И что будет заложено в этот период, то и будет сопровождать его всю жизнь. Исправить можно, но не наломает ли  дров до этого?</p> \n<p>И так, что должен делать каждый родитель, чтобы не вырастить «не пойми кого»?</p> \n<ul> \n<li>Всегда быть справедливым с детьми. Они очень хорошо понимают, где их обманывают. Этому они быстро учатся.</li> \n<li>Хвалить, восхищаться даже на незначительные достижения.</li> \n<li>Не быть цензором для него, а стать другом, который всегда поможет.</li> \n<li>Дайте свободу и при этом и отвественность.</li> \n<li>Самое важное здесь, Любить! Возможно Вы сами недолюблены, что неудивительно. Но Вы можете изменить всё для своих детей и им не придётся проходить то, что необязательно.</li> </ul>   \n<p>Проявление любви бывает разное в зависимости от психологии ребёнка.</p> \n<p>Все эти вопросы учитываются в upbrain.ru. Для тех, кто любит получать преимущества.</p>',NULL,'Трудный ребёнок. Часть 1.','',48,'Психология, дети, родители, семья, школа, учёба, образование','Проблемы с детьми. Воспитание детей. Школа не проблема.','problem_children',1,'2018-02-12 09:31:48','2018-02-14 11:16:16',NULL),
	(3,'Детская игромания у детей.','<h2>Причины появления. Почему от этого нужно скорее спасти  ребёнка?</h2> \n<p>Сегодня дети начинают играть чуть ли не раньше, чем разговаривать. Этому способствуют новые технологии и стремительный рост сферы IT.\nВ играх ничего плохого нет, если это хорошие игры. Они даже развивают ребёнка, но в одном направлении. В случае игромании может стать отсталым или с перекошенным мировоззрением.</p>\n<h3>Откуда появляется игромания и почему в большей степени подвержены мальчики?</h3>\n<p>Цель игры – это выиграть, так сделано большинство игр.</p> \n<p></p>Представьте древнего человека. Охотник, испытывающий наибольший азарт от охоты, будет более успешным. Проще говоря, он обожает охотится. Она улучшает его жизнь, жизнь его племени. Все счастливы и сыты. Отговорить такого от охоты затея так себе.</p></p>\n<p>Вот и ваш ребёнок, где-то в древности был охотником, выигрыш на охоте поощрялся и хотелось быть лучше и лучше. Сейчас времена поменялись, единственная отдушина - в играх.</p> \n<p>А что же, только в играх можно применять свои охотничьи инстинкты?  Можно где угодно, но именно в играх полная свобода.\nА если и проиграешь, никто ругать не будет. В случае же выигрыша, почести и добыча радует, другие участники уважают, как в древние времена. \nА кроме компьютерных игр, что-то ещё интересно? Много всего, но там можно схлопотать, даже если выиграешь. Условия нечестные.</p> \n<p>Подведём итоги.</p>\n<ul>\n<li>В играх единые правила для всех. Это честно.</li>\n<li>За проигрыш не ругают, не наказывают.</li>\n<li>За выигрыш уважают.</li>\n<li>Полная свобода в игре.</li>\n</ul>\n<p>Это то, чего нет вне игры, поэтому приходится получать это в игре.</p>\n<h4>Почему важно избавить от игромании скорее?</h4>\n<p>Дело в том, что в детском возрасте формируется личность. И личность многогранная. В играх формируется одна грань, что создаёт перекос в мировоззрении, психике и личности.\n Более того, он подменяет реальный мир на игровой. Когда другие дети познают мир, развивают себя многогранно.</p>\n<p>Вопрос воспитания, развития ребёнка очень важный и серьёзный. Требует много ресурсов и возникает вопрос, когда же самим жить? (Родителям)</p>\n<p>Upbrain.ru – это курсы для детей и для родителей. Мы разобрали эти вопросы, опробовали успешно на практике и готовы предложить Вам отдохнуть, а мы поработаем за Вас.</p>\n<p>Не каждый родитель осознаёт власть над ребёнком, что очень опасно. При неквалифицированном использовании экскаватора можно наломать дров, а если уметь пользоваться, лопатой сделать лучше и быстрее.</p>\n<p>Игромания - это патология. И не важно во что играет человек, азартные игры, компьютерные игры, гонки, экстрим  и т.д. \n\nДа, это всё имеет одну и ту же причину. \nА сформирована она ещё в детстве. \nЗнаете какая потребность у всех игроков? - стать лучше других. Да. Не сами деньги цель. \nДа, это такой способ добиться признания и любви от своих родителей. Если же они не дают, то от окружения. Поэтому они обречены тусить где могут быть признаны.</p> \n<p>Ещё одна причина, доказать право на собственный выбор и признание его за ним сначала родителей, потом и общество. \nТаким детям родители не позволяли делать то, что они хотят под разными предлогами.</p> \n<p>Бич современных детей - игромания в компьютерных играх.</p> \n<h5>А тут в чём причина?</h5> \n<p>Причина та же. Компьютерный Мир даёт возможность проявлять себя индивидуально и независимо, среди игроков можно добиться признания, но для этого надо покачать себя. А играть и получать почести, кто откажется, если их нет больше ни где?</p> \n<p>Алкоголизм и наркомания. \nТут та же природа - желание жить в мире где признают и любят. Реальный мир неприятен и изматывает.\nЭто случается с теми, кто уже не может играть и выигрывать. Запретите им играть, т.е. выигрывать и сломаете окончательно.</p> \n<h6>Что же делать?</h6>\n<ul>\n<li>Ни в коем случае не запрещать играть.</li> \n<li>Выяснить, что заменяет им  игровой Мир.</li>  \n<li>Дать - это в реальном мире, Т.е. В семье.\nОбычно это Любовь и признание, но как их дать зависит от каждого внутреннего мира ребёнка.</li> \n</ul> \n<p> Самое лучшее решение отдать его специалистам, которые знают как их энергию направить на благо, закрыть травму и начать жить. При этом дадут задел на счастливое будущее.</p>',NULL,'Решить можно всё, но не каждому?','',48,'Психология, дети, родители, семья, школа, учёба, образование','Игромания. Компьютерные игры поглотили ребёнка. Естественные ли это процессы? Что с этим делать?','gambling_addiction',1,'2018-02-14 11:15:23','2018-02-14 11:16:43',NULL),
	(5,'Грустная история. Почему Маугли навсегда останутся животными?','<h2>Когда лучше начать развивать ребёнка? Лучший формат обучения.</h2> \n<p>Чтобы ответить на этот вопрос предлагаю ознакомиться с материалами ниже.</p> \n<p>Мне кажется, каждый врослый человек знает сказку \"Маугли\". Но не знает, что реальный истории \"Маугли\" трагичны.\nК сожелению, такие случае произошли не единожды. Только в России известны несколько случаев. Один случай с мальчиком, которого приютили собаки, закончился почти без последствий.\nА остальные на всегда останутся животными. Т.е. Их животные повадки всегда останутся и самое главное разговаривать и читать, понимать человеческую речь они не научились и не научатся никогда.</p>  \n<h3> Почему?</h3>  \n<p> Есть такое очень мудрое выражение: \" Всему своё время\"</p>  \n<p> Ребёнок не научившийся разговаривать до 7 лет уже никогда не научится разговаривать. Дело в том, что речевые центры к этому моменту сформировались и на основе их идёт дальнейшее формирование мозга. Признаюсь, мозг ещё мало изучен, может быть есть шанс. Но его ни кто не использовал.\nИ так не только с речью.</p>  \n<p> Мы заметили, что если детям давать материал для старших, то они его легко усваивают, а дальше ещё более сложный. Т.е. способности человека значительно круче, чем принято считать. Но развить их можно в детском возрасте. Ну и подача материала играет решительную роль.</p> \n<p> Когда же лучше учится ребёнку, думаю стало понятно. Чем раньше, тем лучше.</p>  \n<p> Чем раньше начать, тем большему можно научить, а тем самым дать значительное преимущество в жизни.</p> \n<p> Upbrain.ru – Невероятные результаты.</p>',NULL,'Не будь Маугли.','',48,'Психология, дети, родители, семья, школа, учёба, образование, МГУ,Социология','Почему лучше раньше, чем позже начать учиться?','develop_the_brain',1,'2018-02-14 11:38:23','2018-02-14 14:25:30',NULL),
	(7,'Идеальное образование для детей и взрослых.','<p>И так, по предидущим статьям мы выяснили:</p>\n<ul>\n<li>Откуда берутся проблемные дети и что с этим делать?</li>\n<li>Игромания. Причины и что с этим делать?</li>\n<li>Чему нас научили \"Маугли\", и когда начинать учиться, чтобы не стать отсталым?</li>\n</ul>\n<p> К нам постоянно обращаются родители с вопросом: \"Где найти время и силы на воспитание детей правильно? И как воспитывать правильно?\"</p>\n<p>Поэтому мы разработали специальные курсы для родителей:\"Как воспитать ребёнка гением, так чтобы он был благодарен Вам.</p>  \n<p>Дело в том, что многие родители в процессе создавания из ребёнка вундеркинда очень сильно портят с ним взаимоотношения и даже друг с другом. Это приводит к распаду семей, дети не хотят иметь ничего общего с такими родичами, или они переходят а режим паразита, почувствовав вину родителей перед ним. Многие ситуации мы не рассказываем, но они кардинально меняют жизнь всех и совсем не в лучшую сторону.</p> \n<p></p>Как избежать негативных последствий, Вы научитесь на нашем тренинге.</p></p>\n<p>Для детей, Мы разработали специальные развивающие и раскрывающие таланты и полезные навыки для жизни. курсы, позволяют им подняться над обычными стандартами. Все наши ученики получают неоспоримые преимущества, как во время учёбы, так и став взрослыми.</p> \n<p>Наши ученики поступают в лучшие ВУЗы страны, такие как: МГУ, РЕЭ, БАУМАНКА, МГИМО и тд. \nИ да, у нас 100% учеников поступают в запланированные ВУЗЫ.</p> \n<p>Курсы у нас рассчитаны на возраст детей от 6 и до 18 лет.</p>\n<p>Как я уже говорил, чем раньше начать, тем больших результатов получишь.</p>\n<h2>Upbrain.ru - прокачай мозг.</h2> \n<p>Почему мозг? Да потому что, это всё. Знаете, что здоровье тоже зависит от мозгов, накачать мышцы... тоже в мозгу решается, достичь успеха в разных областях жизни - мозг. \nПрокачай мозги - сделай жизнь прекрасной.</p> \n<p>Идея создать Upbrain.ru, как источник знаний, творчества, успеха и гармонии в жизни зародилась ещё в 2005 году. И сегодня у каждого есть возможность достигнуть успеха, о котором он даже не мечтал или мечтает уже давно.</p> \n<p>Детям это необходимо, мы даём инструменты, учим ими пользоваться, а уже где их применить решите сами. Как решать тоже научим.\nЗнаете, по тому, какое было детство можно сразу предсказать счастливый ли он будет в жизни. Конечно, каждый может её изменить в любой момент, но практика показывает без помощи эти редко удаётся.</p> \n<p>Так же мы проводим мастер-классы для детей и родителей. И мы разыгрываем подарки.\nПодробнее на сайте Upbrain.ru или по телефонам указанным на сайте.</p>',NULL,'Upbrain.ru - учись для жизни.','',48,'Психология, дети, родители, семья, школа, учёба, образование, МГУ','Учимся и выживаем, мы меняем на учимся, чтобы прекрасно жить.','ideal_education',1,'2018-02-14 12:09:49','2018-02-14 12:09:49',NULL);
