	(246,246,'Для определения оптимального режима повышения цен социологи предложили фирме с 1 января повышать цену на один и тот же товар в двух магазинах двумя способами. В одном магазине — в начале каждого месяца (начиная с февраля) на 2%, в другом — через каждые два месяца, в начале третьего (начиная с марта) на одно и то же число процентов, причём такое, чтобы через полгода (1 июля) цены снова стали одинаковыми. На сколько процентов надо повышать цену товара через каждые два месяца во втором магазине?',NULL,75,2,'C',12,'4.04',NULL,7,'246','1'),
	(247,247,'Для определения оптимального режима снижения цен социологи предложили фирме с 1 января снижать цену на один и тот же товар в двух магазинах двумя способами. В одном магазине — в начале каждого месяца (начиная с февраля) на 10%, в другом — через каждые два месяца, в начале третьего (начиная с марта) на одно и то же число процентов, причём такое, чтобы через полгода (1 июля) цены снова стали одинаковыми. На сколько процентов надо снижать цену товара через каждые два месяца во втором магазине?',NULL,100,5,'C',12,'19',NULL,12,'247','1'),
	(248,248,'В соответствии с договором фирма с целью компенсации потерь от инфляции была обязана в начале каждого квартала повышать сотруднику зарплату на 2%. Однако в связи с финансовыми затруднениями она смогла повысить ему зарплату только раз в полгода (в начале следующего полугодия). На сколько процентов фирма должна повышать зарплату каждые полгода, чтобы 1 января следующего года зарплата сотрудника была равна той зарплате, которую он получил бы при режиме повышения, предусмотренном договором?',NULL,NULL,NULL,NULL,12,'4.04',NULL,NULL,'248','1'),
	(249,249,'Банк предлагает клиентам два вида вкладов. Первый «До востребования» со следующим порядком начисления процентов: каждые 6 месяцев счёт увеличивается на 10% от суммы, имеющейся на счету клиента в момент начисления. Второй вклад «Номерной» с ежегодным начислением процентов по вкладу. Сколько процентов годовых должен начислять банк по второму вкладу, чтобы равные суммы, положенные клиентом на каждый из указанных счетов, через два года оказались снова равными?',NULL,NULL,NULL,NULL,12,'21',NULL,NULL,'249','1'),
	(250,250,'По сберегательному вкладу банк выплачивает 12% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 10 000 рублей, который не пополнялся и с которого не снимали деньги в течение 2 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'2544',NULL,NULL,'250','1'),
	(251,251,'По накопительному вкладу банк выплачивает 20% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 5 000 рублей, который не пополнялся и с которого не снимали деньги в течение 3 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'3640',NULL,NULL,'251','1'),
	(252,252,'По долгосрочному вкладу банк выплачивает 10% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 20 000 рублей, который не пополнялся и с которого не снимали деньги в течение 3 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'6620',NULL,NULL,'252','1'),
	(253,253,'По стандартному вкладу банк выплачивает 8% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 25 000 рублей, который не пополнялся и с которого не снимали деньги в течение 2 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'4160',NULL,NULL,'253','1'),
	(254,254,'По вкладу «Доходный» банк выплачивает 14% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 50 000 рублей, который не пополнялся и с которого не снимали деньги в течение 2 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'14980',NULL,NULL,'254','1'),
	(255,255,'По накопительному вкладу банк выплачивает 10% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 100 000 рублей, который не пополнялся и с которого не снимали деньги в течение 3 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'33100',NULL,NULL,'255','1'),
	(256,256,'По пенсионному вкладу банк выплачивает 18% годовых. По истечении каждого года начисленная сумма присоединяется к вкладу. На этот вид вклада был открыт счёт в 5 000 рублей, который не пополнялся и с которого не снимали деньги в течение 2 лет. Какой доход был получен по истечении этого срока?',NULL,NULL,NULL,NULL,12,'1962',NULL,NULL,'256','1'),
