	(260,260,'В результате колебания цен на рынке цена пакета акций сначала понизилась на некоторое число процентов, затем поднялась на 20%, а затем снова снизилась, причём второе снижение цены было на 5% меньше первого. В итоге начальная цена пакета акций снизилась на 28%. На сколько процентов понизилась цена пакета акций во второй раз?',NULL,NULL,NULL,NULL,12,'20',NULL,NULL,'260','1'),
