	(263,263,'После покупки пакета акций владелец разделил его на две неравные части. Акции первой части он продал на 15%, а акции второй — на 20% дороже их первоначальной цены. В результате его прибыль составила 18%. Сколько процентов всех акций составила первая часть пакета?',NULL,NULL,NULL,NULL,12,'40',NULL,NULL,'263','1'),
