	(1238,1238,'Независимое агентство намерено ввести рейтинг новостных интернет-изданий на основе оценок информативности \\(In\\), оперативности \\(Op\\), объективности публикаций \\(Tr\\), а также качества сайта \\(Q\\). Каждый отдельный показатель оценивается читателями по 9-балльной шкале целыми числами от -4 до 4.\nАналитики, составляющие формулу рейтинга, считают, что объективность ценится втрое, а информативность публикаций – всемеро дороже, чем оперативность и качество сайта. Таким образом, формула приняла вид \\(R=\\frac{7In+Op+3Tr+Q}A.\\)\nЕсли по всем четырём показателям какое-то издание получило одну и ту же оценку, то рейтинг должен совпадать с этой оценкой. Найдите число \\(A\\), при котором это условие будет выполняться.',NULL,2,1,'D',92,'12',NULL,17,'455','8'),
	(1239,1239,'Независимое агентство намерено ввести рейтинг новостных интернет-изданий на основе оценок информативности \\(In\\), оперативности \\(Op\\), объективности публикаций \\(Tr\\), а также качества сайта \\(Q\\). Каждый отдельный показатель оценивается целыми числами от -4 до 4.\nАналитики, составляющие формулу рейтинга, считают, что объективность ценится впятеро, информативность втрое, а оперативность вдвое дороже, чем качество сайта. Таким образом, формула приняла вид \\(R=\\frac{3In+2Op+5Tr+Q}A\\)\nЕсли по всем четырём показателям какое-то издание получило одну и ту же оценку, то рейтинг должен совпадать с этой оценкой. Найдите число \\(A\\), при котором это условие будет выполняться.',NULL,2,1,'D',92,'11',NULL,17,'456','8'),
	(1240,1240,'Рейтинг \\(R\\) интернет-магазина вычисляется по формуле \\( R=r_{pok}-\\frac{r_{pok}-r_{ex}}{(K+1)\\cdot\\frac{0,02K}{r_{pok}+0,1}},\\) где \\({r_{pok}}\\) – средняя оценка магазина покупателями (от 0 до 1), \\({r_{ex}}\\) – оценка магазина экспертами (от 0 до 0,7) и \\(K\\) – число покупателей, оценивших магазин. Найдите рейтинг интернет-магазина \"Центы\", если число покупателей, оставивших отзыв о магазине, равно 19, их средняя оценка равна 0,4, а оценка экспертов равна 0,21.',NULL,2,1,'D',92,'0,3875',NULL,17,'457','8'),
