	(1242,1242,'Зависимость объёма спроса \\(q\\) (единиц в месяц) на продукцию предприятия-монополиста от цены \\(p\\) (тыс. руб.) задаётся формулой \\(q = 175 - 20p.\\) Выручка предприятия за месяц \\(r\\) (в тыс. руб.) вычисляется по формуле \\(r = q \\cdot p\\). Определите наибольшую цену \\(p\\), при которой месячная выручка \\(r(p)\\) составит не менее 375 тыс.руб. Ответ приведите в тыс. руб.',NULL,2,1,'D',92,'5',NULL,17,'459','8'),
