	(1244,1244,'Операционная прибыль предприятия за краткосрочный период вычисляется по формуле \\(\\pi (q) = q(p - \\upsilon ) - f.\\) Компания продаёт свою продукцию по цене \\(p = 400\\) руб. за штуку, затраты на производство одной единицы продукции составляют \\(\\upsilon  = 300\\) руб. за штуку, постоянные расходы предприятия \\(f = 800 000\\) руб. в месяц. Определите наименьший месячный объём производства \\(q\\) (шт.), при котором прибыль предприятия будет не меньше 700 000 руб. в месяц.',NULL,2,1,'D',92,'15000',NULL,17,'461','8'),
	(1245,1245,'Некоторая компания продаёт свою продукцию по цене \\(p = 750\\) руб. за единицу. Переменные затраты на производство одной единицы продукции составляют \\(\\upsilon  = 250\\) руб., постоянные расходы предприятия – \\(f = 800 000\\) руб. в месяц. Месячная операционная прибыль предприятия (в руб.) вычисляется по формуле \\(\\pi(q)=q(p-\\upsilon)-f.\\) Определите наименьший месячный объём производства \\(q\\) (единиц продукции), при котором месячная операционная прибыль предприятия будет не меньше 400 000 руб.',NULL,2,1,'D',92,'2400',NULL,17,'462','8'),
