	(1247,1247,'Коэффициент полезного действия (КПД) некоторого двигателя определяется формулой \\(\\eta=\\frac{T_1}-T_2T_1\\cdot100\\% \\), где \\(T_1\\) – температура нагревателя (в градусах Кельвина), \\(T_2\\) – температура холодильника (в градусах Кельвина). При какой минимальной температуре нагревателя \\(T_1\\)  КПД этого двигателя будет не меньше 20%, если температура холодильника те \\(T_2 = 310\\) К? Ответ выразите в градусах Кельвина.',NULL,2,1,'D',93,'387,5',NULL,17,'464','8'),
	(1248,1248,'В розетку электросети подключены приборы, общее сопротивление которых составляет 70 Ом. Параллельно с ними в розетку предполагается подключить электрообогреватель. Чему равно наименьшее возможное сопротивление (в омах) этого электрообогревателя, если известно, что при параллельном соединении двух проводников с сопротивлениями \\(R_1\\) и \\(R_2\\) их общее сопротивление определяется формулой \\(R=\\frac{R_1}\\cdot R_2R_1+R_2,\\) а для нормального функционирования электросети общее сопротивление в ней должно быть не меньше 21 Ом?',NULL,2,1,'D',93,'30',NULL,17,'465','8'),
	(1249,1249,'В розетку электросети подключены приборы, общее сопротивление которых составляет 90 Ом. Параллельно с ними в розетку предполагается подключить электрочайник. Каково наименьшее возможное сопротивление электрочайника, если известно, что при параллельном соединении двух проводников с сопротивлениями \\(R_1\\) и \\(R_2\\) их общее сопротивление определяется формулой \\(R=\\frac{R_1}\\cdot R_2R_1+R_2,\\) а для нормального функционирования электросети общее сопротивление в ней должно быть не меньше 36 Ом?',NULL,2,1,'D',93,'60',NULL,17,'466','8'),
	(1250,1250,'К источнику с ЭДС \\(\\varepsilon  = 100\\) В и внутренним сопротивлением \\(r = 1\\) Ом хотят подключить нагрузку с сопротивлением \\(R\\) Ом. Напряжение на этой нагрузке, выражаемое в вольтах, задаётся формулой \\(U=\\frac{\\varepsilon R}{R+r}.\\) При каком наименьшем значении сопротивления нагрузки напряжение на ней будет не менее 80 В? Ответ выразите в омах.',NULL,2,1,'D',93,'4',NULL,17,'467','8'),
	(1251,1251,'При сближении источника и приёмника звуковых сигналов, движущихся в некоторой среде по прямой навстречу друг другу, частота звукового сигнала, регистрируемого приёмником, не совпадает с частотой исходного сигнала, регистрируемого приёмником, не совпадает с частотой исходного сигнала \\(f_0= 250\\) Гц и определяется следующим выражением: \\(f=f_0\\frac{c+u}{c-\\upsilon}\\) (Гц), где \\(c\\) – скорость распространения сигнала в среде (в м/с); \\(u = 20\\) м/с и \\(\\upsilon  = 5\\) м/с – скорости приёмника и источника относительно среды соответственно. При какой максимальной скорости \\(c\\) (в м/с) распространения сигнала в среде частота сигнала в приёмнике \\(f\\) будет не менее 270 Гц?',NULL,2,1,'D',93,'317,5',NULL,17,'468','8'),
	(1252,1252,'Для определения эффективной температуры звёзд используют закон Стефана-Больцмана, согласно которому мощность излучения нагретого тела прямо пропорциональна площади его поверхности и четвёртой степени температуры: \\(P=\\sigma ST^4,\\) где \\(\\sigma=5,7\\cdot10^{-8}\\) – числовой коэффициент, площадь измеряется в квадратных метрах, температура – в градусах Кельвина, а мощность – в ваттах. Известно, что некоторая звезда имеет площадь \\(S=\\frac17\\cdot10^{16}\\) \\({м^2}\\), а излучаемая ею мощность \\(P\\) составляет \\(19,551\\cdot10^{22}\\) Вт. Определите температуру этой звезды.',NULL,2,1,'D',93,'7000',NULL,17,'469','8'),
	(1253,1253,'Для определения температуры звёзд используют закон Стефана-Больцмана, согласно которому мощность излучения нагретого тела прямо пропорциональна площади его поверхности и четвёртой степени температуры: \\(P=\\sigma ST^4,\\) где \\(\\sigma=5,7\\cdot10^{-8}\\) – постоянная Стефана-Больцмана, площадь измеряется в квадратных метрах, температура – в градусах Кельвина, а мощность – в ваттах. Известно, что некоторая звезда имеет площадь \\(S=1,5\\cdot10^{10}\\) \\({м^2}\\), а излучаемая ею мощность \\(P\\) равна \\(8,55\\cdot10^{18}\\) Вт. Определите температуру этой звезды.',NULL,2,1,'D',93,'10000',NULL,17,'470','8'),
	(1254,1254,'Изменение высоты полёта брошенного вертикально вверх мяча описывается формулой \\(h(t)=-5t^2+30t\\) (\\(h\\) – высота в метрах, \\(t\\) – время в секундах). Сколько секунд мяч находился на высоте не менее 25 м?',NULL,2,1,'D',93,'4',NULL,17,'471','8'),
	(1255,1255,'Скорость автомобиля \\(\\upsilon \\), разгоняющегося с места старта по прямолинейному отрезку пути длиной \\(l\\) км с постоянным ускорением \\(a\\) км/\\(ч^2\\), вычисляется по формуле \\(\\upsilon^2=2la.\\) Определите, с какой наименьшей скоростью будет двигаться автомобиль на расстоянии 0,4 километра от старта, если по конструктивным особенностям автомобиля приобретаемое им ускорение не меньше 8000 км/\\(ч^2\\). Ответ выразите в км/ч.',NULL,2,1,'D',93,'80',NULL,17,'472','8'),
	(1256,1256,'Парашютисты-экстремалы определяют высоту сооружений для будущих пряжков, засекая время падения небольших камней с вершин сооружений до поверхности приземления. Приближённая зависимость высоты от времени свободного падения имеет вид \\(h=4,9t^2.\\) Здесь \\(h\\) – высота в метрах, \\(t\\) – время в секундах. С вершины первого сооружения камень падал 4,5 с. На сколько метров второе сооружение выше первого, если с вершины второго сооружения камень падал на 1 с дольше?',NULL,2,1,'D',93,'49',NULL,17,'473','8'),
	(1257,1257,'После дождя уровень воды в колодце может повыситься. Мальчик измеряет время падения небольших камешков в колодец и рассчитывает расстояние до воды по формуле \\(h=5t^2,\\) где \\(h\\) – расстояние в метрах, \\(t\\) – время падения в секундах. До дождя время падения камешков составляло 1,6 с. На сколько метров должен подняться уровень воды после дождя, чтобы измеряемое время изменилось на 0,4 с?',NULL,2,1,'D',93,'5.6',NULL,17,'474','8'),
	(1258,1258,'При температуре 0 \\(^\\circ C\\) рельс имеет длину \\(l_0 = 20\\) м. При прокладке путей между рельсами оставили зазор в 6 мм. При возрастании температуры будет происходить тепловое расширение рельса, и его длина будет меняться по закону \\(l(t^\\circ)=l_0(1+\\alpha t^\\circ)\\), где \\(\\alpha=1,2\\cdot10^{-5}\\) \\(^\\circ C^{-1}\\) – коэффициент теплового расширения, \\(t^ \\circ \\) – температура (в градусах Цельсия). При какой минимальной температуре между рельсами исчезнет зазор? Ответ выразите в градусах Цельсия.',NULL,2,1,'D',93,'25',NULL,17,'475','8'),
	(1259,1259,'При температуре 0 \\(^ \\circ C\\) рельс имеет длину \\(l_0=12,5\\) м. При прокладке путей между рельсами оставили зазор 9 мм. При возрастании температуры будет происходить тепловое расширение рельса, и его длина будет меняться по закону \\(l({t^\\circ})=l_0(1+\\alpha{t^\\circ})\\), где \\(\\alpha=1,2\\cdot10^{-5}\\) \\(^\\circ C^{-1}\\) – коэффициент теплового расширения, \\(t^ \\circ \\) – температура (в градусах Цельсия). При какой минимальной температуре между рельсами исчезнет зазор? (Ответ выразите в градусах Цельсия.)',NULL,2,1,'D',93,'60',NULL,17,'476','8'),
	(1260,1260,'Зависимость температуры нагревательного элементв прибора от времени имеет вид \\(T(t)=T_0+at+bt^2,\\) \\(T_0 = 100\\) К, \\(a = 37,5\\) К/мин, \\(b =  - 0,25\\) К/мин\\(^2\\). Прибор может испортиться при температуре свыше 1000 К. Определите момент времени (в минутах), когда прибор необходимо отключить, чтобы он не вышел из строя.',NULL,2,1,'D',93,'30',NULL,17,'477','8'),
	(1261,1261,'При вращении ведёрка с водой на верёвке в вертикальной плоскости сила давления воды на дно не остаётся постоянной: она максимальна в нижней точке и минимальна в верхней. Вода не будет выливаться, если сила её давления на дно будет положительной во всех точках траектории. В верхней точке сила давления равна \\(P=m(\\frac{\\upsilon^2}L-g)\\), где \\(m\\) – масса воды, \\(\\upsilon \\) – скорость движения ведёрка, \\(L\\) – длина верёвки, \\(g\\) – ускорение свободного падения. С какой минимальной скоростью (в м/с) надо вращать ведёрко, чтобы вода не выливалась из него, если длина верёвки равна 90 см? (\\(g\\) считать равным 10 м/с\\(^2\\).)',NULL,2,1,'D',93,'3',NULL,17,'478','8');
INSERT INTO `tasks` (`id`, `number_task`, `task`, `image`, `experience`, `gold`, `grade`, `subject_id`, `answer`, `detail`, `set_of_task_id`, `original_number`, `book`)
VALUES
	(1262,1262,'При быстром вращении ведёрка с водой вода из него не будет выливаться. При этом сила давления воды на дно не остаётся постоянной: она максимальна в нижней точке и минимальна в верхней. Вода не будет выливаться, если сила её давления на дно будет неотрицательной во всех точках траектории. В верхней точке сила давления равна \\(P=m(\\frac{\\upsilon^2}L-g)\\), где \\(m\\) – масса воды, \\(\\upsilon \\) – скорость движения ведёрка, \\(L\\) – длина верёвки, \\(g\\) – ускорение свободного падения (\\(g\\)=10 м/с\\(^2\\)). С какой наименьшей скоростью надо вращать ведёрко, чтобы вода не выливалась, если длина верёвки равна 0,729 м? Ответ выразите в метрах в секунду.',NULL,2,1,'D',93,'2,7',NULL,17,'479','8'),
	(1263,1263,'Перед отправкой тепловоз издал гудок с частотой \\(f_0 = 490\\) Гц. Чуть позже издал гудок подъезжающий к платформе тепловоз. Из-за эффекта Доплера частота второго гудка \\(f\\) больше первого: она зависит от скорости тепловоза по закону \\(f(\\upsilon)=\\frac{f_0}{1-\\frac\\upsilon c}\\) (Гц), где \\(c\\) – скорость звука в воздухе (в м/с). Человек, стоящий на платформе, различает сигналы по тону, если они отличаются не менее, чем на 10 Гц. Определите, с какой минимальной скоростью \\(\\upsilon \\) приближался к платформе тепловоз, если человек смог различить сигналы, а \\(c = 340\\) м/с. Ответ выразите в м/с.',NULL,2,1,'D',93,'6,8',NULL,17,'480','8'),
	(1264,1264,'Глубоководники проектируют новый батискаф в виде сферы радиуса \\(R.\\) Выталкивающая сила Архимеда, действующая на батискаф, вычисляется по формуле \\(F_A=\\rho gV=\\rho g\\cdot\\frac43\\pi R^3.\\) Определите максимальный радиус батискафа (в метрах), если сила Архимеда по технологии не должна превосходить 1 130 400 Н. При расчёте примите следующие значения постоянных: \\(\\rho  = 1000\\) кг/\\(^3\\), \\(g\\) = 10 Н/кг, \\(\\pi \\) = 3,14.',NULL,2,1,'D',93,'3',NULL,17,'481','8'),
	(1265,1265,'Для поддержания навеса планируется использовать цилиндрическую колонну. Давление \\(P\\) (в паскалях), оказываемое навесом и колонной на опору, определяется по формуле \\(P=\\frac{4mg}{\\pi D^2}\\), где \\(m\\) = 270 кг – общая масса навеса и колонны, \\(D\\) – диаметр колонны (в метрах). Считая ускорение свободного падения \\(g\\) = 10 м/с\\(^2\\), а \\(\\pi \\) = 3, определите наименьший возможный диаметр колонны, если давление, оказываемое на опору, не должно быть больше 640 000 Па. Ответ выразите в метрах.',NULL,2,1,'D',93,'0.075',NULL,17,'482','8'),
	(1266,1266,'Камень бросили под углом \\(\\alpha \\) к плоской горизонтальной поверхности Луны. Время полёта камня (в секундах) определяется по формуле \\(t=\\frac{2\\upsilon_0\\sin\\alpha}g.\\) При каком наименьшем значении угла \\(\\alpha \\) (в градусах) время полёта будет не меньше 5 секунд, если камень бросают с начальной скоростью \\(\\upsilon _0\\) = 8 м/с? Считайте, что ускорение свободного падения \\(g\\) = 1,6 м/с\\(^2\\).',NULL,2,1,'D',93,'30',NULL,17,'483','8'),
	(1267,1267,'Деталью некоторого прибора является квадратная рамка с намотанным на неё проводом, через который пропущен постоянный ток. Рамка помещена в однородное магнитное поле так, что она может вращаться. Момент силы Ампера (в Н\\( \\cdot \\)м), стремящейся повернуть рамку, определяется формулой \\(M=NIBl^2\\sin\\alpha,\\) где \\(I\\) = 8 А – сила тока в рамке, \\(B\\) =0,05 Тл – значение индукции магнитного поля, \\(l\\) = 0,03 м – размер рамки, \\(N\\) = 500 – число витков провода в рамке, \\(\\alpha \\) – острый угол между перпендикуляром к рамке и вектором индукции. При каком наименьшем значении угла \\(\\alpha \\) (в градусах) рамка может начать вращаться, если для этого нужно, чтобы раскручивающий момент \\(M\\) был не меньше 0,09 Н\\( \\cdot \\)м?',NULL,2,1,'D',93,'30',NULL,17,'484','8'),
	(1268,1268,'Плоский замкнутый контур площадью \\(S\\) = 0,3 м\\(^2\\) находится в магнитном поле, индукция которого равномерно возрастает. При этом согласно закону электромагнитной индукции Фарадея в контуре появляется ЭДС индукции, значение которой, выраженное в вольтах, определяется формулой \\(\\varepsilon_i=aS\\cos\\alpha ,\\) где \\(\\alpha \\) – острый угол между направлением магнитного поля и перпендикуляром к контуру, \\(a=25\\cdot10^{-4}\\) Тл/с – постоянная, \\(S\\) – площадь замкнутого контура, находящегося в магнитном поле (в м\\(^2\\)). При каком минимальном угле \\(\\alpha \\) (в градусах) ЭДС индукции не будет превышать \\(375\\cdot10^{-6}\\) В?',NULL,2,1,'D',93,'60',NULL,17,'485','8'),
	(1269,1269,'Груз массой 0,16 кг колеблется на пружине со скоростью, меняющейся по закону \\(\\upsilon (t) = 2\\cos \\pi t\\), где \\(t\\) – время в секундах. Кинетическая энергия груза вычисляется по формуле \\(E=\\frac{m\\upsilon^2}2,\\) где \\(m\\) – масса груза (в кг), \\(\\upsilon \\) – скорость груза (в м/с). Определите, какую долю времени из первой секунды после начала движения кинетическая энергия груза будет не менее 0,24 Дж. Ответ выразите десятичной дробью, при необходимости округлите до сотых.',NULL,2,1,'D',93,'0,33',NULL,17,'486','8'),
	(1270,1270,'Скейтбордист прыгает на стоящую на рельсах платформу со скоростью \\(\\upsilon \\) = 2 м/с под острым углом \\(\\alpha \\) к рельсам. От толчка платформа начинает ехать со скоростью \\( u=\\frac m{m+M}\\upsilon\\cos\\alpha \\), где \\(m\\) = 60 кг – масса скейтбордиста со скейтом, а  \\(M\\) = 240 кг – масса платформы. Под каким максимальным углом \\(\\alpha \\) (в градусах) нужно прыгать, чтобы разогнать платформу не менее чем до 0,2 м/с?',NULL,2,1,'D',93,'60',NULL,17,'487','8'),
	(1271,1271,'При номальном падении света с длиной волны \\(\\lambda \\) = 500 нм на дифракционную решётку с периодом \\(d\\) нм наблюдают серию дифракционных максимумов. При этом угол \\(\\varphi \\) (отсчитываемый от перпендикуляра к решётке), под которым наблюдается максимум, и номер максимума \\(k\\) связаны соотношением \\(d\\sin \\alpha  = k\\lambda \\). Под каким минимальным углом \\(\\varphi \\) (в градусах) можно наблюдать третий максимум на решётке с периодом, не превосходящим 3 000 нм?',NULL,2,1,'D',93,'30',NULL,17,'488','8'),
	(1272,1272,'Два тела, массой \\(m\\) = 3 кг каждое, движутся с одинаковой скоростью \\(\\upsilon \\) = 4 м/с под углом \\(2\\alpha \\) друг к другу. Энергия (в джоулях), выделяющаяся при их абсолютно неупругом соударении, определяется выражением \\(Q=m\\upsilon^2\\sin^2\\alpha.\\) Под каким наименьшим углом \\(2\\alpha \\) (в градусах) должны двигаться тела, чтобы в результате соударения выделилось не менее 24 джоулей?',NULL,2,1,'D',93,'90',NULL,17,'489','8'),
	(1273,1273,'Очень лёгкий заряженный металлический шарик с зарядом \\( q=5\\cdot10^{-6}\\) Кл скатывается по гладкой наклонной плоскости. В момент, когда его скорость составляет \\(\\upsilon \\) = 2 м/с, на него начинает действовать постоянное магнитное поле, вектор индукции \\(B\\)  которого лежит в той же плоскости и составляет угол \\(\\alpha \\) с направлением движения шарика. Значение индукции поля \\( B=5\\cdot10^{-3}\\) Тл. При этом на шарик действует сила Лоренца, равная \\(F_L=q\\upsilon B\\sin\\alpha \\) (Н) и направленная вверх перпендикулярно плоскости. При каком наименьшем значении угла \\(\\alpha\\in\\left[0^\\circ;180^\\circ\\right]\\) шарик оторвётся от поверхности, если для этого нужно, чтобы сила \\(F_L\\) была не менее чем \\(25 \\cdot10^{-9}\\) H? Ответ дайте в градусах.',NULL,2,1,'D',93,'30',NULL,17,'490','8'),
	(1274,1274,'Находящийся в воде водолазный колокол, содержащий \\(\\upsilon \\) = 40 молей воздуха при давлении \\(p_1\\) = 1,3 атмосферы, медленно опускают на дно водоёма. При этом происходит изотермическое сжатие воздуха. Работа, совершаемая водой при сжатии воздуха, определяется выражением \\(A=\\alpha\\upsilon T\\log_2\\frac{p_2}{p_1}\\) (Дж), где \\(\\alpha \\) = 3,5 – постоянная, \\(T\\) = 300 К – температура воздуха, \\(p_1\\) (атм) – начальное давление, а \\(p_2\\) (атм) – конечное давление воздуха в колоколе. До какого наибольшего давления \\(p_2\\) можно сжать воздух в колоколе, если при сжатии воздуха совершается работа не более чем 126 000 Дж? Ответ приведите в атмосферах.',NULL,2,1,'D',93,'10,4',NULL,17,'491','8'),
	(1275,1275,'При номальном падении света с длиной волны \\(\\lambda \\) = 500 нм на дифракционную решётку с периодом \\(d\\) нм наблюдают серию дифракционных максимумов. При этом угол \\(\\varphi \\) (отсчитываемый от перпендикуляра к решётке), под которым наблюдается максимум, и номер максимума \\(k\\) связаны соотношением \\(d\\sin \\alpha  = k\\lambda \\). Под каким минимальным углом \\(\\varphi \\) (в градусах) можно наблюдать третий максимум на решётке с периодом, не превосходящим 3 000 нм?',NULL,2,1,'D',93,'45',NULL,17,'492','8'),
	(1276,1276,'В ходе распада радиоактивного изотопа его масса уменьшается по закону \\( m(t)=m_0\\cdot2^{-\\frac tT}\\), где \\({m_0}\\) (мг) – начальная масса изотопа, \\(t\\) (мин) – время, прошедшее от начального момента, \\(T\\) (мин) – период полураспада. В начальный момент времени масса изотопа \\({m_0} = 100\\) мг. Период его полураспада \\(T\\) = 4 мин. Через сколько минут масса изотопа будет равна 25 мг?',NULL,2,1,'D',93,'8',NULL,17,'493','8'),
	(1277,1277,'Расстояние (в километрах) от наблюдателя, находящегося на высоте \\(h\\) километров над землёй, до наблюдаемой им линии горизонта вычисляется по формуле \\(l=\\sqrt{2Rh} \\), где \\(R\\) = 6400 км – радиус Земли. С какой высоты горизонт виден на расстоянии 16 километров? Ответ выразите в километрах.',NULL,2,1,'D',93,'0,02',NULL,17,'494','8'),
	(1278,1278,'Расстояние от наблюдателя, находящегося на небольшой высоте \\(h\\) километров над землёй, до наблюдаемой им линии горизонта вычисляется по формуле \\(l=\\sqrt{2Rh} \\), где \\(R\\) = 6400 км – радиус Земли. С какой высоты горизонт виден на расстоянии 24 километра? Ответ выразите в километрах.',NULL,2,1,'D',93,'0,045',NULL,17,'495','8'),
	(1279,1279,'Независимое агентство намерено ввести рейтинг \\(R\\) новостных изданий на основе показателей информативности \\(In\\), оперативности \\(Op\\) и объективности \\(Tr\\) публикаций. Каждый показатель оценивается целыми числами от -3 до 3. Аналитик, составляющий формулу, считает, что объективность публикаций ценится вдвое, а информативность – втрое дороже, чем оперативность. В результате формула примет вид \\(R=\\frac{2In+Op+3Tr}A.\\)\n Каким должно быть число \\(A\\), чтобы издание, у которого все показатели наибольшие, получило рейтинг 60?',NULL,2,1,'D',92,'0,3',NULL,17,'Вар.1 №1','8'),
