	(1281,1281,'При температуре 0 \\(^ \\circ C\\) рельс имеет длину \\(l_0 = 15\\) м. При температуре 0 \\({}^\\circ C\\) между рельсами оставили зазор в 9 мм. При возрастании температуры будет происходить тепловое расширение рельса, и его длина будет меняться по закону \\(l(t^\\circ)=l_0(1+\\alpha t^\\circ)\\), где \\(\\alpha=1,2\\cdot10^{-5}\\) \\(^\\circ C^{-1}\\) – коэффициент теплового расширения, \\({t^ \\circ }\\) – температура (в градусах Цельсия). При какой минимальной температуре между рельсами исчезнет зазор? Ответ выразите в градусах Цельсия.',NULL,2,1,'D',93,'50',NULL,17,'Вар.1 №3','8'),
