	(1283,1283,'Установка для демонстрации адиабатического сжатия представляет собой сосуд с поршнем, резко сжимающим газ. При этом объём и давление связаны соотношением \\(pV^{1,2}=const\\), где \\(p\\) (атм.) – давление, \\(V\\) – объём газа в литрах. Изначально обоъём газа равен 51,2 л, а его давление равно одной атмосфере. В соответствии с техническими характеристиками сосуд выдерживает давление не более 64 атмосфер. Определите, до какого минимального объёма можно сжать газ. Ответ выразите в литрах.',NULL,2,1,'D',93,'1,6',NULL,17,'Вар.1 №5','8'),
	(1284,1284,'Независимое агентство намерено ввести рейтинг новостных интернет-изданий на основе оценок информативности \\(In\\), оперативности \\(Op\\), объективности публикаций \\(Tr\\), а также качества сайта \\(Q\\). Каждый отдельный показатель оценивается читателями по 5-балльной шкале целыми числами от -2 до 2.\nАналитики, составляющие формулу рейтинга, считают, что объективность ценится вдвое, а информативность публикаций – вшестеро дороже, чем оперативность и качество сайта. Таким образом, формула приняла вид \\(R=\\frac{6In+Op+2Tr+Q}A.\\)\nЕсли по всем четырём показателям какое-то издание получило одну и ту же оценку, то рейтинг должен совпадать с этой оценкой. Найдите число \\(A\\), при котором это условие будет выполняться.',NULL,2,1,'D',92,'10',NULL,17,'Вар.2 №1','8'),
