	(1286,1286,'При сближении источника и приёмника звуковых сигналов, движущихся в некоторой среде по прямой навстречу друг другу, частота звукового сигнала, регистрируемого приёмником, не совпадает с частотой исходного сигнала, регистрируемого приёмником, не совпадает с частотой исходного сигнала \\(f_0 = 280\\) Гц и определяется следующим выражением: \\(f=f_0\\frac{c+u}{c-\\upsilon}\\) (Гц), где \\(c\\) – скорость распространения сигнала в среде (в м/с); \\(u = 30\\) м/с и \\(\\upsilon  = 20\\) м/с – скорости приёмника и источника относительно среды соответственно. При какой максимальной скорости \\(c\\) (в м/с) распространения сигнала в среде частота сигнала в приёмнике \\(f\\) будет не менее 330 Гц?',NULL,2,1,'D',93,'300',NULL,17,'Вар.2 №3','8'),
