	(1570,1570,'1 июня 2013 года Всеволод Ярославович взял в банке 900 000 рублей в кредит. Схема выплаты кредита следующая – 1 числа каждого следующего месяца банк начисляет 1 процент на оставшуюся сумму долга (то есть увеличивает долг на 1%), затем Всеволод Ярославович переводит в банк платёж. На какое минимальное количество месяцев Всеволод Ярославович может взять кредит, чтобы ежемесячные выплаты были не более 300 000 рублей?',NULL,200,8,'B',12,'4',NULL,28,NULL,'2015'),
	(1571,1571,'15-го января был выдан полугодовой кредит на развитие бизнеса. в таблице представлен график его погашения.\nВ конце каждого месяца, начиная с января, текущий долг увеличивался на 5%, а выплаты по погашению кредита происходили в первой половине каждого месяца, начиная с февраля. На сколько процентов общая сумма выплат при таких условиях больше суммы самого кредита?','2015_n17_2.png',200,8,'B',12,'22,5',NULL,28,NULL,'2015'),
	(1572,1572,'В июле планируется взять кредит в бане на сумму 28 млн рублей на некоторый срок (целое число лет). Условия его возврата таковы: \n– каждый январь долг возрастает на 25% по сравнению с концом предыдущего года;\n– с февраля по июнь каждого года необходимо выплатить часть долга;\n– в июле каждого года долг должен быть на одну и ту же сумму меньше долга на июль предыдущего года.\nЧему будет равна общая сумма выплат после полного погашения кредита, если наибольший годовой платёж составит 9 млн рублей?',NULL,200,8,'B',12,'80,5 млн рублей',NULL,28,NULL,'2015'),
