	(1574,1574,'Найдите все значения \\(a\\), при каждом из которых система уравнений \\(\\left\\{\\begin{array}{c}x^2+5x+y^2-y-\\left|x-5y+5\\right|=52,\\\\y-2=a\\left(x-5\\right)\\end{array}\\right.\\) имеет ровно два решения.',NULL,300,12,'A',28,'\\(-\\frac74\\leq a\\leq8\\).',NULL,28,NULL,'2015'),
