	(1576,1576,'Семь экспертов оценивают кинофильм. Каждый из них выставляет оценку – целое число баллов от 0 до 10 (от 0 до 15) включительно. Известно, что все эксперты выставили различные оценки. По старой системе оценивания рейтинг кинофильма – это среднее арифметическое всех оценок экспертов. По новой системе оценивания рейтинг кинофильма вычисляется следующим образом: отбрасываются наименьшая и наибольшая оценки и подсчитывается среднее арифметическое пяти оставшихся оценок.\nа) Может ли разность рейтингов, вычисленных по старой и новой системам оценивания, равняться \\(\\frac1{30}\\)? \\(\\frac2{45}\\)?\nб) Может ли эта разность рейтингов, вычисленных по старой и новой системам оценивания, равняться \\(\\frac1{35}\\)? \\(\\frac2{35}\\)?\nв) Найдите наибольшее возможное значение разности рейтингов, вычисленных по старой и новой системам оценивания.',NULL,300,12,'A',114,'а) нет (нет); б) да (да); в) \\(\\frac47\\) (\\(\\frac87\\)).',NULL,28,NULL,'2015'),
