	(1578,1578,'Числа 1, 2, 3, 4, 5, 6, 7, 8, 9, 16 произвольно делят на три группы так, чтобы в каждой группе было хотя бы одно число. Затем вычисляют значение среднего арифметического чисел в каждой из групп (для группы из единственного числа среднее арифметическое равно этому числу).\nа) Могут ли быть одинаковыми два из этих трёх значений средних арифметических в группах из разного количества чисел?\nб) Могут ли быть одинаковыми все три значения средних арифметических?\nв) Найдите наименьшее возможное значение наибольшего из получаемых трёх\nсредних арифметических.',NULL,300,12,'A',114,'а) да; б) нет; в) \\(6\\frac17\\).',NULL,28,NULL,'2015'),
