	(1604,1604,'Вклад планируется открыть на четыре года. Первоначальный вклад составляет целое число миллионов рублей. В конце каждого года вклад увеличивается на 10% по сравнению с его размером в начале года, а, кроме этого, в начале третьего и четвёртого годов вклад ежегодно пополняется на 3 млн рублей. Найдите наибольший размер первоначального вклада, при котором через четыре года вклад будет меньше 25 млн рублей.',NULL,150,6,'B',12,'12 млн рублей.',NULL,28,NULL,'2016'),
	(1605,1605,'15-го января планируется взять кредит в банке на шесть месяцев в размере 1 млн рублей. Условия его возврата таковы:\n– 1-го числа каждого месяца долг увеличивается на \\({r}\\) процентов по сравнению с концом предыдущего месяца, где \\({r}\\) – целое число;\n– со 2-го по 14-е число каждого месяца необходимо выплатить часть долга;\n– 15-го числа каждого месяца долг должен составлять некоторую сумму в соответствии со следующей таблицей.\nНайдите наибольшее значение \\({r}\\), при котором общая сумма выплат будет меньше 1,2 млн рублей.','2016_n17_2.png',150,6,'B',12,'7',NULL,28,NULL,'2016'),
	(1606,1606,'В июле 2016 года планируется взять кредит в банке на три года в размере \\({S}\\) млн рублей, где \\({S}\\) – целое число. Условия его возврата таковы:\n– каждый январь долг увеличивается на 25% по сравнению с концом предыдушего года;\n– с февраля по июнь каждого года необходимо выплатить одним платежом часть долга;\n– в июле каждого года долг должен составлять часть кредита в соответствии со следующей таблицей.\nНайдите наименьшее значение \\({S}\\), при котором каждая из выплат будет больше 5 млн рублей.','2016_n17_3.png',150,6,'B',12,'11',NULL,28,NULL,'2016'),
	(1607,1607,'В июле 2016 года планируется взять кредит в банке на пять лет в размере \\({S}\\) тыс. рублей. Условия его возврата таковы:\n– каждый январь долг возрастает на 20% по сравнению с концом предыдушего года;\n– с февраля по июнь каждого года необходимо выплатить часть долга;\n– в июле 2017, 2018 и 2019 годов долг остаётся равным \\({S}\\) тыс. рублей;\n– выплаты в 2020 и 2021 годах равны 360 тыс. рублей;\n– к июлю 2021 года долг будет выплачен полностью.\nНайдите общую сумму выплат за пять лет.',NULL,150,6,'B',12,'1050 тыс. рублей.',NULL,28,NULL,'2016'),
	(1608,1608,'Вклад планируется открыть на четыре года. Первоначальный вклад составляет целое число миллионов рублей. В конце каждого года банк увеличивает вклад на 10% по сравнению с его размером в начале года. Кроме этого, в начале третьего и четвёртого годов вкладчик ежегодно пополняет вклад на 3 млн рублей. Найти наименьший размер первоначального вклада, при котором банк за четыре года начислит на вклад больше 5 млн рублей.',NULL,150,6,'B',12,'9 млн рублей.',NULL,28,NULL,'2016'),
