	(1610,1610,'Вклад в размере 10 млн рублей планируется открыть на четыре года. В конце каждого года банк увеличивает вклад на 10% по сравнению с его размером в начале года. Кроме этого, в начале третьего и четвёртого годов вкладчик ежегодно пополняет вклад на \\({x}\\) млн рублей, где \\({x}\\) – целое число. Найдите наименьшее значение \\({x}\\), при котором банк за четыре года начислит на вклад больше 7 млн рублей.',NULL,150,6,'B',12,'8',NULL,28,NULL,'2016'),
