	(2123,2123,'В июне планируется взять кредит в банке на сумму 4 млн рублей сроком на 10 лет. Условия его возврата таковы:\n- каждый январь долг возрастает на \\(p\\% \\) по сравнению с концом предыдущего года;\n- с февраля по июнь каждого года необходимо выплатить часть долга;\n- в июле каждого года долг должен быть на одну и ту же сумму меньше долга на июль предыдущего года.\nНайдите \\({p}\\), если известно, что наибольший годовой платёж по кредите составит не более 1,3 млн рублей, а наименьший - не менее 0,49 млн рублей.',NULL,200,8,'A',12,'22,5',NULL,35,'Вар. 5  №17','12'),
	(2124,2124,'Найдите все значения параметра \\({a}\\), при каждом из которых уравнение \\(x^2+ax+4=\\sqrt{20x^2+8ax+16}\\) имеет ровно три различных корня.',NULL,300,12,'A',20,'\\(\\left[-\\frac8{\\sqrt3};-2\\sqrt3\\right)\\cup\\left(-2\\sqrt3;2\\sqrt3\\right)\\cup\\left(2\\sqrt3;\\frac8{\\sqrt3}\\right]\\)',NULL,35,'Вар. 5  №18','12'),
	(2125,2125,'На доске записаны числа 1, 2, 3, ..., 27. За один ход разрешается стереть произвольно три числа, сумма которых меньше 31 и отлична от каждой из сумм троек чисел, стёртых на предыдущих ходах.\nа) Приведите пример последовательных четырех ходов.\nб) Можно ли сделать 9 ходов?\nв) Какое наибольшее число ходов можно сделать?',NULL,300,12,'A',114,'а) \\(\\left(27;1;2\\right)\\), \\(\\left(20;4;5\\right)\\), \\(\\left(7;8;13\\right)\\), \\(\\left(6;9;12\\right)\\); б) нет; в) 5',NULL,35,'Вар. 5  №19','12'),
	(2126,2126,'Постоянные клиенты интернет-магазина получают при покупке скидку 5%. Покупка стоит 900 рублей. Сколько рублей заплатит постоянный клиент этого интернет-магазина за покупку, при условии, что стоимость доставки включена в стоимость покупки?',NULL,2,1,'D',68,'855',NULL,36,'Вар. 6  №1','12'),
	(2127,2127,'На графике показан процесс разогрева двигателя легкового автомобиля. На оси абсцисс откладывается время в минутах, прошедшее с момента запуска двигателя, на оси ординат - температура двигателя в градусах Цельсия. Определите по графику, сколько минут двигатель нагревался от температуры \\(30^\\circ\\text{C}\\) до температуры \\(70^\\circ\\text{C}\\) (см. рис.)','b12_v6_2.png',2,1,'D',70,'6','рис',36,'Вар. 6  №2','12'),
	(2128,2128,'Найдите площадь ромба, изображённого на клетчатой бумаге с размером клетки 1х1 см (см. рис.). Ответ дайте в квадратных сантиметрах.','b12_v6_3.png',2,1,'D',105,'30','рис',36,'Вар. 6  №3','12'),
	(2129,2129,'Цех выпускает швейные машинки. В среднем 26 швейных машинок из 300 имеют скрытые дефекты. Найдите вероятность того, что купленная машинка окажется без дефектов. Результат округлите до сотых.',NULL,2,1,'D',74,'0,91',NULL,36,'Вар. 6  №4','12'),
	(2130,2130,'Найдите корень уравнения \\(x^2+23x+60=0.\\)\nЕсли уравнение имеет более одного корня, укажите меньший из них.',NULL,2,1,'D',77,'-20',NULL,36,'Вар. 6  №5','12'),
	(2131,2131,'В треугольнике \\({ABC}\\) угол \\({A}\\) равен \\({65^ \\circ }\\), угол \\({C}\\) равен \\({53^ \\circ }\\). На продолжении стороны \\({AB}\\) за точку \\({B}\\) отложен отрезок \\({BD}\\), равный стороне \\({BC}\\) (см. рис.). Найдите угол \\({D}\\) треугольника \\({BCD}\\). Ответ дайте в градусах.','b12_v6_6.png',2,1,'D',101,'31','рис',36,'Вар. 6  №6','12'),
	(2132,2132,'Материальная точка движется прямолинейно по закону \\(x\\left(t\\right)=-t^4+7t^3+6t+16\\), где \\({x}\\) - расстояние от точки отсчёта в метрах, \\({t}\\) - время в секундах, измеренное с начала движения. Найдите её скорость (в метрах в секунду) в момент времени \\(t = 5\\;\\text{c}.\\)',NULL,2,1,'D',87,'31',NULL,36,'Вар. 6  №7','12'),
	(2133,2133,'В основании прямой призмы лежит квадрат со стороной 6. Боковое ребро призмы равно \\(\\frac6{\\pi }\\). Найдите объём цилиндра, описанного около этой призмы (см. рис.)','b12_v6_8.png',2,1,'D',109,'108','рис',36,'Вар. 6  №8','12'),
	(2134,2134,'Найдите значение выражения \\(4^{0,12}\\cdot16^{0,44}.\\)',NULL,5,1,'D',80,'4',NULL,36,'Вар. 6  №9','12'),
	(2135,2135,'Опорные башмаки шагающего экскаватора, имеющего массу \\(m = 2240\\) тонн, представляют собой две пустотелые балки длиной \\(l = 14\\) метров и шириной \\({s}\\) метров каждая. Давление экскаватора на почву, выражаемой в килопаскалях, определяется формулой \\( p=\\frac{mg}{2ls}\\), где \\({m}\\) - масса экскаватора (в тоннах), \\({l}\\) - длина балок в метрах, \\({s}\\) - ширина балок в метрах, \\({g}\\) - ускорение свободного падения (считайте \\( g=10\\;\\text{м/}\\text{с}^\\text2\\)). Определите наименьшую возможную ширину опорных балок, если известно, что давление \\({p}\\) не должно превышать 400 кПа. Ответ выразите в метрах.',NULL,10,1,'D',93,'2',NULL,36,'Вар. 6  №10','12'),
	(2136,2136,'Из одной точки круговой трассы, длина которой 10 км, одновременно в одном направлении стартовали два мотоциклиста. Скорость одного из них 72 км/ч, и через 30 минут после старта он опережал второго мотоциклиста на один круг. Найдите скорость второго мотоциклиста. Ответ дайте в км/ч.',NULL,10,1,'D',71,'52',NULL,36,'Вар. 6  №11','12'),
