	(2144,2144,'На доске записаны числа 1, 2, 3, ..., 33. За один ход разрешается стереть произвольно три числа, сумма которых больше 66 и отлична от каждой из сумм троек чисел, стёртых на предыдущих ходах.\nа) Приведите пример последовательных пяти ходов.\nб) Можно ли сделать 11 ходов?\nв) Какое наибольшее число ходов можно сделать?',NULL,300,12,'A',114,'а) \\(\\left(33;32;2\\right)\\); \\(\\left(30;29;9\\right)\\); \\(\\left(27;26;16\\right)\\); \\(\\left(25;24;21\\right)\\); \\(\\left(23;28;20\\right)\\); б) нет; в) 6',NULL,36,'Вар. 6  №19','12'),
