	(2146,2146,'На графике показан процесс разогрева двигателя легкового автомобиля. На оси абсцисс откладывается время в минутах, прошедшее с момента запуска двигателя, на оси ординат — температура двигателя в градусах Цельсия. Определите, сколько минут двигатель нагревался от температуры \\(50^\\circ\\rm{C}\\) до температуры \\(90^\\circ\\rm{C}\\) (см. рис.).','b12_v7_2.png',2,1,'D',70,'3','<p>рис</p>',37,'Вар. 7  №2','12'),
