	(2150,2150,'В треугольнике \\({ABC}\\) угол \\({B}\\) равен \\({48^ \\circ }\\), угол \\({C}\\) равен \\({95^ \\circ }\\), \\({AD}\\) - биссектриса, \\({E}\\) - такая точка на стороне \\({AB}\\), что \\({AE=AC}\\) (см. рис.). Найдите угол \\({BDE}\\). Ответ дайте в градусах.','b12_v7_6.png',2,1,'D',101,'47','рис',37,'Вар. 7  №6','12'),
	(2151,2151,'Материальная точка движется прямолинейно по закону \\(x(t)=\\frac14t^3-4t^2+t\\), где \\(x\\) - расстояние от точки отсчёта в метрах, \\(t\\) - время в секундах, измеренное с начала движения. В какой момент времени (в секундах) её скорость была 13 м/с?',NULL,2,1,'D',87,'12',NULL,37,'Вар. 7  №7','12'),
