	(2154,2154,'Автомобиль, масса которого равна \\(m = 1100\\;{\\rm{кг}}\\), начинает двигаться с ускорением, которое в течение \\(t\\) секунд остаётся неизменным, и проходит за это время путь \\(S = 600\\) метров. Значение силы (в ньютонах), приложенной в это время к автомобилю, равно \\(F=\\frac{2mS}{t^2}\\). Определите наибольшее время после начала движения автомобиля, за которое он пройдёт указанный путь, если известно, что сила \\(F\\), приложенная к автомобилю, не меньше 3300 Н. Ответ выразите в секундах.',NULL,10,1,'D',93,'20',NULL,37,'Вар. 7  №10','12'),
	(2155,2155,'По двум параллельным железнодорожным путям в одном направлении следуют пассажирский и товарный поезда, скорости которых равны соответственно 80 км/ч и 50 км/ч. Длина товарного поезда 1100 метров. Найдите длину пассажирского поезда, если время, за которое он прошёл мимо товарного поезда, равно 3 минуты 6 секунд. Ответ дайте в метрах.',NULL,10,1,'D',71,'450',NULL,37,'Вар. 7  №11','12'),
