	(2157,2157,'а) Решите уравнение \\(2\\log_2^2\\left(\\frac{\\sin x}2\\right)-7\\log_2\\left(\\frac{\\sin x}2\\right)-15=0\\).\nб) Укажите корни этого уравнения, принадлежащие отрезку \\(\\left[\\frac\\pi2;3\\pi\\right]\\).',NULL,20,1,'C',15,'а) \\(\\left(-1\\right)^n\\frac\\pi4+\\pi n,n\\in\\mathbb{Z};\\)\nб) \\(\\frac{3\\pi}4,\\frac{9\\pi}4,\\frac{11\\pi}4\\)',NULL,37,'Вар. 7  №13','12'),
	(2158,2158,'В правильной треугольной призме \\(ABC{A_1}{B_1}{C_1}\\) сторона основания \\(AB\\) равна \\(8\\sqrt 3 \\), а боковое ребро \\(A{A_1} = 6\\). На ребре \\({B_1}{C_1}\\) отмечена точка \\(L\\) так, что \\({B_1}L = 2\\sqrt 3 \\). Точки \\(K\\) и \\(M\\) - середины рёбер \\(AB\\) и \\({A_1}{C_1}\\) соответственно. Плоскость \\(\\gamma \\) параллельна прямой \\(AC\\) и содержит точки \\(K\\) и \\(L\\).\nа) Докажите, что прямая \\(BM\\) перпендикулярна плоскости \\(\\gamma \\).\nб) Найдите объём пирамиды, вершина которой - точка \\(M\\), а основание - сечение данной призмы плоскостью \\(\\gamma \\).',NULL,120,4,'B',60,'\\(54\\sqrt 3 \\)',NULL,37,'Вар. 7  №14','12'),
	(2159,2159,'Решите неравенство \\(\\frac{35\\cdot3^x}{4+10\\cdot3^x-6\\cdot3^{2x}}\\geq\\frac{3^x+2}{3^{x+1}+1}-\\frac{3^{x+1}-1}{3^x-2}.\\)',NULL,100,4,'B',32,'\\(\\left[\\log_3\\frac3{16};\\log_32\\right)\\cup\\left(\\log_32;+\\infty\\right)\\)',NULL,37,'Вар. 7  №15','12'),
	(2160,2160,'В трапеции \\(KLMN\\) боковая сторона \\(KL\\) перпендикулярна основаниям. Из точки \\(K\\) на сторону \\(MN\\) опустили перпендикуляр \\(KA\\). На стороне \\(KL\\) отмечена точка \\(B\\) так, что прямые \\(LA\\) и \\(BN\\) параллельны.\nа) Докажите, что прямые \\(BM\\) и \\(MN\\) перпендикулярны.\nб) Найдите отношение \\(LA:BN\\), если угол \\(LMN\\) равен \\({150^ \\circ }\\).',NULL,350,14,'A',53,'б) \\(\\frac14\\)',NULL,37,'Вар. 7  №16','12'),
