	(2423,2423,'В июле планируется взять кредит в банке на сумму 16 млн рублей на некоторый срок (целое число лет). Условия его возврата таковы:\n- каждый январь долг возрастает на 25% по сравнению с концом предыдущего года;\n- с февраля по июнь каждого года необходимо выплатить часть долга;\n- в июле каждого года долг должен быть на одну и ту же сумму меньше долга на июль предыдущего года.\nНа сколько лет нужно взять кредит, чтобы общая сумма выплат после его полного погашения составила 38 млн руб.?',NULL,NULL,NULL,NULL,NULL,'10.',NULL,48,'969','13'),
	(2424,2424,'31 декабря 2013 года Сергей взял в банке 9930000 рублей в кредит под 10% годовых. Схема выплаты кредита следующая: 31 декабря каждого следующего года банк начисляет 10% процентов на оставшуюся сумму долга, затем Сергей переводит в банк определённую сумму ежегодного платежа. Какой должна быть сумма ежегодного платежа, чтобы Сергей выплатил долг тремя равными ежегодными платежами?',NULL,NULL,NULL,NULL,NULL,'3993000 рублей.',NULL,48,'970','13'),
	(2425,2425,'В конце года Пётр взял в банке 100000 рублей в кредит. Схема выплаты кредита следующая: в конце каждого следующего года банк увеличивает оставшуюся сумму долга на определённое количество процентов, затем Игорь переводит очередной транш. Игорь выплатил кредит за 2 транша, переведя сначала 51000 руб., а потом - 66600 руб. Под какой процент банк выдал кредит Петру?',NULL,NULL,NULL,NULL,NULL,'11.',NULL,48,'971','13'),
	(2426,2426,'По вкладу А в конце каждого года банк увеличивает сумму, имеющуюся на вкладе в начале года, на 10% в течение 3 лет, а по вкладу Б - на 11%, но только в течение первых 2 лет. Найдите наименьшее целое число процентов за 3-й год по вкладу Б, при котором за все 3 года этот вклад всё ещё останется выгоднее вклада А.',NULL,NULL,NULL,NULL,NULL,'9.',NULL,48,'972','13'),
	(2427,2427,'15 января планируется взять кредит в банке на 19 месяцев. Условия его возврата таковы: 1 числа каждого месяца имеющийся на этот момент долг взявшего кредит возрастает на \\(r\\% \\) по сравнению с концом предыдущего месяца; со 2 по 14 число каждого месяца необходимо выплатить часть долга; 15 числа каждого месяца долг должен быть на одну и ту же сумму меньше долга на 15 число предыдущего месяца. Известно, что общая сумма долговых выплат после полного погашения кредита будет на 30% больше суммы, взятой в кредит. Найдите \\(r\\).',NULL,NULL,NULL,NULL,NULL,'3.',NULL,48,'973','13'),
	(2428,2428,'Два вкладчика вложили деньги в общее дело. После этого один из них добавил ещё 1 млн р., в результате чего его доля в общем деле увеличилась на 0,04, а когда он добавил ещё 1 млн р., его доля увеличилась ещё на 0,02. Сколько денег ему нужно добавить ещё, чтобы увеличить свою долю ещё на 0,04?',NULL,NULL,NULL,NULL,NULL,'8 млн р.',NULL,48,'974','13'),
	(2429,2429,'Положительные числа \\(x\\) и \\(y\\) таковы, что 3% от \\(x\\) меньше, чем 2% от \\(y\\). Какое из чисел меньше: \\(\\frac{y}{x}\\) или \\(\\sqrt 2\\)?',NULL,NULL,NULL,NULL,NULL,'\\(\\sqrt 2 \\).',NULL,48,'975','13'),
	(2430,2430,'Две подруги отправились в магазин, имея одинаковые суммы на счетах своих кредитных карт. Одна из подруг израсходовала на одну покупку 40% своих денег вторая израсходовала на первую покупку 20% своих денег, а на вторую покупку 25% оставшихся у неё денег после первой покупки. Какая из подруг израсходовала больше денег?',NULL,NULL,NULL,NULL,NULL,'Одинаково.',NULL,48,'976','13'),
	(2431,2431,'Из 22 кг свежих грибов получается 2,5 кг сухих грибов, содержащих 12% влаги. Каков процент влаги в свежих грибах?',NULL,NULL,NULL,NULL,NULL,'90%.',NULL,NULL,'977','13'),
	(2432,2432,'На плодоовощной базе хранились ягоды, влажность которых составляла 99%. За время хранения влажность ягод уменьшилась на 1% (стала 98%). На сколько процентов уменьшилась масса хранившихся ягод?',NULL,NULL,NULL,NULL,NULL,'50%.',NULL,NULL,'978','13'),
	(2433,2433,'На первом поле 65% площади засеяно овсом. На втором поле под овсом занято 45% площади. Известно, что на первом и втором полях вместе под овсом занято 53% общей площади. Какую часть всей засеянной площади составляет первое поле?',NULL,NULL,NULL,NULL,NULL,'\\(\\frac2{5}\\).',NULL,NULL,'979','13'),
	(2434,2434,'Для приготовления водного раствора кислоты взяли 4 л 40%-го и 6 л 60%-го растворов кислоты. Затем часть полученной смеси вылили и добавили такое же количество чистой воды, в результате чего получили 39%-й раствор кислоты. Сколько литров чистой воды были добавлено?',NULL,NULL,NULL,NULL,NULL,'2,5.',NULL,NULL,'980','13'),
	(2435,2435,'На факультете X отличники составляют 10% от общего количества студентов этого факультета, на факультете Y - 20%, а на факультете Z - лишь 4%. Найдите средний процент отличников по всем трём факультетам, если известно, что на факультете Y учится на 50% больше студентов, чем на факультете X, а на факультете Z - вдвое меньше, чем на факультете X.',NULL,NULL,NULL,NULL,NULL,'14%.',NULL,NULL,'981','13'),
	(2436,2436,'Популярность продукта А за 2012 г. выросла на 20%, в следующем году снизилась на 10%, а в конце 2014 г. сравнялась с популярностью продукта Б. Популярность продукта Б в 2012 г. снизилась на 20%, затем на протяжении одного года не изменялась, а за 2014 г. выросла на 40%. Как изменилась популярность продукта А за 2014 г., если в начале 2012 г. она составляла \\(\\frac2{3}\\) от популярности продукта Б?',NULL,NULL,NULL,NULL,NULL,'Выросла на \\(\\frac{500}9\\% \\).',NULL,NULL,'982','13'),
	(2437,2437,'Число 51,2 трижды увеличили на одно и то же самое число процентов, а затем трижды уменьшили на то же самое число процентов. В результате получилось число 21,6. На сколько процентов увеличивали, а затем уменьшали исходное число?',NULL,NULL,NULL,NULL,NULL,'50%.',NULL,NULL,'983','13'),
	(2438,2438,'Кооператив на изготавливаемые им изделия первоначально назначил цену выше государственной на определённое число процентов. Через некоторое время кооператив уценил изделия на то же число процентов, в результате чего цена изделия стала на 1% меньше государственной. На какое число процентов кооперативная цена первоначально превышала государственную?',NULL,NULL,NULL,NULL,NULL,'10%.',NULL,NULL,'984','13'),
	(2439,2439,'Магазин продал книгу со скидкой 10% по сравнению с первоначально назначенной ценой и получил при этом 8% прибыли. Сколько процентов прибыли первоначально предполагал получить магазин?',NULL,NULL,NULL,NULL,NULL,'20%.',NULL,NULL,'985','13'),
	(2440,2440,'В двух мешках находится 140 кг муки. Если из первого мешка переложить во второй 12,5% муки, находящейся в первом мешке, то в мешках окажется одинаковое количество муки. Сколько килограммов муки в каждом мешке?',NULL,NULL,NULL,NULL,NULL,'80 и 60.',NULL,NULL,'986','13'),
	(2441,2441,'Гонорар за сценарий был распределён между тремя соавторами в отношении 8:6:5. Если бы этот же гонорар был распределён в отношении 7:5:4, то один из соавторов получил бы на 25 у.е. больше, чем он получил на самом деле. Чему равна сумма гонорара?',NULL,NULL,NULL,NULL,NULL,'1520 у.е.',NULL,NULL,'987','13'),
	(2442,2442,'Имеются два слитка золота массой 300 г и 400 г с различным процентным содержанием золота. Каждый слиток нужно разделить на две части таким образом, чтобы из получившихся четырёх кусков можно было изготовить два слитка массой 200 г и 500 г с равным процентным содержанием золота. На какие части следует разделить каждый слиток?',NULL,NULL,NULL,NULL,NULL,'Слиток массой 300 г на части: \\(\\frac{600}7\\) и \\(\\frac{1500}7\\), а слиток массой 400 г - на части: \\(\\frac{800}7\\) и \\(\\frac{2000}7\\).',NULL,NULL,'988','13'),
	(2443,2443,'Алиса и Базилио поделили между собой 39 золотых монет. Число монет, доставшихся любому из них, меньше удвоенного числа монет, доставшихся другому. Квадрат трети числа монет, доставшихся Базилио, меньше числа монет, доставшихся Алисе. Сколько монет досталось каждому?',NULL,NULL,NULL,NULL,NULL,'Алисе 25, Базилио 14.',NULL,NULL,'989','13'),
	(2444,2444,'Технология изготовления дискет состоит из четырёх этапов. На каждом из них увеличивается содержание кремния на определённое количество процентов по отношению к результату предыдущего этапа: на первом этапе - на 25%, на втором этапе - на 20%, на третьем этапе - на 10%, на четвёртом этапе - на 8%. На сколько процентов в результате увеличится содержание кремния?',NULL,NULL,NULL,NULL,NULL,'78,2%.',NULL,NULL,'990','13'),
	(2445,2445,'Биржа запланировала провести торги в июле и августе. Если объём торгов в июле оставить на запланированном уровне, а план на август превысить в 3 раза, то суммарный объём торгов, проводимых в течение этих 2 месяцев, возрастёт в 2 раза. Найдите отношение объёмов торгов, запланированных на июль и на август, и выясните, во сколько раз надо увеличить план на июль, оставляя неизменным план на август, чтобы суммарный объём торгов, проводимых за эти два месяца, возрос в 3 раза.',NULL,NULL,NULL,NULL,NULL,'1:1, в 5 раз.',NULL,NULL,'991','13'),
	(2446,2446,'Длину одной из диагоналей выпуклого четырёхугольника увеличили на 50%, а длину другой диагонали уменьшили на 10%, оставив угол между диагоналями неизменным. Как изменилась площадь четырёхугольника и на сколько процентов?',NULL,NULL,NULL,NULL,NULL,'Увеличилась на 35%.',NULL,NULL,'992','13'),
	(2447,2447,'На экзамене по математики 15% сдававших не решили ни одной задачи, 144 человека решили задачи с ошибками, а число остальных сдававших, верно решивших все задачи, относится к числу не решивших ничего как 5:3. Сколько человек сдавали экзамен?',NULL,NULL,NULL,NULL,NULL,'240.',NULL,NULL,'993','13'),
	(2448,2448,'В банк был положен вклад под банковский процент 10%. Через год хозяин вклада снял со счёта 2000 руб., а ещё через год снова внёс 2000 руб. Однако вследствие этих действий через 3 года со времени первоначального вложения вклада он получил сумму меньше запланированной (если бы не было промежуточных операций со вкладом). На сколько рублей меньше запланированной суммы получил в итоге вкладчик?',NULL,NULL,NULL,NULL,NULL,'220.',NULL,NULL,'994','13'),
	(2449,2449,'15-го января был выдан полугодовой кредит на развитие бизнеса. В таблице представлен график его погашения.\nВ конце каждого месяца, начиная с января, текущий долг увеличивался на 5%, а выплаты по погашению кредита происходили в первой половине каждого месяца, начиная с февраля. На сколько процентов общая сумма выплат при таких условиях оказалась больше суммы самого кредита?','b13_995.png',NULL,NULL,NULL,NULL,'22,5.','рис',NULL,'995','13'),
	(2450,2450,'Вклад в целое число миллионов рублей планируется открыть на 4 года. В конце каждого года вклад увеличивается на 10% по сравнению с его размером в начале года, а, кроме этого, в начале 3-го и 4-го годов вклад ежегодно пополняется на 1 млн руб. Найдите наименьший размер первоначального вклада, при котором через 4 года вклад будет больше 10 млн руб.',NULL,NULL,NULL,NULL,NULL,'6 млн.',NULL,NULL,'996','13'),
	(2451,2451,'Наталья хочет взять в кредит 1000000 руб. под 10% годовых. Погашение кредита происходит раз в год равными суммами (кроме, может быть, последней) после начисления процентов. На какое минимальное количество лет может Наталья взять кредит, чтобы ежегодные выплаты были не более 240000 рублей?',NULL,NULL,NULL,NULL,NULL,'6.',NULL,NULL,'997','13'),
	(2452,2452,'Семья Ивановых ежемесячно вносит плату за коммунальные услуги, телефон и электричество. Если бы коммунальные услуги подорожали на 50%, то общая сумма платежа увеличилась бы на 35%. Если бы электричество подорожало на 50%, то общая сумма платежа увеличилась бы на 10%. Какой процент от общей суммы платежа приходится на оплату телефона?',NULL,NULL,NULL,NULL,NULL,'10.',NULL,NULL,'998','13'),
	(2453,2453,'Два вкладчика вложили деньги в общее дело. После этого один из них добавил ещё 1 млн р., в результате чего его доля в общем деле увеличилась на 0,05, а когда он добавил ещё 1 млн р., его доля увеличилась ещё на 0,04. Сколько денег ему нужно добавить ещё, чтобы увеличить свою долю ещё на 0,06?',NULL,NULL,NULL,NULL,NULL,'2 млн р.',NULL,NULL,'1000','13'),
	(2454,2454,'На двух заводах производятся одинаковые товары, но на первом - с помощью более совершенной технологии: все рабочие первого завода за один рабочий день, трудясь суммарно \\(t \\ge 1\\) ч, производят суммарно \\(4\\sqrt t \\) единиц товара, а второго завода - только \\(3\\sqrt t \\). Владелец этих двух заводов планирует выделять на оплату труда рабочих по 5000000 руб. в день, платя каждому из них по 500 руб. в ч. Производство какого наибольшего количества единиц товара в день владелец может организовать на этих двух заводах, установив на каждом из них своё суммарное время работы в день?',NULL,NULL,NULL,NULL,NULL,'500.',NULL,NULL,'1001','13'),
	(2455,2455,'На двух заводах производятся одинаковые товары, но на первом - с помощью более дешёвой рабочей силы. За один рабочий день все рабочие одного (любого) завода, трудясь суммарно \\(t \\ge 1\\) ч, производят суммарно \\(\\sqrt t \\) единиц товара. Владелец этих двух заводов планирует выделять на оплату труда рабочих по 900000 руб. в день, платя каждому рабочему первого завода по 200 руб. в ч, а второго - по 250. Производство какого наибольшего количества единиц товара в день владелец может организовать на этих двух заводах, установив на каждом из них своё суммарное время работы в день?',NULL,NULL,NULL,NULL,NULL,'90.',NULL,NULL,'1002','13'),
	(2456,2456,'Для охраны объекта в течение одной рабочей недели (5 суток) заказчик заключил договор с бригадой охранников. По договору каждый член бригады указывает один промежуток времени своего предполагаемого дежурства (в данную рабочую неделю) так, чтобы в итоге объект всегда находился под охраной, после чего заказчик оставляет любую часть охранников, которая обеспечивает круглосуточную охрану, и оплачивает их работу их расчёта 500 руб. в час каждому. Какую наименьшую сумму денег достаточно подготовить заказчику заранее для гарантированной возможности расплатиться с бригадой?',NULL,NULL,NULL,NULL,NULL,'2х5х24х500=120000 руб.',NULL,NULL,'1003','13'),
	(2457,2457,'На охрану объекта заказчик выделил 80000 руб., заключив договор с бригадой охранников. По договору заказчик заранее задаёт весь период (отрезок) времени охраны, а каждый член бригады указывает один промежуток времени своего предполагаемого дежурства (в заданный период) так, чтобы в итоге объект всегда находился под охраной, после чего заказчик оставляет любую часть охранников, которая обеспечивает постоянную охрану, и оплачивает их работу их расчёта 250 руб. в час каждому. Какой наибольший период времени охраны заказчик сможет гарантированно оплатить?',NULL,NULL,NULL,NULL,NULL,'\\(80000:\\left(2\\times250\\right)=160\\) час.',NULL,NULL,'1004','13'),
	(2458,2458,'Клиент 31 декабря взял в банке кредит в размере \\(S\\) руб. под фиксированный процент (годовых). Схема выплаты кредита следующая: 31 декабря каждого следующего года банк увеличивает имеющийся на этот момент долг на \\(p\\% \\), затем клиент переводит в банк фиксированную сумму в \\(a\\) руб. в качестве частичного (или полного) погашения долга. В итоге клиент ровно за 2 года выплатил долг полностью. Если бы он платил каждый год не по \\(a\\) руб., а по \\(b\\) руб., то выплатил бы долг ровно за 4 года. Зная произвольные две из трёх величин \\(a\\), \\(b\\) и \\(p\\), найдите третью, а также величину \\(S\\).',NULL,NULL,NULL,NULL,NULL,', \\(S=\\frac{100a\\left(200+p\\right)}{\\left(100+p\\right)^2}\\).',NULL,NULL,'1005','13'),
	(2459,2459,'Клиент взял в банке кредит 155000 рублей под 17% годовых. Он должен погашать кредит, внося в банк ежемесячно одинаковую сумму денег, с тем, чтобы через год выплатить всю сумму, взятую в кредит, вместе с процентами. Сколько рублей он должен вносить в банк ежемесячно?',NULL,NULL,NULL,NULL,NULL,'15112,5',NULL,NULL,'Вар. 21  №1','12'),
