	(2819,2819,'Имеется прямоугольная таблица размером \\(M \\times N\\), заполненная числами 0 и 1, обладающая следующими свойствами. Во-первых, в каждой строке и в каждом столбце есть хотя бы один элемент, равный 1. Во-вторых, нет ни одной пары одинаковых строк, а также ни одной пары одинаковых столбцов. Таблицы, обладающие этими свойствами, назовём \"хорошими\".\nДве таблицы назовём эквивалентными в том (и только том) случае, если из них можно получить другую путём перестановки строк и/или столбцов. Приведём пример двух эквивалентных таблиц размером 3х3.\nВтора таблица получается из первой сначала перестановкой в ней 1-й и 3-й строк, потом 2-го и 3-го столбца в полученной таблице и, наконец, 1-й и 2-й строки в последней полученной таблице.\nа) Сколько существует различных попарно неэквивалентных \"хороших\" таблиц размером 2х3?\nб) Укажите количество всех таблиц, эквивалентных \"хорошей\" таблице.\nв) 1. Какое максимальное число столбцов может быть в \"хорошей\" таблице, содержащей \\(M\\) строк?\n2. Приведите пример \"хорошей\" таблицы, содержащей 3 строки и максимально возможное число столбцов в ней (в ответе запишите столбцы таблицы по убыванию десятичных чисел, соответствующих этим столбцам и рассматриваемых как числа в двоичной системе с расположением цифр сверху вниз).','b12_v39_19_1.png',NULL,NULL,NULL,NULL,'а) 1; б) 6; в) 1) \\(2^M-1\\); 2) рис','рис',NULL,'Вар. 39  №19','12'),
	(2820,2820,'В доме, в котором живёт Фёдор, 16 этажей и несколько подъездов. На каждом этаже находится по 3 квартиры. Фёдор живёт в квартире №151. В каком подъезде живёт Фёдор?',NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,'Вар. 40  №1','12'),
	(2821,2821,'Мощность отопителя в автомобиле регулируется дополнительным сопротивлением, которое можно менять, поворачивая рукоятку в салоне машины. При этом меняется сила тока в электрической цепи электродвигателя - чем меньше сопротивление, тем больше сила тока и тем быстрее вращается мотор отопителя. На рисунке показана зависимость силы тока от величины сопротивления. На оси абсцисс откладывается сопротивление (в омах), на оси ординат - сила тока в амперах. Ток в цепи электродвигателя уменьшился с 6 до 2 ампер. На сколько омов при этом увеличилось сопротивление цепи?','b12_v40_2.png',NULL,NULL,NULL,NULL,'1','рис',NULL,'Вар. 40  №2','12'),
