	(3007,3007,'Найдите ординату точки касания графика функции \\(y = \\sin^2x\\) и прямой \\(y=x+0,5-\\frac\\pi4.\\)',NULL,60,2,'C',47,'0.5',NULL,46,'№13','http://shkolkovo.net/catalog/vzaimosvyaz_funkcii_i_ee_proizvodnoj/uglovoj_koefficient_kasatelnoj_kak_znacheniev_tochke_kasaniya/page-2'),
	(3008,3008,'Прямая, заданная уравнением \\(y =  - 3kx + 7\\), касается графика функции \\(g(x) = 2f(x) + 5\\) в точке \\(({x_0}; g({x_0}))\\). Найдите \\(f\'({x_0})\\), если \\(g\'({x_0}) + k = 3.\\)',NULL,60,2,'C',47,'2.25',NULL,46,'№14','http://shkolkovo.net/catalog/vzaimosvyaz_funkcii_i_ee_proizvodnoj/uglovoj_koefficient_kasatelnoj_kak_znacheniev_tochke_kasaniya/page-2'),
	(3009,3009,'Говорят, что две кривые касаются в точке \\((x; y)\\), если они обе через неё проходят и имеют в этой точке общую касательную. Найдите абсциссу точки касания графиков функций \\(y=\\frac{x^4}4+\\pi x^2+\\frac13\\) и \\(y=\\frac{x^3}3+\\pi x^2+\\frac14.\\)',NULL,60,2,'C',47,'1',NULL,46,'№15','http://shkolkovo.net/catalog/vzaimosvyaz_funkcii_i_ee_proizvodnoj/uglovoj_koefficient_kasatelnoj_kak_znacheniev_tochke_kasaniya/page-3'),
	(3010,3010,'Прямая, заданная уравнением \\(y = 0,5kx + k\\), касается графика функции \\(g(x) = \\sin (f(x)) - 2\\) в точке \\((x_0;g(x_0))\\). Найдите \\(f\'(x_0)\\), если \\(g\'(x_0)-1,5k=2\\), \\(f(x_0)=2\\pi.\\)',NULL,60,2,'C',47,'-1',NULL,46,'№16','http://shkolkovo.net/catalog/vzaimosvyaz_funkcii_i_ee_proizvodnoj/uglovoj_koefficient_kasatelnoj_kak_znacheniev_tochke_kasaniya/page-3'),
	(3011,1043,'В кубе \\(ABCDA_1B_1C_1D_1\\): \\(A_1C_1\\), \\(A_1D\\) и \\(C_1D\\) — диагонали граней \\(A_1B_1C_1D_1\\), \\(AA_1D_1D\\) и \\(DD_1C_1C\\) соответственно. В тетраэдр \\(D_1A_1C_1D\\) вписан конус так, что его основание вписано в треугольник \\(A_1C_1D\\) и \\(D_1\\) — его вершина. Найдите объём большей из частей, на которые куб делится плоскостью \\(A_1C_1D\\), если объём конуса равен \\(\\frac\\pi6.\\)',NULL,NULL,NULL,NULL,65,'\\(\\frac{5\\sqrt3}2\\)','',NULL,'1043',NULL);
INSERT INTO `tasks_physics` (`id`, `number_task`, `task`, `image_1`, `image_2`, `image_1_answer`, `image_2_answer`, `experience`, `gold`, `grade`, `subject_id`, `answer`, `detail`, `set_of_task_id`, `original_number`, `book`)
VALUES
	(1,1,'В сосуде, заполненном азотом, поршень неплотно прилегает к стенкам сосуда. Медленно опуская поршень, так, что объём азота уменьшается в 1,5 раза, замечают, что давление азота увеличилось в 1,2 раза. Считая температуру азота неизменной, определите, во сколько раз уменьшилось количество молекул азота в данном опыте.',NULL,NULL,NULL,NULL,30,1,'D',30,'1.25',NULL,1,' Вар.1 №25','1'),
	(2,2,'В опытах Иоффе по определению заряда электрона мелкие заряженные частички цинка удерживались в равновесии между пластинами плоского вакуумного конденсатора. Какое напряжение (в вольтах) нужно было подать на конденсатор, чтобы удержать частичку цинка массой 1,6 мг с зарядом 3,2 нКл, если расстояние между пластинами конденсатора равно 10 см?',NULL,NULL,NULL,NULL,30,1,'D',46,'500',NULL,1,' Вар.1 №26','1'),
	(3,3,'Линза оптической силой 20 дптр даёт на экране изображение предмета, увеличенное в 5 раз. Каково расстояние от предмета до линзы? (Ответ дайте в см).',NULL,NULL,NULL,NULL,30,1,'D',68,'6',NULL,1,' Вар.1 №27','1'),
	(4,4,'Для просмотра фильмов с ЗD-изображением необходимы специальные очки. Если при просмотре фильма наклонить голову влево или вправо, то изображение сразу искажается. Объясните наблюдаемое явление с физической точки зрения.',NULL,NULL,NULL,NULL,60,2,'C',69,NULL,NULL,1,' Вар.1 №28','1'),
	(5,5,'На дне сосуда с жидкостью укреплена шарнирно тонкая деревянная цилиндрическая палочка длиной 40 см, часть которой длиной 10 см выступает над поверхностью жидкости (см. рис.). Чему равно отношение плотности жидкости к плотности дерева?','b1_v1_29.png',NULL,NULL,NULL,100,4,'C',23,'1,78','рис.',1,' Вар.1 №29','1'),
	(6,6,'В двух сосудах объёмами 10 л и 20 л находится аргон. Давление в обоих сосудах одинаковое, но в 1-м сосуде температура равна 300 К, а во 2-м 450 К. Сосуды соединены между собой тонкой трубкой с краном. Какая температура установится в сосудах, если открыть кран? Объёмом трубки и теплообменом с окружающей средой пренебречь. Считать давление аргона неизменным.',NULL,NULL,NULL,NULL,150,6,'B',35,'386 K',NULL,1,' Вар.1 №30','1'),
	(7,7,'Рамка площадью 400 см\\[^2\\] вращается в однородном магнитном поле индукцией 20 мТл. При периоде вращения рамки 2,5 мс вольтметр, подключённый к концам рамки, показывает напряжение 80 В. Сколько витков проволоки намотано на рамку? (Вольтметр показывает действующее значение ЭДС.)',NULL,NULL,NULL,NULL,150,6,'B',58,'56',NULL,1,' Вар.1 №31','1'),
	(8,8,'Глаз человека воспринимает свет длиной волны 500 нм в том случае, если световые лучи, попадающие в глаз, имеют мощность не менее 2,1 · \\[{10^{ - 17}}\\] Вт. Какое количество квантов света попадает на сетчатку глаза в течение 1 мин?',NULL,NULL,NULL,NULL,150,6,'B',73,'3182',NULL,1,' Вар.1 №32','1'),
	(9,9,'С 0,1 моль идеального газа происходит циклический процесс, как показано на рис. Определите минимальную температуру газа в этом цикле. Ответ округлите до целых и выразите в К.','b1_v2_25.png',NULL,NULL,NULL,30,1,'D',37,'241','рис.',1,' Вар.2 №25','1'),
	(10,10,'Какова угловая скорость вращения квадратной рамки стороной 10 см в магнитном поле индукцией 40 мТл, если в ней возникает переменный ток амплитудой 6 мА? Сопротивление рамки 2 Ом. (Ответ в с\\[^{ - 1}\\]).',NULL,NULL,NULL,NULL,30,1,'D',58,'30',NULL,1,' Вар.2 №26','1'),
	(11,11,'Фотоны с энергией 4,8 эВ вызывают фотоэффект при попадании на вольфрамовый фотокатод с работой выхода электрона 4,5 эВ. Во сколько раз изменится максимальная кинетическая энергия фотоэлектронов, если увеличить в 3 раза количество фотонов, а их энергию увеличить в 1,5 раза?',NULL,NULL,NULL,NULL,30,1,'D',72,'9',NULL,1,' Вар.2 №27','1'),
	(12,12,'Что произойдёт с лёгкой гильзой из алюминиевой фольги, подвешенной на длинной нити, если к ней поднести, не касаясь её, заряженную отрицательно эбонитовую палочку? Объяснить наблюдаемое явление с физической точки зрения.',NULL,NULL,NULL,NULL,80,3,'C',40,NULL,NULL,1,' Вар.2 №28','1'),
	(13,13,'На длинных тонких нитях подвешены пластилиновые шары массой m и 3m, как показано на рис. Шар массой 3m отводят на угол 60° и отпускают без начальной скорости. На какой угол отклонятся шары после абсолютно неупругого столкновения, если длина нити L.','b1_v2_29.png',NULL,NULL,NULL,100,4,'C',22,'\\[\\arccos (0,72)\\]','рис.',1,' Вар.2 №29','1'),
	(14,14,'В калориметр теплоёмкостью 76 Дж/К, содержащий воду при 20 °С впускают водяной пар массой 40 г при температуре 100 °С. После теплообмена в калориметре установилась температура 60 °С. Определите начальную массу воды в калориметре, если тепловые потери составили 20%.',NULL,NULL,NULL,NULL,100,4,'C',34,'452 г',NULL,1,' Вар.2 №30','1'),
	(15,15,'В электрической схеме, изображённой на рис., напряжённость электрического поля между пластинами конденсатора уменьшилась в 1,2 раза после замыкания ключа. Определите сопротивление лампы, если внутреннее сопротивление источника тока равно 2 Ом.','b1_v2_31.png',NULL,NULL,NULL,100,4,'C',48,'10 Ом','рис.',1,' Вар.2 №31','1'),
	(16,16,'Электрон с кинетической энергией 2 эВ влетает в однородное электрическое поле напряжённостью 20 В/м и движется вдоль силовой линии до полной остановки. Какой путь пройдёт электрон и сколько времени для этого потребуется?',NULL,NULL,NULL,NULL,100,4,'C',46,'10 см; 0,24 мкс',NULL,1,' Вар.2 №32','1'),
	(17,17,'Во сколько раз угловая скорость секундной стрелки больше угловой скорости часовой стрелки?',NULL,NULL,NULL,NULL,30,1,'D',15,'720',NULL,2,' Вар.3 №25','1'),
	(18,18,'Какова температура кислорода, если среднеквадратическая скорость его молекул равна 510 м/с? Ответ округлите до целых и выразите в градусах Цельсия).',NULL,NULL,NULL,NULL,30,1,'D',29,'61',NULL,2,' Вар.3 №26','1'),
	(19,19,'На сколько изменился магнитный поток внутри катушки за 0,5 с, если за это время в ней возникла ЭДС индукции 12 В. Число витков катушки равно 1000. (Ответ в мВб).',NULL,NULL,NULL,NULL,30,1,'D',58,'6',NULL,2,' Вар.3 №27','1'),
	(20,20,'Что произойдёт с массивным медным стержнем, если внести и оставить его на длительное время внутри катушки, по которой течёт переменный ток? Ответ объясните, ссылаясь на физические законы.',NULL,NULL,NULL,NULL,80,3,'C',58,NULL,NULL,2,' Вар.3 №28','1'),
	(21,21,'Под каким углом к горизонту бросили мяч, если в верхней точке его траектории значения потенциальной и кинетической энергии оказались одинаковыми?',NULL,NULL,NULL,NULL,100,4,'C',22,'\\[{45^ \\circ }\\]',NULL,2,' Вар.3 №29','1'),
	(22,22,'На графике (см. рис.) показан цикл тепловой машины, у которой рабочим телом является идеальный газ. Определите отношение работ газа на участках цикла 3 - 4 и 1 - 2.','b1_v3_30.png',NULL,NULL,NULL,150,6,'B',37,'1.5','рис.',2,' Вар.3 №30','1'),
	(23,23,'Колебательный контур настроен на частоту 20 МГц. В процессе колебаний максимальная сила тока на катушке достигает 12 мА, а амплитуда колебаний напряжения на конденсаторе равна 6,28 мВ. Определите индуктивность катушки, включённой в колебательный контур.',NULL,NULL,NULL,NULL,150,6,'B',62,'4,2 нГн',NULL,2,' Вар.3 №31','1'),
	(24,24,'В однородном электрическом поле напряжённостью 100 В/м находится металлическая пластинка, которая освещается светом с длиной волны 400 нм. Определите, на какое максимальное расстояние от пластины могут удалиться электроны, если поле оказывает на них тормозящее действие. Красная граница фотоэффекта 500 нм.',NULL,NULL,NULL,NULL,120,5,'C',72,'6,2 мм',NULL,2,' Вар.3 №32','1'),
	(25,25,'С какой высоты упало тело, если в тот момент, когда его кинетическая энергия была равна потенциальной, оно имело скорость 14 м/ с? (Ответ дайте в м).',NULL,NULL,NULL,NULL,30,1,'D',22,'19,6',NULL,2,' Вар.4 №25','1'),
	(26,26,'В сосуде находится смесь \\[{m_1}\\] = 10 г азота и \\[{m_2}\\] = 20 г углекислого газа при температуре \\[T\\] = 300 К и давлении \\[p\\] = \\[{10^5}\\] Па. Найдите плотность смеси, считая газы идеальными. Ответ округлите до сотых и выразите в кг/ м\\[^3\\]). ',NULL,NULL,NULL,NULL,30,1,'D',32,'1.482',NULL,2,' Вар.4 №26','1'),
	(27,27,'Два изолированных проводника, удалённых друг от друга, имеют потенциалы \\[{\\varphi _1}\\] = 20 В и \\[{\\varphi _2}\\] = 60 В; заряды на проводниках равны. Какой потенциал установится на проводниках после того, как их ненадолго соединили тонким проводником? (Ответ дайте в вольтах).',NULL,NULL,NULL,NULL,30,1,'D',50,'30',NULL,2,' Вар.4 №27','1'),
	(28,28,'Почему, когда мы прикладываем к уху раковину, слышим звук, напоминающий шум моря?',NULL,NULL,NULL,NULL,60,2,'C',65,NULL,NULL,2,' Вар.4 №28','1'),
	(29,29,'В верхнюю точку треугольного клина с длиной основания \\[L\\] = 49 см, углом наклона \\[\\alpha \\] = 45° и массой \\[M\\] = 300 г поместили прямоугольный брус с основанием \\[l\\] = 10 см и массой \\[m\\] = 50 г. Брус отпускают, и он начинает свободно скользить по клину. Какое расстояние пройдёт клин к моменту, когда брус коснётся горизонтальной поверхности, на которой находится клин? (Силами трения бруса о клин и клина о горизонтальную поверхность пренебречь.)',NULL,NULL,NULL,NULL,200,8,'B',13,'6 см',NULL,2,' Вар.4 №29','1'),
	(30,30,'В комнате размерами 2,5 х 4 х 5 м при \\[{t_0}\\] = 25 °С влажность воздуха составляет 85%. Какова масса росы, которая может выпасть при уменьшении температуры до \\[{t_1}\\] = 10 °С? (Давление насыщенного водяного пара при 25 °С \\[{p_{{{25}^ \\circ }C}} = 3,17 \\cdot {10^3}\\] Па, при 10 °С \\[{p_{{{10}^ \\circ }C}} = 1,23 \\cdot {10^3}\\] Па.)\n',NULL,NULL,NULL,NULL,150,6,'B',33,'507,5 г',NULL,2,' Вар.4 №30','1'),
	(31,31,'На стакан с водой положили стеклянную пластинку. При каком угле падения на пластинку луч будет полностью отражаться от границы «стекло-вода», если показатель преломления стекла равен 1,45?',NULL,NULL,NULL,NULL,100,4,'C',66,'Угла не существует',NULL,2,' Вар.4 №31','1'),
	(32,32,'Лазер излучил короткий световой импульс длительностью \\[\\tau \\] = 0,13 мкс с энергией \\[E\\] = 10 Дж. Найдите среднее давление такого импульса, если его сфокусировать в пятно диаметром \\[d\\] = 10 мкм на поверхность, перпендикулярную к пучку, с коэффициентом отражения \\[\\rho \\] = 0,5.',NULL,NULL,NULL,NULL,100,4,'C',73,'3 Гпа',NULL,2,' Вар.4 №32','1'),
	(33,33,'Мяч брошен горизонтально из окна со скоростью \\[{V_0} = 10\\] м/с. На каком расстоянии упадёт мяч, если окно находится на высоте  45 м? (Ответ выразите в метрах).',NULL,NULL,NULL,NULL,30,1,'D',6,'30',NULL,3,' Вар.5 №25','1'),
	(34,34,'Температура нагревателя идеальной тепловой машины 400 К, а температура холодильника – 300 К. Нагреватель ежесекундно передаёт тепловой машине 800 Дж тепла. Определите полезную мощность этого двигателя. (Ответ дайте в Дж).',NULL,NULL,NULL,NULL,30,1,'D',38,'200',NULL,3,' Вар.5 №26','1'),
	(35,35,'Луч света из воздуха падает под углом 30° на плоскопараллельную пластинку с показателем преломления \\[n\\] = 1,5 и проходит её за время \\[t\\] = 0,025 нс. Какова толщина пластинки (в мм)?',NULL,NULL,NULL,NULL,30,1,'D',67,'4.7',NULL,3,' Вар.5 №27','1'),
	(36,36,'Почему, если человек вдохнёт гелий, его голос изменится?',NULL,NULL,NULL,NULL,60,2,'С',29,NULL,NULL,3,' Вар.5 №28','1'),
	(37,37,'Шарик, движущийся горизонтально со скоростью 11,3 м/с, вкатывается на горку, имеющую форму, представленную на рисунке. Дуга АБ – четверть окружности радиуса \\[R\\] = 5 м. Пренебрегая силой трения, определите, на каком расстоянии от точки Б упадёт шарик. (g = 9,8 м/ с\\[^2\\]) ( При расчётах рекомендуется учитывать 2 знака после запятой.)','b1_v5_29.png',NULL,NULL,NULL,300,12,'A',15,'1,31 м','рис.',3,' Вар.5 №29','1'),
