	(87,87,'Шайба съезжает из состояния покоя с горки высотой \\[H\\]. Ускорение свободного падения равно \\[g\\]. У подножия горки кинетическая энергия шайбы равна \\[{E_{к}}\\]. Трение шайбы о горку пренебрежимо мало.\nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. \n\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.\n\nФИЗИЧЕСКАЯ ВЕЛИЧИНА      ФОРМУЛА\nА) масса шайбы       1) \\[{E_{к}}\\sqrt {\\frac{2}{{gH}}} \\]\nБ) модуль импульса шайбы у подножия горки  2) \\[\\frac{{\\sqrt {2{E_{к}}} }}{{gH}}\\]\n        3) \\[\\sqrt {\\frac{{2{E_{к}}}}{{gH}}} \\]\n        4) \\[\\frac{{{E_{к}}}}{{gH}}\\]','b2_v1_7.png',NULL,NULL,NULL,5,1,'D',22,'41','рис.',6,' Вар.1 №7','2'),
	(88,88,'При проведении опыта в сосуд закачивали воздух, одновременно охлаждая его. При этом температура воздуха в сосуде понизилась в 2 раза, а давление воздуха возросло в три раза. Во сколько раз увеличилась масса воздуха в сосуде?',NULL,NULL,NULL,NULL,5,1,'D',29,'6',NULL,6,' Вар.1 №8','2'),
	(89,89,'Газ переводят из состояния 1 в состояние 3 так, как показано на \\[p - V\\]-диаграмме. Чему равна работа, совершенная газом в процессе\n1-2-3, если \\[{p_0}\\] = 80 кПа, \\[{V_0}\\] = 2 л? Ответ дайте в Дж.','b2_v1_9.png',NULL,NULL,NULL,5,1,'D',36,'160','рис.',6,' Вар.1 №9','2'),
	(90,90,'Относительная влажность воздуха в закрытом сосуде с поршнем равна 40%. Какой станет относительная влажность, если объем сосуда за счет движения поршня при неизменной температуре уменьшить в 3 раза?',NULL,NULL,NULL,NULL,5,1,'D',33,'100',NULL,6,' Вар.1 №10','2'),
	(91,91,'Горячая жидкость медленно охлаждалась в стакане. В таблице приведены результаты измерений её температуры с течением времени.\nВыберите из предложенного перечня два утверждения, которые соответствуют результатам проведенного экспериментального исследования, и укажите их номера.\n1) Температура кристаллизации жидкости в данных условиях равна 80 °С.\n2) Через 7 мин после начала измерений в стакане находилось вещество только в твердом состоянии.\n3) Через 4 мин после начала измерений в стакане находилось вещество как в жидком, так и в твердом состоянии.\n4) Через 12 мин после начала измерений в стакане находилось вещество только в жидком состоянии.\n5) Через 14 мин после начала измерений в стакане находилось вещество только в твердом состоянии.','b2_v1_11.png',NULL,NULL,NULL,10,1,'D',34,'15 или 51','рис.',6,' Вар.1 №11','2'),
	(92,92,'Температуру холодильника теплового двигателя, работающего по циклу Карно, увеличили, оставив температуру нагревателя прежней. Количество теплоты, полученное газом от нагревателя за цикл, не изменилось. Как изменились при этом КПД теплового двигателя и количество теплоты, отданное газом за цикл холодильнику?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась\n2) уменьшилась\n3) не изменилась\n\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b2_v1_12.png',NULL,NULL,NULL,10,1,'D',38,'21','рис.',6,' Вар.1 №12','2'),
	(93,93,'Как направлена (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) сила Кулона \\[\\overrightarrow F \\], действующая на положительный точечный заряд \\[ + q\\], помещенный в центр квадрата, в вершинах которого находятся заряды: \\[ + q\\], \\[ + q\\], \\[ - q\\], \\[ - q\\] (см. рисунок)? Ответ запишите словом (словами). ','b2_v1_13.png',NULL,NULL,NULL,5,1,'D',41,'Вниз',' рис.',6,' Вар.1 №13 ','2'),
