	(95,95,'Луч света падает на плоское зеркало. Угол между падающим и отраженным лучами равен 60° . Определите угол между отраженным лучом и зеркалом.',NULL,NULL,NULL,NULL,5,1,'D',66,'60',NULL,6,' Вар.1 №15','2'),
	(96,96,'На рисунке изображена зависимость силы тока через лампу накаливания от приложенного к ней напряжения. Выберите два верных утверждения, которые можно сделать, анализируя этот график.\n\n1) Сопротивление лампы не зависит от приложенного напряжения.\n2) Мощность, выделяемая в лампе при напряжении 110 В, равна 38,5 Вт.\n3) Мощность, выделяемая в лампе при напряжении 1 70 В, равна 40 Вт.\n4) Сопротивление лампы при силе тока в ней 0,15 А равно 200 Ом.\n5) Сопротивление лампы при напряжении 100 В равно 400 Ом.','b2_v1_16.png',NULL,NULL,NULL,10,1,'D',52,'24 или 42',' рис.',6,' Вар.1 №16','2'),
	(97,97,'В прозрачном сосуде, заполненном водой, находится дифракционная решетка. Решетка освещается параллельным пучком монохроматического света, падающим перпендикулярно ее поверхности через боковую стенку сосуда. Как изменятся частота световой волны, падающей на решетку, и угол между падающим лучом и первым дифракционным максимумом при замене воды в сосуде прозрачной жидкостью с большим показателем преломления?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась\n2) уменьшилась\n3) не изменилась\n\nЗапишите в таблицу выбранные цифры для каждого ответа. Цифры в ответе могут повторяться.','b2_v1_17.png',NULL,NULL,NULL,10,1,'D',69,'32',' рис.',6,' Вар.1 №17','2'),
	(98,98,'На рисунке показана цепь постоянного тока. У становите соответствие между физическими величинами и формулами, по которым их можно рассчитать (\\[\\varepsilon \\] – ЭДС источника напряжения; \\[r\\] – внутреннее сопротивление источника; \\[R\\] – сопротивление резистора).\n\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\n','b2_v1_18_1.png','b2_v1_18_2.png',NULL,NULL,10,1,'D',51,'13',' рис.',6,' Вар.1 №18','2'),
	(99,99,'На рисунке изображена модель нейтрального атома. Масса атома равна 11 а.е.м. Сколько протонов и нейтронов содержит ядро данного атома? \nВ бланк ответов перенесите только числа, без пробелов и других дополнительных символов. Указывайте числа в таком порядке: число протонов, число нейтронов.','b2_v1_19.png',NULL,NULL,NULL,5,1,'D',76,'56',' рис.',6,' Вар.1 №19','2'),
	(100,100,'Период полураспада изотопа натрия \\[{}_{11}^{22}Na\\] равен 2,6 года. Изначально было 208 г этого изотопа. Сколько его будет через 5,2 года? Ответ дайте в граммах.',NULL,NULL,NULL,NULL,5,1,'D',77,'52',NULL,6,' Вар.1 №20','2'),
	(101,101,'Для некоторых атомов характерной особенностью является возможность захвата атомным ядром одного из ближайших к нему электронов. Как изменяются при этом массовое число и заряд ядра?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличивается\n2) уменьшается\n3) не изменяется\n\nВ ответе запишите выбранные цифры для каждой физической величины (массовое число ядра, заряд ядра) без пробелов. Цифры в ответе могут повторяться.\n',NULL,NULL,NULL,NULL,10,1,'D',74,'32',NULL,6,' Вар.1 №21','2'),
	(102,102,'Для проведения опыта ученик налил воду в мензурку. Шкала мензурки проградуирована в миллилитрах (мл). Погрешность измерений объема равна цене деления шкалы мензурки. Чему равен объем налитой учеником воды? Ответ: ( ____ \\[ \\pm \\] ____ ) мл','b2_v1_22.png',NULL,NULL,NULL,5,1,'D',28,'1502',' рис.',6,' Вар.1 №22','2'),
	(103,103,'Необходимо экспериментально изучить зависимость ускорения тела, скользящего по шероховатой наклонной плоскости, от коэффициента трения груза о плоскость. Какие две установки из изображенных ниже следует выбрать, чтобы провести такое исследование? \nВ ответ запишите номера выбранных установок.','b2_v1_23.png',NULL,NULL,NULL,10,1,'D',8,'45 или 54','рис.',6,' Вар.1 №23','2'),
