	(105,105,'Цилиндрический сосуд разделен неподвижной теплоизолирующей перегородкой. В одной части сосуда находится кислород, в другой – водород, концентрации газов одинаковы. Давление кислорода в 4 раза меньше давления водорода. Чему равно отношение средней кинетической энергии молекул кислорода к средней кинетической энергии молекул водорода?',NULL,NULL,NULL,NULL,30,1,'D',29,'0.25',NULL,6,' Вар.1 №25','2'),
