	(107,107,'Тонкая линза Л дает четкое действительное изображение предмета АВ на экране Э (рис. 1). Что произойдет с изображением предмета на экране, если верхнюю половину линзы закрыть куском черного картона К (рис. 2)? Постройте изображение предмета в обоих случаях. Ответ поясните, указав, какие физические закономерности вы использовали для объяснения.','b2_v1_27_1.png','b2_v1_27_2.png',NULL,NULL,100,4,'С',68,'Изображение предмета продолжает существовать на прежнем месте, не меняя формы, но становится менее ярким','рис.',6,' Вар.1 №27','2'),
	(108,108,'Небольшая шайба после толчка приобретает скорость \\[\\upsilon \\] = 2 м/с и скользит по внутренней поверхности гладкого закрепленного кольца радиусом \\[R\\] = 0,14 м. На какой высоте \\[h\\] шайба отрывается от кольца и начинает свободно падать?','b2_v1_28.png',NULL,NULL,NULL,250,10,'A',13,'\\[h = \\frac{R}{3} + \\frac{{{\\upsilon ^2}}}{{3g}} \\approx 0,18\\] м','рис.',6,' Вар.1 №28','2'),
