	(110,110,'Два параллельных друг другу рельса, лежащих в горизонтальной плоскости, находятся в однородном магнитном поле, индукция \\[\\overrightarrow B \\] которого направлена вертикально вниз (см. рисунок, вид сверху). На рельсах находятся два одинаковых проводника. Левый проводник движется вправо со скоростью \\[\\overrightarrow V \\], а правый – покоится. С какой скоростью \\[\\overrightarrow \\upsilon  \\] надо перемещать правый проводник направо, чтобы в три раза уменьшить силу Ампера, действующую на левый проводник? (Сопротивлением рельсов пренебречь.)','b2_v1_30.png',NULL,NULL,NULL,200,8,'B',56,'\\[\\upsilon  = \\frac{2}{3}V\\]','рис.',6,' Вар.1 №30','2'),
	(111,111,'Уровни энергии электрона в атоме водорода задаются формулой \\[{E_n} =  - \\frac{{13,6}}{{{n^2}}}\\] эВ , где \\[n\\] = 1, 2, 3, … . При переходе атома из состояния \\[{E_2}\\] в состояние \\[{E_1}\\] атом испускает фотон. Попав на поверхность фотокатода, фотон выбивает фотоэлектрон. Частота света, соответствующая красной границе фотоэффекта для материала поверхности фотокатода, \\[{\\nu _{кр}}\\] = 6 · \\[{10^{14}}\\] Гц. Чему равна максимально возможная скорость фотоэлектрона?',NULL,NULL,NULL,NULL,200,8,'B',72,'\\[\\sqrt {\\frac{2}{{{m_e}}}\\left[ {({E_2} - {E_1}) - h{\\nu _{кр}}} \\right]}  \\approx 1,65 \\cdot {10^6}\\] м/с',NULL,6,' Вар.1 №31','2'),
