	(203,203,'При изучении гармонических колебаний груз на пружине заменили на другой, масса которого поменьше. Как при этом изменятся период колебаний и максимальная скорость груза при той же амплитуде колебаний?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу цифры, выбранные для каждой физической величины. Цифры в ответе могут повторяться. ','b2_v15_6.png',NULL,NULL,NULL,10,1,'D',78,'21','рис.',12,'Вар.15 №6','1'),
