	(205,205,'Давление идеального газа от среднеквадратичной скорости его частиц зависит (\\[p\\] -- давление, \\[\\vec{\\varepsilon}\\] -- средняя кинетическая энергия частицы) ...\n1) обратно пропорционально, т.к. более быстрые молекулы не дают вклада в давление\n2) прямо пропорционально, т.к. чем больше скорость частиц, тем больше их импульс\n3) квадратично, т.к. это следует из связи \\[V_{\\text{ср.кв.}}\\] с \\[\\vec{\\varepsilon}\\] и пропорциональностью \\[p\\] и \\[\\vec{\\varepsilon}\\]\n4) давление идеального газа зависит от скоростей отдельных частиц, а не от среднеквадратичной скорости',NULL,NULL,NULL,NULL,5,1,'D',29,'3',NULL,12,'Вар.15 №8','1'),
