	(241,241,'Относительная влажность воздуха \\[\\varphi\\] при абсолютной температуре \\[T\\] и объёме сосуда \\[V\\], давление насыщенного пара воздуха при этой температуре \\[p_o\\]. Установите соответствие между физическими величинами и формулами для их расчёта (\\[p\\] - давление водяного пара, \\[W\\] - энергия молекул воды в сосуде, \\[w_0\\] -- энергия одной молекулы).\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.','b2_v16_12.png',NULL,NULL,NULL,10,1,'D',33,'23','рис.',13,'Вар.16 №12','1'),
	(242,242,'К двум соединённым между собой проводом металлическим шарикам поднесли положительно заряженное тело (см. рис.). Каким электрическим зарядом будут обладать тела после снятия провода?\n1) А -- положительное; В -- отрицательное\n2) А -- положительное; В -- положительное\n3) А -- отрицательное; В -- положительное\n4) А -- отрицательное; В -- отрицательное','b2_v16_13.png',NULL,NULL,NULL,5,1,'D',40,'3','рис.',13,'Вар.16 №13','1'),
	(243,243,'По бесконечно длинному проводнику течёт увеличивающийся ток \\[I\\] (см. рис.). Как направлены индукционные токи на участках 1--2 и 3--4?\n1) 1--2 вверх; 3--4 вверх\n2) 1--2 вниз; 3--4 вниз\n3) 1--2 вверх; 3--4 вниз\n4) 1--2 вниз; 3--4 вверх','b2_v16_14.png',NULL,NULL,NULL,5,1,'D',59,'2','рис.',13,'Вар.16 №14','1'),
	(244,244,'Между точками \\[A\\] и \\[B\\] поддерживают напряжение \\[100\\] В (см.рис.). Все сопротивления одинаковы. Чему равно напряжение на \\[R_2\\]?\nОтвет: В.','b2_v16_15.png',NULL,NULL,NULL,5,1,'D',51,'50','рис.',13,'Вар.16 №15','1'),
