	(246,246,'Источник ЭДС с внутренним сопротивлением нагружен на реостат. Что произойдёт с ЭДС источника и силой тока в нём, если сопротивление реостата увеличивать?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b2_v16_17.png',NULL,NULL,NULL,10,1,'D',51,'32','рис.',13,'Вар.16 №17','1'),
	(247,247,'К источнику ЭДС присоединили два конденсатора переменной ёмкости, соединённых последовательно. Ёмкость одного из них увеличивают. Как при этом будут изменяться заряд на обкладках конденсатора, чья ёмкость не изменяется, и энергия, запасённая в системе конденсаторов?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b2_v16_18.png',NULL,NULL,NULL,10,1,'D',51,'11','рис.',13,'Вар.16 №18','1'),
	(248,248,'У изотопа А массовое число больше, чем у изотопа В. Как отличаются составы ядер этих изотопов?\n1) ядро А содержит больше протонов, чем ядро В\n2) ядро А содержит больше нейтронов, чем ядро В\n3) ядро А содержит больше протонов и нейтронов, чем ядро В\n4) в ядре А, кроме нейтронов и протонов, имеются электроны',NULL,NULL,NULL,NULL,5,1,'D',76,'2',NULL,13,'Вар.16 №19','1'),
	(249,249,'При \\[\\beta\\]-распаде ядра \\[^M_AX\\] получилось ядро \\[Z\\] ...\n1) \\[^{M-2}_{A-2}Z\\]\n2) \\[^{M-4}_{A-2}Z\\]\n3) \\[^{M-4}_{A+1}Z\\]\n4) \\[^{\\;\\;\\;\\:M}_{A+1}Z\\] ',NULL,NULL,NULL,NULL,5,1,'D',77,'4',NULL,13,'Вар.16 №20','1'),
	(250,250,'Изначально было \\[2\\cdot10^{34}\\] ядер радиоактивного изотопа. Через время, равное \\[0,\\!5\\] времени полураспада, их осталось ...\nОтвет: \\[\\cdot10^{34}\\]',NULL,NULL,NULL,NULL,5,1,'D',77,'1.41',NULL,13,'Вар.16 №21','1'),
	(251,251,'Монохроматический свет с длиной волны \\[\\lambda\\] падает на металлическую пластинку и вызывает фотоэффект. Эту пластинку заменяют пластинкой из другого металла с меньшей работой выхода. Что произойдёт с фототоком насыщения и модулем запирающего напряжения?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b2_v16_22.png',NULL,NULL,NULL,10,1,'D',72,'31','рис.',13,'Вар.16 №22','1'),
	(252,252,'Имеются два амперметра. Один \\[A_1\\] измеряет номинальный ток \\[40\\] мА, второй \\[A_2\\] -- \\[20\\] мА. Классы точности у амперметров одинаковы. Какой амперметр позволит измерить ток \\[15\\] мА с меньшей погрешностью?\n1) \\[A_1\\]\n2) \\[A_2\\]\n3) погрешности одинаковы\n4) по приведённым данным ответить невозможно',NULL,NULL,NULL,NULL,5,1,'D',51,'2',NULL,13,'Вар.16 №23','1'),
	(253,253,'Две железные пластинки подвешены на нитях вертикально. Снизу к каждой из пластинок по очереди подносят постоянный магнит, повёрнутый к пластинкам северным полюсом. Пластинка А притягивается к магниту, пластинка Б отталкивается от него. Выберите два верных утверждения.\n1) Пластинка А постоянный магнит.\n2) Пластинка А неметаллический кусок железа.\n3) Пластинка А либо постоянный магнит, либо неметаллический кусок железа.\n4) Пластинка Б постоянный магнит.\n5) Пластинка Б неметаллический кусок железа. ','b2_v16_24.png',NULL,NULL,NULL,10,1,'D',54,'34','рис.',13,'Вар.16 №24','1'),
	(254,254,'Брусок движется по наклонной плоскости, составляющей угол \\[30^{\\circ}\\] с горизонтом, равномерно. Чему равен коэффициент трения между бруском и плоскостью?',NULL,NULL,NULL,NULL,30,1,'D',13,'0.58',NULL,13,'Вар.16 №25','1'),
	(255,255,'В калориметре находится \\[2\\] кг воды при \\[0^{\\circ}\\]С. В воду впустили \\[0,\\!2\\] кг водяного пара, находящегося при \\[100^{\\circ}\\]С. Какая температура установится в калориметре после теплообмена? Теплоёмкостью калориметра и теплообменом с окружающей средой пренебречь.\nОтвет: \\[^{\\circ}\\]C.',NULL,NULL,NULL,NULL,30,1,'D',34,'58.9',NULL,13,'Вар.16 №26','1'),
	(256,256,'Дифракционная решётка с периодом \\[10^{-6}\\] м расположена параллельно экрану. На решётку по нормали к ней падает плоская монохроматическая волна с длиной \\[0,\\!4\\] мкн. По какому количеству максимумов, наблюдаемому на экране, можно проводить спектральный анализ?',NULL,NULL,NULL,NULL,30,1,'D',69,'4',NULL,13,'Вар.16 №27','1'),
	(257,257,'В схеме на рисунке сопротивление резистора и полное сопротивление реостата равны \\[R\\], ЭДС батарейки равна \\[E\\], её внутреннее сопротивление ничтожно (\\[r=0\\]). Как ведут себя (увеличиваются, уменьшаются, остаются постоянными) показания идеального вольтметра при перемещении движка реостата из крайнего верхнего в крайнее нижнее положение?\nОтвет поясните, указав, какие физические закономерности Вы использовали для объяснения.','b2_v16_28.png',NULL,NULL,NULL,80,3,'C',51,NULL,'рис.',13,'Вар.16 №28','1'),
	(258,258,'Снаряд массой \\[2m\\] разрывается в полёте на две равные части, одна из которых продолжает движение по направлению движения снаряда, а другая -- в противоположную сторону. В момент разрыва суммарная кинетическая энергия осколков увеличивается за счёт энергии взрыва на величину \\[\\Delta E\\]. Модуль скорости осколка, движущегося по направлению движения снаряда, равен \\[v_1\\], а модуль скорости второго осколка равен \\[v_2\\]. Найдите \\[\\Delta E\\].',NULL,NULL,NULL,NULL,100,4,'C',22,'\\[\\frac{{m{{({\\upsilon _1} + {\\upsilon _2})}^2}}}{4}\\]',NULL,13,'Вар.16 №29','1'),
	(259,259,'Один моль аргона, находящийся в цилиндре при температуре \\[T_1 = 600\\] К и давлении \\[p_1=4\\cdot 10^5\\] Па, расширяется и одновременно охлаждается так, что его температура при расширении обратно пропорциональна объёму. Конечное давление газа \\[p_2=10^5\\] Па. Какую работу совершил газ при расширении, если он отдал холодильнику количество теплоты \\[Q=1247\\] Дж?',NULL,NULL,NULL,NULL,200,8,'B',37,'572 Дж',NULL,13,'Вар.16 №30','1'),
	(260,260,'В цепи, изображённой на рисунке, ЭДС батареи равна \\[100\\] В, сопротивления резисторов \\[R_1=10\\] Ом и \\[R_2=6\\] Ом, а ёмкости конденсатором \\[C_1=100\\] мкФ и \\[C_2=60\\] мкФ. В начальном состоянии ключ \\[K\\] разомкнут, а конденсаторы не заряжены. Через некоторое время после замыкания ключа в системе установится равновесие. Какую работу совершат сторонние силы к моменту установления равновесия?','b2_v16_31.png',NULL,NULL,NULL,150,6,'B',51,'\\[\\frac{{{C_1} \\cdot {C_2}}}{{{C_1} + {C_2}}} \\cdot {\\varepsilon ^2}\\]','рис.',13,'Вар.16 №31','1'),
	(261,261,'Металлическая пластинка облучается светом частотой \\[\\nu=1,\\!6\\cdot10^{15}\\] Гц. Работа выхода электронов из данного металла равна \\[3,\\!7\\] эВ. Вылетающие из пластины фотоэлектроны попадают в однородное электрическое поле напряжённостью \\[130\\] В\\[/\\]м, причём вектор напряжённости \\[\\vec{E}\\] направлен к пластине перпендикулярно её поверхности. Какова максимальная кинетическая энергия фотоэлектронов на расстоянии \\[2\\] см от пластины?',NULL,NULL,NULL,NULL,150,6,'B',72,'\\[4,8 \\cdot {10^{ - 20}}\\] Дж',NULL,13,'Вар.16 №32','1'),
