	(269,269,'Большую банку с водой при температуре \\[0^{\\circ}\\]C поставили в морозильную камеру бытового холодильника. Что будет происходить с температурой воды до того, как она замёрзнет, и почему? Температура воды:\n1) повысится, т.к. при замерзании воды при создании кристаллической решётки льда выделяется тепло\n2) не изменится, т.к. при замерзании лёд отдаёт тепло окружающей среде, а затем получает его обратно\n3) не изменится, т.к. отдаваемое водой тепло идёт на создание кристаллической решётки льда\n4) понизится, т.к. вода отдаёт тепло холодильнику',NULL,NULL,NULL,NULL,5,1,'D',34,'3',NULL,13,'Вар.17 №8','1'),
