	(283,283,'Монохроматический свет с длиной волны \\[\\lambda\\] падает на металлическую пластинку и вызывает фотоэффект. Длину волны уменьшают. Что произойдёт с фототоком насыщения, работой выхода, если интенсивность света, падающего на металл, не изменяется?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b2_v17_22.png',NULL,NULL,NULL,10,1,'D',72,'23','рис.',13,'Вар.17 №22','1'),
