	(285,285,'Имеются два лёгких диэлектрических шарика, подвешенных на нитях. При поднесении к ним по очереди положительно заряженного тела шарик Б притягивается к нему, а шарик А отталкивается. Выберите два верных утверждения.\n1) Шарик А заряжён положительно. \n2) Шарик А заряжён отрицательно.\n3) Шарик Б заряжён положительно. \n4) Шарик Б заряжён отрицательно.\n5) Шарик Б либо нейтрален, либо заряжён отрицательно.',NULL,NULL,NULL,NULL,10,1,'D',39,'15',NULL,13,'Вар.17 №24','1'),
