	(289,289,'Катушка, обладающая индуктивностью \\[L\\], соединена с источником питания ЭДС \\[\\varepsilon\\] и двумя одинаковыми резисторами \\[R\\]. Электрическая схема соединения показана на рисунке а). В начальный момент ключ в цепи разомкнут.\nВ момент времени \\[t=0\\] ключ замыкают, что приводит к изменениям силы тока, регистрируемым амперметром, как показано на рис. б). Основываясь на известных физических законах, объясните, почему при замыкании ключа сила тока плавно увеличивается до некоторого нового значения -- \\[I_1\\]. Определите значение силы тока \\[I_1\\]. Внутренним сопротивлением источника тока пренебречь.','b2_v17_28.png',NULL,NULL,NULL,80,3,'C',63,NULL,'рис.',13,'Вар.17 №28','1'),
	(290,290,'На гладкой горизонтальной поверхности стола покоится горка с двумя вершинами, высоты которых \\[h\\] и \\[4h\\] (см. рис.). На правой вершине горки находится шайба. Масса горки в 8 раз больше массы шайбы. От незначительного толчка шайба и горка приходят в движение, причём шайба движется влево, не отрываясь от гладкой поверхности горки, а поступательно движущаяся горка не отрывается от стола. Найдите скорость шайбы на левой вершине горки.','b2_v17_29.png',NULL,NULL,NULL,150,6,'B',22,'\\[2,3\\sqrt {gh} \\]','рис.',13,'Вар.17 №29','1'),
