	(293,293,'Уровни энергии электрона в атоме водорода задаются формулой\n\\[E_n=-\\frac{13,\\!6}{n^2}\\text{эВ, где }n=1, 2, 3, \\ldots.\\]\nПри переходе атома из состояния \\[E_2\\] в состояние \\[E_1\\] атом испускает фотон. Попав на поверхность фотокатода, фотон выбивает фотоэлектрон. Длина волны света, соответствующая красной границе фотоэффекта для материала поверхности фотокатода, \\[\\lambda_{\\text{кр}}=300\\] нм. Чему равна максимально возможная кинетическая энергия фотоэлектрона?',NULL,NULL,NULL,NULL,150,6,'B',72,'\\[9,72 \\cdot {10^{ - 19}}\\] Дж',NULL,13,'Вар.17 №32','1'),
