	(310,310,'В однородном магнитном поле находится проводящий виток, ориентированный перпендикулярно линиям магнитной индукции. За некоторый промежуток времени поле уменьшают до нуля, вследствие чего по проводнику протекает некоторый заряд. Как изменяется ЭДС индукции и индукционный ток, если время выключения поля уменьшить?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b2_v18_17.png',NULL,NULL,NULL,10,1,'D',59,'11','рис.',14,'Вар.18 №17','1'),
