	(312,312,'Энергия электрона, находящегося в стационарном состоянии в своём атоме, -- это...\n1) его кинетическая энергия\n2) его потенциальная энергия взаимодействия с ядром\n3) сумма потенциальной и кинетической энергий\n4) \\[mc^2\\], где \\[m\\] -- масса электрона',NULL,NULL,NULL,NULL,5,1,'D',76,'3',NULL,14,'Вар.18 №19','1'),
