	(317,317,'На рисунке приведён экспериментально полученный график зависимости температуры от времени при нагревании некоторого вещества. Первоначально вещество находилось в жидком состоянии.\nВыберите из предложенного перечня два утверждения, соответствующие результатам опыта, и запишите в таблицу цифры, под которыми они указаны.\n1) Температура кипения равна \\[100^{\\circ}\\]C.\n2) Теплоёмкости в жидком и газообразном состоянии одинаковы.\n3) Наибольшей внутренней энергией вещество обладает в точке \\[D\\].\n4) Наименьшей внутренней энергией вещество обладает в точке \\[B\\].\n5) В точке \\[D\\] вещество находится в газообразном состоянии.','b2_v18_24_1.png',NULL,NULL,NULL,10,1,'D',34,'35','рис.',14,'Вар.18 №24','1'),
