	(319,319,'Если в нагрузке источника тока при сопротивлениях \\[27\\] Ом и \\[3\\] Ом выделяется одинаковая полезная мощность, то внутреннее сопротивление источника тока равно...\nОтвет: Ом.',NULL,NULL,NULL,NULL,30,1,'D',52,'9',NULL,14,'Вар.18 №26','1'),
