	(321,321,'Медное кольцо колеблется продолжительное время с почти неизменной амплитудой. На его пути поместили магнит так, чтобы в процессе колебания кольцо \"надевалось\" на магнит. Как это повлияет на колебания кольца (см. рис.)?','b2_v18_28.png',NULL,NULL,NULL,80,3,'C',59,NULL,'рис.',14,'Вар.18 №28','1'),
