	(392,392,'Отец везет сына на санках по горизонтальной заснеженной дороге с постоянной скоростью. Отец совершил механическую работу, равную \\[2000\\] Дж, проделав путь \\[50\\] м. Определите модуль силы трения, действовавшей на санки во время движения.\nОтвет: Н.',NULL,NULL,NULL,NULL,5,1,'D',12,'\\[40\\]',NULL,16,'Вар.3 №3','2'),
	(393,393,'На рисунке приведен график зависимости координаты колеблющегося тела от времени. Чему равна частота колебаний тела?\nОтвет: Гц.','b2_v3_4.png',NULL,NULL,NULL,5,1,'D',61,'\\[0,\\!25\\]','рис.',16,'Вар.3 №4','2'),
	(394,394,'Деревянный кубик с ребром \\[10\\] см плавает частично погруженный в воду. Его начинают медленно погружать, действуя силой, направленной вертикально вниз. В таблице приведены значения модуля силы, под действием которой кубик находится в равновесии частично или полностью погруженный в воду. Погрешность измерения силы составила \\[0,\\!1\\] Н. Выберите два верных утверждения на основании данных, приведенных в таблице.\n1) В опыте № 6 сила Архимеда, действующая на кубик, меньше, чем в опыте № 2. \n2) В опыте № 7 кубик погружен в воду полностью. \n3) Масса кубика равна \\[0,\\!5\\] кг. \n4) В опыте № 4 кубик погружен в воду на половину своего объема. \n5) Плотность кубика равна \\[400\\] кг/м\\[^3\\].','b2_v3_5.png',NULL,NULL,NULL,10,1,'D',27,'\\[23\\] или \\[32\\]','рис.',16,'Вар.3 №5','2'),
	(395,395,'В результате перехода спутника Земли с одной круговой орбиты на другую его центростремительное ускорение уменьшается. Как изменяются в результате этого перехода потенциальная энергия спутника в поле тяжести Земли и скорость его движения по орбите?\nДля каждой величины определите соответствующий характер изменения: \n1) увеличивается \n2) уменьшается \n3) не изменяется \nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в \nответе могут повторяться.','b2_v3_6.png',NULL,NULL,NULL,10,1,'D',15,'\\[12\\]','рис.',16,'Вар.3 №6','2'),
	(396,396,'Тело брошено с горизонтальной поверхности со скоростью \\[v\\] под углом \\[\\alpha\\] к горизонту. \nСопротивление воздуха пренебрежимо мало. \nУстановите соответствие между физическими величинами, характеризующими движение тела, и формулами, выражающими их в рассматриваемой задаче. \nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры.','b2_v3_7.png',NULL,NULL,NULL,5,1,'D',6,'\\[13\\]','рис.',16,'Вар.3 №7','2'),
	(397,397,'В сосуде находится некоторое количество идеального газа. Определите отношение температур газа \\[\\displaystyle\\frac{T_1}{T_2}\\], в состояниях 1 и 2 (см. рис.).','b2_v3_8.png',NULL,NULL,NULL,5,1,'D',30,'\\[6\\]','рис.',16,'Вар.3 №8','2'),
	(398,398,'Какое количество теплоты передано газу, если его внутренняя энергия увеличилась на \\[200\\] Дж, а газ совершил работу, равную \\[500\\] Дж?\nОтвет: Дж.',NULL,NULL,NULL,NULL,5,1,'D',37,'\\[700\\]',NULL,16,'Вар.3 №9','2'),
	(399,399,'Воспользовавшись таблицами, определите, каково должно быть примерное отношение масс \\[\\displaystyle\\frac{m_{Fe}}{m_{Al}}\\] железного и алюминиевого тел, чтобы при получении одного и того же количества теплоты они нагрелись на одно и то же число градусов. Ответ округлите до целых.',NULL,NULL,NULL,NULL,5,1,'D',34,'\\[2\\]','рис.',16,'Вар.3 №10','2'),
	(400,400,'В сосуде неизменного объема при комнатной температуре находилась смесь водорода и гелия, по \\[1\\] моль каждого. Половину содержимого сосуда выпустили, а затем добавили в сосуд \\[1\\] моль водорода. Считая газы идеальными, а их температуру постоянной, выберите из предложенного перечня два утверждения, которые соответствуют результатам проведенных экспериментальных исследований, и укажите их номера. \n1) Парциальное давление водорода уменьшилось. \n2) Давление смеси газов в сосуде не изменилось. \n3) Концентрация гелия увеличилась. \n4) В начале опыта концентрации газов были одинаковые. \n5) В начале опыта массы газов были одинаковые.',NULL,NULL,NULL,NULL,10,1,'D',32,'\\[24\\] или \\[42\\]',NULL,16,'Вар.3 №11','2'),
	(401,401,'На рисунках А и Б приведены графики двух процессов 1 -- 2 и 3 -- 4, каждый из которых совершается одним молем аргона. Графики построены в координатах \\[р -- V\\] и \\[V -- Т\\], где \\[р\\] -- давление, \\[V\\] -- объем и \\[Т\\] -- абсолютная температура газа. Установите соответствие между графиками и утверждениями, характеризующими изображенные на графиках процессы.\n\nК каждой позиции первого столбца подберите соответствующую позицию второго и за-\nпишите в таблицу выбранные цифры под соответствующими буквами.','b2_v3_12.png',NULL,NULL,NULL,10,1,'D',30,'\\[14\\]','рис.',16,'Вар.3 №12','2'),
	(402,402,'На рисунке изображен проволочный виток, по которому течет электрический ток в направлении, указанном стрелкой. Виток расположен в плоскости чертежа. Куда направлен (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вектор индукции магнитного поля тока в центре витка? Ответ запишите словом (словами).','b2_v3_13.png',NULL,NULL,NULL,5,1,'D',54,'К наблюдателю','рис.',16,'Вар.3 №13','2'),
	(403,403,'На рисунке представлен участок электрической цепи. Каково отношение количеств теплоты \\[Q_1/Q_2\\], выделившихся на резисторах \\[R_1\\] и \\[R_2\\] за одно и то же время?','b2_v3_14.png',NULL,NULL,NULL,5,1,'D',52,'\\[2\\]','рис.',16,'Вар.3 №14','2'),
	(404,404,'Угол падения света на горизонтально расположенное плоское зеркало равен \\[30^{\\circ}\\]. Каким станет угол отражения света, если повернуть зеркало на \\[10^{\\circ}\\] так, как показано на рисунке?\nОтвет: \\[^{\\circ}\\]','b2_v3_15.png',NULL,NULL,NULL,5,1,'D',66,'\\[20\\]','рис.',16,'Вар.3 №15','2'),
	(405,405,'Два незаряженных стеклянных кубика 1 и 2 сблизили вплотную и поместили в электрическое поле, напряженность которого направлена горизонтально вправо, как показано в верхней части рисунка. Затем кубики раздвинули и уже потом убрали электрическое поле (нижняя часть рисунка). Выберите из предложенного перечня два утверждения, которые соответствуют результатам проведенных экспериментальных исследований, и укажите их номера. \n1) После того, как кубики раздвинули, заряд первого кубика оказался отрицателен, \nзаряд второго -- положителен. \n2) После помещения в электрическое поле электроны из первого кубика стали переходить во второй. \n3) После того, как кубики раздвинули, заряды обоих кубиков остались равными нулю.\n4) До разделения кубиков в электрическом поле левая поверхность 1-го кубика была заряжена отрицательно. \n5) До разделения кубиков в электрическом поле правая поверхность 2-го кубика была заряжена отрицательно.','b2_v3_16.png',NULL,NULL,NULL,10,1,'D',39,'\\[34\\] или \\[43\\]','рис.',16,'Вар.3 №16','2'),
	(406,406,'Частица массой \\[m\\], несущая заряд \\[q\\], движется в однородном магнитном поле с индукцией \\[B\\] по окружности радиуса \\[R\\] со скоростью \\[v\\]. Что произойдет с радиусом орбиты и кинетической энергией частицы при увеличении скорости ее движения?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b2_v3_17.png',NULL,NULL,NULL,10,1,'D',57,'\\[11\\]','рис.',16,'Вар.3 №17','2'),
	(407,407,'Заряд неподвижного металлического уединенного кубика равен \\[q\\]. Точка \\[O\\] -- центр кубика, точки \\[B\\] и \\[C\\] -- центры его граней, \\[AB=OB\\], \\[CD=OC\\], \\[\\displaystyle OM=\\frac{OB}{2}\\]. Модуль напряженности электростатического поля заряда \\[Q\\] в точке \\[A\\] равен \\[E_A\\].\nУстановите соответствие между физическими величинами и их значениями.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b2_v3_18_1.png','b2_v3_18_2.png',NULL,NULL,10,1,'D',46,'\\[21\\]','рис.',16,'Вар.3 №18','2'),
	(408,408,'В результате серии радиоактивных распадов уран \\[^{238}_{\\;\\;92}U\\] превращается в свинец \\[^{206}_{\\;\\;82}Pb\\]. Какое количество \\[\\alpha\\]-распадов и \\[\\beta\\]-распадов он испытывает при этом?','b2_v3_19.png',NULL,NULL,NULL,5,1,'D',76,'\\[86\\]','рис.',16,'Вар.3 №19','2'),
	(409,409,'Период полураспада ядер радиоактивного изотопа висмута \\[19\\] мин. За какой промежуток времени распадется \\[75\\%\\] ядер висмута в исследуемом образце?\nОтвет: мин. ',NULL,NULL,NULL,NULL,5,1,'D',77,'\\[38\\]',NULL,16,'Вар.3 №20','2'),
	(410,410,'В опытах по фотоэффекту взяли пластину из металла с работой выхода \\[3,\\!4\\cdot10^{-19}\\] Дж и стали освещать ее светом частоты \\[6\\cdot10^{14}\\] Гц. Как изменится работа выхода фотоэлектронов из металла и максимальная кинетическая энергия фотоэлектронов \\[E_{max}\\], вылетающих с поверхности металла, если увеличить интенсивность падающего света, не изменяя его частоту? Для каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b2_v3_21.png',NULL,NULL,NULL,10,1,'D',72,'\\[33\\]','рис.',16,'Вар.3 №21','2'),
	(411,411,'Ученики исследовали зависимость силы трения скольжения от массы груза. Результаты измерений представлены в виде графика на рисунке. Погрешность измерения массы равна \\[0,\\!1\\] кг, силы -- \\[1\\] Н.\nЧему равна с учетом погрешности измерений сила трения, действующая на груз массы \\[1\\] кг?\nОтвет: \\[(\\_\\_\\_\\pm\\_\\_\\_)\\] H.','b2_v3_22.png',NULL,NULL,NULL,10,1,'D',12,'\\[21\\]','рис.',16,'Вар.3 №22','2'),
	(412,412,'Пучок белого цвета, пройдя через призму, разлагается в спектр. Была выдвинута гипотеза, что ширина спектра, получаемого на стоящем за призмой экране, зависит от угла падения пучка на грань призмы. Необходимо экспериментально проверить эту гипотезу. Какие два опыта нужно провести для такого исследования?','b2_v3_23.png',NULL,NULL,NULL,10,1,'D',69,'\\[13\\] или \\[31\\]','рис.',16,'Вар.3 №23','2'),
	(413,413,'Скорость брошенного мяча непосредственно перед ударом о стену была вдвое больше его скорости сразу после удара. Какое количество теплоты выделилось при ударе, если перед ударом кинетическая энергия мяча была равна \\[20\\] Дж?\nОтвет: Дж.',NULL,NULL,NULL,NULL,30,1,'D',22,'\\[15\\]',NULL,16,'Вар.3 №24','2'),
	(414,414,'Точка В находится в середине отрезка АС. Неподвижные точечные заряды \\[-q\\] и \\[-2q\\] (\\[q=1\\] нКл) расположены в точках А и С соответственно (см. рис.). Какой положительный заряд надо поместить в точку С взамен заряда \\[-2q\\], чтобы модуль напряженности электрического поля в точке В увеличился в \\[2\\] раза?\nОтвет: нКл.','b2_v3_25.png',NULL,NULL,NULL,30,1,'D',44,'\\[1\\]','рис.',16,'Вар.3 №25','2'),
	(415,415,'Пучок параллельных световых лучей падает нормально на тонкую собирающую линзу диаметром \\[6\\] см с отптической силой \\[5\\] дптр (см. рис.). Экран расположен за линзой на расстоянии \\[10\\] см. Рассчитайте внешний диаметр светлого пятна, созданного линзой на экране.\nОтвет: см. ','b2_v3_26.png',NULL,NULL,NULL,30,1,'D',68,'\\[3\\]','рис.',16,'Вар.3 №26','2'),
	(416,416,'В цилиндрическом сосуде под поршнем длительное время находятся вода и ее пар. Поршень начинают вдвигать в сосуд. При этом температура воды и пара остается неизменной. Как будет меняться при этом масса жидкости в сосуде? Ответ поясните, опираясь на законы молекулярной физики. ',NULL,NULL,NULL,NULL,100,4,'С',33,'Масса жидкости в сосуде будет увеличиваться',NULL,16,'Вар.3 №27','2'),
	(417,417,'Грузы массами \\[M=1\\] кг и \\[m\\] связаны легкой нерастяжимой нитью, переброшенной через блок, по которому нить может скользить без трения (см. рис.). Груз массой \\[M\\] находится на шероховатой наклонной плоскости (угол наклона плоскости к горизонту \\[\\alpha=30^{\\circ}\\], коэффициентр трения \\[\\mu = 0,\\!3\\]). Чему равно максимальное значение массы \\[m\\], при котором система грузов еще не выходит из первоначального состояния покоя?','b2_v3_28.png',NULL,NULL,NULL,250,10,'A',13,'\\[m_{max}=M(\\sin\\alpha+\\mu\\cos\\alpha)\\approx0,\\!76\\] кг.',NULL,16,'Вар.3 №28','2'),
	(418,418,'Воздушный шар объемом \\[V=2500\\] м\\[^3\\] с массой оболочки \\[m_{\\text{об}}=400\\] кг имеет внизу отверстие, через которое воздух в шаре нагревается горелкой. До какой минимальной температуры \\[t_1\\] нужно нагреть воздух в шаре, чтобы шар взлетел вместе с грузом (корзиной и воздухоплавателем) массой \\[m_{\\text{г}}=200\\] кг? Температура окружающего воздуха \\[t=7^{\\circ}\\]C, его плотность \\[\\rho=1,\\!2\\] кг/м\\[^3\\]. Оболочку шара считать нерастяжимой. ',NULL,NULL,NULL,NULL,200,8,'B',27,'\\[T_1=\\frac{\\rho VT}{\\rho V-m_{\\text{об}}-m_{\\text{г}}}=350\\;K\\]',NULL,16,'Вар.3 №29','2'),
	(419,419,'Горизонтально расположенный проводник длиной \\[1\\] м движется равноускоренно в вертикальном однонродном магнитном поле, индукция которого равна \\[0,\\!5\\] Тл. Скорость проводника направлена горизонтально, перпендикулярно проводнику (см. рис.). Начальная скорость проводника равна нулю, а его ускорение \\[8\\] м/c\\[^2\\]. Какова ЭДС индукции на концах проводника в тот момент, когда он переместился на \\[1\\] м?','b2_v3_30.png',NULL,NULL,NULL,200,8,'B',60,'\\[|\\varepsilon|=Bl\\sqrt{2ax}=2\\] В.',NULL,16,'Вар.3 №30','2'),
	(420,420,'Фотокатод облучают светом с длиной волны \\[\\lambda=300\\] нм. Красная граница фотоэффекта для вещества фотокатода \\[\\lambda_0=450\\] нм. Какое запирающее напряжение \\[U\\] нужно создать между анодом и катодом, чтобы фототок прекратился?',NULL,NULL,NULL,NULL,200,8,'B',72,'\\[\\displaystyle U=\\frac{hc}{e}(\\frac{1}{\\lambda}-\\frac{1}{\\lambda_0})\\approx1,\\!4\\] В.',NULL,16,'Вар.3 №31','2'),
	(421,421,'Вагонетка массой \\[m\\] движется по горизонтальным рельсам со скоростью \\[v=6\\] м/с. Определите, какой станет скорость вагонетки, когда на нее сверху вертикально опустят груз, масса которого равна половине массы вагонетки.\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,'\\[4\\]',NULL,17,'iwc №1','4'),
	(422,422,'Вдоль одной прямой движутся два шара массами \\[m_1=1\\] кг и \\[m_2=2\\] кг со скоростями, равными соответственно \\[v_1=10\\] м/с и \\[v_2=5\\] м/с. Первый шар движется за вторым и, догнав, прилипает к нему. Каков суммарный импульс шаров после удара?\nОтвет: кг\\[\\cdot\\]м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,'\\[20\\]',NULL,17,'iwc №2','4'),
	(423,423,'Легковой автомобиль и грузовик массами \\[m=1000\\] кг и \\[M=5000\\] кг движутся с постоянными скоростями. Скорость автомобиля равна \\[v_1=110\\] км/ч, а отношение импульса грузовика к импульсу автомобиля равно 2. Определите скорость грузовика. \nОтвет: км/ч.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,'\\[44\\]',NULL,17,'iwc №3','4'),
	(424,424,'Человек везет ребенка на санках с постоянной скоростью по горизонтальной заснеженной дороге. Модуль силы трения санок о снег равен \\[30\\] Н. Человек совершил механическую работу, равную \\[3000\\] Дж. Определите пройденный им путь.\nОтвет: м.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[100\\]',NULL,17,'iwc №4','4'),
	(425,425,'Мяч массой \\[0,\\!5\\] кг летит со скоростью \\[4\\] м/с. Какова его кинетическая энергия?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[4\\]',NULL,17,'iwc №5','4'),
	(426,426,'Шайба после удара клюшкой приобрела скорость \\[13\\] м/с и стала скользить вверх по ледяной горке. Чему равна скорость шайбы на вершине горки, если ее высота \\[8\\] м? Трением шайбы о лед пренебречь.\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[3\\]',NULL,17,'iwc №6','4'),
	(427,427,'Первоначальное удлинение пружины равно \\[\\Delta l\\]. Во сколько раз уменьшится потенциальная энергия пружины, если ее удлинение станет вдвое меньше?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[4\\]',NULL,17,'iwc №7','4'),
	(428,428,'Скорость брошенного мяча непосредственно перед ударом о стену была вдвое больше его скорости сразу после удара. Определите кинетическую энергию мяча до удара, если при ударе выделилось количество теплоты, равное \\[15\\] Дж.\nОтвет: Дж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[20\\]',NULL,17,'iwc №8','4'),
	(429,429,'В неподвижно висящий на нити длиной \\[40\\] см груз массой \\[81\\] г попадает летящая горизонтально пластилиновая пуля массой \\[9\\] г, в результате чего груз с прилипшей к нему пулей начинает совершать колебания. Максимальный угол отклонения нити от вертикали при этом \\[\\alpha=60^{\\circ}\\]. Какова скорость пули перед попаданием в груз?\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[20\\]',NULL,17,'iwc №9','4'),
	(430,430,'Камень брошен вверх под углом к горизонту. Сопротивление воздуха пренебрежимо мало. Как меняются с набором высоты модуль ускорения камня и его потенциальная энергия в поле силы тжести?\nДля каждой величины определите соответсвующий характер изменения:\n1) увеличивается\n2) уменьшается\n3) не изменяется\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b4_iwc_10.png',NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[31\\]','рис.',17,'iwc №10','4'),
	(431,431,'Автобус массой \\[m\\], движущийся по прямолинейному горизонтальному участку дороги со скоростью \\[v\\], тормозит до полной остановки. Колеса автобуса при торможении не вращаются. Коэффициент трения между колесами и дорогой равен \\[\\mu\\]. Установите соответствие между физическими величинами и формулами, по которым их можно рассчитать.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b4_iwc_11.png',NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[43\\]','рис.',17,'iwc №11','4'),
	(432,432,'Среднее давление пороховых газов в стволе орудия равно \\[5\\cdot10^8\\] Па. Какова длина ствола орудия, если скорость вылетевшего из него снаряда \\[1,\\!5\\] км/с? Диаметр ствола \\[45\\] мм, масса снаряда \\[2\\] кг. (Трение пренебрежимо мало.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[\\displaystyle l=\\frac{2mv^2}{\\pi d^2p}\\approx 2,\\!8\\] м.',NULL,17,'iwc №12','4'),
	(433,433,'По длинной доске массой \\[M=2\\] кг, находящейся на гладкой горизонтальной плоскости, скользит шайба массой \\[m=0,\\!5\\] кг. Коэффициент трения между шайбой и доской \\[\\mu=0,\\!2\\]. В начальный момент времени скорость шайбы \\[v_0=2\\] м/с, а доска покоится. В какой момент времени \\[\\tau\\] шайба перестает скользить по доске?','b4_iwc_13.png',NULL,NULL,NULL,300,12,'A',22,'\\[\\displaystyle \\tau=\\frac{v}{a}=\\frac{Mv}{\\mu mg}=\\frac{Mv_0}{\\mu g(M+m)}=0,\\!8\\] с.',NULL,17,'iwc №13','4'),
	(434,434,'Снаряд выпущен из пушки вертикально вверх с начальной скоростью \\[v_0=10\\] м/с. В точке максимального подъема снаряд разорвался на два осколка, массы которых относятся как \\[\\displaystyle\\frac{m_1}{m_2}=\\frac{2}{1}\\]. Осколок большей массы упал на землю первым со скоростью \\[2v_0\\]. До какой максимальной высоты \\[h_{max}\\] может подняться осколок меньшей массы?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[h_{max}=\\frac{13v_0^2}{2g}=65\\] м.',NULL,17,'iwc №14','4'),
	(435,435,'Груз массой \\[m=2\\] кг, лежащий на горизонтальной плоскости, прикреплен к одному концу легкой пружины жесткостью \\[k=100\\] Н/м, другой конец которой закреплен неподвижно (см. рис.). Груз смещают по горизонтали, растягивая пружину, затем отпускают с начальной скоростью, равной нулю. Груз движется в одном направлении и затем останавливается в положении, в котором пружина уже сжата. Максимальное растяжение пружины, при котором груз движется таким образом, равно \\[d=15\\] см. Найдите коэффициент трения \\[\\mu\\] груза о плоскость.',NULL,NULL,'b3_iwc_15_answer.png',NULL,NULL,NULL,NULL,22,'\\[\\displaystyle \\mu=\\frac{kd}{3mg}=0,\\!25\\].',NULL,17,'iwc №15','4'),
	(436,436,'Снаряд выпущен из пушки вертикально вверх с начальной скоростью \\[v_0=10\\] м/с. В точке максимального подъема снаряд разорвался на два осколка, массы которых относятся как \\[1:2\\]. Осколок меньшей массы \\[m_1\\] упал на землю со скоростью \\[u_1=20\\] м/с. Какова скорость \\[u_2\\] большего осколка массы \\[m_2\\] при его падении на землю? Считать поверхность земли плоской и горизонтальной.','b4_iwc_16.png',NULL,NULL,NULL,NULL,NULL,NULL,22,'\\[u_2=\\frac{\\sqrt{3v_0^2+u_1^2}}{2}=13,\\!2\\;\\text{м/с.}\\]',NULL,17,'iwc №16','4'),
	(437,437,'По двум тонким прямым проводникам, параллельным друг другу, текут одинаковые токи \\[i\\] (см. рис.), направление которых указано стрелками. Как направлен (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вектор индукции создаваемого ими магнитного поля в точке D? Ответ запишите словом (словами).','b4_mfe_1.png',NULL,NULL,NULL,NULL,NULL,NULL,54,'От наблюдателя','рис.',17,'mfe №1','4'),
	(438,438,'Два параллельных длинных проводника с токами \\[I_1=I_2\\] расположены перпендикулярно плоскости чертежа (см. рис). Как направлен (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вектор индукции магнитного поля, создаваемого этими проводниками в точке А? Ответ запишите словом (словами).','b4_mfe_2.png',NULL,NULL,NULL,NULL,NULL,NULL,54,'Вниз','рис.',17,'mfe №2','4'),
	(439,439,'Электрическая цепь, состоящая из четырех прямолинейных горизонтальных проводников (1-2, 2-3, 3-4, 4-1) и источника постоянного тока, находится в однородном магнитном поле, вектор магнитной индукции которого \\[\\vec{B}\\] направлен на нас перпендикулярно плоскости рисунка. Куда направлена (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вызванная этим полем сила Ампера, действующая на проводник 2-1? Ответ запишите словом (словами).','b4_mfe_3.png',NULL,NULL,NULL,NULL,NULL,NULL,56,'Вниз','рис.',17,'mfe №3','4'),
	(440,440,'По трем тонким параллельным проводникам текут одинаковые токи \\[I\\]. Как направлена (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) сила Ампера, действующая на проводник № 1 со стороны двух других (см. рис.)? Расстояния между соседними проводниками одинаковы. Ответ запишите словом (словами).','b4_mfe_4.png',NULL,NULL,NULL,NULL,NULL,NULL,56,'Вниз','рис.',17,'mfe №4','4'),
	(441,441,'В некоторый момент времени скорость \\[\\vec{v}\\] электрона \\[e^-\\], движущегося в магнитном поле, направлена вдоль оси \\[x\\] (см. рис.). Как направлен (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вектор магнитной индукции \\[\\vec{B}\\], если в этот момент сила Лоренца, действующая на электрон, направлена вдоль оси \\[y\\]?  Ответ запишите словом (словами).','b4_mfe_5.png',NULL,NULL,NULL,NULL,NULL,NULL,57,'От наблюдателя','рис.',17,'mfe №5','4'),
	(442,442,'В некоторый момент времени скорость \\[\\vec{v}\\] электрона \\[e^-\\], движущегося в магнитном поле, направлена вдоль оси \\[x\\] (см. рис.). Как направлен (вверх, вниз, влево, вправо, от наблюдателя, к наблюдателю) вектор магнитной индукции \\[\\vec{B}\\], если в этот момент сила Лоренца, действующая на электрон, направлена вдоль оси \\[y\\]?  Ответ запишите словом (словами).','b4_mfe_6.png',NULL,NULL,NULL,NULL,NULL,NULL,57,'К наблюдателю','рис.',17,'mfe №6','4'),
	(443,443,'Чему равна сила Ампера, действующая на стальной прямой проводник с током длиной \\[10\\] см и площадью поперечного сечения \\[2\\cdot 10^{-2}\\] мм\\[^2\\], если напряжение на нем \\[3,\\!6\\] В, а модуль вектора магнитной индукции \\[0,\\!4\\] Тл? Вектор магнитной индукции перпендикулярен проводнику. Удельное сопротивление стали \\[0,\\!12\\] Ом\\[\\cdot\\]мм\\[^2\\]/м.\nОтвет: Н.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,56,'\\[0,\\!24\\]',NULL,17,'mfe №7','4'),
	(444,444,'В однородном горизонтальном магнитном поле с индукцией \\[0,\\!01\\] Тл находится прямолинейный проводник, расположенный в горизонтальной плоскости перпендикулярно линиям индукции поля. Какой ток следует пропустить по проводнику, чтобы сила Ампера уравновесила силу тяжести? Масса единицы длины проводника \\[0,\\!01\\] кг/м.\nОтвет: А.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,56,'\\[10\\]',NULL,17,'mfe №8','4'),
	(445,445,'Заряженная частица движется в однородном магнитном поле по окружности радиусом \\[2\\cdot 10^{-3}\\] м. Сила, действующая на частицу со стороны магнитного поля, равна \\[1,\\!6\\cdot10^{-13}\\] Н. Какова кинетическая энергия движущейся частицы?\nОтвет: эВ.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,57,'\\[1000\\]',NULL,17,'mfe №9','4'),
	(446,446,'Две частицы, имеющие отношение масс \\[\\displaystyle\\frac{m_1}{m_2}=2\\], влетели в однородное магнитное поле перпендикулярно его линиям индукции и движутся по окружности с отношением радиусов \\[\\displaystyle\\frac{R_1}{R_2}=2\\]. Определите отношение зарядов \\[\\displaystyle\\frac{q_1}{q_2}\\] этих частиц, если отношение их скоростей \\[\\displaystyle\\frac{v_1}{v_2}=\\frac{1}{2}\\].',NULL,NULL,NULL,NULL,NULL,NULL,NULL,57,'\\[0,\\!5\\]',NULL,17,'mfe №10','4'),
	(447,447,'Заряженная частица массой \\[m\\], несущая положительный заряд \\[q\\], движется перпендикулярно линиям индукции однородного магнитного поля \\[\\vec{B}\\] по окружности радиусом \\[R\\]. \nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. К каждой позиции первого столбца подберите соотвествующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами. ','b4_mfe_11.png',NULL,NULL,NULL,NULL,NULL,NULL,57,'\\[34\\]','рис.',17,'mfe №11','4'),
	(448,448,'В первой экспериментальной установке положительно заряженная частица влетает в однородное магнитное поле так, что вектор \\[\\vec{v}_0\\] перпендикулярен индукции магнитного поля (см. рис.). Во второй экспериментальной установке вектор \\[\\vec{v}_0\\] той же частицы параллелен напряженности электрического поля (см. рис.). Влиянием силы тяжести пренебречь.\nУстановите соответствие между экспериментальной установкой и траекторией движения частицы в ней.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами. ','b4_mfe_12_1.png','b4_mfe_12_2.png',NULL,NULL,NULL,NULL,NULL,54,'\\[21\\]','рис.',17,'mfe №12','4'),
	(449,449,'Плоская рамка помещена в однородное магнитное поле, линии магнитной индукции которого перпендикулярны ее плоскости. Магнитный поток через рамку равен \\[0,\\!01\\] Вб. Чему будет равен магнитный поток через рамку, если площадь рамки и индукцию магнитного поля увеличить в 2 раза?\nОтвет: Вб.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,58,'\\[0,\\!04\\]',NULL,17,'mfe №13','4'),
	(450,450,'На рисунке приведен график зависимости магнитного потока через плоскость проволочного витка от времени. Определите модуль ЭДС индукции в витке в промежутке времени 5-6 с.\nОтвет: В.','b4_mfe_14.png',NULL,NULL,NULL,NULL,NULL,NULL,60,'\\[2\\]','рис.',17,'mfe №14','4'),
	(451,451,'В опыте по наблюдению электромагнитной индукции квадратная рамка из одного витка тонкого провода находится в однородном магнитном поле, перпендикулярном плоскости рамки. Индукция магнитного поля равномерно возрастает от 0 до максимального значения \\[B_{\\text{макс}}\\] за время \\[T\\]. При этом в рамке возбуждается ЭДС индукции, равная \\[4\\] мВ. Определите ЭДС индукции, возникающую в рамке, если \\[T\\] уменьшить в 2 раза, а \\[B_{\\text{макс}}\\] в 2 раза увеличить.\nОтвет: мВ.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,60,'\\[16\\]',NULL,17,'mfe №15','4'),
	(452,452,'На рисунке показаны два способа вращения квадратной проволочной рамки в однородном магнитном поле, линии индукции которого направлены из плоскости чертежа к нам. Вращение происходит вокруг оси MN, лежащей в плоскости рисунка. В первом случае максимальная величина ЭДС индукции, возникающей в рамке равна \\[6\\] мВ. Определите максимальную величину ЭДС индукции, возникающей в рамке во втором случае, если частота вращения рамки в обоих случаях одинакова.\nОтвет: мВ.','b4_mfe_16.png',NULL,NULL,NULL,NULL,NULL,NULL,60,'\\[6\\]','рис.',17,'mfe №16','4'),
	(453,453,'По П-образному проводнику, находящемуся в однородном магнитном поле, перпендикулярном плоскости проводника, скользит проводящая перемычка (см. рис.). На графике приведена зависимость ЭДС индукции, возникающей в перемычке при ее движении в магнитном поле. Пренебрегая сопротивлением проводника, выберите два верных утверждения о результатах этого опыта. Известно, что модуль индукции магнитного поля равен \\[B=0,\\!5\\] Тл, длина проводника \\[l=0,\\!1\\] м.\n1) Проводник сначала двигался равномерно, а затем покоился.\n2) Через \\[2\\] с скорость проводника была равна \\[8\\] м/с.\n3) В момент времени \\[4\\] с сила Ампера на проводник не действовала.\n4) В промежуток времени от \\[2\\] с до \\[6\\] с сила тока в проводнике не изменялась.\n5) Через \\[6\\] с проводник остановился.','b4_mfe_17.png',NULL,NULL,NULL,NULL,NULL,NULL,60,'\\[24\\] или \\[42\\]','рис.',17,'mfe №17','4'),
	(454,454,'Индуктивность катушки в колебательном контуре, изображенном на рисунке, равна \\[L=2\\] мГн. Какой должна быть индуктивность \\[L_x\\] катушки в контуре, чтобы при переводе ключа К из положения 1 в положение 2 период собственных электромагнитных колебаний в контуре увеличился в 3 раза?\nОтвет: мГн.','b4_mfe_18.png',NULL,NULL,NULL,NULL,NULL,NULL,62,'\\[18\\]','рис.',17,'mfe №18','4'),
	(455,455,'В идеальном колебательном контуре происходят колебания с периодом \\[T\\]. Максимальная энергия магнитного поля катушки равна \\[E\\]. Индуктивность катушки контура -- \\[L\\]. Установите соответствие между физическими величинами, характеризующими процесс колебаний, и формулами, по которым их можно рассчитать.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b4_mfe_19.png',NULL,NULL,NULL,NULL,NULL,NULL,62,'\\[31\\]','рис.',17,'mfe №19','4'),
	(456,456,'Конденсатор колебательного контура длительное время подключен к источнику постоянного напряжения (см. рис.). В момент времени \\[t=0\\] переключатель К переводят из положения 1 в положение 2. Приведенные ниже графики А и Б представляют изменения физических величин, характеризующих колебания в контуре после этого (\\[T\\] -- период электромагнитных колебаний в контуре). Установите соответствие между графиками и физическими величинами, зависимости которых от времени эти графики могут представлять. \nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b4_mfe_20_1.png','b4_mfe_20_2.png',NULL,NULL,NULL,NULL,NULL,62,'\\[14\\]','рис.',17,'mfe №20','4'),
	(457,457,'Чему равна энергия магнитного поля катушки, в которой при силе тока \\[10\\] А возникает магнитный поток \\[1\\] Вб?\nОтвет: Дж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,62,'\\[5\\]',NULL,17,'mfe №21','4'),
	(458,458,'Электрический колебательный контур радиоприемника содержит конденсатор и катушку индуктивности. Как изменятся частота колебаний силы тока в контуре и период колебаний энергии конденсатора, если уменьшить расстояние между пластинами конденсатора? Для каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b4_mfe_22.png',NULL,NULL,NULL,NULL,NULL,NULL,62,'\\[21\\]','рис.',17,'mfe №22','4'),
	(459,459,'Катушка индуктивности подключена к источнику тока с пренебрежимо малым внутренним сопротивлением через резистор \\[R=60\\] Ом (см. рис.). В момент \\[t=0\\] ключ К замыкают. Значения силы тока в цепи, измеренные в последовательные моменты времени, представлены в таблице. Выберите два верных утверждения о процессах, происходящих в цепи. Сопротивлением катушки пренебречь.\n1) Напряжение на резисторе в момент времени \\[t=5,\\!0\\] с равно \\[18\\] В.\n2) Модуль ЭДС самоиндукции катушки в момент времени \\[t=0\\] с равен \\[18\\] В.\n3) ЭДС источника тока равен \\[20\\] В.\n4) Напряжение на катушке максимально в момент времени \\[t=3,\\!0\\] с.\n5) Энергия катушки минимальна в момент времени \\[t=6,\\!0\\] с.','b4_mfe_23_1.png','b4_mfe_23_2.png',NULL,NULL,NULL,NULL,NULL,62,'\\[12\\] или \\[21\\]','рис.',17,'mfe №23','4'),
	(460,460,'На железный сердечник надеты две катушки, как покзано на рисунке. По правой катушке пропускают ток, который меняется согласно приведенному графику. Выберите два верных утверждения о процессах, происходящих в катушках.\n1) Индукция магнитного поля в сердечнике в интервале времени от \\[t=2\\] с до \\[t=2,\\!5\\] с равна нулю.\n2) Амперметр показывает наличие тока только в промежуток времени от \\[t=2,\\!5\\] с до \\[t=5\\] с.\n3) Показания амперметра минимальны в промежуток времени от \\[t=1\\] с до \\[t=2\\] с.\n4) Показания амперметра максимальны в промежуток времени от \\[t=2,\\!5\\] с до \\[t=5\\] с.\n5) Энергия магнитного поля в правой катушке максимальна в промежуток времени от \\[t=0\\] с до \\[t=1\\] с.','b4_mfe_24.png',NULL,NULL,NULL,NULL,NULL,NULL,64,'\\[15\\] или \\[51\\]','рис.',17,'mfe №24','4'),
	(461,461,'Установите соотвествие между физическими величинами и их единицами измерения в системе СИ.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b4_mfe_25.png',NULL,NULL,NULL,NULL,NULL,NULL,64,'\\[43\\]','рис.',17,'mfe №25','4'),
	(462,462,'Установите соотвествие между физическими величинами и их единицами измерения в системе СИ.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b4_mfe_26.png',NULL,NULL,NULL,NULL,NULL,NULL,64,'\\[32\\]','рис.',17,'mfe №26','4'),
	(463,463,'По П-образному проводнику \\[acdb\\] постоянного сечения скользит со скоростью \\[\\vec{v}\\] медная перемычка \\[ab\\] длиной \\[l\\] из того же материала и такого же сечения (см. рис.). Проводники, образующие контур, помещены в постоянное однородное магнитное поле, вектор индукции которого направлен перпендикулярно плоскости проводников и равен по модулю \\[B\\]. Определить разность потенциалов \\[U\\] между точками \\[a\\] и \\[b\\] в тот момент, когда \\[ac-2ab\\].','b4_mfe_27.png',NULL,NULL,NULL,300,12,'A',60,'\\[U=\\frac{5Blv}{6}.\\]',NULL,17,'mfe №27','4'),
	(464,464,'Сила тока в идеальном колебательном контуре меняется со временем так, как показано на рисунке. Определите заряд конденсатора в момент времени \\[t=3\\] мкс.','b4_mfe_28.png',NULL,NULL,NULL,NULL,NULL,NULL,62,'\\[q\\approx 0,\\!6\\] мкКл.',NULL,17,'mfe №28','4'),
	(465,465,'Электрическая цепь состоит из двух лампочек, двух диодов и витка провода, соединенных, как показано на рисунке. (Диод пропускает ток только в одном направлении, как показано в верхней части рисунка.) Какая из лампочек загорится, если отодвигать от витка северный полюс магнита? Ответ объясните, указав, какие физические явления и закономерности вы использовали для объяснения. ','b4_mfe_29.png',NULL,NULL,NULL,NULL,NULL,NULL,54,'Загорится лампочка 1',NULL,17,'mfe №29','4'),
	(466,466,'Установите соответствие между графиками процессов, в которых участвует \\[1\\] моль идеального газа, и значениями физических величин, характеризующих эти процессы (\\[\\Delta U\\] -- изменение внутренней энергии; \\[A\\] -- работа газа).\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами. ','b4_td_1.png',NULL,NULL,NULL,NULL,NULL,NULL,37,'\\[42\\]','рис.',17,'td №1','4'),
	(467,467,'Газ в сосуде сжали, совершив работу \\[30\\] Дж. Внутренняя энергия газа при этом увеличилась на \\[35\\] Дж. Какое количество теплоты получил газ?\nОтвет: Дж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,37,'\\[5\\]',NULL,17,'td №2','4'),
	(468,468,'На \\[VT\\]-диаграмме показан процесс изменения состояния идеального одноатомного газа. В процессе 1--2 масса газа не изменяется. В этом процессе газ отдал количество теплоты \\[9\\] кДж. Насколько уменьшилась внутренняя энергия газа?\nОтвет: кДж.','b4_td_3.png',NULL,NULL,NULL,NULL,NULL,NULL,35,'\\[9\\]','рис.',17,'td №3','4'),
	(469,469,'Два различных процесса провели с одним молем идеального газа. В одном из них газ сначала совершает положительную работу, а затем работа газа равна нулю. В другом -- сначала работа газа равна нулю, а затем его работа положительна. Установите соответствие между процессами, происходящими с газом, и графиками.\nК каждой позиции первого столбца подберите соотвтетствующую позицию второго и запишите в таблицу выбранные цифры под соотвтетствующими буквами. ','b4_td_4.png',NULL,NULL,NULL,NULL,NULL,NULL,36,'\\[31\\]','рис.',17,'td №4','4'),
	(470,470,'Идеальный газ переводят из состояния 1 в состояние 3 так, как показано на графике зависимости давления газа от объема. Давление \\[p_0=10\\] кПа, объем \\[V_0=2\\] л. Чему равна работа внешних сил?\nОтвет: Дж.','b4_td_5.png',NULL,NULL,NULL,NULL,NULL,NULL,36,'\\[40\\]','рис.',17,'td №5','4'),
	(471,471,'За один цикл работы тепловой двигатель получает от нагревателя \\[5\\] кДж теплоты. КПД этого двигателя равен \\[40\\%\\]. Какое количество теплоты двигатель отдает холодильнику за один цикл работы? \nОтвет: кДж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,37,'\\[3\\]',NULL,17,'td №6','4'),
	(472,472,'За один цикл работы тепловая машина с КПД \\[40\\%\\] получает от нагревателя \\[100\\] Дж. Какую полезную работу машина совершает за цикл?\nОтвет: Дж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,38,'\\[40\\]',NULL,17,'td №7','4'),
	(473,473,'Температура нагревателя идеального теплового двигателя, работающего по циклу Карно, равна \\[T_1\\], а температура холодильника равна \\[T_2\\]. За цикл двигатель получает от нагревателя количество теплоты \\[Q_1\\]. Установите соответствие между физическими величинами и формулами, по которым их можно рассчитать.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами. ','b4_td_8.png',NULL,NULL,NULL,NULL,NULL,NULL,38,'\\[41\\]','рис.',17,'td №8','4'),
	(474,474,'Одному молю идеального газа в изотермическом процессе было передано количество теплоты \\[Q\\]. Как изменились в результате этого давление газа и его плотность?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась\n2) уменьшилась\n3) не изменилась\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b4_td_9.png',NULL,NULL,NULL,NULL,NULL,NULL,37,'\\[22\\]','рис.',17,'td №9','4'),
	(475,475,'Одноатомный идеальный газ находится в горизонтальном цилиндрическом сосуде, закрытом подвижным поршнем площадью поперечного сечения \\[S=40\\] см\\[^2\\]. Давление окружающего воздуха \\[p=10^5\\] Па. Трение между поршнем и стенками сосуда пренебрежимо мало. В процессе медленного охлаждения от газа отведено количество теплоты \\[|Q|=80\\] Дж. На какое расстояние \\[x\\] при этом передвинулся поршень?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,30,'\\[\\displaystyle x=\\frac{2|Q|}{5pS}=8\\] см.',NULL,17,'td №10','4'),
	(476,476,'Один моль одноатомного идеального газа переводят из состояния 1 с температурой \\[T_1=200\\] К в состояние 2. В ходе этого процесса давление газа возрастает прямо пропорционально его объему. В результате плотность газа уменьшается в 2 раза. Какое количество теплоты \\[Q\\] получает газ в ходе процесса?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,37,'\\[\\displaystyle Q=2\\nu RT_1(\\alpha^2-1)=9972\\] Дж.',NULL,17,'td №11','4'),
	(477,477,'В качестве рабочего вещества теплового двигателя используется 1 моль идеального одноатомного газа. Цикл работы двигателя изображен на \\[PV\\]-диаграмме и состоит из двух адиабат, изохоры, изобары. Зная, что КПД цикла равен \\[50\\%\\], определите модуль отношения изменения температуры газа при изобарном процессе \\[\\Delta T_{12}\\] к изменению его температуры \\[\\Delta T_{34}\\] при изохорном процессе.','b4_td_12.png',NULL,NULL,NULL,300,12,'A',38,'\\[\\displaystyle\\frac{\\Delta T_{12}}{|\\Delta T_{34}|}=\\frac{3}{5(1-\\eta)}=1,\\!2.\\]',NULL,17,'td №12','4'),
	(478,478,'По П-образному проводнику \\[acdb\\] постоянного сечения скользит со скоростью \\[\\overrightarrow \\upsilon  \\] медная перемычка \\[ab\\] длиной \\[l\\] из того же материала и такого же сечения. Образующие контур проводники помещены в постоянное однородное магнитное поле, вектор индукции которого направлен перпендикулярно плоскости проводников (см. рис.). Определите индукцию магнитного поля \\[B\\] в тот момент, когда \\[ab = ac\\], а разность потенциалов между точками \\[a\\] и \\[b\\] равна \\[U\\]?','b4_v1_30.png',NULL,NULL,NULL,300,12,'A',57,'\\[B = \\frac{{4U}}{{3l\\upsilon }}\\]','рис.',NULL,'Вар.1 №30','4'),
	(479,479,'Четыре одинаковых кирпича массой \\[m\\] = 2 кг каждый сложены в стопку (см. рис.). Определите, насколько увеличится модуль силы \\[\\overrightarrow N \\], действующей со стороны первого кирпича на второй, если сверху положить ещё один такой же кирпич?\nОтвет: Н.','b4_v1_2.png',NULL,NULL,NULL,10,1,'D',13,'20','рис.',NULL,'Вар.1 №2','4'),
	(480,480,'Груз, прикреплённый к нити длиной \\[l\\] = 15 см, вращается вокруг вертикальной оси так, что нить отклоняется от вертикали на угол \\[\\alpha  = {60^ \\circ }\\]. Определите скорость движения груза.','b4_dyn_11.png',NULL,NULL,NULL,100,4,'C',13,'1,5  м/с','рис.',NULL,'dyn №11 стр.38','4'),
	(481,481,'На рисунке представлен график зависимости давления от температуры гелия, занимающего в состоянии 1 объём 5 л. Какой объём соответствует состоянию 2, если масса гелия не меняется?\nОтвет: л.','b4_mkt_6.png',NULL,NULL,NULL,10,1,'D',30,'43','рис.',NULL,'mkt №6 стр.57','4'),
	(482,482,'Два точечных заряда: положительный \\[{q_1}\\] = 30 нКл и отрицательный \\[{q_2}\\] = -20 нКл – находятся в вакууме. Определите величину напряжённости электрического поля этих зарядов в точке А, расположенной на прямой, соединяющей заряды, на расстоянии \\[L\\] от первого и \\[\\frac{1}{2}L\\] от второго заряда, если \\[L\\] = 3 м.\nОтвет: В/м.','b4_elec_12.png',NULL,NULL,NULL,30,1,'D',40,'110','рис.',NULL,'elec №12 стр.79','4'),
	(483,483,'Конденсатор ёмкостью \\[C\\] = 5 мкФ присоединён к батарее с ЭДС \\[\\varepsilon \\] = 10 В и внутренним сопротивлением \\[r\\] = 1 Ом. В начальный момент времени ключ К был замкнут (см. рис.). Каким станет заряд конденсатора через длительное время после размыкания ключа К, если сопротивление резистора \\[R\\] = 8 Ом?\nОтвет: мкКл.\nОтвет: \\[10^{-6}\\] Дж.','b4_elec_13.png',NULL,NULL,NULL,80,3,'С',51,'50','рис.',NULL,'elec №13 стр.79','4'),
	(484,484,'На рисунке приведены графики зависимости проекции скорости движения двух тел от времени. Определите, в какой момент времени второе тело пройдёт в два раза большее расстояние, чем первое.\n1) \\[0,\\!8\\] с\n2) \\[2\\] с\n3) \\[4\\] с\n4) \\[0,\\!4\\] с','b1_v21_1.png',NULL,NULL,NULL,5,1,'D',5,'\\[2\\]','рис.',18,'Вар.21 №1','1'),
	(485,485,'На тележку массой \\[120\\] кг, движущуюся со скоростью \\[20\\] м/с, сверху вертикально опустили груз массой \\[40\\] кг. С какой скоростью будет двигаться тележка с грузом?\n1) \\[60\\] м/с\n2) \\[12,\\!5\\] м/с\n3) \\[15\\] м/с\n4) \\[20\\] м/с',NULL,NULL,NULL,NULL,5,1,'D',18,'\\[3\\]',NULL,18,'Вар.21 №2','1'),
	(486,486,'Найдите центростремительное ускорение спутника, который движется по круговой орбите радиусом \\[6,\\!4\\cdot10^6\\] м, имея скорость \\[8\\] км/с.\nОтвет: м/с\\[^2\\].',NULL,NULL,NULL,NULL,5,1,'D',15,'\\[10\\]',NULL,18,'Вар.21 №3','1'),
	(487,487,'Найдите кинетическую энергию тела массой \\[500\\] г, брошенного вертикально вверх, если в полёте оно находилось \\[6\\] с. \nОтвет: Дж.',NULL,NULL,NULL,NULL,5,1,'D',6,'\\[225\\]',NULL,18,'Вар.21 №4','1'),
	(488,488,'К концам рычага длиной \\[60\\] см приложены две силы \\[F_1\\] и \\[F_2\\]. Найдите плечо силы \\[F_1\\], если известно, что \\[F_1=2F_2\\].\nОтвет: м.',NULL,NULL,NULL,NULL,5,1,'D',23,'\\[0,\\!2\\]',NULL,18,'Вар.21 №5','1'),
	(489,489,'Груз совершает вертикальные колебания на пружине. Как изменятся полная энергия системы и частота колебаний, если, оставив величину начального отклонения груза из положения равновесия неизменным, увеличить массу груза в два раза?\nДля каждой физической величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться. ','b1_v21_6.png',NULL,NULL,NULL,10,1,'D',78,'\\[12\\]','рис.',18,'Вар.21 №6','1'),
	(490,490,'Груз, подвешенный на нити, совершает колебания (см. рис.). Установите соответствие между физическими величинами и формулами для их вычисления.\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.','b1_v21_7_1.png','b1_v21_7_2.png',NULL,NULL,10,1,'D',78,'\\[13\\]','рис.',18,'Вар.21 №7','1'),
