	(646,646,'Тонкое закреплённое кольцо радиусом \\[R\\] равномерно заряжено так, что на единицу длины кольца приходится заряд \\[+q\\]. В вакууме на оси кольца на расстоянии \\[l\\] от центра кольца помещён маленький шарик с зарядом \\[+Q\\]. Какую максимальную кинетическую энергию приобретёт шарик, если его освободить?',NULL,NULL,NULL,NULL,200,8,'B',47,'\\[\\frac{2\\pi kqQR}{(R^2+l^2)^{1/2}}\\]',NULL,NULL,'Основы электродинамики №497','3'),
	(647,647,'В однородном элекрическом поле, образованном параллельными вертикальными разноимённо заряженными пластинами, находится шарик массой \\[1\\] г и зарядом \\[2\\] мкКл посередине между ними. Пластины находятся на расстоянии \\[9\\] см друг от друга, напряжённость созданного ими поля \\[10\\] кВ/м. Шарик освобождают, и он приходит в движение. Какую скорость будет иметь шарик в момент касания одной из пластин?',NULL,NULL,NULL,NULL,200,8,'B',47,'\\[1,\\!5\\] м/с',NULL,NULL,'Основы электродинамики №498','3'),
	(648,648,'К полюсам батареи, состоящей из двух источников с ЭДС \\[75\\] В и внутренним сопротивлением \\[4\\] Ом, подведены две параллельные медные шины сопротивлением \\[10\\] Ом каждая. К концам шин и к их серединам подключены две лампочки сопротивлением по \\[20\\] Ом каждая, как показано на рисунке. Определите силу тока, протекающего через вторую лампочку.','b3_499.png',NULL,NULL,NULL,250,10,'B',51,'\\[2\\] А','рис.',NULL,'Основы электродинамики №499','3'),
	(649,649,'Электрический чайник имеет две обмотки. При включении одной из них вода в чайнике закипает через \\[t_1=15\\] мин, при включении другой -- через \\[t_2=30\\] мин. Через сколько времени закипает вода в чайнике при включении обеих обмоток последовательно (теплоотдачей в окружающую среду пренебречь)?',NULL,NULL,NULL,NULL,100,4,'C',52,'\\[45\\] мин',NULL,NULL,'Основы электродинамики №500','3'),
	(650,650,'К источнику постоянного тока с внутренним сопротивлением \\[2\\] Ом подключён резистор сопротивлением \\[6\\] Ом. Напряжение на полюсах источника равно \\[12\\] В. Какое количество теплоты выделяется во всей цепи в единицу времени?',NULL,NULL,NULL,NULL,150,6,'B',52,'\\[32\\] Вт',NULL,NULL,'Основы электродинамики №501','3'),
	(651,651,'Неоновая лампочка включена на \\[10\\] мин в сеть переменного синусоидального напряжения с эффективным значением напряжения \\[120\\] В и частотой \\[50\\] Гц. Найдите время горения лампочки, если она зажигается и гаснет при напряжении \\[120\\] В.',NULL,NULL,NULL,NULL,350,14,'A',64,'\\[300\\] с',NULL,NULL,'Основы электродинамики №502','3'),
	(652,652,'Точечный источник света с длиной волны \\[0,\\!5\\] мкм расположен на оптической оси и находится на расстоянии \\[40\\] см от собирающей линзы с фокусным расстоянием \\[30\\] см. Сразу за линзой установлена дифракционная решётка с периодом \\[0,\\!02\\] мм. Какое расстояние будет между соседними изображениями источника света?',NULL,NULL,NULL,NULL,350,14,'А',69,'\\[3\\] см',NULL,NULL,'Оптика №503','3'),
	(653,653,'Линейные размеры изображения, полученного на экране, в 3 раза больше линейного размера предмета. Фокусное расстояние линзы равно \\[27\\] см. На каком расстоянии от линзы находится предмет?',NULL,NULL,NULL,NULL,80,3,'С',68,'\\[35,\\!9\\] см',NULL,NULL,'Оптика №504','3'),
	(654,654,'Плоское зеркало, расположенное в вертикальной плоскости, может вращаться вокруг горизонтальной оси (см. рис.). На расстоянии \\[R\\] от оси находится светящяся точка \\[A\\]. Какое расстояние будет между изображением точки и изображением, которое образуется после поворота зеркала на угол \\[\\alpha\\]?','b3_505.png',NULL,NULL,NULL,150,6,'В',66,'\\[2R\\sin\\alpha\\]','рис.',NULL,'Оптика №505','3'),
	(655,655,'Расстояние между предметом и экраном \\[L=0,\\!75\\] м. Линза, помещённая между ними, даёт чёткое изображение при двух её положениях: один раз -- уменьшенное, другой раз -- увеличенное. Увеличенное изображение предмета больше самого предмета в \\[\\text{Г}=2\\] раза. Чему равна оптическая сила линзы?',NULL,NULL,NULL,NULL,80,3,'С',68,'\\[6\\] дптр',NULL,NULL,'Оптика №506','3'),
	(656,656,'Плоское зеркало, расположенное в вертикальной плоскости, может вращаться вокруг горизонтальной оси (см. рис.). На расстоянии \\[R\\] от оси находится светящяся точка \\[A\\]. Какое расстояние будет между изображением точки и изображением, которое образуется после поворота зеркала на угол \\[\\alpha\\]?',NULL,NULL,NULL,NULL,150,6,'В',66,'\\[2R\\sin\\alpha\\]',NULL,NULL,'Оптика №507','3'),
	(657,657,'На поверхности воды плавает надувной плот шириной \\[4\\] м и длиной \\[6\\] м. Небо затянуто сплошным облачным покровом, полностью рассеивающим солнечный свет. На какой максимальной глубине под плотом должна находиться маленькая рыбка, чтобы её не могли увидеть плавающие вокруг плота хищники? Глубиной погружения плота, рассеиванием света водой и его отражением от дна водоёма пренебречь. Показатель преломления воды относительно воздуха принять равным \\[4/3\\].',NULL,NULL,NULL,NULL,200,8,'В',66,'\\[\\approx1,\\!76\\] м',NULL,NULL,'Оптика №508','3'),
	(658,658,'Фокусное расстояние собирающей линзы \\[F=5\\] см. Точечный источник света находится на оси линзы на расстоянии \\[d=6\\] см от неё. Линзу разрезали по диаметру на две равные части, которые раздвинули на расстояние \\[h=1\\] см симметрично относительно оптической оси. Найдите расстояние \\[H\\] между двумя изображениями точки. ',NULL,NULL,NULL,NULL,200,8,'В',68,'\\[6\\] см',NULL,NULL,'Оптика №509','3'),
	(659,659,'Линза, фокусное расстояние которой \\[20\\] см, даёт на экран изображение предмета с четырёхкратным увеличением. Экран подвинули к линзе вдоль её главной оптической оси на расстояние \\[l\\]. Затем, чтобы изображение снова стало резким, передвинули предмет на расстояние \\[5\\] см. На сколько см передвинули экран относительно его первоначального положения?',NULL,NULL,NULL,NULL,200,8,'В',68,'На \\[40\\] см',NULL,NULL,'Оптика №510','3'),
	(660,660,'Предмет в виде отрезка длиной \\[6\\] см расположен вдоль главной оптической оси собирающей линзы с фокусным расстоянием \\[10\\] см. Середина отрезка расположена на расстоянии \\[15\\] см от линзы. Определите продольное увеличение предмета. ',NULL,NULL,NULL,NULL,200,8,'В',68,'\\[6,\\!25\\]',NULL,NULL,'Оптика №511','3'),
	(661,661,'На каком расстоянии друг от друга следует расположить две линзы: рассеивающую с фокусным расстоянием \\[-4\\] см и собирающую с фокусным расстоянием \\[9\\] см, чтобы пучок лучей, параллельных оптической оси линзы, пройдя через обе линзы, остался бы параллельным?',NULL,NULL,NULL,NULL,100,4,'C',68,'\\[5\\] см',NULL,NULL,' Оптика №512','3'),
	(662,662,'Круглый бассейн радиусом \\[5\\] м залит до краёв водой. Над центром бассейна на высоте \\[3\\] м от поверхности воды висит лампа. На какое расстояние от края бассейна может отойти человек ростом \\[1,\\!8\\] м, чтобы всё ещё видеть отражение лампы в воде?',NULL,NULL,NULL,NULL,100,4,'C',66,'\\[3\\] м',NULL,NULL,' Оптика №513','3'),
	(663,663,'На дне водоёма глубиной \\[2\\] м лежит зеркало. Луч света, пройдя черех воду, отражается от зеркала и выходит из воды. Показатель преломления воды равен \\[1,\\!33\\]. Найдите расстояние между точкой входа луча в воду и точкой выхода луча из воды, если угол падения луча равен \\[30^{\\circ}\\].',NULL,NULL,NULL,NULL,150,6,'В',66,'\\[1,\\!62\\] м',NULL,NULL,'Оптика №514','3'),
	(664,664,'Между краями двух хорошо отшлифованных тонких плоских стеклянных пластинок помещена тонкая проволочка, противоположные концы пластинок плотно прижаты друг к  другу (см. рис.). Расстояние от проволочки до линии соприкосновения пластинок равно \\[20\\] см. На верхнюю пластинку нормально к её поверхности падает монохроматический пучок света длиной волны \\[600\\] нм. Определите диаметр проволочки, если на \\[1\\] см длины клина умещается \\[10\\] интерференционных полос.','b3_515.png',NULL,NULL,NULL,350,14,'А',69,'\\[0,\\!06\\] мм','рис.',NULL,'Оптика №515','3'),
	(665,665,'Если фотоэлемент освещать светом с длиной волны \\[400\\] нм, то фототок прекращается при запирающем напряжении \\[1,\\!5\\] В. Определите по этим данным красную границу фотоэффекта.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[776\\] нм',NULL,NULL,'Квантовая физика №516','3'),
	(666,666,'Считая, что 25-ваттная лампочка испускает электромагнитные волны длиной волны \\[1100\\] нм, рассчитайте, сколько фотонов испускает лампочка за \\[10\\] с работы в номинальном режиме.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[1,\\!4\\cdot10^{21}\\]',NULL,NULL,'Квантовая физика №517','3'),
	(667,667,'Электромагнитное излучение с длиной волны \\[3,\\!3\\cdot10^{-7}\\] м используется для нагревания воды массой \\[1\\] кг. Сколько фотонов излучает источник за одну секунду, если за время \\[700\\] с вода нагревается на \\[10^{\\circ}\\]C? Считаем, что излучение полностью поглощается водой.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[10^{20}\\]',NULL,NULL,'Квантовая физика №518','3'),
	(668,668,'Фотокатод, работа выхода из которого \\[A=4,\\!42\\cdot10^{-19}\\] Дж, освещается светом с частотой \\[\\nu\\]. Вылетевшие из катода электроны попадают в однородное магнитное поле с индукцией \\[B=4\\cdot10^{-4}\\] Тл перпендикулярно линиям магнитной индукции этого поля и движутся по окружности радиусом \\[R=10\\] мм. Чему равна частота \\[\\nu\\] падающего света?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[4\\cdot10^{12}\\] Гц',NULL,NULL,'Квантовая физика №519','3'),
	(669,669,'В вакууме находятся два покрытых кальцием электрода, к которым подключён конденсатор ёмкостью \\[C=8000\\] пФ. При длительном освещении катода светом с частотой \\[\\nu=1015\\] Гц фототок, возникающий вначале, прекращается. Работа выхода электронов из кальция \\[A=4,\\!42\\cdot10^{-19}\\] Дж. Какой заряд \\[q\\] при этом оказывается на обкладках конденсатора?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[1,\\!1\\cdot10^{-8}\\] Кл',NULL,NULL,'Квантовая физика №520','3'),
	(670,670,'Для определения постоянной Планка был проведён эксперимент. Потенциометром можно было регулировать запирающее напряжение. При освещении фотоэлемента красным светом с частотой \\[\\nu_1=390\\] ТГц запирающее напряжение \\[U_{\\text{З1}}=0,\\!5\\] В, а при освещении фиолетовым светом с частотой \\[\\nu_2=750\\] ТГц запирающее напряжение \\[U_{\\text{З2}}=2\\] В. Какое значение постоянной Планка было получено?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[6,\\!7\\cdot10^{-34}\\] Дж\\[\\cdot\\]с',NULL,NULL,'Квантовая физика №521','3'),
	(671,671,'Для увеличения яркости изображения слабых источников света используется вакуумный прибор -- электронно-оптический преобразователь. В этом приборе фотоны, падающие на катод, выбивают из него фотоэлектроны, которые ускоряются разностью потенциалов \\[\\Delta U\\] и бомбардируют флуоресцирующий экран, рождающий вспышку света при попадании каждого электрона. Длина волны падающего на катод света \\[\\lambda_1=820\\] нм, а для света, излучаемого экраном, \\[\\lambda_2=410\\] нм. Каково значение \\[\\Delta U\\], если число фотонов на выходе прибора в \\[N=500\\] раз больше числа фотонов, падающих на катод? Считать, что один фотоэлектрон рождается при падении на катод в среднем \\[10\\] фотонов. Работу выхода электронов \\[A\\] принять равной \\[1\\] эВ. Считать, что энергия электронов переходит в энергию света без потерь. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[15\\] Кв',NULL,NULL,'Квантовая физика №522','3'),
	(672,672,'Источник монохроматического света испускает ежесекундно \\[2\\cdot10^{20}\\] фотонов, вызывающих фотоэффект на металлической пластине с работой выхода электронов \\[1,\\!6\\cdot10^{-19}\\] Дж. При длительном освещении пластина заряжается до потенциала \\[0,\\!9\\] В. Найдите мощность источника света.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[60,\\!8\\] Вт',NULL,NULL,'Квантовая физика №523','3'),
	(673,673,'В микрокалориметр теплоёмкостью \\[100\\] Дж/К помещён изотоп кобальта массой \\[10\\] г. При распаде одного ядра выделяется энергия \\[2\\cdot10^{-19}\\] Дж. Через 50 мин температура калориметра повысилась на \\[0,\\!06\\] К. Определите период полураспада изотопа кобальта. Молярная масса кобальта \\[M=0,\\!059\\] кг/моль.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[2,\\!3\\cdot10^7\\] с',NULL,NULL,'Атом и атомное ядро №524','3');
INSERT INTO `tasks_physics` (`id`, `number_task`, `task`, `image_1`, `image_2`, `image_1_answer`, `image_2_answer`, `experience`, `gold`, `grade`, `subject_id`, `answer`, `detail`, `set_of_task_id`, `original_number`, `book`)
VALUES
	(674,674,'Препарат массой \\[1\\] г, содержащий радий, за \\[1\\] с испускает \\[3,\\!7\\cdot10^{10}\\] альфа-частиц, обладающих скоростью \\[15\\] Мм/с. Чему равна масса образца с такой же концентрацией радия, в котором за полчаса выделяется энергия \\[500\\] Дж? Энергией отдачи ядер и релятивистскими эффетами пренебречь.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[10,\\!3\\] г',NULL,NULL,'Атом и атомное ядро №525','3'),
	(675,675,'В соответствии с теорией Бора произведение импульса электрона на радиус стационарной орбиты (момент импульса) квантуется \\[mvr=(h/2)\\pi n,\\] где \\[n=1,\\;2,\\;3...\\] Оценит энергию электрона в атоме водорода на первой стационарной орбите. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[-13,\\!6\\] эв',NULL,NULL,'Атом и атомное ядро №526','3'),
	(676,676,'В боровской теории атома водорода частота излучения при переходе электрона с одной стационарной орбиты на другую описывается соотношением \\[\\nu=\\frac{k^2me^416\\pi^2}{h^3}\\Big(\\frac{1}{n^2}-\\frac{1}{n^{`2}}\\Big).\\] Здесь \\[k\\] -- коэффициент пропорциональности в законе Кулона, \\[m\\] -- масса электрона, \\[e\\] -- его заряд, \\[h\\] -- постоянная Планка, \\[n\\] и \\[n\'\\] -- номера стационарных орбит. Какая минимальная длина волны наблюдается при излучении серии Бальмера?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[367\\] нм',NULL,NULL,'Атом и атомное ядро №527','3'),
	(677,677,'Препарат активностью \\[N=3,\\!4\\cdot10^{11}\\] частиц в секунду помещён в калориметр, заполненный водой при \\[T_0=293\\] К. Какую массу воды можно довести до кипения за время \\[t=3\\] ч, если известно, что данный препарат испускает \\[\\alpha\\]-частицы энергией \\[\\varepsilon=5,\\!3\\] МэВ, причём энергия всех \\[\\alpha\\]-частиц полностью поглощается водой? Теплоёмкостью препарата, калориметра и теплообменом с окружающей средой пренебречь. Изменением активности препарата также пренебречь. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[9,\\!3\\] г',NULL,NULL,'Атом и атомное ядро №528','3'),
	(678,678,'Радиоактивный изотоп калия \\[^{40}_{19}K\\] в результате \\[\\beta\\]-распада превращается в изотоп кальция \\[^{40}_{20}Ca\\]. Период полураспада изотопа калия \\[^{40}_{20}K\\] равен \\[1,\\!24\\] млрд лет. Какое относительное количество ядер калия (в процентах) превратилось в ядра кальция за время существования Земли (равном примерно \\[6,\\!5\\] млрд лет)?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[29\\%\\]',NULL,NULL,'Атом и атомное ядро №529','3'),
	(679,679,'Предполагая, что нуклоны плотно упакованы в ядре с массовым числом \\[A\\], можно оценить радиус ядра \\[R\\]: \\[R=r_0A^{1/3},\\] где \\[r_0=1,\\!2\\] фм (\\[1\\] фм=\\[10^{-15}\\] м).\nОцените радиус атома серебра \\[^{108}_{\\;47}Ag\\].',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[5,\\!71\\] фм',NULL,NULL,'Атом и атомное ядро №530','3'),
	(680,680,'\\[\\pi^0\\]-мезон распадается на два \\[\\gamma\\]-кванта. Частота одного из образовавшихся \\[\\gamma\\]-квантов в системе отсчёта, где первичный \\[\\pi^0\\]-мезон покоится, \\[\\nu=1,\\!64\\cdot10^{22}\\] Гц. Найдите массу \\[\\pi^0\\]-мезона.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[2,\\!4\\cdot10^{-28}\\] кг',NULL,NULL,'Атом и атомное ядро №531','3'),
	(681,681,'Система состоит из двух линз с одинаковыми по модулю фокусными расстояниями. Одна из линз собирающая, другая рассеивающая. Линзы расположены на одной оси на некотором расстоянии друг от друга. Известно, что если поменять линзы местами, то действительное изображение Луны, даваемое этой системой, сместится на \\[l\\] = 20 см. Найдите фокусное расстояние каждой из линз. Расстояние между линзами 40 см.',NULL,NULL,NULL,NULL,300,12,'А',NULL,'10 см','Решение задач по теме \"Линзы. Построение изображений в тонкой линзе. Формула линзы\".',NULL,'Оптика   №6','https://ido.tsu.ru/schools/physmat/data/res/optika/pract/text/pr_6.htm'),
	(682,682,'Часто в деревнях, находящихся на открытых местах, на пригорках, во время ураганных ветров с деревянных домов срывает двускатные крыши, особенно с тех, у которых не были плотно закрыты чердачные оконца. Вначале крыша с подветренной стороны, если на ней есть чердак с окном, слегка приподнимается над домом, а потом вся крыша поворачивается, встаёт поперёк ветра и улетает. Перечислите и объясните физические явления и закономерности, которые приводят к подобному результату.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Вариант ФИ10104',NULL,'№27','СтатГрад 2016-2017'),
	(683,683,'Гладкий клин массой \\[M\\] с углом \\[\\alpha \\] при основании стоит на горизонтальной плоскости, часть которой под ним и левее – гладкая, а часть – справа от него – шероховатая (см. рис.). На вершине клина, на высоте \\[H\\] над плоскостью находится маленький брусок \\[m\\], коэффициент трения которого о шероховатую часть плоскости равен \\[\\mu \\]. Брусок отпускают без начальной скорости, он скатывается по клину и далее скользит по шероховатой плоскости и останавливается на некотором расстоянии \\[L\\] по горизонтали от своего начального положения. Найдите это расстояние \\[L\\], если в точке перехода с клина на плоскость есть гладкое закругление, так что скорость бруска при переходе с клина на плоскость не уменьшается.','28_statgrad_10104.png',NULL,NULL,NULL,350,14,'А',NULL,'\\[L = \\frac{H}{\\mu } - \\frac{{m{\\upsilon ^2} \\cdot {{\\cos }^2}\\alpha }}{{2Mg\\mu }} + \\frac{H}{{tg\\alpha }}\\]','Вариант ФИ10104',NULL,'№28','СтатГрад 2016-2017'),
	(684,684,'В холодное зимнее время хозяева квартиры стали замерзать при температуре в комнате \\[T =  + {17^ \\circ }C\\] и, включив дополнительный обогреватель, добились повышения температуры на \\[\\Delta T = {6^ \\circ }C\\]. На сколько при этом изменилась масса воздуха в комнате? Площадь комнаты \\[S = 25\\] м\\[^2\\], высота потолка \\[h = 2,75\\] м, атмосферное давление \\[p = {10^5}\\] Па, воздух в комнате свободно сообщается с атмосферой. Ответ округлите до целого числа граммов.',NULL,NULL,NULL,NULL,200,8,'В',NULL,NULL,'Вариант ФИ10104',NULL,' №29','СтатГрад 2016-2017'),
	(685,685,'Протон, летящий со скоростью \\[\\upsilon \\] = 0,01 c (1% от скорости света в вакууме), попадает в область пространства толщиной \\[d = 5\\] см, где имеется однородное магнитное поле с индукцией \\[B\\] = 1 Тл, направленное перпендикулярно вектору (см. рис.). На какой угол \\[\\varphi \\] повернётся вектор скорости протона после вылета из этой области?','30_statgrad_10104.png',NULL,NULL,NULL,300,12,'А',NULL,NULL,'Вариант ФИ10104',NULL,' №30','СтатГрад 2016-2017'),
	(686,686,'На горизонтальном столе лежит прямоугольная пластина со сторонами \\[a\\] = 4,2 см, \\[c\\] = 3,2 см и толщиной \\[d\\] = 1 см, изготовленная из стекла с показателем преломления \\[n\\] = 1,5. Боковые вертикальные поверхности пластины зачернены и поглощают свет. Школьник с разных сторон направляет узкий световой луч от мощной лазерной указки на пластину под углом \\[\\alpha \\] = \\[{30^ \\circ }\\] к вертикали и наблюдает на потолке комнаты пятна света, многократно отражённого от пластины. Какое максимальное число \\[N\\] таких пятен он сможет увидеть, если  наиболее удачно выберет направление падения светового луча?',NULL,NULL,NULL,NULL,300,12,'А',NULL,NULL,'Вариант ФИ10104',NULL,'№31','СтатГрад 2016-2017'),
	(687,687,'В одной плоскости лежат длинный прямой проводник и кольцевой проводник, по которым текут постоянные токи (см. рисунок). Куда направлена суммарная сила, действующая на кольцевой проводник со стороны магнитного поля, создаваемого прямым проводником? Ответ поясните, опираясь на законы электродинамики.','27_statgrad_10202.png',NULL,NULL,NULL,80,3,'С',NULL,NULL,'Вариант ФИ10202',NULL,'№27','СтатГрад 2016-2017'),
	(688,688,'Какое ускорение \\[a\\] поступательного движения можно сообщить однородному кубику, находящемуся на шероховатой горизонтальной плоскости, прикладывая к его верхнему ребру горизонтальную силу в плоскости симметрии кубика (см. рисунок)? Коэффициент трения кубика о плоскость равен \\[\\mu \\] = 0,4.','28_statgrad_10202.png',NULL,NULL,NULL,250,10,'A',NULL,NULL,'Вариант ФИ10202',NULL,'№28','СтатГрад 2016-2017'),
	(689,689,'С одним молем гелия, находящегося в цилиндре под\nпоршнем, провели процесс 1–2, изображённый на \\[p - T\\] диаграмме. Во сколько раз изменилась при этом частота \\[\\nu \\] столкновений атомов со стенками сосуда, то есть число ударов атомов в единицу времени о единицу площади стенок? Начальные и конечные параметры процесса 1–2 приведены на рисунке.','29_statgrad_10202.png',NULL,NULL,NULL,350,14,'А',NULL,NULL,'Вариант ФИ10202',NULL,' №29','СтатГрад 2016-2017'),
	(690,690,'В схеме, изображённой на рисунке, ключ К вначале замыкают на достаточно долгое время, пока ток в цепи не установится, а затем размыкают. Какое количество теплоты выделится после этого в резисторе \\[{R_1}\\]? Параметры цепи: \\[\\varepsilon  = 5\\] В, \\[r\\] =10 Ом, \\[{R_1}\\] = 5 Ом, \\[{R_2}\\] =10 Ом,\\[L\\] = 30 мГн.','30_statgrad_10202.png',NULL,NULL,NULL,350,14,'А',NULL,NULL,'Вариант ФИ10202',NULL,' №30','СтатГрад 2016-2017'),
	(691,691,'На оптической оси тонкой собирающей линзы с фокусным расстоянием \\[F\\] = 10 см слева от неё на расстоянии\\[a = \\frac{{3F}}{2}\\] = 15 см находится точечный источник света \\[S\\]. За линзой справа от неё на таком же расстоянии \\[a\\] = 15 см расположено плоское зеркало, перпендикулярное оси линзы. На каком расстоянии от источника находится его изображение \\[SS\'\\] в данной оптической системе?\nК решению приложите рисунок с изображением хода лучей от\\[S\\] до \\[S\'\\].',NULL,NULL,NULL,NULL,300,12,'А',NULL,NULL,'Вариант ФИ10202',NULL,'№31','СтатГрад 2016-2017'),
	(692,692,'Два абсолютно упругих шарика подвешены на длинных нерастяжимых вертикальных нитях одинаковой длины так, что центры шариков находятся на одной высоте и шарики касаются друг друга (см. рисунок). Вначале отклоняют в сторону в плоскости нитей лёгкий шарик, отпускают его, и после лобового удара о тяжёлый шар лёгкий шарик отскакивает и поднимается на некоторую высоту \\[h\\]. Затем такой же опыт проводят, отклоняя из начального положения на ту же высоту тяжёлый шар. Во сколько раз высота подъёма лёгкого шарика после удара по нему тяжёлым шаром будет отличаться от той, что была в первом случае? Масса лёгкого шарика намного меньше массы тяжёлого, потерями энергии можно пренебречь. Ответ поясните, опираясь на законы механики.','27_statgrad_10301.png',NULL,NULL,NULL,30,1,'D',NULL,NULL,'Вариант ФИ10301',NULL,'№27','СтатГрад 2016-2017'),
	(693,693,'На шероховатую наклонную плоскость положили брусок (см. рис.). Коэффициент трения бруска о плоскость \\[\\mu  = 0,3\\], тангенс \\[\\alpha \\] угла наклона плоскости к горизонту равен 0,2. В первом случае бруску ударом придали скорость \\[\\overrightarrow \\upsilon  \\], направленную вдоль плоскости вверх, а во втором – вниз. Во сколько раз путь, пройденный бруском до остановки на наклонной плоскости во втором случае, будет больше, чем в первом?','28_statgrad_10301.png',NULL,NULL,NULL,250,10,'A',NULL,NULL,'Вариант ФИ10301',NULL,'№28','СтатГрад 2016-2017'),
	(694,694,'Железный шарик радиусом \\[r\\] = 2 см вморожен в ледяной шар радиусом \\[R\\] = 3 см. Их охладили до температуры \\[{t_1} =  - {20^ \\circ }C\\] и опустили в калориметр, в котором находится вода массой \\[m\\] = 200 г при температуре \\[{t_2} =  + {30^ \\circ }C\\]. Какая температура \\[t\\] установится в калориметре после достижения равновесного состояния? Потерями теплоты пренебречь. Плотность льда \\[{\\rho _{л}}\\] = 900 кг/м\\[^3\\].',NULL,NULL,NULL,NULL,300,12,'А',NULL,NULL,'Вариант ФИ10301',NULL,' №29','СтатГрад 2016-2017'),
	(695,695,'В цепи, схема которой изображена на рисунке, оба конденсатора вначале разряжены. Ключ \\[{K_1}\\] замыкают на достаточно долгое премя, пока ток в цепи не прекратится, а затем замыкают ключ \\[{K_2}\\]. Какое количество теплоты \\[Q\\] выделится в цепи после замыкания ключа \\[{K_2}\\]? Параметры цепи: \\[U\\] = 12 B, \\[{C_1}\\] = 5 мкФ, \\[{C_2}\\] = 10 мкФ.','30_statgrad_10301.png',NULL,NULL,NULL,300,12,'А',NULL,NULL,'Вариант ФИ10301',NULL,' №30','СтатГрад 2016-2017'),
	(696,696,'Параллельный пучок света от ртутной лампы нормально падает на дифракционную решётку с периодом \\[d\\] = 5 мкм. За решёткой находится объектив с фокусным расстоянием \\[F\\] = 25 см, а в его фокальной плоскости, параллельной решётке,  – экран, на котором наблюдается линейчатый спектр лампы. Каково расстояние \\[\\Delta l\\] на экране между жёлтой линией с длиной волны \\[{\\lambda _1}\\] = 578 нм в спектре порядка \\[{m_1}\\] =3 и синей линией с длиной волны \\[{\\lambda _2}\\] = 436 нм в спектре порядка \\[{m_2}\\]?',NULL,NULL,NULL,NULL,350,14,'А',NULL,NULL,'Вариант ФИ10301',NULL,'№31','СтатГрад 2016-2017'),
	(697,697,'Точечное тело движется вдоль горизонтальной оси \\[OX\\]. При этом его координата изменяется с течением времени \\[t\\] по закону \\[x\\left( t \\right) = 5 - 10t + 2{t^2}\\] (все величины заданы в единицах СИ). Какой из следующих графиков соответствует графику зависимости проекции скорости \\[V\\] этого тела на ось \\[OX\\] от времени?','b5_v1_1.png',NULL,NULL,NULL,5,1,'D',5,'4','рис.',21,'Вар.1 №1','5'),
	(698,698,'Небольшое тело двигалось вдоль прямой и обладало импульсом, равным по модулю 8 кг\\[ \\cdot \\]м/с. В некоторый момент времени на это тело начала действовать постоянная сила, всё время направленная вдоль этой прямой. Через 4 с после начала действия силы модуль импульса тела увеличился в 2 раза. Чему мог быть равен модуль силы, действовавшей на тело?\n1) 2 Н или 4 Н 2) 4 Н или 6 Н 3) 2 Н или 6 Н 4) 4 Н или 8 Н',NULL,NULL,NULL,NULL,5,1,'D',16,'3',NULL,21,'Вар.1 №2','5'),
	(699,699,'Брусок массой 5 кг покоится на шероховатом горизонтальном столе. Коэффициент трения между поверхностью бруска и поверхностью стола равен 0,2. На этот брусок действуют горизонтально направленной силой 2,5 Н. Чему равна по модулю возникающая при этом сила трения?\nОтвет: Н',NULL,NULL,NULL,NULL,5,1,'D',12,'2,5',NULL,21,'Вар.1 №3','5'),
	(700,700,'Телу массой 1 кг, находящемуся у основания шероховатой наклонной плоскости, сообщили начальную скорость 2 м/с в направлении вверх вдоль наклонной плоскости. Через некоторое время тело вернулось в исходную точку, имея вдвое меньшую кинетическую энергию. Какую работу совершила сила трения за время движения тела?\nОтвет: Дж',NULL,NULL,NULL,NULL,5,1,'D',22,'1',NULL,21,'Вар.1 №4','5'),
	(701,701,'Кубик из пробки с ребром 10 см опускают в воду. Каково отношение объёма части кубика, находящейся над водой, к объёму части кубика, находящейся под водой?\nПлотность пробки \\[{\\text{0,25 г/}}{{\\text{см}}^{\\text{3}}}\\]',NULL,NULL,NULL,NULL,5,1,'D',27,'3',NULL,21,'Вар.1 №5','5'),
	(702,702,'Математический маятник, представляющий собой свинцовую дробинку, подвешенную на длинной нити, колеблется с угловой амплитудой 1 градус. Как изменятся частота колебаний маятника и запас его полной механической энергии, если увеличить длину нити маятника и увеличить массу дробинки, оставив угловую амплитуду прежней? Для каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА \nА) частота колебаний маятника \nБ) запас полной механической энергии маятника \nЕЕ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,10,1,'D',78,'21',NULL,21,'Вар.1 №6','5'),
	(703,703,'На рисунке изображён график зависимости проекции импульса \\[p\\] точечного тела массой 2 кг, движущегося вдоль координатной оси по гладкой горизонтальной поверхности, от времени \\[t\\]. Установите соответствие между графиками и физическими величинами, зависимости которых от времени эти графики могут представлять. В каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nГРАФИК\nА)\nБ)\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\n1) модуль силы, действующей на тело\n2) проекция на координатную ось ускорения тела\n3) проекция на координатную ось скорости тела\n4) кинетическая энергия тела','b5_v1_7_1.png','b5_v1_7_2.png',NULL,NULL,10,1,'D',16,'13','рис.',21,'Вар.1 №7','5'),
	(704,704,'Вечером через некоторое время после захода солнца на траве выпала роса. Это произошло потому, что\n1) водяной пар, который содержался в приземном слое воздуха до захода солнца, был насыщенным\n2) после захода солнца температура в приземном слое воздуха понизилась и водяной пар, который содержался в воздухе, стал насыщенным\n3) относительная влажность приземного слоя воздуха после захода солнца уменьшилась\n4) после захода солнца трава начала более интенсивно выделять содержащуюся в ней воду, и излишки воды выступили на травинках в виде капель',NULL,NULL,NULL,NULL,5,1,'D',33,'2',NULL,21,'Вар.1 №8','5'),
	(705,705,'На \\[pV\\]-диаграмме (где \\[p\\] - давление, \\[V\\] - объём) изображён процесс перехода двух молей идеального одноатомного газа из состояния 1 в состояние 2. Выберите верное утверждение, характеризующее этот процесс.\n1) Изменение внутренней энергии газа в 1,5 раза больше, чем совершённая им работа.\n2)  Работа, совершённая газом, в 2,5 раза больше, чем количество теплоты, полученное газом в этом процессе.\n3) В данном процессе газ не совершал работу.\n4) В данном процессе не происходит изменения внутренней энергии газа.\n','b5_v1_9.png',NULL,NULL,NULL,5,1,'D',35,'1','рис.',21,'Вар.1 №9','5'),
	(706,706,'Газ в некотором процессе получил количество теплоты 25 Дж, а внутренняя энергия газа в этом процессе уменьшилась на 10 Дж. Какую работу совершил газ?\nОтвет: Дж',NULL,NULL,NULL,NULL,5,1,'D',37,'35',NULL,21,'Вар.1 №10','5'),
	(707,707,'На графике зависимости объёма \\[V\\] от абсолютной температуры \\[T\\] изображён процесс перехода идеального одноатомного газа из состояния 1 в состояние 2.\nИзвестно, что масса газа в этом процессе не изменялась.\nКак изменились при этом переходе плотность и давление газа?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась;\n2) уменьшилась;\n3) не изменилась.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) плотность газа\nБ) давление газа\nЕЕ ИЗМЕНЕНИЕ\n1) увеличилась\n2) уменьшилась\n3) не изменилась','b5_v1_11.png',NULL,NULL,NULL,10,1,'D',30,'23','рис.',21,'Вар.1 №11','5'),
	(708,708,'В топке тепловой машины сгорело топливо массой \\[m\\] с удельной теплотой сгорания \\[q\\]. При этом рабочее тело машины передало холодильнику количество теплоты \\[{Q_{хол}} < 0\\]. Считая, что вся теплота, выделившаяся при сгорании топлива, была передана рабочему телу, установите соответствие между физическими величинами и выражающими их формулами.\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) работа, совершённая тепловой машиной\nБ) КПД тепловой машины\nФОРМУЛА\n1) \\[1 - \\frac{{\\left| {{Q_{хол}}} \\right|}}{{qm}}\\]\n2) \\[ \\frac{{\\left| {{Q_{хол}}} \\right|}}{{qm}}\\]\n3) \\[qm - {Q_{хол}}\\]\n4) \\[qm + {Q_{хол}}\\]',NULL,NULL,NULL,NULL,10,1,'D',38,'41',NULL,21,'Вар.1 №12','5'),
	(709,709,'Незаряженный металлический шарик помещён в неоднородное электрическое поле с напряжённостью \\[\\vec E\\] (см. рисунок).Точки \\[A\\], \\[B\\], \\[C\\] и \\[D\\] лежат на поверхности шарика. Выберите верное утверждение.\n1) Разность потенциалов между точками \\[A\\] и \\[B\\] больше, чем разность потенциалов между точками \\[C\\] и \\[D\\].\n2) На поверхности шарика в окрестности точки \\[A\\] появится\nиндуцированный положительный заряд.\n3) На поверхности шарика в окрестности точки \\[D\\] появится\nиндуцированный положительный заряд.\n4) Направление вектора напряжённости электрического поля в любой точке внутри шарика совпадает с направлением вектора напряжённости внешнего электрического поля.\n','b5_v1_13.png',NULL,NULL,NULL,5,1,'D',45,'3','рис.',21,'Вар.1 №13','5'),
	(710,710,'По очень длинному тонкому прямому проводнику протекает постоянный электрический ток. Линии индукции магнитного поля, создаваемого этим током, имеют вид\n1) прямых линий, перпендикулярных проводу\n2) прямых линий, параллельных проводу\n3) изогнутых кривых сложной формы, которые начинаются и заканчиваются на проводе\n4) окружностей, центры которых лежат на проводе',NULL,NULL,NULL,NULL,5,1,'D',54,'4',NULL,21,'Вар.1 №14','5'),
	(711,711,'В школьной лаборатории есть два проводника круглого сечения. Удельное сопротивление первого проводника в 2 раза больше удельного сопротивления второго проводника. Длина первого проводника в 2 раза больше длины второго. При подключении этих проводников к одинаковым источникам постоянного напряжения за одинаковые интервалы времени во втором проводнике выделяется количество теплоты, в 4 раза большее, чем в первом. Отношение радиуса второго проводника к радиусу первого проводника равно',NULL,NULL,NULL,NULL,5,1,'D',52,'1',NULL,21,'Вар.1 №15','5'),
	(712,712,'В состав колебательного контура входят конденсатор ёмкостью 2 мкФ, катушка индуктивности и ключ. Соединение осуществляется при помощи проводов с пренебрежимо малым сопротивлением. Вначале ключ разомкнут, а конденсатор заряжен до напряжения 4 В. Затем ключ замыкают. Чему будет равна запасённая в конденсаторе энергия через \\[\\frac{1}{{12}}\\] часть периода колебаний, возникших в контуре?\nОтвет: мкДж',NULL,NULL,NULL,NULL,5,1,'D',48,'12',NULL,21,'Вар.1 №16','5'),
	(713,713,'Проводящий контур \\[KLMN\\] подключён к источнику постоянного напряжения и находится в однородном магнитном поле, линии индукции \\[\\vec B\\] которого перпендикулярны плоскости контура (см. рисунок). Провода имеют поперечное сечение \\[S\\] и удельное сопротивление \\[\\rho \\] Как изменятся следующие физические\nвеличины: сила тока, протекающая в контуре, и модуль силы Ампера, действующей на сторону \\[LM\\], - если уменьшить в 2 раза поперечное сечение проводов и увеличить в 2 раза модуль индукции магнитного поля? \nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) сила тока в контуре\nБ) модуль силы Ампера\nЕЕ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v1_17.png',NULL,NULL,NULL,10,1,'D',51,'23','рис.',21,'Вар.1 №17','5'),
	(714,714,'Проволочная рамка сопротивлением \\[R\\] и площадью \\[S\\] находится в однородном постоянном магнитном поле \\[\\vec B\\], линии индукции которого перпендикулярны плоскости рамки. В момент времени \\[t = 0\\] рамка начинает вращаться с частотой \\[n\\] оборотов в секунду вокруг оси, лежащей в плоскости рамки. Установите для момента времени \\[t > 0\\] соответствие между физическими величинами и выражающими их формулами. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) поток вектора магнитной индукции через плоскость рамки\nБ) модуль ЭДС индукции, возникающей в рамке\nФОРМУЛА\n1) \\[\\frac{{BS}}{{2\\pi n}}\\cos \\left( {2\\pi nt} \\right)\\]\n2) \\[BS\\left| {\\sin \\left( {2\\pi nt} \\right)} \\right|\\]\n3) \\[BS\\cos \\left( {2\\pi nt} \\right)\\]\n4) \\[2\\pi nBS\\left| {\\sin \\left( {2\\pi nt} \\right)} \\right|\\]',NULL,NULL,NULL,NULL,10,1,'D',58,'34',NULL,21,'Вар.1 №18','5'),
	(715,715,'В ядре \\[{}_{13}^{27}{\\text{Al}}\\] содержится\n1) 27 протонов и 13 нейтронов \n2)  13 протонов и 27 нейтронов\n3) 14 протонов и 13 нейтронов\n4) 13 протонов и 14 нейтронов\n',NULL,NULL,NULL,NULL,5,1,'D',76,'4',NULL,21,'Вар.1 №19','5'),
	(716,716,'При каком виде радиоактивного распада из ядра атома вылетает отрицательно заряженная частица?\n1) альфа-распад\n2) позитронный бета-распад\n3) электронный бета-распад\n4) гамма-распад',NULL,NULL,NULL,NULL,5,1,'D',77,'3',NULL,21,'Вар.1 №20','5'),
	(717,717,'В вакууме распространяются два параллельных пучка света. Свет первого пучка характеризуется длиной волны 300 нм, а свет второго пучка - частотой\n\\[0,5 \\cdot {10^{15}}\\]. Во сколько раз отличается энергия фотона из первого пучка от энергии фотона из второго пучка?',NULL,NULL,NULL,NULL,5,1,'D',73,'2',NULL,21,'Вар. 1 №21','5'),
	(718,718,'При переходе электрона в атоме с \\[\\left( {n + 1} \\right)\\]-го энергетического уровня на \\[n\\]-й энергетический уровень испускается фотон. Как изменятся при увеличении \\[n\\] на единицу следующие физические величины: энергия испускаемого фотона, длина волны испускаемого фотона?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) энергия испускаемого фотона\nБ) длина волны испускаемого фотона\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,10,1,'D',75,'21',NULL,21,'Вар.1 №22','5'),
	(719,719,'На занятиях физического кружка школьник изучал движение тел вблизи поверхности Земли. В своём эксперименте он использовал игрушечный пистолет с маленьким тяжёлым шариком в качестве пули, фотодатчик и электронный секундомер. В результате своей работы он построил график, показанный на рисунке,  -\nзависимость высоты \\[h\\] подъёма шарика от времени \\[t\\].\nСогласно этому графику можно утверждать, что\n1) в своём эксперименте ученик направлял ствол пистолета под углом к горизонтальной плоскости\n2)  в момент времени, соответствующий точке \\[B\\] графика, модуль скорости шарика был равен нулю\n3) проекция начальной скорости шарика на вертикальное направление была равна 2 м/с\n4) модуль скорости шарика в момент времени \\[t = 0,5\\] с был равен 3 м/с','b5_v1_23.png',NULL,NULL,NULL,5,1,'D',6,'3','рис.',21,'Вар.1 №23','5'),
	(720,720,'Луч света идёт в воде, падает на плоскую границу раздела вода-воздух и выходит из воды в воздух, частично отражаясь от границы раздела. Затем угол падения луча на границу раздела начинают увеличивать. Выберите два верных утверждения о характере изменений углов, характеризующих ход луча, и о ходе самого луча.\n1) Угол преломления луча будет уменьшаться.\n2) Преломление луча может совсем исчезнуть.\n3) Отражённый луч может совсем исчезнуть.\n4) Если преломление будет возможно, то угол преломления луча будет увеличиваться.\n5) Угол отражения луча может стать больше угла падения.',NULL,NULL,NULL,NULL,10,1,'D',66,'24',NULL,21,'Вар.1 №24','5'),
	(721,721,'Куб с ребром \\[a\\] сделан из материала, плотность которого равна 6000 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\]. Из\nэтого куба вырезают маленький кубик с ребром \\[\\frac{a}{2}\\] и заменяют его кубиком\nтаких же размеров, но сделанным из другого материала с плотностью 3000 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\]. Определите среднюю плотность полученного составного куба. \nОтвет: \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\]',NULL,NULL,NULL,NULL,30,1,'D',80,'5625',NULL,21,'Вар.1 №25','5'),
	(722,722,'В большом сосуде с жёсткими стенками, закрытом подвижным поршнем, находятся воздух и насыщенный водяной пар при температуре 100°С. Давление в сосуде равно 300 кПа. Поршень переместили, поддерживая температуру содержимого сосуда постоянной. При этом половина водяного пара сконденсировалась. Какое давление установилось в сосуде?\nОтвет: кПа',NULL,NULL,NULL,NULL,30,1,'D',32,'500',NULL,21,'Вар.1 №26','5'),
	(723,723,'Светящаяся точка находится на расстоянии 3 см от главной оптической оси тонкой собирающей линзы. Расстояние от линзы до изображения этой точки в 4 раза больше, чем фокусное расстояние линзы. Определите, на каком расстоянии от главной оптической оси линзы находится изображение светящейся точки.',NULL,NULL,NULL,NULL,30,1,'D',68,'9',NULL,21,'Вар.1 №27','5'),
	(724,724,'Вакуумные лампочки накаливания имеют весьма ограниченный срок службы. Если они уже долго светили, то их стеклянные баллоны постепенно покрываются изнутри чёрным налётом, а перегорают они чаще всего в момент включения в сеть. Объясните указанные факты, указав, какие физические явления и законы Вы использовали.',NULL,NULL,NULL,NULL,100,4,'C',49,NULL,NULL,21,'Вар.1 №28','5'),
	(725,725,'Струя воды круглого сечения радиусом \\[{{\\text{r}}_0} = 1\\] см начинает бить из шланга вверх со скоростью \\[{V_0} = 20\\] м/с. Найдите радиус струи \\[r\\] на высоте \\[h = 16\\] м\nпо вертикали от конца шланга. Трением и силами поверхностного натяжения можно пренебречь. Считайте скорость движения частиц воды по вертикали в любом поперечном сечении струи одинаковой для данного сечения, а сами частицы - находящимися в состоянии свободного падения в поле силы тяжести. ',NULL,NULL,NULL,NULL,250,10,'A',22,'\\[r = \\frac{{{r_0}}}{{\\sqrt[4]{{1 - \\frac{{2gh}}{{{V_0}^2}}}}}} \\approx 1,50\\;{\\rm{см}}\\]',NULL,21,'Вар.1 №29','5'),
	(726,726,'Гелий в количестве \\[\\nu  = 0,1\\] моля находится в горизонтальном закреплённом цилиндре с поршнем, который может без трения перемещаться в цилиндре и вначале удерживается в равновесии силой \\[{F_1} = 200\\] Н. При этом среднеквадратичная скорость движения атомов гелия составляет \\[{V_1} = 1100\\] м/с. Затем гелий стали нагревать, а поршень удерживать\nв равновесии, медленно сдвигая его и постепенно увеличивая действующую на него силу. Когда эта сила равнялась \\[{F_2} = 300\\] Н, среднеквадратичная скорость движения атомов гелия стала равной \\[{V_2} = 1500\\] м/с. На какое расстояние \\[\\Delta l\\] от исходного положения при этом сдвинулся поршень?',NULL,NULL,NULL,NULL,250,10,'A',29,'\\[\\Delta l = \\frac{{\\nu \\mu }}{3}\\left( {\\frac{{{V_2}^2}}{{{F_2}}} - \\frac{{{V_1}^2}}{{{F_1}}}} \\right) \\approx 0,193\\;{\\rm{м}} \\approx {\\rm{19}}\\;{\\rm{см}}\\]',NULL,21,'Вар.1 №30','5'),
	(727,727,'У школьника в наличии был источник постоянного напряжения с малым внутренним сопротивлением, два точных, но неидеальных измерительных прибора - амперметр и вольтметр, а также резистор с сопротивлением \\[R = 4\\] Ом. Школьник вначале подключил к источнику только вольтметр, и он показал напряжение \\[{U_0} = 5\\] В. Потом школьник собрал цепь, схема которой изображена на рисунке, и обнаружил, что амперметр показывает ток \\[{I_1} = 1\\] А, а вольтметр - напряжение \\[{U_1} = 3\\] В. Затем школьник поменял в цепи местами измерительные приборы. Чему при этом стали равны их показания \\[{I_2}\\] и \\[{U_2}\\]?\n','b5_v1_31.png',NULL,NULL,NULL,350,14,'A',51,'\\[{I_2} = 0,25\\] А, \\[{U_2} = 4,5\\] В',NULL,21,'Вар.1 №31','5'),
	(728,728,'Аквариум имеет прозрачные вертикальные стенки: три плоские (боковые и заднюю) и одну\nцилиндрическую (переднюю), с радиусом \\[R = 0,8\\] м. В него налита вода с показателем преломления \\[n = \\frac{4}{3}\\]. Мальчик, глядя в аквариум сверху (см. рисунок), видит маленькую рыбку в аквариуме на расстоянии \\[a = 20\\] см от его передней стенки. На каком расстоянии \\[b\\] от этой стенки будет видна рыбка, если мальчик будет смотреть на неё по горизонтали, перпендикулярно стенке? ','b5_v1_32.png',NULL,'b5_v1_32_answer.png',NULL,500,20,'A',66,'\\[b = \\frac{a}{{n - \\left( {n - 1} \\right)\\frac{a}{R}}} = 16\\;{\\rm{см}\\]',NULL,21,'Вар.1 №32','5'),
	(729,729,'Точечное тело движется вдоль горизонтальной оси \\[OX\\]. При этом его координата изменяется с течением времени \\[t\\] по закону \\[x\\left( t \\right) = 10 + 5t - {t^2}\\] (все величины заданы в единицах СИ). Какой из следующих графиков соответствует графику зависимости проекции скорости \\[V\\] этого тела на ось \\[OX\\] от времени?','b5_v2_1.png',NULL,NULL,NULL,5,1,'D',5,'3','рис.',21,'Вар.2 №1','5'),
	(730,730,'Небольшое тело двигалось вдоль прямой и обладало импульсом, равным по модулю 8 кг\\[ \\cdot \\]м/с. В некоторый момент времени на это тело начала действовать постоянная сила, всё время направленная вдоль этой прямой. Через 4 с после начала действия силы модуль импульса тела уменьшился в 2 раза. Чему мог быть равен модуль силы, действовавшей на тело?\n1) 1 Н или 3 Н 2) 3 Н или 5 Н 3) 1 Н или 5 Н 4) 3 Н или 6 Н',NULL,NULL,NULL,NULL,5,1,'D',16,'1',NULL,21,'Вар.2 №2','5'),
	(731,731,'Брусок массой 5 кг покоится на шероховатом горизонтальном столе. Коэффициент трения между поверхностью бруска и поверхностью стола равен 0,2. На этот брусок действуют горизонтально направленной силой 15 Н. Чему равна по модулю возникающая при этом сила трения?\nОтвет: Н',NULL,NULL,NULL,NULL,5,1,'D',12,'10',NULL,21,'Вар.2 №3','5'),
	(732,732,'Телу массой 2 кг, находящемуся у основания шероховатой наклонной плоскости, сообщили начальную скорость 3 м/с в направлении вверх вдоль наклонной плоскости. Через некоторое время тело вернулось в исходную точку, имея втрое меньшую кинетическую энергию. Какую работу совершила сила трения за время движения тела?\nОтвет: Дж',NULL,NULL,NULL,NULL,5,1,'D',22,'6',NULL,21,'Вар.2 №4','5'),
	(733,733,'Кубик из резины с ребром 10 см опускают в воду. Каково отношение объёма части кубика, находящейся под водой, к объёму части кубика, находящегося над водой? Плотность резины 0,8 \\[{\\rm{г/с}}{{\\rm{м}}^{\\rm{3}}}\\].',NULL,NULL,NULL,NULL,5,1,'D',27,'4',NULL,21,'Вар.2 №5','5'),
	(734,734,'Математический маятник, представляющий собой свинцовую дробинку, подвешенную на длинной нити, колеблется с угловой амплитудой 1 градус. Как изменятся период колебаний маятника и запас его полной механической энергии, если уменьшить длину нити маятника и уменьшить массу дробинки, оставив угловую амплитуду прежней? Для каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) период колебаний маятника\nБ) запас полной механической энергии маятника\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,10,1,'D',78,'22',NULL,21,'Вар.2 №6','5'),
	(735,735,'На рисунке изображён график зависимости проекции импульса \\[p\\] точечного тела массой 2 кг, движущегося вдоль координатной оси по гладкой горизонтальной поверхности, от времени \\[t\\]. Установите соответствие между графиками и физическими величинами, зависимости которых от времени эти графики могут представлять. В каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nГРАФИК\nА) рис.\nБ) рис.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\n1) модуль силы, действующей на тело\n2) проекция на координатную ось ускорения тела\n3) проекция на координатную ось скорости тела\n4) кинетическая энергия тела','b5_v2_7_1.png','b5_v2_7_2.png',NULL,NULL,10,1,'D',16,'32','рис.',21,'Вар.2 №7','5'),
	(736,736,'Утром после восхода солнца роса, лежавшая на траве, через некоторое время исчезла. Это произошло потому, что\n1) водяной пар, который содержался в приземном слое воздуха до восхода солнца, был ненасыщенным\n2) после восхода солнца температура в приземном слое воздуха повысилась, и водяной пар, который содержался в воздухе, стал ненасыщенным\n3) относительная влажность приземного слоя воздуха после восхода солнца увеличилась\n4) после восхода солнца трава начала менее интенсивно выделять содержащуюся в ней воду, и капли воды с травинок испарились',NULL,NULL,NULL,NULL,5,1,'D',33,'2',NULL,21,'Вар.2 №8','5'),
	(737,737,'На \\[pV\\]-диаграмме (где \\[p\\] - давление, \\[V\\] - объём) изображён процесс перехода двух молей идеального одноатомного газа из состояния 1 в состояние 2. Выберите верное утверждение, характеризующее этот процесс.\n1) Изменение внутренней энергии газа в 1,5 раза меньше, чем совершённая им работа.\n2)  Работа, совершённая газом, в 2,5 раза меньше, чем количество теплоты, полученное газом в этом процессе.\n3) В данном процессе газ не совершал работу.\n4) В данном процессе не происходит изменения внутренней энергии газа.','b5_v2_9.png',NULL,NULL,NULL,5,1,'D',35,'2','рис.',21,'Вар.2 №9','5'),
	(738,738,'Газ в некотором процессе отдал количество теплоты 35 Дж, а внутренняя энергия газа в этом процессе увеличилась на 10 Дж. Какую работу совершили над газом внешние силы?\nОтвет: Дж',NULL,NULL,NULL,NULL,5,1,'D',37,'45',NULL,21,'Вар.2 №10','5'),
	(739,739,'На графике зависимости давления \\[p\\] от абсолютной температуры \\[T\\] изображён процесс перехода идеального одноатомного газа из состояния 1 в состояние 2.\nИзвестно, что масса газа в этом процессе не изменялась.\nКак изменились при этом переходе объём газа и его плотность?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась;\n2) уменьшилась;\n3) не изменилась.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) объём газа\nБ) плотность газа\nЕЁ ИЗМЕНЕНИЕ\n1) увеличилась\n2) уменьшилась\n3) не изменилась','b5_v2_11.png',NULL,NULL,NULL,10,1,'D',30,'33','рис.',21,'Вар.2 №11','5'),
	(740,740,'В топке тепловой машины сгорело топливо массой \\[m\\] с удельной теплотой сгорания \\[q\\]. При этом рабочее тело машины совершило работу \\[A\\]. Считая, что вся теплота, выделившаяся при сгорании топлива, была передана рабочему телу, установите соответствие между физическими величинами и выражающими их формулами.\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) модуль количества теплоты, переданного рабочим телом холодильнику\nБ) КПД тепловой машины\nФОРМУЛА\n1) \\[\\frac{A}{{qm}}\\]\n2) \\[qm - A\\]\n3) \\[1 - \\frac{A}{{qm}}\\]\n4) \\[qm + A\\]',NULL,NULL,NULL,NULL,10,1,'D',38,'21',NULL,21,'Вар.2 №12','5'),
	(741,741,'Незаряженный металлический шарик помещён в неоднородное электрическое поле с напряжённостью \\[\\vec E\\] (см. рисунок).Точки \\[A\\], \\[B\\], \\[C\\] и \\[D\\] лежат на поверхности шарика. Выберите верное утверждение.\n1) Разность потенциалов между точками \\[A\\] и \\[B\\] меньше, чем разность потенциалов между точками \\[C\\] и \\[D\\].\n2) На поверхности шарика в окрестности точки \\[A\\] появится\nиндуцированный положительный заряд.\n3) На поверхности шарика в окрестности точки \\[D\\] появится\nиндуцированный положительный заряд.\n4) Направление вектора напряжённости электрического поля в любой точке внутри шарика совпадает с направлением вектора напряжённости внешнего электрического поля.','b5_v2_13.png',NULL,NULL,NULL,5,1,'D',45,'2','рис.',21,'Вар.2 №13','5'),
	(742,742,'На нити подвешен полосовой постоянный магнит, имеющий форму тонкого стержня. Северный и южный полюсы магнита находятся на концах этого стержня. Линии индукции магнитного поля, создаваемого этим магнитом, имеют вид\n1) прямых линий, перпендикулярных стержню\n2) прямых линий, параллельных стержню\n3) изогнутых кривых сложной формы, которые выходят из одного конца стержня и входят в другой его конец\n4) окружностей, центры которых лежат на оси стержня',NULL,NULL,NULL,NULL,5,1,'D',54,'3',NULL,21,'Вар.2 №14','5'),
	(743,743,'В школьной лаборатории есть два проводника круглого сечения. Удельное сопротивление первого проводника в 2 раза больше удельного сопротивления второго проводника. Длина первого проводника в 2 раза больше длины второго. При подключении этих проводников к одинаковым источникам постоянного напряжения за одинаковые интервалы времени во втором проводнике выделяется количество теплоты, в 4 раза меньшее, чем в первом. Чему равно отношение радиуса первого проводника к радиусу второго проводника?',NULL,NULL,NULL,NULL,5,1,'D',52,'4',NULL,21,'Вар.2 №15','5'),
	(744,744,'В состав колебательного контура входят конденсатор ёмкостью 2 мкФ, катушка индуктивности и ключ. Соединение осуществляется при помощи проводов с пренебрежимо малым сопротивлением. Вначале ключ разомкнут, а конденсатор заряжен до напряжения 8 В. Затем ключ замыкают. Чему будет равна запасённая в конденсаторе энергия через \\[\\frac{1}{6}\\] часть периода колебаний, возникших в контуре?\nОтвет: мкДж',NULL,NULL,NULL,NULL,5,1,'D',48,'16',NULL,21,'Вар.2 №16','5'),
	(745,745,'Проводящий контур \\[KLMN\\] подключён к источнику постоянного напряжения и находится в однородном магнитном поле, линии индукции \\[\\vec B\\] которого перпендикулярны плоскости контура (см. рисунок). Провода имеют поперечное сечение \\[S\\] и удельное сопротивление \\[\\rho \\] Как изменятся следующие физические\nвеличины: сила тока, протекающая в контуре, и модуль силы Ампера, действующей на сторону \\[LM\\], - если уменьшить в 2 раза модуль индукции магнитного поля и увеличить в 2 раза ЭДС источника? \nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) сила тока в контуре\nБ) модуль силы Ампера\nЕЕ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v2_17.png',NULL,NULL,NULL,10,1,'D',51,'13','рис.',21,'Вар.2 №17','5'),
	(746,746,'Проволочная рамка сопротивлением \\[R\\] и площадью \\[S\\] находится в однородном постоянном магнитном поле \\[\\vec B\\], линии индукции которого перпендикулярны плоскости рамки. В момент времени \\[t = 0\\] рамка начинает вращаться с частотой \\[n\\] оборотов в секунду вокруг оси, лежащей в плоскости рамки. Установите для момента времени \\[t > 0\\] соответствие между физическими величинами и выражающими их формулами. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) поток вектора магнитной индукции через плоскость рамки\nБ) модуль ЭДС индукции, возникающей в рамке\nФОРМУЛА\n1) \\[BS\\cos \\left( {2\\pi nt} \\right)\\]\n2) \\[BSR\\left| {\\sin \\left( {2\\pi nt} \\right)} \\right|\\]\n3) \\[\\frac{{2\\pi nBS\\left| {\\sin \\left( {2\\pi nt} \\right)} \\right|}}{R}\\]\n4) \\[\\frac{{BS}}{R}\\cos \\left( {2\\pi nt} \\right)\\]',NULL,NULL,NULL,NULL,10,1,'D',58,'13',NULL,21,'Вар.2 №18','5'),
	(747,747,'В ядре \\[{}_{8}^{17}{\\text{O}}\\] содержится\n1) 17 протонов и 8 нейтронов \n2) 8 протонов и 17 нейтронов\n3) 8 протонов и 9 нейтронов\n4) 9 протонов и 8 нейтронов\n',NULL,NULL,NULL,NULL,5,1,'D',76,'3',NULL,21,'Вар.2 №19','5'),
	(748,748,'При каком виде радиоактивного распада из ядра атома вылетает незаряженная частица?\n1)  альфа-распад\n2)  позитронный бета-распад\n3) электронный бета-распад\n4) гамма-распад',NULL,NULL,NULL,NULL,5,1,'D',77,'4',NULL,21,'Вар.2 №20','5'),
	(749,749,'В вакууме распространяются два параллельных пучка света. Свет первого пучка характеризуется длиной волны 600 нм, а свет второго пучка - частотой \\[{10^{15}}\\] Гц. Во сколько раз отличается энергия фотона из второго пучка от энергии фотона из первого пучка?',NULL,NULL,NULL,NULL,5,1,'D',73,'2',NULL,21,'Вар.2 №21','5'),
	(750,750,'При переходе электрона в атоме с \\[\\left( {n + 1} \\right)\\]-го энергетического уровня на \\[n\\]-й энергетический уровень испускается фотон. Как изменятся следующие физические величины при уменьшении \\[n\\] на единицу: энергия испускаемого фотона, длина волны испускаемого фотона?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) энергия испускаемого фотона\nБ) длина волны испускаемого фотона\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится\n',NULL,NULL,NULL,NULL,10,1,'D',75,'12',NULL,21,'Вар.2 №22','5'),
	(751,751,'На занятиях физического кружка школьник изучал движение тел вблизи поверхности Земли. В своём эксперименте он использовал игрушечный пистолет с маленьким тяжёлым шариком в качестве пули, фотодатчик и электронный секундомер. В результате своей работы он построил график, показанный на рисунке, - зависимость высоты \\[h\\] подъёма шарика от времени \\[t\\].\nСогласно этому графику можно утверждать, что\n1) в своём эксперименте ученик направлял ствол пистолета вертикально вверх\n2) за первые 0,3 секунды перемещение шарика составляет 15 см\n3) модуль начальной скорости шарика был равен 2 м/с\n4) проекция скорости шарика на вертикальное направление в момент времени \\[t = 0,5\\] с равна -3 м/с','b5_v2_23.png',NULL,NULL,NULL,5,1,'D',6,'4','рис.',21,'Вар.2 №23','5'),
	(752,752,'Луч света идёт в воде, падает на плоскую границу раздела вода-воздух и целиком отражается от границы раздела. Затем угол падения луча на границу раздела начинают уменьшать. Выберите два верных утверждения о характере изменений углов, характеризующих ход луча, и о ходе самого луча.\n1) Угол отражения луча будет уменьшаться.\n2) Может появиться преломлённый луч.\n3) Отражённый луч может совсем исчезнуть.\n4) Если преломление будет возможно, то угол преломления луча будет увеличиваться.\n5) Угол отражения может стать больше угла падения.',NULL,NULL,NULL,NULL,10,1,'D',66,'12',NULL,21,'Вар.2 №24','5'),
	(753,753,'Куб с ребром \\[a\\] сделан из материала, плотность которого равна 6000 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\]. Из этого куба вырезают маленький кубик с ребром \\[\\frac{a}{2}\\] и заменяют его кубиком таких же размеров, но сделанным из другого материала с плотностью 12000 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\]. Определите среднюю плотность полученного составного куба. \nОтвет: \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\].',NULL,NULL,NULL,NULL,30,1,'D',80,'6750',NULL,21,'Вар.2 №25','5'),
	(754,754,'В большом сосуде с жёсткими стенками, закрытом подвижным поршнем, находятся воздух, малое количество воды и насыщенный водяной пар при температуре 100°С. Давление в сосуде равно 300 кПа. Поршень переместили, поддерживая температуру содержимого сосуда постоянной. При этом масса водяного пара в сосуде возросла в два раза и на дне сосуда осталось некоторое количество жидкой воды. Какое давление установилось в сосуде?\nОтвет: кПа.',NULL,NULL,NULL,NULL,30,1,'D',32,'200',NULL,21,'Вар.2 №26','5'),
	(755,755,'Изображение светящейся точки находится на расстоянии 2 см от главной оптической оси тонкой собирающей линзы. Расстояние от линзы до изображения этой точки в 3 раза больше, чем фокусное расстояние линзы. Определите, на каком расстоянии от главной оптической оси линзы находится сама светящаяся точка.\nОтвет: см.',NULL,NULL,NULL,NULL,30,1,'D',68,'1',NULL,21,'Вар.2 №27','5'),
	(756,756,'Вакуумные лампочки накаливания имеют весьма ограниченный срок службы - в конце своей «жизни» они перегорают, причём случается это, как правило, в момент включения в сеть. Объясните эти факты, указав, какие физические явления и законы Вы использовали.',NULL,NULL,NULL,NULL,100,4,'C',49,NULL,NULL,21,'Вар.2 №28','5'),
	(757,757,'Струя воды круглого сечения радиусом \\[{{\\text{r}}_0} = 1,1\\] см начинает бить из шланга вверх со скоростью \\[{V_0} = 15\\] м/с. Найдите радиус струи \\[r\\] на высоте \\[h = 10\\] м по вертикали от конца шланга. Трением и силами поверхностного натяжения можно пренебречь. Считайте скорость движения частиц воды по вертикали в любом поперечном сечении струи одинаковой для данного сечения, а сами частицы - находящимися в состоянии свободного падения в поле силы тяжести. ',NULL,NULL,NULL,NULL,250,10,'A',22,NULL,NULL,21,'Вар.2 №29','5'),
	(758,758,'Гелий в количестве \\[\\nu  = \\frac{1}{{20}}\\] моля находится в горизонтальном закреплённом цилиндре с поршнем, который может без трения перемещаться в цилиндре и вначале удерживается в равновесии силой \\[{F_1} = 280\\] Н. При этом среднеквадратичная скорость движения атомов гелия составляет \\[{V_1} = 1400\\] м/с. Затем гелий стали охлаждать, а поршень медленно сдвигать, постепенно уменьшая действующую на него силу. Когда эта сила равнялась \\[{F_2} = 150\\] Н, среднеквадратичная скорость движения атомов гелия стала равной \\[{V_2} = 1200\\] м/с. На какое расстояние \\[\\Delta l\\] от исходного положения при этом сдвинулся поршень?',NULL,NULL,NULL,NULL,250,10,'A',29,NULL,NULL,21,'Вар.2 №30','5'),
	(759,759,'У школьника в наличии был источник постоянного напряжения с малым внутренним сопротивлением, два точных, но неидеальных измерительных прибора - амперметр и вольтметр, а также резистор с сопротивлением \\[R = 4\\] Ом. Школьник вначале подключил к источнику только вольтметр, и он показал напряжение \\[{U_0} = 5\\] В. Потом школьник собрал цепь, схема которой изображена на рисунке, и обнаружил, что амперметр показывает ток \\[{I_1} = 0,25\\] А, а вольтметр - напряжение \\[{U_1} = 4,5\\] В. Затем школьник понял, что перепутал положения приборов и поменял их местами. Чему при этом стали равны показания амперметра и вольтметра \\[{I_2}\\] и \\[{U_2}\\]?','b5_v2_31.png',NULL,NULL,NULL,350,14,'A',51,NULL,NULL,21,'Вар.2 №31','5'),
	(760,760,'Аквариум имеет прозрачные вертикальные стенки: три плоские (боковые и заднюю) и одну цилиндрическую (переднюю), с радиусом \\[R = 0,8\\] м. В него налита вода с показателем преломления \\[n = \\frac{4}{3}\\]. Мальчик, глядя на маленькую рыбку в аквариуме по горизонтали, перпендикулярно цилиндрической стене, видит рыбку (точнее, её изображение) на расстоянии \\[b = 16\\] см от этой стенки (см. рисунок). На каком расстоянии \\[a\\] от этой стенки будет видна рыбка, если мальчик будет смотреть на неё сквозь поверхность воды по вертикали, сверху вниз?','b5_v2_32.png',NULL,'b5_v2_32_answer.png',NULL,500,20,'A',66,NULL,NULL,21,'Вар.2 №32','5'),
	(761,761,'Материальная точка движется вдоль оси \\[OX\\]. На рисунке приведён график зависимости проекции скорости \\[{V_x}\\] этой точки на ось \\[OX\\] от времени \\[t\\]. Согласно графику, материальная точка\n1) в момент времени \\[t = 3\\] с изменила направление движения на противоположное\n2) всё время двигалась в одном направлении\n3) всё время имела положительную проекцию ускорения на ось \\[OX\\]\n4) за всё время движения ни разу не останавливалась','b5_v3_1.png',NULL,NULL,NULL,5,1,'D',5,'2','рис.',22,'Вар.3 №1','5'),
	(762,762,'Точечное тело движется по гладкой горизонтальной поверхности под действием постоянной горизонтальной силы, направленной вдоль оси \\[OX\\]. Известно, что проекция импульса этого тела на указанную ось изменяется со временем по закону \\[{p_x} =  - 4 + t\\]. Чему равен модуль силы, действующей на это тело?\n1) 8 Н 2) 4 Н 3) 2 Н 4) 1 Н',NULL,NULL,NULL,NULL,5,1,'D',16,'4',NULL,22,'Вар.3 №2','5'),
	(763,763,'На неподвижном горизонтальном столе лежит однородный куб. Его убирают, и вместо него кладут другой куб, сделанный из материала с вдвое большей плотностью и с ребром втрое большей длины. Во сколько раз увеличится давление, оказываемое кубом на стол?',NULL,NULL,NULL,NULL,5,1,'D',24,'6',NULL,22,'Вар.3 №3','5'),
	(764,764,'Тела 1 и 2 находятся на гладкой горизонтальной плоскости (см. рисунок, вид сверху). На них одновременно начинают действовать постоянные силы, равные соответственно, \\[{F_1} = 3\\] Н и \\[{F_2}\\]. Чему равно изменение проекции импульса системы этих тел на ось \\[OY\\] за первые две секунды?\nОтвет: \\[{\\rm{кг}} \\cdot {\\rm{м/с}}\\].','b5_v3_4.png',NULL,NULL,NULL,5,1,'D',16,'8','рис.',22,'Вар.3 №4','5'),
	(765,765,'Груз подвешен на лёгкой вертикальной пружине и совершает на ней колебания с частотой \\[\\omega  = 10\\] рад/с, двигаясь по вертикали. На какую длину растянется эта пружина, если аккуратно подвесить к ней тот же груз, не возбуждая колебаний?\nОтвет: см.',NULL,NULL,NULL,NULL,5,1,'D',11,'10',NULL,22,'Вар.3 №5','5'),
	(766,766,'На рисунке изображены две шестерёнки 1 и 2, закреплённые на двух параллельных осях \\[{O_1}\\] и \\[{O_2}\\]. Ось \\[{O_2}\\] шестеренки 2 вращают с постоянной угловой скоростью \\[\\omega \\]. На краю шестерёнки 1 в точке \\[A\\] закреплено точечное тело. Как изменятся период обращения этого тела и модуль его линейной скорости, если закрепить это тело в точке \\[B\\] на краю шестерёнки 2 (при неизменной угловой скорости вращения оси шестерёнки 2)?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) период обращения\nБ) модуль линейной скорости\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится\n','b5_v3_6.png',NULL,NULL,NULL,10,1,'D',15,'13','рис.',22,'Вар.3  №6','5'),
	(767,767,'Маленькой шайбе, покоящейся у основания гладкой наклонной плоскости, сообщают начальную скорость \\[{V_0}\\], направленную вдоль наклонной плоскости вверх (см. рисунок). Наклонная плоскость достаточно длинная. Установите соответствие между зависимостями физических величин от времени и графиками.\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) проекция скорости \\[{V_x}\\]\nБ) модуль скорости \\[V\\]\nГРАФИК\n1)\n2)\n3)\n4)','b5_v3_7_1.png','b5_v3_7_2.png',NULL,NULL,10,1,'D',5,'13','рис.',22,'Вар.3 №7','5'),
	(768,768,'Скорость диффузии не зависит от\nА) температуры\nБ) агрегатного состояния веществ\nКакие из представленных утверждений верны\n1) только А\n2) только Б\n3) и А, и Б\n4) ни А, ни Б',NULL,NULL,NULL,NULL,5,1,'D',29,'4',NULL,22,'Вар.3 №8','5'),
	(769,769,'С постоянным количеством идеального газа провели процесс 1-2-3-4-1, изображённый на графике зависимости давления \\[p\\] от объёма \\[V\\]. Какая точка на графике соответствует состоянию с наибольшей температурой?\n1) 1 2) 2 3) 3 4) 4','b5_v3_9.png',NULL,NULL,NULL,5,1,'D',31,'3','рис.',22,'Вар.3 №9','5'),
	(770,770,'Определите плотность водяного пара в воздухе, который находится при температуре 100 °С, если известно, что относительная влажность этой порции воздуха равна 30 %. Ответ округлите до сотых долей\nОтвет: \\[{\\rm{кг/}}{{\\rm{м}}^3}\\]',NULL,NULL,NULL,NULL,5,1,'D',33,'0,17',NULL,22,'Вар.3 №10','5'),
	(771,771,'На рисунке изображён график зависимости объёма \\[V\\] одного моля идеального одноатомного газа от его температуры \\[T\\] в процессе 1-2. Как в результате перехода из состояния 1 в состояние 2 изменяются внутренняя энергия газа и давление газа?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличивается;\n2) уменьшается;\n3) не изменяется.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) внутренняя энергия газа\nБ) давление газа\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v3_11.png',NULL,NULL,NULL,10,1,'D',31,'12','рис.',22,'Вар.3 №11','5'),
	(772,772,'Один моль идеального газа находился в некотором состоянии 1. Затем в результате некоторых процессов, в ходе которых газ мог обмениваться количеством теплоты \\[\\Delta Q\\] с окружающими телами, газ медленно перешёл в состояние 2. Установите соответствие между графиками процессов 1-2 и названиями этих процессов, если \\[T\\] - абсолютная температура газа, а \\[V\\] - его объём. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nГРАФИК\nА)\nБ)\nНАЗВАНИЕ ПРОЦЕССА\n1) изотермический\n2) изохорный\n3) изобарный\n4) адиабатный','b5_v3_12_1.png','b5_v3_12_2.png',NULL,NULL,10,1,'D',31,'14','рис.',22,'Вар.3 №12','5'),
	(773,773,'В плоский конденсатор помещена диэлектрическая пластина, толщина которой намного меньше размера обкладок конденсатора. Конденсатор подключён к источнику постоянного напряжения \\[U\\] так, как показано на рисунке. На какой поверхности диэлектрической пластины локализованы положительные поляризационные заряды?\n1) А 2) B 3) C 4) на всех трёх поверхностях A, B и C','b5_v3_13.png',NULL,NULL,NULL,5,1,'D',48,'1','рис.',22,'Вар.3 №13','5'),
	(774,774,'Магнитное поле образовано двумя бесконечно длинными тонкими прямыми проводами, по которым протекают одинаковые токи \\[I\\]. Провод 1 лежит на оси \\[OY\\], провод 2 параллелен оси \\[OZ\\] и пересекает ось \\[OX\\]. Направление вектора индукции магнитного поля, создаваемого этими токами в точке \\[A\\], изображено на рисунке (пунктирный прямоугольник параллелен плоскости \\[YOZ\\]).\nНа каком из следующих рисунков правильно показаны направления протекания токов в проводах?\n1) 1 2) 2 3) 3 4) 4','b5_v3_14_1.png','b5_v3_14_2.png',NULL,NULL,5,1,'D',54,'2','рис.',22,'Вар.3 №14','5'),
	(775,775,'Участок цепи, схема которого изображена на рисунке, до замыкания ключа К имел электрическую ёмкость 3 нФ. После замыкания ключа\nэлектроёмкость данного участка цепи стала равной 4 нФ. Чему равна электроёмкость конденсатора \\[{C_x}\\]?\nОтвет: нФ','b5_v3_15.png',NULL,NULL,NULL,5,1,'D',48,'6','рис.',22,'Вар.3 №15','5'),
	(776,776,'Прямой проводник длиной 25 см равномерно поступательно движется в однородном постоянном магнитном поле, направление которого совпадает с направлением вертикальной оси \\[Y\\] (на рисунке эта ось направлена «на нас»). Скорость проводника равна 1 м/с, направлена перпендикулярно проводнику, и составляет угол 60° с горизонтальной осью \\[X\\], как показано на рисунке. Разность потенциалов между концами проводника равна 75 мВ. Определите модуль индукции магнитного поля.\nОтвет: Тл.','b5_v3_16.png',NULL,NULL,NULL,5,1,'D',60,'0,3','рис.',22,'Вар.3 №16','5'),
	(777,777,'Заряженная частица влетает в полупространство, в котором создано однородное постоянное магнитное поле с индукцией \\[\\vec B\\].\nВектор скорости \\[\\vec V\\] частицы в момент попадания в магнитное поле перпендикулярен вектору \\[\\vec B\\]. Как изменятся радиус траектории частицы при движении в поле и время нахождения частицы в поле, если увеличить модуль скорости частицы при её попадании в поле?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) радиус траектории частицы при движении в поле\nБ) время нахождения частицы в поле\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v3_17.png',NULL,NULL,NULL,10,1,'D',57,'13','рис.',22,'Вар.3 №17','5'),
	(778,778,'На рисунке изображена схема электрической цепи, состоящей из источника постоянного напряжения с ЭДС \\[E\\] и с внутренним сопротивлением \\[r\\], двух одинаковых резисторов 1 и 2 сопротивлением \\[2r\\] каждый и идеального амперметра.\nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) ток, протекающий через амперметр\nБ) мощность, выделяющаяся в резисторе 2\nФОРМУЛА\n1) \\[\\frac{{{E^2}}}{{8r}}\\]\n2) \\[\\frac{E}{{2r}}\\]\n3) \\[\\frac{2}{{25}}\\frac{{{E^2}}}{r}\\]\n4) \\[\\frac{E}{r}\\]','b5_v3_18.png',NULL,NULL,NULL,10,1,'D',51,'21','рис.',22,'Вар.3 №18','5'),
	(779,779,'Ядро какого изотопа из нижеперечисленных содержит наибольшее количество нейтронов?\n1) \\[{}_6^{13}{\\rm{C}}\\] 2) \\[{}_9^{15}{\\rm{F}}\\] 3) \\[{}_4^8{\\rm{Be}}\\] 4) \\[{}_2^7{\\rm{He}}\\]',NULL,NULL,NULL,NULL,5,1,'D',76,'1',NULL,22,'Вар.3 №19','5'),
	(780,780,'Определите неизвестный продукт \\[X\\] ядерной реакции\n\\[{}_4^9{\\rm{Be + }}{}_2^4{\\rm{He}} \\to {}_6^{12}{\\rm{C + X}}{\\rm{.}}\\]\n1) электрон 2) протон 3) \\[\\alpha \\]-частица 4) нейтрон',NULL,NULL,NULL,NULL,5,1,'D',77,'4',NULL,22,'Вар.3 №20','5'),
	(781,781,'Современная зелёная лазерная указка обеспечивает генерацию лазерного луча площадью поперечного сечения 1 \\[{\\rm{м}}{{\\rm{м}}^2}\\] и мощностью 0,3 Вт. Какая энергия запасена в одном кубическом сантиметре этого луча?\nОтвет: \\[нДж/с{м^3}\\].',NULL,NULL,NULL,NULL,5,1,'D',73,'1',NULL,22,'Вар.3 №21','5'),
	(782,782,'В пробирке находится \\[\\nu \\] молей атомов \\[\\beta \\]-радиоактивного вещества с периодом полураспада \\[T\\]. Экспериментатор отмеряет время \\[10T\\]. Потом он берёт другую пробирку с тем же количеством атомов другого радиоактивного вещества с периодом полураспада \\[2T\\] и отмеряет то же самое время \\[10T\\]. Известно, что продуктами распада обоих веществ являются стабильные изотопы.\nКак для второй пробирки по сравнению с первой через время \\[10T\\] изменяются следующие физические величины: количество вещества в пробирке; количество радиоактивных атомов в пробирке? Для каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) количество вещества в пробирке\nБ) количество радиоактивных атомов в пробирке\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,10,1,'D',77,'31',NULL,22,'Вар.3 №22','5'),
	(783,783,'Школьник собирается проверить гипотезу о том, что коэффициент сухого трения зависит от материала трущихся поверхностей. Для этого он кладёт на горизонтальную стальную поверхность деревянный брусок массой \\[m\\] и измеряет модуль минимальной горизонтально направленной силы, которую нужно приложить к бруску для того, чтобы сдвинуть его с места. Какой второй опыт должен провести школьник для того, чтобы проверить гипотезу?\n1) с деревянным бруском массой \\[2m\\], лежащим на стальной поверхности\n2) со стальным бруском массой \\[\\frac{m}{2}\\], лежащим на деревянной поверхности\n3) с деревянным бруском массой \\[2m\\], лежащим на деревянной поверхности\n4) с деревянным бруском массой \\[m\\], лежащим на деревянной поверхности',NULL,NULL,NULL,NULL,5,1,'D',12,'4',NULL,22,'Вар.3 №23','5'),
	(784,784,'В двух закрытых сосудах одинакового объёма (1 литр) нагревают два различных газа 1 и 2. На рисунке показаны зависимости давления \\[p\\] этих газов от времени \\[t\\]. Известно, что начальные температуры газов были одинаковы.\nВыберите два верных утверждения,\nсоответствующие результатам этих экспериментов.\n1) Количество вещества первого газа меньше, чем количество вещества второго газа.\n2) Так как по условию эксперимента газы имеют одинаковые объёмы, а в момент времени \\[t = 40\\] мин они имеют и одинаковые давления, температуры этих газов в этот момент времени также одинаковы.\n3) В момент времени \\[t = 40\\] мин температура газа 1 больше температуры газа 2.\n4) В процессе проводимого эксперимента внутренняя энергия обоих газов увеличивается.\n5) В процессе проводимого эксперимента оба газа не совершают работу.','b5_v3_24.png',NULL,NULL,NULL,10,1,'D',29,'45','рис.',22,'Вар.3 №24','5'),
	(785,785,'Камень бросили вертикально вверх с начальной скоростью 30 м/с. Через какое минимальное время после броска кинетическая энергия камня будет в 3 раза меньше его потенциальной энергии, отсчитанной от уровня точки бросания? Сопротивление воздуха пренебрежимо мало.\nОтвет: с.',NULL,NULL,NULL,NULL,30,1,'D',22,'1,5',NULL,22,'Вар.3 №25','5'),
	(786,786,'В идеальной тепловой машине температура холодильника отличается от температуры нагревателя в 0,75 раза. Над рабочим телом машины совершается один цикл. Чему равно отношение модуля количества теплоты, отданного рабочим телом, к совершённой машиной работе?',NULL,NULL,NULL,NULL,30,1,'D',37,'4',NULL,22,'Вар.3 №26','5'),
	(787,787,'Поток фотонов падает на металлическую пластину с работой выхода 2,6 эВ и выбивает из пластины фотоэлектроны, которые попадают в замедляющее однородное электрическое поле с модулем напряжённости 1 В/м. Какое время проходит от момента начала замедления фотоэлектронов до их полной остановки, если энергия падающего фотона 11,5 эВ? Считайте, что все фотоэлектроны при вылете из пластины имеют одинаковую скорость.\nОтвет: мкс.',NULL,NULL,NULL,NULL,30,1,'D',72,'10',NULL,22,'Вар.3 №27','5'),
	(788,788,'Во время грозы было видно, как между облаками проскакивает длинная молния, а затем, через некоторое время, был слышен удар грома и его раскаты, как бы «разбегающиеся» в разные стороны от середины молнии. Объясните описанные выше явления, наблюдаемые во время грозы.',NULL,NULL,NULL,NULL,80,3,'C',53,NULL,NULL,22,'Вар.3 №28','5'),
	(789,789,'К потолку на двух одинаковых лёгких пружинах общей жёсткостью \\[k = 400\\] Н/м подвешена чашка массой \\[m = 500\\] г. С высоты \\[h = 10\\] см в чашку падает и прилипает к ней груз такой же массой \\[m\\] (см. рисунок). На какое максимальное расстояние \\[H\\] после этого опустится чашка относительно своего исходного положения? Потерями механической энергии можно пренебречь.','b5_v3_29.png',NULL,NULL,NULL,400,16,'A',22,'5 см',NULL,22,'Вар.3 №29','5'),
	(790,790,'Идеальный одноатомный газ в количестве \\[\\nu  = 3\\] моль сначала охладили, уменьшив его температуру от \\[{T_1} = 300\\] К до \\[{T_2} = \\frac{{{T_1}}}{n}\\], где \\[n = 2\\], а затем нагрели до начальной температуры. При этом давление \\[p\\] газа изменялось так, как показано на графике. Какое суммарное количество теплоты газ отдал и получил в процессе 1-2-3? ','b5_v3_30.png',NULL,NULL,NULL,250,10,'A',38,'3740 Дж',NULL,22,'Вар.3 №30','5'),
	(791,791,'Плоский конденсатор имеет между своими обкладками пластину из твёрдого диэлектрика с диэлектрической проницаемостью \\[\\varepsilon  = 7\\], полностью заполняющую зазор между ними. Ёмкость конденсатора при этом равна \\[C = 100\\] пФ. Конденсатор подсоединён к источнику с напряжением \\[U = 50\\] В. Какую работу \\[A\\] надо совершить для того, чтобы медленно вытянуть диэлектрическую пластину из конденсатора? Трения нет.',NULL,NULL,NULL,NULL,350,14,'A',48,'107 нДж',NULL,22,'Вар.3 №31','5'),
	(792,792,'Небольшой уединённый металлический шарик долго облучали в вакууме светом с длиной волны \\[\\lambda  = 412\\] нм, в результате чего он зарядился и приобрёл потенциал \\[\\varphi  = 1\\] В. Чему равна работа выхода электрона из этого металла? Ответ выразите в эВ.',NULL,NULL,NULL,NULL,150,6,'B',72,'2,0 эВ',NULL,22,'Вар.3 №32','5'),
	(793,793,'Материальная точка движется вдоль оси \\[OX\\]. На рисунке приведён график зависимости модуля скорости \\[V\\] этой точки от времени \\[t\\]. Согласно графику, материальная точка\n1) в момент времени \\[t = 3\\] с изменила направление движения на противоположное\n2) всё время двигалась в одном направлении\n3) всё время имела положительную проекцию ускорения на ось \\[OX\\]\n4) в момент времени \\[t = 3\\] с остановилась.','b5_v4_1.png',NULL,NULL,NULL,5,1,'D',5,'4','рис.',22,'Вар.4 №1','5'),
	(794,794,'Точечное тело движется по гладкой горизонтальной поверхности под действием постоянной горизонтальной силы, направленной вдоль оси \\[OX\\]. Известно, что проекция импульса этого тела на указанную ось изменяется со временем по закону \\[{p_x} =  - 10 + 4t\\]. Чему равен модуль силы, действующей на это тело?\n1) 10 Н 2) 5 Н 3) 4 Н 4) 2 Н',NULL,NULL,NULL,NULL,5,1,'D',16,'3',NULL,22,'Вар.4 №2','5'),
	(795,795,'На неподвижном горизонтальном столе лежит однородный куб. Его убирают, и вместо него кладут другой куб, сделанный из материала с втрое меньшей плотностью и с ребром вдвое меньшей длины. Во сколько раз уменьшится давление, оказываемое кубом на стол?',NULL,NULL,NULL,NULL,5,1,'D',24,'6',NULL,22,'Вар.4 №3','5'),
	(796,796,'Тела 1 и 2 находятся на гладкой горизонтальной плоскости (см. рисунок, вид сверху). На них одновременно начинают действовать постоянные силы, равные соответственно, \\[{F_1} = 3\\] Н и \\[{F_2}\\]. Чему равно изменение проекции импульса системы этих тел на ось \\[OX\\] за первые две секунды?\nОтвет: \\[{\\rm{кг}} \\cdot {\\rm{м/с}}\\].','b5_v4_4.png',NULL,NULL,NULL,5,1,'D',16,'0','рис.',22,'Вар.4 №4','5'),
	(797,797,'Груз подвешен на лёгкой вертикальной пружине и совершает на ней колебания с частотой \\[\\omega  = 5\\] рад/с, двигаясь по вертикали. На какую длину растянется эта пружина, если аккуратно подвесить к ней тот же груз, не возбуждая колебаний?\nОтвет: см.',NULL,NULL,NULL,NULL,5,1,'D',11,'40',NULL,22,'Вар.4 №5','5'),
	(798,798,'На рисунке изображены две шестерёнки 1 и 2, закреплённые на двух параллельных осях \\[{O_1}\\] и \\[{O_2}\\]. Ось \\[{O_2}\\] шестеренки 2 вращают с постоянной угловой скоростью \\[\\omega \\]. На краю шестерёнки 1 в точке \\[A\\] закреплено точечное тело. Как изменятся модуль центростремительного ускорения этого тела и его угловая скорость, если закрепить это тело в точке \\[B\\] на краю шестерёнки 2 (при неизменной угловой скорости вращения оси шестерёнки 2)?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) модуль центростремительного\nБ) угловая скорость\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v4_6.png',NULL,NULL,NULL,10,1,'D',15,'22','рис.',22,'Вар.4 №6','5'),
	(799,799,'Маленькой шайбе, покоящейся у основания гладкой наклонной плоскости, сообщают начальную скорость \\[{V_0}\\], направленную вдоль наклонной плоскости вверх (см. рисунок). Наклонная плоскость достаточно длинная. Установите соответствие между зависимостями физических величин от времени и графиками.\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) модуль ускорения \\[a\\]\nБ) потенциальная энергия \\[u\\] (относительно начального положения шайбы)\nГРАФИК\n1)\n2)\n3)\n4)','b5_v4_7_1.png','b5_v4_7_2.png',NULL,NULL,10,1,'D',5,'24','рис.',22,'Вар.4 №7','5'),
	(800,800,'Скорость диффузии не зависит от\nА) температуры\nБ) агрегатного состояния веществ\nКакие из представленных утверждений верны\n1) только А 2) только Б 3) и А, и Б 4) ни А, ни Б',NULL,NULL,NULL,NULL,5,1,'D',29,'3',NULL,22,'Вар.4 №8','5'),
	(801,801,'С постоянным количеством идеального газа провели процесс 1-2-3-4-1, изображённый на графике зависимости давления \\[p\\] от объёма \\[V\\]. Какая точка на графике соответствует состоянию с наименьшей температурой?\n1) 1 2) 2 3) 3 4) 4','b5_v4_9.png',NULL,NULL,NULL,5,1,'D',31,'1','рис.',22,'Вар.4 №9','5'),
	(802,802,'Определите массу водяного пара в воздухе, который находится в объёме 1 \\[{{\\rm{м}}^3}\\] при температуре 100 °С, если известно, что относительная влажность этой порции воздуха равна 60 %. Ответ округлите до сотых долей.\nОтвет: кг.',NULL,NULL,NULL,NULL,5,1,'D',33,'0,35',NULL,22,'Вар.4 №10','5'),
	(803,803,'На рисунке изображён график зависимости давления \\[p\\] одного моля идеального одноатомного газа от его температуры \\[T\\] в процессе 1-2. Как в результате перехода из состояния 1 в состояние 2 изменяются внутренняя энергия газа и объём газа?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличивается;\n2) уменьшается;\n3) не изменяется.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) внутренняя энергия газа\nБ) объём газа\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v4_11.png',NULL,NULL,NULL,10,1,'D',31,'21','рис.',22,'Вар.4 №11','5'),
	(804,804,'Один моль идеального газа находился в некотором состоянии 1. Затем в результате некоторых процессов, в ходе которых газ мог обмениваться количеством теплоты \\[\\Delta Q\\] с окружающими телами, газ медленно перешёл в состояние 2. Установите соответствие между графиками процессов 1-2 и названиями этих процессов, если \\[V\\] - объём газа, а \\[U\\] - его внутренняя энергия. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nГРАФИК\nА)\nБ)\nНАЗВАНИЕ ПРОЦЕССА\n1) изотермический\n2) изохорный\n3) изобарный\n4) адиабатный','b5_v4_12_1.png','b5_v4_12_2.png',NULL,NULL,10,1,'D',31,'21','рис.',22,'Вар.4 №12','5'),
	(805,805,'В плоский конденсатор помещена диэлектрическая пластина, толщина которой намного меньше размера обкладок конденсатора. Конденсатор подключён к источнику постоянного напряжения \\[U\\] так, как показано на рисунке. На какой поверхности диэлектрической пластины локализованы отрицательные поляризационные заряды?\n1) А 2) B 3) C 4) на всех трёх поверхностях A, B и C','b5_v4_13.png',NULL,NULL,NULL,5,1,'D',48,'3','рис.',22,'Вар.4 №13','5'),
	(806,806,'Магнитное поле образовано двумя бесконечно длинными тонкими прямыми проводами, по которым протекают одинаковые токи \\[I\\]. Провод 1 лежит на оси \\[OY\\], провод 2 параллелен оси \\[OZ\\] и пересекает ось \\[OX\\]. Направление вектора индукции магнитного поля, создаваемого этими токами в точке \\[A\\], изображено на рисунке (пунктирный прямоугольник параллелен плоскости \\[YOZ\\]).\nНа каком из следующих рисунков правильно показаны направления протекания токов в проводах?\n1) 1 2) 2 3) 3 4) 4','b5_v4_14.png',NULL,NULL,NULL,5,1,'D',54,'1','рис.',22,'Вар.4 №14','5'),
	(807,807,'Участок цепи, схема которого изображена на рисунке, до размыкания ключа К имел электрическую ёмкость 8 нФ. После размыкания ключа электроёмкость данного участка цепи стала равной 6 нФ. Чему равна электроёмкость конденсатора \\[{C_x}\\]?\nОтвет: нФ','b5_v4_15.png',NULL,NULL,NULL,5,1,'D',48,'12','рис.',22,'Вар.4 №15','5'),
	(808,808,'Прямой проводник длиной 50 см равномерно поступательно движется в однородном постоянном магнитном поле, направление которого совпадает с направлением вертикальной оси \\[Y\\] (на рисунке эта ось направлена «на нас»). Скорость проводника направлена перпендикулярно ему и составляет угол 30° с горизонтальной осью \\[X\\], как показано на рисунке. Разность потенциалов между концами проводника равна 25 мВ, модуль индукции магнитного поля 0,1 Тл. Определите модуль скорости движения проводника.\nОтвет: м/с.','b5_v4_16.png',NULL,NULL,NULL,5,1,'D',60,'0,5','рис.',22,'Вар.4 №16','5'),
	(809,809,'Заряженная частица влетает в полупространство, в котором создано однородное постоянное магнитное поле с индукцией \\[\\vec B\\].\nВектор скорости \\[\\vec V\\] частицы в момент попадания в магнитное поле перпендикулярен вектору \\[\\vec B\\]. Как изменятся радиус траектории частицы при движении в поле и время нахождения частицы в поле, если уменьшить скорость частицы при её попадании в поле?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) радиус траектории частицы при движении в поле\nБ) время нахождения частицы в поле\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v4_17.png',NULL,NULL,NULL,10,1,'D',57,'23','рис.',22,'Вар.4 №17','5'),
	(810,810,'На рисунке изображена схема электрической цепи, состоящей из источника постоянного напряжения с ЭДС \\[E\\] и с внутренним сопротивлением \\[r\\], двух одинаковых резисторов 1 и 2 сопротивлением \\[2r\\] каждый и идеального амперметра.\nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) ток, протекающий через амперметр\nБ) мощность, выделяющаяся в резисторе 1\nФОРМУЛА\n1) \\[\\frac{{{E^2}}}{{5r}}\\]\n2) \\[\\frac{E}{{2r}}\\]\n3) \\[\\frac{2}{{25}} \\cdot \\frac{{{E^2}}}{r}\\]\n4) \\[\\frac{E}{5r}\\]','b5_v4_18.png',NULL,NULL,NULL,10,1,'D',51,'43','рис.',22,'Вар.4 №18','5'),
