	(813,813,'Современная зелёная лазерная указка обеспечивает генерацию лазерного луча мощностью 0,6 Вт. В одном кубическом сантиметре этого луча запасена энергия 2 нДж. Какова площадь поперечного сечения такого луча?\nОтвет: \\[{\\rm{м}}{{\\rm{м}}^2}\\]',NULL,NULL,NULL,NULL,5,1,'D',73,'1',NULL,22,'Вар.4 №21','5'),
	(814,814,'В пробирке находится \\[\\nu \\] молей атомов \\[\\beta \\]-радиоактивного вещества с периодом полураспада \\[T\\]. Экспериментатор отмеряет время \\[10T\\]. Потом он берёт другую пробирку с тем же количеством атомов другого радиоактивного вещества с периодом полураспада \\[5T\\] и отмеряет то же самое время \\[10T\\]. Известно, что продуктами распада обоих веществ являются стабильные изотопы.\nКак для второй пробирки по сравнению с первой через время \\[10T\\] изменяются следующие физические величины: количество вещества в пробирке; количество нерадиоактивных атомов в пробирке? Для каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) количество вещества в пробирке\nБ) количество нерадиоактивных атомов в пробирке\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,10,1,'D',77,'32',NULL,22,'Вар.4 №22','5'),
	(815,815,'Школьник собирается проверить гипотезу о том, что коэффициент сухого трения не зависит от площади соприкосновения трущихся поверхностей. Для этого он кладёт на горизонтальную стальную поверхность деревянный брусок с площадью нижнего основания \\[S\\] и измеряет модуль минимальной горизонтально направленной силы, которую нужно приложить к бруску для того, чтобы сдвинуть его с места. Какой второй опыт должен провести школьник для того, чтобы проверить гипотезу?\n1) с деревянным бруском большей массы с площадью нижнего основания \\[S\\], лежащим на стальной поверхности\n2) с деревянным бруском той же массы с площадью нижнего основания \\[2S\\], лежащим на деревянной поверхности\n3) с деревянным бруском той же массы с площадью нижнего основания \\[2S\\], лежащим на стальной поверхности\n4) со стальным бруском меньшей массы с площадью нижнего основания \\[S\\], лежащим на деревянной поверхности',NULL,NULL,NULL,NULL,5,1,'D',12,'3',NULL,22,'Вар.4 №23','5'),
	(816,816,'В двух закрытых сосудах одинакового объёма (1 литр) нагревают два различных газа 1 и 2. На рисунке показаны зависимости давления \\[p\\] этих газов от времени \\[t\\]. Известно, что начальные температуры газов были одинаковы.\nВыберите два верных утверждения,\nсоответствующие результатам этих экспериментов.\n1) Количество вещества первого газа больше, чем количество вещества второго газа.\n2) Так как по условию эксперимента газы имеют одинаковые объёмы, а в момент времени \\[t = 40\\] мин они имеют и одинаковые давления, температуры этих газов в этот момент времени также одинаковы.\n3) В момент времени \\[t = 40\\] мин температура газа 1 меньше температуры газа 2.\n4) В процессе проводимого эксперимента не происходит изменения внутренней энергии газов.\n5) В процессе проводимого эксперимента оба газа совершают положительную работу.','b5_v4_24.png',NULL,NULL,NULL,10,1,'D',29,'13','рис.',22,'Вар.4 №24','5'),
