	(818,818,'В идеальной тепловой машине температура холодильника отличается от температуры нагревателя в 1,5 раза. Над рабочим телом машины совершается один цикл. Чему равно отношение полезной работы этой тепловой машины к модулю количества теплоты, отданного рабочим телом?',NULL,NULL,NULL,NULL,30,1,'D',37,'0,5',NULL,22,'Вар.4 №26','5'),
