	(826,826,'Стержень \\[OA\\], расположенный в плоскости рисунка, может вращаться вокруг неподвижной оси \\[O\\], которая расположена перпендикулярно плоскости рисунка. К концу стержня \\[A\\] приложена постоянная сила \\[F = 0,5\\] Н, перпендикулярная оси \\[O\\]. Используя рисунок, на котором указан масштаб, определите, чему равен по модулю момент силы \\[F\\] относительно оси \\[O\\].\n1) \\[3\\sqrt 2 {\\rm{Н}} \\cdot {\\rm{см}}\\]\n2) \\[\\frac{3}{{\\sqrt 2 }} {\\rm{Н}} \\cdot {\\rm{см}}\\]\n3) \\[6\\sqrt 2 {\\rm{Н}} \\cdot {\\rm{см}}\\]\n4) \\[0 {\\rm{Н}} \\cdot {\\rm{см}}\\]','b5_v5_2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',22,'Вар.5 №2','5'),
