	(829,829,'Пустой цилиндрический стеклянный стакан плавает в воде, погрузившись на половину своей высоты. Дно стакана при плавании горизонтально, плотность стекла 2500 \\[{\\rm{кг/}}{{\\rm{м}}^3}\\]. Чему равно отношение внутреннего объёма стакана к его наружному объёму? Ответ представьте в виде десятичной дроби, округлив до десятых долей.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,8',NULL,22,'Вар.5 №5','5'),
	(830,830,'Бруску, лежащему на горизонтальной шероховатой поверхности, сообщили некоторую начальную скорость, после чего он прошёл до полной остановки некоторое расстояние. Затем тот же самый брусок положили на другую горизонтальную поверхность и сообщили ему ту же самую начальную скорость. Коэффициент трения бруска о поверхность в первом случае меньше, чем во втором. Как изменятся во втором случае по сравнению с первым следующие физические величины: модуль работы силы сухого трения; расстояние, пройденное бруском до остановки?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) модуль работы силы сухого трения\nБ) расстояние, пройденное бруском до остановки\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'32',NULL,22,'Вар.5 №6','5'),
	(831,831,'Точечное тело массой 2 кг движется вдоль оси \\[OX\\]. Зависимость проекции импульса \\[{p_x}\\] этого тела от времени \\[t\\] изображена на рисунке.\nУстановите соответствие между физическими величинами и их значениями в СИ. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) проекция на ось \\[OX\\] силы, действующей на тело в момент времени \\[t = 4\\] с\nБ) проекция скорости тела на ось \\[OX\\] в момент времени \\[t = 4\\] с\nЗНАЧЕНИЕ ФИЗИЧЕСКОЙ ВЕЛИЧИНЫ (В СИ)\n1) 0 2) 0,5 3) 1 4) 2','b5_v5_7.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'13','рис.',22,'Вар.5 №7','5'),
	(832,832,'В стакане находится вода в кристаллическом состоянии при температуре 0 °С. Из-за контакта с тёплым стаканом и с комнатным воздухом вся вода переходит в жидкое состояние. В процессе перехода воды из кристаллического состояния в жидкое\n1) её объём увеличивается\n2) её плотность увеличивается\n3) её внутренняя энергия сохраняется постоянной\n4) её температура возрастает',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,22,'Вар.5 №8','5'),
	(833,833,'Идеальный газ в результате изобарного расширения перешёл из состояния 1 в состояние 2, а затем, в результате изотермического сжатия - в состояние 3. На каком из следующих рисунков правильно изображены эти переходы?\n1) 1 2) 2 3) 3 4) 4','b5_v5_9.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4','рис.',22,'Вар.5 №9','5'),
	(834,834,'Идеальный газ медленно переводят из состояния 1 в состояние 3. Процесс 1-2-3 представлен на графике зависимости давления газа \\[p\\] от его объёма \\[V\\] (см. рисунок).\nСчитая, что \\[1\\;{\\rm{атм = 1}}{{\\rm{0}}^5}{\\rm{Па}}\\], найдите, какую работу совершает газ в процессе 1-2-3.\nОтвет: кДж.','b5_v5_10.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',22,'Вар.5 №10','5'),
	(835,835,'Водяной пар находится в сосуде объёмом 10 литров при давлении 60 кПа (точка \\[A\\] на графике). Используя график зависимости давления \\[p\\] насыщенных паров воды от температуры \\[T\\], приведённый на рисунке, определите, как будут изменяться масса пара и его внутренняя энергия при изотермическом уменьшении объёма, занимаемого паром, на 10%.\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) масса пара\nБ) внутренняя энергия пара\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v5_11.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'33','рис.',22,'Вар.5 №11','5'),
	(836,836,'Установите соответствие между уравнениями процессов, в которых участвует постоянное количество идеального газа, и графиками процессов, изображёнными на диаграммах (\\[\\rho \\] - плотность, \\[V\\] - объём, \\[T\\] - абсолютная температура, \\[p\\] - давление).\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nУРАВНЕНИЕ ПРОЦЕССА\nА) \\[\\rho  = {\\rm{const}}\\]\nБ) \\[pV = {\\rm{const}}\\]\nГРАФИК ПРОЦЕССА\n1)\n2)\n3)\n4)\n','b5_v5_12_1.png','b5_v5_12_2.png',NULL,NULL,NULL,NULL,NULL,NULL,'34','рис.',22,'Вар.5 №12','5'),
	(837,837,'Четыре металлические рамки находятся в однородном магнитном поле. Направление вектора магнитной индукции \\[\\vec B\\] и начальное расположение рамок показано на рис. : плоскости рамок 1 и 4 перпендикулярны оси \\[0z\\], плоскость рамки 2 перпендикулярна оси \\[0y\\], а плоскость рамки 3 перпендикулярна оси \\[0x\\].\nВ некоторый момент времени (см. рис. )\nрамку № 1 начинают вращать вокруг оси \\[0y\\];\nрамку № 2 начинают вращать вокруг оси \\[0x\\];\nрамку № 3 начинают перемещать с постоянной скоростью \\[\\vec V\\] параллельно оси \\[0x\\];\nрамку № 4 начинают перемещать с постоянным ускорением \\[\\vec a\\] параллельно оси \\[0z\\].\nДля какой из этих рамок на рис. правильно изображена зависимость ЭДС индукции, возникающей в рамке, от времени \\[t\\]?\n1) 1 2) 2 3) 3 4) 4','b5_v5_13_1.png','b5_v5_13_2.png',NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',22,'Вар.5 №13','5'),
	(838,838,'Два длинных прямых провода расположены параллельно друг другу. В одной плоскости с ними лежит квадратный проволочный контур, две стороны которого параллельны проводам. По проводам текут одинаковые электрические токи силой \\[I\\], направленные в противоположные стороны. Электрический ток в проводе 1 начинает уменьшаться. Индукционный ток, который при этом будет протекать по квадратному контуру,\n1) направлен против часовой стрелки\n2) направлен по часовой стрелке\n3) равен нулю\n4) может быть направлен как против часовой стрелки, так и по часовой стрелке','b5_v5_14.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',22,'Вар.5 №14','5'),
	(839,839,'Какая мощность выделяется в резисторе \\[{R_1}\\], включённом в электрическую цепь, схема которой изображена на рисунке? \\[{R_1} = 3\\] Ом, \\[{R_2} = 2\\] Ом, \\[{R_3} = 1\\] Ом, ЭДС источника 5 В, внутреннее сопротивление источника пренебрежимо мало.\nОтвет: Вт.','b5_v5_15.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3','рис.',22,'Вар.5 №15','5'),
	(840,840,'Электрический ток протекает через катушку индуктивностью 6 мГн. На графике приведена зависимость силы \\[I\\] этого тока от времени \\[t\\]. Чему равна энергия магнитного поля, запасённая в катушке в момент времени \\[t = 5\\] мс?\nОтвет: мДж.','b5_v5_16.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3','рис.',22,'Вар.5 №16','5'),
	(841,841,'С помощью тонкой собирающей линзы с фокусным расстоянием 20 см получают изображение предмета, находящегося на расстоянии 30 см от линзы и расположенного перпендикулярно главной оптической оси. Как изменятся расстояние от линзы до изображения и размер изображения, если, не изменяя расположение предмета, заменить линзу на другую тонкую собирающую линзу с фокусным расстоянием 10 см?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) расстояние от линзы до изображения\nБ) размер изображения\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'22',NULL,22,'Вар.5 №17','5'),
	(842,842,'На дифракционную решётку с периодом \\[d\\] перпендикулярно к ней падает широкий пучок монохроматического света с длиной волны \\[\\lambda \\].\nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) частота падающего света\nБ) угол, под которым наблюдается главный дифракционный максимум \\[m\\]-го порядка\nФОРМУЛА\n1) \\[ \\pm \\arccos \\frac{{m\\lambda }}{d}\\]\n2) \\[c\\lambda \\]\n3) \\[ \\pm \\arcsin \\frac{{m\\lambda }}{d}\\]\n4) \\[\\frac{c}{\\lambda }\\]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'43',NULL,22,'Вар.5 №18','5'),
	(843,843,'Какие из следующих четырёх ядер: \\[_5^{11}{\\rm{B}}\\], \\[_6^{12}{\\rm{C}}\\], \\[_3^8{\\rm{Li}}\\], \\[_2^6{\\rm{He}}\\] - имеют в своём составе одинаковое число нейтронов?\n1) \\[_5^{11}{\\rm{B}}\\] и \\[_2^6{\\rm{He}}\\]\n2) \\[_5^{11}{\\rm{B}}\\] и \\[_6^{12}{\\rm{C}}\\]\n3) \\[_3^8{\\rm{Li}}\\] и \\[_2^6{\\rm{He}}\\]\n4) \\[_3^8{\\rm{Li}}\\] и \\[_6^{12}{\\rm{C}}\\]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,22,'Вар.5 №19','5'),
	(844,844,'В результате термоядерной реакции синтеза \\[_2^3{\\rm{He + }}_1^3{\\rm{T}} \\to _2^4{\\rm{He + ???}}\\] образуется ядро гелия \\[_2^4{\\rm{He}}\\], а также\n1) протон 2) нейтрон 3) протон и нейтрон 4) два протона',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,22,'Вар.5 №20','5'),
	(845,845,'Электрон в атоме водорода переходит на вторую стационарную орбиту, испуская волны, длина которых равна 656 нм. С какой стационарной орбиты переходит этот электрон?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,22,'Вар.5 №21','5'),
	(846,846,'Положительно заряженная частица движется в вакууме с постоянной скоростью. Затем эта частица попадает в однородное электрическое поле и в течение некоторого времени движется в направлении его силовых линий. Как меняются в процессе движения частицы в электрическом поле следующие физические величины: кинетическая энергия, длина волны де Бройля?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) кинетическая энергия частицы\nБ) длина волны де Бройля частицы\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'12',NULL,22,'Вар.5 №22','5'),
	(847,847,'В калориметре находится 0,5 литра воды при температуре 10°С. Необходимо экспериментально изучить зависимость конечной температуры воды от начальной температуры погружаемого в неё тела при достижении теплового равновесия. Данный эксперимент последовательно проводят с двумя телами одинаковых масс (100 г) - алюминиевым и оловянным. Удельная теплоёмкость олова 230 \\[Дж/\\left( {кг \\cdot {}^ \\circ C} \\right)\\]. Буквой \\[t\\] на графиках обозначена начальная температура погружаемого тела, а буквой \\[T\\] - конечная температура воды. Цифрой 1 отмечена зависимость \\[T\\left( t \\right)\\] для алюминия, а цифрой 2 - для олова.\nНа каком рисунке зависимости \\[T\\left( t \\right)\\] для обоих тел изображены правильно?\n1) 1 2) 2 3) 3 4) 4','b5_v5_23.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4','рис.',22,'Вар.5 №23','5'),
	(848,848,'Для повторения опыта Эрстеда учитель взял горизонтально расположенную магнитную стрелку, которая могла свободно вращаться на вертикальной игольчатой подставке, и поместил над стрелкой прямой провод. Учитель первый раз подключил концы провода к полюсам батареи, как показано на рисунке, и замкнул ключ, а второй раз изменил полярность подключения батареи (поменял местами концы провода, подключённые к «плюсу» и к «минусу»).\nВыберите два верных утверждения, соответствующие результатам этих\nэкспериментов.\n1) После подключения концов провода к полюсам батареи магнитная стрелка каждый раз устанавливалась параллельно проводу.\n2) После подключения концов провода к полюсам батареи магнитная стрелка каждый раз устанавливалась перпендикулярно проводу.\n3) При обоих вариантах подключения концов провода к полюсам батареи магнитная стрелка оставалась в покое.\n4) После изменения полярности подключения концов провода к полюсам батареи магнитная стрелка повернулась на 90°.\n5) После изменения полярности подключения концов провода к полюсам батареи магнитная стрелка повернулась на 180°.','b5_v5_24.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'25','рис.',22,'Вар.5 №24','5'),
	(849,849,'Невесомая пружина жёсткостью 100 Н/м прикреплена одним концом к оси вращения гладкого горизонтального диска радиусом 30 см. К другому концу этой пружины прикреплено небольшое тело массой 0,1 кг, лежащее на диске. Длина пружины в недеформированном состоянии равна 16 см. На каком расстоянии от оси вращения будет находиться тело, если медленно раскрутить диск до частоты обращения \\[\\nu  = 3\\] Гц? Ответ округлите до целого числа сантиметров.\nОтвет: см.','b5_v5_25.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'25','рис.',22,'Вар.5 №25','5'),
	(850,850,'В плоский конденсатор, расстояние между обкладками которого равно 2 см, вставили плоскопараллельную металлическую пластину толщиной 1,6 см. Плоскости пластины параллельны обкладкам конденсатора, расстояние между обкладками намного меньше их поперечных размеров, пластина не касается обкладок. Во сколько раз в результате этого увеличилась электроёмкость конденсатора?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,22,'Вар.5 №26','5'),
	(851,851,'Три одинаковых резистора сопротивлением 30 Ом каждый подключают к источнику постоянного напряжения: первый раз последовательно, второй - параллельно. При этом показания идеального амперметра (см. рисунок) отличаются в 3 раза.\nЧему равно внутреннее сопротивление источника напряжения?\nОтвет: Ом.','b5_v5_27.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'30','рис.',22,'Вар.5 №27','5'),
	(852,852,'В сосуде, закрытом поршнем, находится при комнатной температуре воздух, относительная влажность которого равна 50 %, а масса пара равна \\[m\\]. Поршень медленно вдвигают в сосуд, уменьшая его объём в 8 раз, при постоянной температуре. Нарисуйте график зависимости массы воды, сконденсировавшейся в этом процессе, от объёма сосуда.',NULL,NULL,'b5_v5_28_answer.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'Вар.5 №28','5'),
	(853,853,'Маятник состоит из маленького груза массой \\[M = 200\\] г, висящего на лёгкой нерастяжимой нити длиной \\[L = 100\\] см. Он висит в состоянии покоя в вертикальном положении. В груз ударяется и прилипает к нему небольшое тело массой \\[m = 100\\] г, летевшее в горизонтальном направлении. В результате возникает вращение маятника в вертикальной плоскости вокруг его точки подвеса, причём груз маятника всё время движется по окружности, делая полный оборот. Какова могла быть скорость тела до удара?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'Вар.5 №29','5'),
	(854,854,'В цилиндре под поршнем находится некоторое количество идеального одноатомного газа, среднеквадратичная скорость молекул которого равна \\[u = 440\\] м/с. В результате некоторого процесса объём газа уменьшился на \\[\\alpha  = 20\\% \\], а давление выросло на \\[\\beta  = 80\\% \\]. Каким стало новое значение \\[\\nu \\] среднеквадратичной скорости молекул этого газа?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'Вар.5 №30','5'),
	(855,855,'Известно, что «лошадиная сила» (л. с.) равна мощности 75 \\[{\\rm{кгс}} \\cdot {\\rm{м/с}} \\approx {\\rm{735}}\\] Вт, а средний человек при длительной работе развивает мощность около 0,16 л.с. и кратковременно может превышать это ограничение. Человек, стараясь после отключения электричества в сети осветить своё жилище, использует электрогенератор с механическим приводом с КПД \\[\\eta  = 60\\% \\]. Он вращает ротор генератора через редуктор за ручку, находящуюся на расстоянии \\[R = 0,5\\] м от оси, со скоростью \\[n = 20\\] об./мин, прикладывая к ручке силу \\[F = 100\\] Н. Сможет ли он долго поддерживать горение лампочки мощностью \\[P = 60\\] Вт и не перегорит ли она от перенапряжения (лампочка рассчитана на номинальное напряжение 220 В, но не более 235 В, а напряжение генератора прямо пропорционально скорости вращения ротора)?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'Вар.5 №31','5'),
	(856,856,'Для исследования рентгеновских лучей с длинами волн меньше 10 нм изготовить обычную дифракционную решётку с подходящим периодом не представляется возможным, однако есть способ обойти эту трудность. Возьмём обычную решётку с периодом \\[d = 20\\] мкм и осветим её параллельным пучком рентгеновского излучения с длиной волны \\[\\lambda  = 3\\] нм с углом падения на решётку \\[\\alpha  = 89,{5^ \\circ }\\] (скользящее падение лучей). Под каким углом \\[\\gamma \\] к первоначальному пучку будет фиксироваться дифракционный максимум первого порядка? Считайте этот угол малым: \\[\\gamma  \\ll 1\\]. Ответ выразите в градусах и округлите до целого числа.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,'Вар.5 №32','5'),
	(857,857,'Точечное тело движется вдоль оси \\[0X\\]. В начальный момент времени тело находилось в точке с координатой \\[x =  5\\] м. На рисунке изображена зависимость проекции скорости \\[{V_x}\\] этого тела от времени \\[t\\]. В момент времени \\[t = 4\\] с координата этого тела равна\n1) 0 м 2) 5 м 3) -1 м 4) 37 м.','b5_v6_1.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №1','5'),
	(858,858,'Стержень \\[OA\\], расположенный в плоскости рисунка, может вращаться вокруг неподвижной оси \\[O\\], которая расположена перпендикулярно плоскости рисунка. К концу стержня \\[A\\] приложена постоянная сила \\[F = 2\\] Н, перпендикулярная оси \\[O\\]. Используя рисунок, на котором указан масштаб, определите, чему равен по модулю момент силы \\[F\\] относительно оси \\[O\\].\n1) \\[6\\sqrt 2 {\\rm{Н}} \\cdot {\\rm{см}}\\] 2) \\[\\frac{6}{{\\sqrt 2 }} {\\rm{Н}} \\cdot {\\rm{см}}\\] 3) \\[6 {\\rm{Н}} \\cdot {\\rm{см}}\\] 4) \\[0 {\\rm{Н}} \\cdot {\\rm{см}}\\]','b5_v6_2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',NULL,'Вар.6 №2','5'),
	(859,859,'Чему равен модуль силы тяжести, действующей на тело массой 50 кг, на высоте, в полтора раза большей радиуса Земли?\nОтвет: Н.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'80',NULL,NULL,'Вар.6 №3','5'),
	(860,860,'Мальчик бросил камень массой 100 г под углом к горизонту из точки \\[A\\]. На рисунке в некотором масштабе изображена траектория \\[ABC\\] полёта камня. Сопротивление воздуха пренебрежимо мало. В точке \\[B\\] траектории модуль скорости камня был равен 8 м/с. Какую кинетическую энергию имел камень в точке \\[C\\]?\nОтвет: Дж.','b5_v6_4.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'9,2','рис.',NULL,'Вар.6 №4','5'),
	(861,861,'Пустой цилиндрический стеклянный стакан плавает в воде, погрузившись на \\[\\frac{3}{4}\\] своей высоты. Дно стакана при плавании горизонтально, плотность стекла 2500 \\[{\\rm{кг/}}{{\\rm{м}}^3}\\]. Чему равно отношение внутреннего объёма стакана к его наружному объёму? Ответ представьте в виде десятичной дроби, округлив до десятых долей.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,7',NULL,NULL,'Вар.6 №5','5'),
	(862,862,'Бруску, лежащему на горизонтальной шероховатой поверхности, сообщили некоторую начальную скорость, после чего он прошёл до полной остановки некоторое расстояние. Затем тот же самый брусок положили на другую горизонтальную поверхность и сообщили ему ту же самую начальную скорость. Коэффициент трения бруска о поверхность в первом случае больше, чем во втором. Как изменятся во втором случае по сравнению с первым следующие физические величины: модуль работы силы сухого трения; расстояние, пройденное бруском до остановки?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) модуль работы силы сухого трения\nБ) расстояние, пройденное бруском до остановки\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'31',NULL,NULL,'Вар.6 №6','5'),
	(863,863,'Точечное тело массой 2 кг движется вдоль оси \\[OX\\]. Зависимость проекции импульса \\[{p_x}\\] этого тела от времени \\[t\\] изображена на рисунке.\nУстановите соответствие между физическими величинами и их значениями в СИ. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) проекция на ось \\[OX\\] силы, действующей на тело в момент времени \\[t = 4\\] с\nБ) проекция скорости тела на ось \\[OX\\] в момент времени \\[t = 4\\] с\nЗНАЧЕНИЕ ФИЗИЧЕСКОЙ ВЕЛИЧИНЫ (В СИ)\n1) 0 2) -0,5 3) 2 4) 4','b5_v6_7.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'21','рис.',NULL,'Вар.6 №7','5'),
	(864,864,'В стакане находится вода в кристаллическом состоянии при температуре 0 °С. Из-за контакта с тёплым стаканом и с комнатным воздухом вся вода переходит в жидкое состояние. В процессе перехода воды из кристаллического состояния в жидкое\n1) её объём уменьшается\n2) её плотность уменьшается\n3) её внутренняя энергия уменьшается\n4) её температура уменьшается',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'Вар.6 №8','5'),
	(865,865,'Идеальный газ в результате изобарного сжатия перешёл из состояния 1 в состояние 2, а затем, в результате изотермического расширения - в состояние 3. На каком из следующих рисунков правильно изображены эти переходы?\n1) 1 2) 2 3) 3 4) 4','b5_v6_9.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №9','5'),
	(866,866,'Идеальный газ медленно переводят из состояния 1 в состояние 3. Процесс 1-2-3 представлен на графике зависимости давления газа \\[p\\] от его объёма \\[V\\] (см. рисунок).\nСчитая, что \\[1\\;{\\rm{атм = 1}}{{\\rm{0}}^5}{\\rm{Па}}\\], найдите, какую работу совершает газ в процессе 1-2-3.\nОтвет: кДж.','b5_v6_10.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',NULL,'Вар.6 №10','5'),
	(867,867,'Водяной пар находится в сосуде объёмом 10 литров при давлении 20 кПа (точка \\[A\\] на графике). Используя график зависимости давления \\[p\\] насыщенных паров воды от температуры \\[T\\], показанный на рисунке, определите, как будут изменяться масса пара и его внутренняя энергия при изобарном уменьшении объёма, занимаемого паром, на 5%.\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) масса пара\nБ) внутренняя энергия пара\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится','b5_v6_11.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'32','рис.',NULL,'Вар.6 №11','5'),
	(868,868,'Установите соответствие между уравнениями процессов, в которых участвует постоянное количество идеального газа, и графиками процессов, изображёнными на диаграммах (\\[p\\] - давление, \\[V\\] - объём, \\[T\\] - абсолютная температура, \\[\\rho \\] - плотность).\nК каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nУРАВНЕНИЕ ПРОЦЕССА\nА) \\[\\frac{T}{p} = {\\rm{const}}\\]\nБ) \\[\\frac{p}{\\rho } = {\\rm{const}}\\]\nГРАФИК ПРОЦЕССА\n1)\n2)\n3)\n4)','b5_v6_12_1.png','b5_v6_12_2.png',NULL,NULL,NULL,NULL,NULL,NULL,'34','рис.',NULL,'Вар.6 №12','5'),
	(869,869,'Четыре металлические рамки находятся в однородном магнитном поле. Направление вектора магнитной индукции \\[\\vec B\\] и начальное расположение рамок показано на рис. : плоскости рамок 1 и 4 перпендикулярны оси \\[0z\\], плоскость рамки 2 перпендикулярна оси \\[0y\\], а плоскость рамки 3 перпендикулярна оси \\[0x\\].\nВ некоторый момент времени (см. рис. )\nрамку № 1 начинают вращать вокруг оси \\[0y\\];\nрамку № 2 начинают вращать вокруг оси \\[0x\\];\nрамку № 3 начинают перемещать с постоянной скоростью \\[\\vec V\\] параллельно оси \\[0x\\];\nрамку № 4 начинают перемещать с постоянным ускорением \\[\\vec a\\] параллельно оси \\[0z\\].\nДля какой из этих рамок на рис. правильно изображена зависимость ЭДС индукции, возникающей в рамке, от времени \\[t\\]?\n1) 1 2) 2 3) 3 4) 4','b5_v6_13_1.png','b5_v6_13_2.png',NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №13','5'),
	(870,870,'Два длинных прямых провода расположены параллельно друг другу. В одной плоскости с ними лежит квадратный проволочный контур, две стороны которого параллельны проводам. По проводам текут одинаковые электрические токи силой \\[I\\], направленные в противоположные стороны. Электрический ток в проводе 1 начинает уменьшаться. Индукционный ток, который при этом будет протекать по квадратному контуру,\n1) направлен против часовой стрелки\n2) направлен по часовой стрелке\n3) равен нулю\n4) может быть направлен как против часовой стрелки, так и по часовой стрелке','b5_v6_14.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №14','5'),
	(871,871,'Какая мощность выделяется в резисторе \\[{R_2}\\], включённом в электрическую цепь, схема которой изображена на рисунке? \\[{R_1} = 3\\] Ом, \\[{R_2} = 2\\] Ом, \\[{R_3} = 1\\] Ом, ЭДС источника 5 В, внутреннее сопротивление источника пренебрежимо мало.\nОтвет: Вт.','b5_v6_15.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №15','5'),
	(872,872,'Электрический ток протекает через катушку индуктивностью 6 мГн. На графике приведена зависимость силы \\[I\\] этого тока от времени \\[t\\]. Чему равна энергия магнитного поля, запасённая в катушке в момент времени \\[t = 15\\] мс?\nОтвет: мДж.','b5_v6_16.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3','рис.',NULL,'Вар.6 №16','5'),
	(873,873,'С помощью тонкой собирающей линзы с фокусным расстоянием 20 см получают изображение предмета, находящегося на расстоянии 30 см от линзы и расположенного перпендикулярно главной оптической оси. Как изменятся расстояние от линзы до изображения и размер изображения, если, не изменяя расположение предмета, заменить линзу на другую тонкую собирающую линзу с фокусным расстоянием 25 см?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) расстояние от линзы до изображения\nБ) размер изображения\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'11',NULL,NULL,'Вар.6 №17','5'),
	(874,874,'На дифракционную решётку с периодом \\[d\\] перпендикулярно к ней падает широкий пучок монохроматического света с частотой \\[\\nu \\].\nУстановите соответствие между физическими величинами и формулами, по которым их можно рассчитать. К каждой позиции первого столбца подберите соответствующую позицию из второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) длина волны падающего света\nБ) угол, под которым наблюдается главный дифракционный максимум \\[m\\]-го порядка\nФОРМУЛА\n1) \\[ \\pm \\arccos \\frac{{m\\lambda }}{d}\\]\n2) \\[\\frac{c}{\\lambda }\\]\n3) \\[ \\pm \\arcsin \\frac{{m\\lambda }}{d}\\]\n4) \\[c\\lambda \\]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'23',NULL,NULL,'Вар.6 №18','5'),
	(875,875,'У каких из следующих четырёх ядер: \\[_5^{11}{\\rm{B}}\\], \\[_6^{12}{\\rm{C}}\\], \\[_3^8{\\rm{Li}}\\], \\[_2^6{\\rm{He}}\\] - разность числа нейтронов и протонов одинакова?\n1) \\[_5^{11}{\\rm{B}}\\] и \\[_2^6{\\rm{He}}\\]\n2) \\[_5^{11}{\\rm{B}}\\] и \\[_6^{12}{\\rm{C}}\\]\n3) \\[_3^8{\\rm{Li}}\\] и \\[_2^6{\\rm{He}}\\]\n4) \\[_3^8{\\rm{Li}}\\] и \\[_6^{12}{\\rm{C}}\\]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,'Вар.6 №19','5'),
	(876,876,'В результате термоядерной реакции синтеза \\[_1^3{\\rm{T + }}_1^3{\\rm{T}} \\to _2^4{\\rm{He + ???}}\\] образуется ядро гелия \\[_2^4{\\rm{He}}\\], а также\n1) протон 2) нейтрон 3) протон и нейтрон 4) два нейтрона',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,'Вар.6 №20','5'),
	(877,877,'Электрон в атоме водорода переходит на вторую стационарную орбиту, испуская волны, длина которых равна 486 нм. С какой стационарной орбиты переходит этот электрон?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,'Вар.6 №21','5'),
	(878,878,'Отрицательно заряженная частица движется в вакууме с постоянной скоростью. Затем эта частица попадает в однородное электрическое поле и в течение некоторого времени движется в направлении его силовых линий. Как меняются в процессе движения частицы в электрическом поле следующие физические величины: кинетическая энергия, длина волны де Бройля?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится;\n2) уменьшится;\n3) не изменится.\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.\nФИЗИЧЕСКАЯ ВЕЛИЧИНА\nА) кинетическая энергия частицы\nБ) длина волны де Бройля частицы\nЕЁ ИЗМЕНЕНИЕ\n1) увеличится\n2) уменьшится\n3) не изменится',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'21',NULL,NULL,'Вар.6 №22','5'),
	(879,879,'В калориметре находится 0,5 литра воды при температуре 10°С. Необходимо экспериментально изучить зависимость конечной температуры воды от начальной температуры погружаемого в неё тела при достижении теплового равновесия. Данный эксперимент последовательно проводят с двумя телами одинаковых масс (100 г) - свинцовым и оловянным. Удельная теплоёмкость олова 230 \\[Дж/\\left( {кг \\cdot {}^ \\circ C} \\right)\\]. Буквой \\[t\\] на графиках обозначена начальная температура погружаемого тела, а буквой \\[T\\] - конечная температура воды. Цифрой 1 отмечена зависимость \\[T\\left( t \\right)\\] для свинца, а цифрой 2 - для олова.\nНа каком рисунке зависимости \\[T\\left( t \\right)\\] для обоих тел изображены правильно?\n1) 1 2) 2 3) 3 4) 4','b5_v6_23.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','рис.',NULL,'Вар.6 №23','5'),
	(880,880,'Для повторения опыта Эрстеда учитель взял горизонтально расположенную магнитную стрелку, которая могла свободно вращаться на вертикальной игольчатой подставке, и прямой провод, подключённый к полюсам батареи.\nУчитель сначала расположил провод над магнитной стрелкой, как показано на рисунке, а через некоторое время переместил провод и расположил его под магнитной стрелкой.\nВыберите два верных утверждения, соответствующие результатам этих экспериментов.\n1) При расположении провода над магнитной стрелкой стрелка установилась параллельно проводу.\n2) При расположении провода над магнитной стрелкой стрелка установилась перпендикулярно проводу.\n3) При обоих вариантах расположения провода магнитная стрелка не меняла своего первоначального расположения.\n4) При изменении расположения провода стрелка повернулась на 90°.\n5) При изменении расположения провода стрелка повернулась на 180°.','b5_v6_24.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'25','рис.',NULL,'Вар.6 №24','5'),
	(881,881,'Невесомая пружина жёсткостью 100 Н/м прикреплена одним концом к оси вращения гладкого горизонтального диска радиусом 20 см. К другому концу этой пружины прикреплено небольшое тело массой 0,1 кг, лежащее на диске. При медленном раскручивании диска до частоты обращения \\[\\nu  = 3\\] Гц тело оказалось на расстоянии 14 см от оси вращения. Чему равна длина пружины в недеформированном состоянии? Ответ округлите до целого числа сантиметров.\nОтвет: см.','b5_v6_25.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'9,0','рис.',NULL,'Вар.6 №25','5'),
	(882,882,'В плоский конденсатор, расстояние между обкладками которого равно 3 см, вставили плоскопараллельную металлическую пластину толщиной 2,5 см. Плоскости пластины параллельны обкладкам конденсатора, расстояние между обкладками намного меньше их поперечных размеров, пластина не касается обкладок. Во сколько раз в результате этого увеличилась электроёмкость конденсатора?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,'Вар.6 №26','5'),
	(883,883,'Три одинаковых резистора сопротивлением 30 Ом каждый подключают к источнику постоянного напряжения: первый раз последовательно, второй - параллельно. При этом показания идеального амперметра (см. рисунок) отличаются в 6 раз.\nЧему равно внутреннее сопротивление источника напряжения?\nОтвет: Ом.','b5_v6_27.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6','рис.',NULL,'Вар.6 №27','5'),
	(884,884,'В сосуде, закрытом поршнем, находится при комнатной температуре воздух, относительная влажность которого равна 50 %, а масса пара равна \\[m\\]. Поршень медленно вдвигают в сосуд, уменьшая его объём в 8 раз, при постоянной температуре. Нарисуйте график зависимости массы пара в сосуде в этом процессе от объёма сосуда.',NULL,NULL,'b5_v6_28_answer.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Вар.6 №28','5'),
	(885,885,'Маятник состоит из маленького груза массой \\[M = 100\\] г, висящего на лёгкой нерастяжимой нити длиной \\[L = 50\\] см. Он висит в состоянии покоя в вертикальном положении. В груз ударяется и прилипает к нему небольшое тело массой \\[m = 20\\] г, летевшее в горизонтальном направлении. В результате возникает вращение маятника в вертикальной плоскости вокруг его точки подвеса, причём груз маятника всё время движется по окружности, делая полный оборот. Какова могла быть скорость тела до удара?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Вар.6 №29','5'),
	(886,886,'В цилиндре под поршнем находится некоторое количество идеального одноатомного газа, среднеквадратичная скорость молекул которого равна \\[u = 400\\] м/с. В результате некоторого процесса объём газа увеличилось на \\[\\alpha  = 80\\% \\], а давление уменьшилось на \\[\\beta  = 20\\% \\]. Каким стало новое значение \\[\\nu \\] среднеквадратичной скорости молекул этого газа?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Вар.6 №30','5'),
	(887,887,'Известно, что «лошадиная сила» (л. с.) равна мощности 75 \\[{\\rm{кгс}} \\cdot {\\rm{м/с}} \\approx {\\rm{735}}\\] Вт, а средний человек при длительной работе развивает мощность около 0,16 л.с. и кратковременно может превышать это ограничение. Человек, стараясь после отключения электричества в сети осветить своё жилище, использует электрогенератор с механическим приводом с КПД \\[\\eta  = 65\\% \\]. Он вращает ротор генератора через редуктор за ручку, находящуюся на расстоянии \\[R = 0,35\\] м от оси, со скоростью \\[n = 30\\] об./мин, прикладывая к ручке силу \\[F = 90\\] Н. Сможет ли он долго поддерживать горение лампочки мощностью \\[P = 60\\] Вт и не перегорит ли она от перенапряжения (лампочка рассчитана на номинальное напряжение 220 В, но не более 235 В, а напряжение генератора прямо пропорционально скорости вращения ротора)?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Вар.6 №31','5'),
