	(1009,1009,'Светящаяся точка равномерно движется по прямой, образующей угол 30° с плоскостью зеркала, со скоростью 0,2 м/с. С какой скоростью изменяется расстояние между светящейся точкой и её изображением?\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,2',NULL,NULL,'№1407',NULL),
	(1010,1010,'Плоское зеркало движется со скоростью \\[v = 1,5\\] см/с. С какой по модулю и направлению скоростью должен двигаться точечный источник света \\[S\\], чтобы его отражение в плоском зеркале было неподвижным?\nОтвет: см/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1,5',NULL,NULL,'№1408',NULL),
	(1011,1011,'Предмет высотой 20 см расположен перпендикулярно главной оптической оси тонкой собирающей линзы с фокусным расстоянием \\[F = 40\\] см на расстоянии \\[L = 30\\] см от центра линзы. Определите размер изображения этого предмета, создаваемого линзой.\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'80',NULL,NULL,'№1409',NULL),
	(1012,1012,'На каком расстоянии друг от друга следует расположить линзы – рассеивающую с фокусным расстоянием -4 см и собирающую с фокусным расстоянием 9 см, чтобы пучок лучей, параллельных главной оптической оси линзы, пройдя через обе линзы, оставался бы параллельным?\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,'№1410',NULL),
