	(1014,1014,'Точка лежит на главной оптической оси рассеивающей линзы с фокусным расстоянием \\[F = 50\\] см. Расстояние от линзы до изображения этой точки \\[f = 30\\] см. На какое расстояние переместится изображение точки, если линзу передвинуть на расстояние \\[l = 3\\] см в направлении, перпендикулярном главной оптической оси?\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1,8',NULL,NULL,'№1412',NULL),
	(1015,1015,'Предмет высотой 5 см расположен перпендикулярно главной оптической оси тонкой собирающей линзы с фокусным расстоянием \\[F = 20\\] см на расстоянии \\[L = 22\\] см от центра линзы. Определите высоту изображения этого предмета, создаваемого линзой.\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'50',NULL,NULL,'№1413',NULL),
