	(1022,1022,'На каком расстоянии от рассеивающей линзы с фокусным расстоянием 12 см окажется предмет, если его мнимое изображение оказалось слева от линзы на расстоянии 9 см?\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'36',NULL,NULL,'№1420',NULL),
	(1023,1023,'Параллельный световой пучок падает нормально на тонкую собирающую линзу диаметром 8 см и оптической силой 4 дптр (см. рис.). Экран расположен на расстоянии 10 см за линзой. Рассчитайте (в см) диаметр светлого пятна, созданного линзой на экране.\nОтвет: см.','b6_1421.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4,8','рис.',NULL,'№1421',NULL),
