	(1028,1028,'Дифракционную решётку с периодом 1,2 мкм освещают лучом света с длиной волны 600 нм, направленным по нормали к решётке. На какой угол отклонятся лучи, соответствующие первому максимуму?\nОтвет: °.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'30',NULL,NULL,'№1426',NULL),
	(1029,1029,'Дифракционная картина поочерёдно наблюдается с помощью двух дифракционных решёток. Если поставить решётку с периодом 10 мкм, то на некотором расстоянии от центрального максимума наблюдается жёлтая линия первого порядка с длиной волны 600 нм. Если использовать вторую решётку, то в этом же месте наблюдается линия третьего порядка с длиной волны 440 нм. Определите период второй решётки.\nОтвет: мкм.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'22',NULL,NULL,'№1427',NULL),
	(1030,1030,'Для определения периода дифракционной решётки на неё направили световой пучок через красный светофильтр, пропускающий лучи с длиной волны 600 нм. Каков период решётки, если на экране, отстоящем от решётки на 1 м, расстояние между спектрами первого порядка равно 12 см?\nОтвет:  мкм.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'10',NULL,NULL,'№1428',NULL),
