	(1033,1033,'На дифракционную решётку с периодом \\[d = 2\\] мкм нормально падает плоская волна с \\[\\lambda  = 650\\] нм. Сколько максимумов в спектре?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'7',NULL,NULL,'№1431',NULL),
