	(1035,1035,'Дифракционная решётка, имеющая 250 штрихов на 1 мм, расположена на расстоянии 1 м от экрана параллельно ему. Какой должна быть минимальная ширина экрана, чтобы можно было наблюдать дифракционные максимумы третьего порядка? Длина волны падающего света равна 500 нм. Принять \\[\\sin \\varphi  \\approx \\operatorname{tg} \\varphi \\].\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'75',NULL,NULL,'№1433',NULL),
	(1036,1036,'Каков наибольший порядок спектра, наблюдаемый для света с  \\[{\\lambda _2} = 0,550\\] мкм, падающего нормально на дифракционную решётку, если при нормальном падении света с \\[{\\lambda _1} = 0,630\\] мкм максимум второго порядка наблюдается под углом 30° к нормали?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,'№1434',NULL),
