	(1039,1039,'Установите соответствие между физическими свойствами света и примерами их проявления. К каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1437.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'12','рис.',NULL,'№1437',NULL),
	(1040,1040,'Луч света переходит из света в воду. Частота световой волны – \\[\\nu \\], скорость света в воздухе – \\[c\\], показатель преломления воды относительно воздуха – \\[n\\]. Установите соответствие между физическими величинами и формулами, по которым их можно рассчитать.\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1438.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'243','рис.',NULL,'№1438',NULL),
	(1041,1041,'Установите соответствие между физическими явлениями и примерами их наблюдения. К каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1439.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'24','рис.',NULL,'№1439',NULL),
	(1042,1042,'Установите соответствие между физическими явлениями волновой оптики и формулами, которыми эти явления можно описать.\nК каждой позиции первого столбца подберите соответствующую позицию второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1440.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'32','рис.',NULL,'№1440',NULL),
	(1043,1043,'Ученик изучает спектр ртутной лампы, полученный с помощью дифракционной решётки (см. рис.). Максимумы в наблюдаемой картине обозначены цифрами 1-4. Установите соответствие между длиной волны максимума и его положением в спектре.\nК каждой позиции первого столбца подберите соответствующую позицию второго столбца и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1441_1.png','b6_1441_2.png',NULL,NULL,NULL,NULL,NULL,NULL,'23','рис.',NULL,'№1441',NULL),
