	(1045,1045,'Луч света падает на поверхность воды под углом. Угол падения луча постепенно увеличивают. Как изменяются при этом угол между отражённым лучом и поверхностью воды, угол преломления и показатель преломления воды?\nДля каждой величины подберите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1443.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'213','рис.',NULL,'№1443',NULL),
	(1046,1046,'Предмет находился на двойном фокусном расстоянии от собирающей линзы. Его начали приближать к линзе. Как в начале этого движения меняются размеры изображения предмета, расстояние изображения от линзы, фокусное расстояние линзы? Установите соответствие между физическими явлениями и приборами, в которых используются эти явления.\nДля каждой величины определите соответствующий характер изменения: \n1) увеличивается\n2) уменьшается\n3) не изменяется\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1444.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'113','рис.',NULL,'№1444',NULL),
	(1047,1047,'На главной оптической оси собирающей линзы между двойным фокусом и фокусом линзы находится светящаяся стрелка, параллельная линзе. Стрелку передвигают ближе к фокусу линзы. Как при этом изменяются размер изображения и расстояние от изображения до линзы?\nДля каждой величины подберите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1445.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'11','рис.',NULL,'№1445',NULL),
	(1048,1048,'На главной оптической оси собирающей линзы дальше двойного фокуса линзы находится светящаяся стрелка, параллельная линзе. Стрелку придвигают ближе к двойному фокусу. Как при этом изменяются размер изображения и расстояние от изображения до линзы?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1446.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'11','рис.',NULL,'№1446',NULL),
	(1049,1049,'Частота света, падающего на дифракционную решётку, увеличивается. Как при этом меняются угол дифракции, определяющий направление на максимум первого порядка, энергия падающих на решётку фотонов, длина волны света?\nДля каждой величины определите соответствующий характер изменения:\n1) увеличилась\n2) уменьшилась\n3) не изменилась\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1447.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'212','рис.',NULL,'№1447',NULL),
	(1050,1050,'При проведении опыта по дифракции света на дифракционной решётке жёлтый луч света заменили на фиолетовый. Как при этом изменятся расстояния между первыми максимумами, угол отклонения лучей и период дифракционной решётки?\nК каждой позиции первого столбца подберите соответствующую позицию второго и запишите в таблицу выбранные цифры под соответствующими буквами.','b6_1448.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'223','рис.',NULL,'№1448',NULL),
	(1051,1051,'С помощью дифракционной решётки наблюдают дифракционную картину монохроматического источника. Если увеличить длину волны света, то как при этом изменятся период дифракционной решётки, расстояние от центра картины до самого интенсивного максимума, угол дифракции первого порядка?\nДля каждой величины подберите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1449.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'331','рис.',NULL,'№1449',NULL),
	(1052,1052,'После прохождения монохроматического света через дифракционную решётку на экране наблюдается картина дифракционного спектра. Как изменятся ширина спектра, угол между двумя спектрами первого порядка и положение нулевого максимума, если увеличить период решётки?\nДля каждой величины подберите соответствующий характер изменения:\n1) увеличится\n2) уменьшится\n3) не изменится\nЗапишите в таблицу выбранные цифры для каждой физической величины. Цифры в ответе могут повторяться.','b6_1450.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'223','рис.',NULL,'№1450',NULL),
	(1053,1053,'1449. Ученик, изучая преломление света, пускает лазерный луч на границы раздела «воздух — глицерин», «воздух — стекло», «воздух — алмаз» (см. рис.). (\\[\\sin {28^ \\circ } = 0,47\\]; \\[\\sin {22^ \\circ } = 0,47\\]; \\[\\sin {17^ \\circ } = 0,29\\]).\nВыберите из предложенного перечня два утверждения, соответствующих результатам опыта, и запишите в таблицу цифры, под которыми они указаны.\n1) Угол преломления не зависит от свойств преломляющей среды.\n2) Показатель преломления алмаза наибольший.\n3) Показатель преломления стекла наименьший.\n4) Показатель преломления глицерина равен 1,5.\n5) Угол преломления не зависит от угла падения.','b6_1451.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'24','рис.',NULL,'№1451',NULL),
	(1054,1054,'Ученик проводил опыты с собирающими линзами, изготовленными из одинакового сорта стекла. Условия проведения опытов показаны на рисунке. \\[AB\\] – предмет, \\[A\'B\'\\] — его изображение.\nВыберите из предложенного перечня два утверждения, соответствующих результатам проведённых экспериментальных наблюдений, и запищите в таблицу цифры, под которыми они указаны.\n1) Наибольшее фокусное расстояние имеет линза 2.\n2) Наименьшее фокусное расстояние имеет линза 3.\n3) По отношению к линзе 3 предмет располагается в двойном фокусе.\n4) Собирающие линзы дают только действительные изображения.\n5) Собирающие линзы дают только увеличенные изображения.','b6_1452.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'23','рис.',NULL,'№1452',NULL),
	(1055,1055,'На рисунке схематически показан ход луча света через линзу. С помощью рисунка выберите из предложенного перечня два верных утверждения. Укажите их номера.\n1) Фокусное расстояние линзы равно 10 см.\n1) Оптическая сила линзы равна —20 дптр.\n2) Оптическая сила линзы равна +10 дптр.\n3) Фокусное расстояние линзы равно 5 см.\n4) Оптическая сила линзы равна +20 дптр.','b6_1453.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'45','рис.',NULL,'№1453',NULL),
	(1056,1056,'Протон влетает со скоростью 60 км/с в пространство с электрическим и магнитным полями. Траектория протона совпадает по направлению, перпендикулярному этим линиям. Индукция магнитного поля равна 0,1 Тл. Начальное ускорение протона при достижении этих полей равно \\[{10^{12}}{\\text{м/}}{{\\text{с}}^2}\\]. Найти напряженность электрического поля.\nОтвет: кВ/м',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[E = 9\\] кВ/м',NULL,NULL,'№1',NULL),
	(1057,1057,'Маленький шарик падает свободно на наклонную плоскость и упруго отражается от нее. Наклонная плоскость составляет угол 30º с горизонтом. Скорость шарика в момент улара о плоскость 1 м/с. На какое расстояние переместится шарик по горизонтали к моменту его удара о плоскость?\nОтвет: м.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,17 м',NULL,NULL,'№2',NULL),
	(1058,1058,'С высоты \\[H = 20\\] м свободно падает стальной шарик. Через \\[t = 1\\] с после начала падения он сталкивается с неподвижной плитой, плоскость которой наклонена под углом 30° к горизонту. На какую высоту \\[h\\] над поверхностью Земли поднимется шарик после удара? Удар шарика о плиту считать абсолютно упругим. Сопротивление воздуха мало.\nОтвет: м.','list_2017_3.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'16,25 м','рис.',NULL,'№3',NULL),
	(1059,1059,'Газ в количестве 0,15 моля находился при комнатной температуре в вертикальном цилиндре под поршнем массой 3,3 кг и площадью 30 см2.Поршень способен свободно перемещаться. Трение между поршнем и стенками сосуда отсутствует. Внешнее атмосферное давление нормальное. В результате медленного нагревания поршень переместился вверх на 3 см. на какую величину изменилась температура газа?\nОтвет: К.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'8 К',NULL,NULL,'№4',NULL),
	(1060,1060,'Состояние неизменной массы одноатомного идеального газа изменяется по циклу, показанному на рисунке. За цикл газ совершает работу \\[A = 5\\] кДж. Какое количество теплоты газ получает за цикл от нагревателя?\nОтвет: кДж.','list_2017_5.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'57,5 кДж','рис.',NULL,'№5',NULL),
	(1061,1061,'На p – V диаграмме изображен замкнутый цикл, проведенный с одноатомным идеальным газом. Определить КПД этого цикла.\nОтвет: %.','list_2017_6.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'10%','рис.',NULL,'№6',NULL),
	(1062,1062,'С одним молем идеального одноатомного газа совершают циклический процесс 1-2-3-4-1 (см. рис.). Во сколько раз КПД данного цикла меньше, чем КПД идеальной тепловой машины, работающей при тех же максимальной и минимальной температурах?\nОтвет: раз(а)','list_2017_7.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'в 12 раз','рис.',NULL,'№7',NULL),
	(1063,1063,'Один моль идеального одноатомного газа переводят из состояния 1 с температурой \\[{T_1} = 300\\] К в состояние 2 таким образом, что в течение всего процесса давление газа возрастает пропорционально его объему. В ходе всего процесса газ получает количество теплоты \\[Q = 14958\\] Дж. Во сколько раз уменьшается в результате этого процесса плотность газа?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Уменьшится в 2 раза',NULL,NULL,'№8',NULL),
	(1064,1064,'В сосуде содержится кусок льда. Температура льда \\[{t_1} = {0^ \\circ }C\\]. Если сообщить ему количество теплоты \\[Q\\], то весь лед растает и образовавшаяся вода нагреется до температуры \\[{t_2} = {20^ \\circ }C\\]. Какая доля льда \\[k\\] растает, если сообщить ему количество теплоты \\[q = \\frac{Q}{2}\\]? Тепловыми потерями на нагрев сосуда пренебречь.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[k = 0,63\\]',NULL,NULL,'№9',NULL),
	(1065,1065,'В сосуде объемом 2 л находится гелий при давлении 100 кПа и температуре 200 К, а в сосуде объемом 5 л – неон при давлении 200 кПа и температуре 500 К. Определить температуру газа в сосудах после их соединения.\nОтвет: К.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'400 К',NULL,NULL,'№10',NULL),
	(1066,1066,'В сосуде объемом 0,5 л находится идеальный газ при температуре 27  и давлении 100 кПа. Сколько молекул газа нужно выпустить из сосуда, чтобы давление в нем уменьшилось в два раза. Температура газа не меняется.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[6 \\cdot {10^{21}}\\] молекул',NULL,NULL,'№11',NULL),
	(1067,1067,'Горизонтально расположенный цилиндр разделен скользящей без трения перегородкой на две части. С одной стороны от перегородки находится водород, с другой – гелий. Массы и температуры газов – одинаковы. Во сколько раз объем, занимаемый водородом, больше объема, занимаемого гелием?\nОтвет: раз(а)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'В 2 раза',NULL,NULL,'№12',NULL),
	(1068,1068,'С одним молем гелия провели процесс, при котором среднеквадратичная скорость атомов гелия выросла в \\[n = 2\\] раза. В ходе этого процесса средняя кинетическая энергия атомов гелия была пропорциональна объему, занимаемому гелием. Какую работу совершил газ в этом процессе? Считать гелий идеальным газом, а значение среднеквадратичной скорости атомов гелия в начале процесса принять равным \\[{v_1} = 100\\] м/c.\nОтвет: Дж.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'40 Дж',NULL,NULL,'№13',NULL),
	(1069,1069,'В процессе колебаний в идеальном колебательном контуре амплитуда колебаний силы тока в катушке индуктивности 5мА, а амплитуда колебаний напряжения на конденсаторе – 2 В. В момент времени \\[t\\] сила тока в катушке 3 мА. Определить напряжение на конденсаторе в этот момент времени.\nОтвет: В.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1,6 В',NULL,NULL,'№14',NULL),
	(1070,1070,'В электрической цепи, изображенной на рисунке, ЭДС источника тока – 12 В, емкость конденсатора – 2 мФ, индуктивность катушки – 5 мГн, сопротивление лампы – 5 Ом, сопротивление резистора – 3 Ом. Какая энергия выделится на лампочке после размыкания ключа? Внутренним сопротивлением источника тока, сопротивлением катушки и проводов пренебречь.\nОтвет: Дж.','list_2017_15.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,29 Дж','рис.',NULL,'№15',NULL),
	(1071,1071,'В одном из вариантов опыта, поставленного А.К.Тимирязевым для демонстрации закона сохранения и превращения энергии, груз массой \\[m = 1\\] кг, подвешенный на шнурке, перекинутом через блок, опускался с постоянной скоростью 1 м/с, вращая динамо-машину, на вал которой был намотан другой конец шнурка. Динамо-машина питала электрическую лампочку, рассчитанную на напряжение 6 В и силу тока 0,5 А, причем лампочка горела с нормальным накалом. Каков был КПД превращения механической энергии в электрическую, выделяющуюся в лампочке в виде света и тепла?\nОтвет: %.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'30%',NULL,NULL,'№16',NULL),
	(1072,1072,'Препарат активностью \\[1,7 \\cdot {10^{11}}\\] частиц в секунду помещен в металлический контейнер массой 0,5 кг. За 2 ч температура контейнера повысилась на 5,2 К. Известно, что данный препарат испускает α-частицы с энергией 5,3 МэВ, причем практически вся энергия \\[\\alpha \\]-частиц переходит во внутреннюю энергию контейнера. Найти удельную теплоемкость металла контейнера. Теплоемкостью препарата и теплообменом с окружающей средой пренебречь.\nОтвет: \\[{\\text{Дж/кг}} \\cdot {\\text{К}}\\]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'400 \\[{\\text{Дж/кг}} \\cdot {\\text{К}}\\]',NULL,NULL,'№17',NULL),
	(1073,1073,'На рисунке показана электрическая цепь, содержащая источник тока (с внутренним сопротивлением), два одинаковых резистора, конденсатор, ключ, а также амперметр и идеальный вольтметр. Как изменятся показания амперметра и вольтметра в результате замыкания ключа К? Ответ поясните, указав, какие физические явления и закономерности вы использовали для объяснения.','list_2017_18.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'рис.',NULL,'№18',NULL),
	(1074,1074,'В цепи, изображенной на рисунке, сопротивление диода в прямом направлении пренебрежимо мало, а в обратном – многократно превышает сопротивление резисторов. При подключении к точке \\[A\\] положительного, а к точке \\[B\\] отрицательного полюсов батареи, с ЭДС 12 В и пренебрежимо малым внутренним сопротивлением, потребляемая цепью мощность равняется 4,8 Вт. При изменении полярности подключения батареи потребляемая цепью мощность оказалась 14,4 Вт. Укажите условия протекания тока через диод и резисторы в обоих случаях и определите сопротивления резисторов в этой цепи.\nОтвет: Ом','list_2017_19.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'10 Ом; 20 Ом','рис.',NULL,'№19',NULL),
	(1075,1075,'На уроке физики школьник собрал схему, изображенную на рисунке. Ему известно, что сопротивления резисторов \\[{R_1} = 0,5\\] Ом, \\[{R_2} = 2\\] Ом. Токи, измеренные школьником при помощи идеального амперметра А при последовательном подключении колюча К к контактам 1,2,3, оказались равными соответственно 3 А, 2 А и 1,5 А. Чему было равно сопротивление резистора \\[{R_3}\\]?\nОтвет: Ом.','list_2017_20.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3,5 Ом','рис.',NULL,'№20',NULL),
	(1076,1076,'Электрическая цепь состоит из источника тока с конечным внутренним сопротивлением и реостата. Сопротивление реостата можно изменять от 1 до 5 Ом. Максимальная мощность тока, выделяющаяся на реостате, достигается при сопротивлении реостата \\[R = 2\\] Ом. Какова ЭДС источника тока?\nОтвет: В.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6 В',NULL,NULL,'№21',NULL),
	(1077,1077,'Цепь, схема которой изображена на рисунке, состоит из источника постоянного напряжения с нулевым внутренним сопротивлением,1 идеального амперметра, резистора с постоянным сопротивлением \\[{R_3}\\] и двух реостатов, сопротивления \\[{R_1}\\] и \\[{R_2}\\] сопротивления которых можно изменять. Сопротивления реостатов изменяют таким образом, что их сумма все время остается неизменной. Как при этом сила тока, текущего через идеальный амперметр А, изменяется? При каком отношении \\[{R_2}/{R_1}\\] сила тока будет минимальной?','list_2017_22.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','рис.',NULL,'№22',NULL),
	(1078,1078,'Хорошо проводящая рамка площадью \\[S = 20{\\text{с}}{{\\text{м}}^2}\\] вращается в однородном магнитном поле с индукцией \\[B = 1,5\\] Тл, перпендикулярной оси вращения рамки, с частотой 50 Гц. Скользящие контакты рамки присоединены к цепи, состоящей из резистора сопротивлением \\[{R_1} = 5\\] Ом, к которому последовательно присоединены два параллельно соединенных резистора \\[{R_2} = 10\\] Ом и \\[{R_3} = 15\\] Ом. Найти максимальную силу тока, текущего через резистор \\[{R_3}\\] в процессе вращения рамки. Индуктивностью цепи пренебрегаем.\nОтвет: А.','list_2017_23.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,03 А','рис.',NULL,'№23',NULL),
	(1079,1079,'Медное кольцо из провода диаметром 2 мм расположено в однородном магнитном поле, магнитная индукция которого меняется по модулю со скоростью 1,09 Тл/с. Плоскость кольца перпендикулярна вектору магнитной индукции. Какой диаметр кольца, если возникающий в нем индукционный ток равен 10 А? Удельное сопротивление меди \\[1,72 \\cdot {10^{ - 8}}{\\text{Ом}} \\cdot {\\text{м}}\\].\nОтвет: м.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,2 м',NULL,NULL,'№24',NULL),
	(1080,1080,'Шарик, находящийся в масле, плотностью 800 \\[{\\text{кг/}}{{\\text{м}}^3}\\], «висит» в поле плоского конденсатора. Плотность вещества шарика 2700 \\[{\\text{кг/}}{{\\text{м}}^3}\\], его радиус 2мкм, расстояние между обкладками конденсатора 1 см. Каков заряд шарика, если электрическое поле направлено вертикально вниз, а разность потенциалов между обкладками 5 кВ. Объем шара \\[V = \\frac{4}{3}\\pi {r^3}\\].\nОтвет: Кл.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[ - 1,3 \\cdot {10^{ - 18}}\\] Кл',NULL,NULL,'№25',NULL),
	(1081,1081,'На шероховатом проводящем диске, расположенном в горизонтальной плоскости, лежит точечное тело, находящееся на расстоянии \\[R = 0,5\\] м от центра диска, и несущее заряд \\[q = 75\\] мкКл. Диск равномерно вращается вокруг своей оси против часовой стрелки (если смотреть сверху), совершая 0,5 оборотов в секунду. Коэффициент трения между телом и поверхностью диска равен 0,6. Какой должна быть минимальная масса тела для того, чтобы в однородном магнитном поле с индукцией \\[B = 2\\] Тл, направленном вертикально вверх, тело не скользило по поверхности диска?\nОтвет: кг.','list_2017_26.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,22 кг','рис.',NULL,'№26',NULL),
	(1082,1082,'На шероховатом горизонтальном диске, вращающемся вокруг вертикальной оси, покоится небольшое тело. Расстояние от оси вращения до тела 25 см. Угловую скорость тела начали медленно увеличивать. Каков коэффициент трения между телом и диском, если тело начало скользить по диску при угловой скорости \\[\\omega  = 4,5\\] рад/с?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,5',NULL,NULL,'№27',NULL),
	(1083,1083,'В изображенной на рисунке системе нижний брусок может двигаться по наклонной плоскости, составляющей угол в 30º, а верхний брусок вдоль наклонной плоскости, составляющей с горизонтом некоторый угол. Коэффициент трения между нижним бруском и плоскостью равен 0,2. Трение между верхним бруском и наклонной плоскостью отсутствует. Считая соединяющую бруски нить очень легкой и нерастяжимой и пренебрегая массой блока и трением в его оси, найдите, при каких значениях угла нить будет натянута.\nОтвет: º.','list_2017_28.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[\\beta  \\leqslant {19^ \\circ }\\]','рис.',NULL,'№28',NULL),
	(1084,1084,'Система грузов \\[M\\], \\[{m_1}\\] и \\[{m_2}\\], показанная на рисунке движется из состояния покоя. Поверхность стола гладкая горизонтальная. Коэффициент трения между грузами \\[M\\] и \\[{m_1}\\] равен 0,2. Грузы \\[M\\] и \\[{m_2}\\] связаны нерастяжимой и невесомой нитью, которая скользит по блоку без трения. Пусть \\[M = 1,2\\] кг, \\[{m_1} = {m_2} = m\\]. При каких значениях \\[m\\] грузы \\[M\\] и \\[{m_1}\\] движутся как единое целое?\nОтвет: кг.','list_2017_29.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,4 кг','рис.',NULL,'№29',NULL),
	(1085,1085,'Однородный цилиндр с площадью поперечного сечения 0,01 \\[{{\\text{м}}^2}\\] плавает на границе несмешивающихся жидкостей с плотностями 800 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\] и 1000 \\[{\\text{кг/}}{{\\text{м}}^{\\text{3}}}\\](см.рис.). Пренебрегая сопротивлением жидкостей, определите массу цилиндра, если период его малых вертикальных колебаний составляет \\[\\frac{\\pi }{3}\\] с.\nОтвет: кг.','list_2017_30.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,56 кг','рис.',NULL,'№30',NULL),
	(1086,1086,'Полый шарик массой 0,4 г с зарядом 8 нКл движется в горизонтальном однородном электрическом поле, напряженность которого равна 500 кВ/м. Какой угол образует с вертикалью траектория шарика, если его начальная скорость равна нулю?\nОтвет: \\[^ \\circ \\].',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[{45^ \\circ }\\]',NULL,NULL,'№31',NULL),
