	(1088,1088,'Маятник состоит из маленького груза массой \\[M = 200\\] г и очень легкой нити подвеса длиной \\[L = 1,25\\] м. Он висит в состоянии покоя в вертикальном положении. В груз ударяется небольшое тело массой \\[m = 100\\] г, летевшее в горизонтальном направлении со скоростью 10 м/с. После удара тело останавливается и падает вертикально вниз. На какой максимальный угол отклонится маятник от положения равновесия после удара?\nОтвет: \\[^ \\circ \\].',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[{90^ \\circ }\\]',NULL,NULL,'№33',NULL),
