	(1094,1094,'Два абсолютно упругих шарика массами 100 и 300 г подвешены на одинаковых нитях длиной 50 см каждая. Первый шарик отклоняют от положения равновесия на угол 90º и опускают. На какую высоту поднимется второй шарик после удара?\nОтвет: см.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'12,5 см',NULL,NULL,'№39',NULL),
