	(1096,1096,'Из пушки массой 800 кг, находящейся у подножья горки, вылетает в горизонтальном направлении снаряд, массой 1 кг с начальной скоростью 500 м/с. На какую высоту поднимется пушка по горке в результате отдачи, если угол наклона горки 45º, а коэффициент трения о плоскость 0,1?\nОтвет: м.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[ \\approx 0{\\text{,02}}\\] м',NULL,NULL,'№41',NULL),
	(1097,1097,'Вокруг невесомой горизонтальной оси может вращаться невесомый стержень, плечи которого равны \\[L\\] и \\[2L\\]. На концах стержня укреплены грузы одинаковой массы. Чему будет равна линейная скорость одного из грузов в нижней точке при повороте на 90º под действием силы тяжести, если первоначально стержень находился в горизонтальном положении и был неподвижен?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[\\sqrt {\\frac{{8gL}}{5}} \\]',NULL,NULL,'№42',NULL),
	(1098,1098,'Образец, содержащий радий, за 1 с испускает \\[3,7 \\cdot {10^{10}}\\] \\[\\alpha \\]-частиц. Скорость частиц \\[1,5 \\cdot {10^7}\\] м/с. За какое время выделится энергия 100 Дж? Масса \\[\\alpha \\]-частицы \\[6,7 \\cdot {10^{ - 27}}\\] кг.\nОтвет: ч.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1 ч',NULL,NULL,'№43',NULL),
	(1099,1099,'На дифракционную решетку с периодом \\[d = 2\\] мкм нормально падает пучок света, состоящий из фотонов с импульсом \n\\[p = 1,32 \\cdot {10^{ - 27}}{\\text{кг}} \\cdot {\\text{м/с}}\\]. Под каким углом к направлению падения пучка наблюдается дифракционный максимум второго порядка?\nОтвет: º.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'30º',NULL,NULL,'№44',NULL),
	(1100,1100,'Плоская световая монохроматическая волна подает по горизонтали на дифракционную решетку ДР с периодом \\[d\\]. На экране Э, расположенном в фокальной плоскости тонкой собирающей линзы Л, наблюдается дифракционная картина. Каково расстояние \\[x\\] между соседними дифракционными полосами вблизи центра картины, если фокусное расстояние линзы \\[f\\], а длина волны \\[\\lambda \\].','list_2017_45.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[x = \\frac{{2fk\\lambda }}{d}\\]','рис.',NULL,'№45',NULL),
	(1101,1101,'Тонкая линза дает действительное изображение предмета АВ на экране Э (см.рис.). Что произойдет с изображением предмета на экране, если верхнюю половину линзы закрыть куском черного картона К (см.рис.). Постройте изображение предмета в обоих случаях, указав, какие физические закономерности вы использовали для объяснения.','list_2017_46.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'рис.',NULL,'№46',NULL),
	(1102,1102,'Замкнутый контур площадью \\[S\\] из тонкой проволоки помещен в магнитное поле. Плоскость контура перпендикулярна вектору магнитной индукции поля. В контуре возникают колебания тока с амплитудой \\[{I_m} = 35\\] мА, если индукция магнитного поля с течением времени меняется по закону \\[B = a\\cos \\left( {bt} \\right)\\], где \\[a = 6 \\cdot {10^{ - 3}}\\] Тл, \\[b = 3500\\;{{\\text{с}}^{ - 1}}\\]. Электрическое сопротивление контура \\[R = 12\\] Ом. Чему равна площадь контура?\nОтвет: м.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,02 м',NULL,NULL,'№47',NULL),
	(1103,1103,'Ион ускоряется в электрическом поле с разностью потенциалов 10 кВ и попадает в однородное магнитное поле перпендикулярно вектору его индукции (см. рис.). Радиус траектории движения иона в магнитном поле 0,2 м, модуль индукции магнитного поля равен 0,5 Тл. Определите отношение массы иона к его электрическому заряду. Кинетической энергией иона при его вылете из источника пренебрегаем.\nОтвет: кг/Кл.','list_2017_48.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[5 \\cdot {10^{ - 6}}\\] кг/Кл','рис.',NULL,'№48',NULL),
	(1104,1104,'На проводящих рельсах, проложенных на наклонной плоскости, в однородном вертикальном магнитном поле находится горизонтальный прямой проводник прямоугольного сечения массой 20 г. Плоскость наклонена к горизонту под углом 30º. Расстояние между рельсами 40 см. Когда рельсы подключены к источнику тока, по проводнику протекает постоянный ток 11 А. При этом проводник поступательно движется вверх по рельсам равномерно и прямолинейно. Коэффициент рения между проводником и рельсами 0,2. Чему равен модуль индукции магнитного поля?\nОтвет: Тл.','list_2017_49.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0,015 Тл','рис.',NULL,'№49',NULL),
	(1105,1105,'Полый стержень длиной 50 см и массой 100 г висит в горизонтальном положении на двух вертикальных нитях. Вокруг стержня создано внешнее однородное горизонтальное поле с индукцией \\[B = 1\\] Тл, линии которого направлены перпендикулярно стержню. По стержню протекает ток силой 2 А так, как показано на рисунке (вид с торца стержня). Силу тока в стержне медленно изменяют. Какому значению должна стать равной сила тока и как он должен быть направлен для того, чтобы сила натяжения каждой из нитей, на которых висит стержень, уменьшилась в 4 раза?\nОтвет: А.','list_2017_50.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1 А','рис.',NULL,'№50',NULL),
	(1106,1106,'В однородном магнитном поле с индукцией \\[B\\] равномерно скользит без трения и без потери контактов металлической стержень длины \\[L\\] и массой \\[m\\] по двум вертикальным рейкам, расположенным в вертикальной плоскости. Магнитное поле перпендикулярно плоскости, в которой лежат рейки и направлено от наблюдателя. Рейки замкнуты на резистор сопротивлением \\[R\\], параллельно которому подключен конденсатом емкостью \\[C\\]. Какую максимальную энергию запасет конденсатор при движении стержня? Сопротивлением реек пренебречь.','list_2017_51.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[W = \\frac{{c{m^2}{R^2}{g^2}}}{{2{B^2}{l^2}}}\\]','рис.',NULL,'№51',NULL),
	(1107,1107,'Квадратную рамку из медной проволоки со стороной \\[b = 5\\] см перемещают вдоль оси \\[Ox\\] по гладкой горизонтальной поверхности с постоянной скоростью \\[v = 1\\] м/с. Начальное положение рамки изображено на рисунке. За время движения рамка успевает полностью пройти между полюсами магнита. Индукционные токи, возникающие в рамке, оказывают тормозящее действие, поэтому для поддержания постоянной скорости движения к ней прикладывают внешнюю силу \\[F\\], направленную вдоль оси \\[Ox\\]. Чему равно сопротивление проволоки рамки, если суммарная работа внешней силы за время движения \\[A = 2,5 \\cdot {10^{ - 3}}\\] Дж? Ширина полюсов магнита \\[d = 20\\] см, магнитное поле имеет резкую границу, однородно между полюсами, а его индукция \\[B = 1\\] Тл.','list_2017_52.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'рис.',NULL,'№52',NULL),
	(1108,1108,'Фотоэлектроны, выбитые рассеянным светом частоты \\[\\nu  = 6,7 \\cdot {10^{14}}\\] Гц из металла с работой выхода \\[{A_{вых}} = 1,89\\] эВ, попадают в однородное электрическое поле. Какова напряжённость поля \\[E\\], если длина тормозного пути у фотоэлектронов, чья начальная скорость максимальна и направлена вдоль силовых линий поля \\[E\\], составляет 8,75 мм?\nОтвет: В/м',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100 В/м',NULL,NULL,'№53',NULL),
	(1109,1109,'При падении света на поверхность платины их нее вылетают фотоэлектроны, имеющие скорость 2000 км/с. Затем этим же светом начинают облучать атомы водорода, вследствие чего они ионизируются. Какую скорость будут иметь электроны, вылетающие из ионизированных атомов водорода, если работа выхода электрона из платины 5,3 эВ, а энергия ионизации атома водорода 13,6 эВ? Изменением кинетической энергии атомов водорода пренебречь.\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[{10^3}\\] м/с',NULL,NULL,'№54',NULL),
	(1110,1110,'Металлическая пластина облучается светом с частотой \\[1,6 \\cdot {10^{15}}\\] Гц. Работа выхода электрона из данного металла равна 3,7 эВ. Вылетевшие из пластины фотоэлектроны попадают в однородное электрическое поле напряженностью 130 В/м, причем вектор напряженности \\[E\\] направлен к пластине перпендикулярно её поверхности. Какова максимальная энергия фотоэлектронов на расстоянии 10 см от пластины.\nОтвет: эВ.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'15,9 эВ',NULL,NULL,'№55',NULL),
	(1111,1111,'Четыре одинаковых заряда по 40 мкКл расположены в вершинах квадрата со стороной \\[a = 2\\] м. Какова будет напряженность поля на расстоянии \\[2a\\] от центра квадрата на продолжении диагонали?\nОтвет: кВ/м',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'103,5 кВ/м',NULL,NULL,'№56',NULL),
	(1112,1112,'Мощность излучения лазерной указки с длиной волны 600 нм равна \\[P = 2\\] мВт. Определите число фотонов, излучаемых указкой за 1 с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[6 \\cdot {10^{15}}\\]',NULL,NULL,'№57',NULL),
	(1113,1113,'На рисунке представлена схема энергетических уровней электронной оболочки атома и указаны частоты фотонов, излучаемых и поглощаемых при переходах между этими уровнями. Какова минимальная длина волны фотонов, излучаемых атомом при любых возможных переходах между уровнями Е1, Е2, Е3 и Е4, если \\[{\\nu _{13}} = 7 \\cdot {10^{14}}\\] Гц, \\[{\\nu _{24}} = 5 \\cdot {10^{14}}\\] Гц, \\[{\\nu _{32}} = 3 \\cdot {10^{14}}\\] Гц?\nОтвет: м.','list_2017_58.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[1,7 \\cdot {10^{ - 5}}\\] м','рис.',NULL,'№58',NULL),
	(1114,1114,'Уровни энергии в атоме водорода задаются формулой \\[{E_n} =  - 13,6\\frac{{{\\text{эВ}}}}{{{n^2}}}\\], где \\[n = 1,2,3,4,...\\]. При переходе атома из состояния \\[{E_n}\\] в состояние \\[{E_1}\\]  атом испускает фотон. Попав на поверхность фотокатода, фотон выбивает фотоэлектрон. Частота света, соответствующая красной границе фотоэффекта для материала поверхности фотокатода \\[{\\nu _{кр}} = 6 \\cdot {10^{14}}\\] Гц. Чему равна максимально возможная скорость фотоэлектронов?\nОтвет: м/с.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\\[1,6 \\cdot {10^6}\\] м/с',NULL,NULL,'№59',NULL),
	(1115,1115,'В вакууме находятся два покрытых кальцием электрода, к которым подключен конденсатор емкостью \\[C = 8000\\] пФ. При длительном освещении катода светом фототок, возникший вначале, прекращается, а на конденсаторе появляется заряд \\[q = 11\\] нКл. Работа выхода электронов из кальция \\[{A_{вых}} = 4,42 \\cdot {10^{ - 19}}\\] Дж. Определите длину волны света, освещающего катод.\nОтвет: нм',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'300 нм',NULL,NULL,'№60',NULL);
